Rytuał duchowy nigdy nie zastąpi leczenia farmakologicznego. Należy pamiętać również o tym, że małe dzieci, kobiety w ciąży, chorzy na padaczkę oraz osoby uczulone są bardziej wrażliwe na działanie kadzideł i olejków eterycznych i nie powinny ich stosować. Rytuał duchowy nigdy nie zastąpi leczenia farmakologicznego.','','rytual-szczescia-good-vibes-only','','','','Rytuał szczęścia - Good Vibes Only','','','',''),
(278,1,1,'Oryginalny stojak do kadzidełek, który może stać się piękną ozdobą Twojego domowego sanktuarium. Podstawka posiada kilka otworów na kadzidełka, została wyprodukowana w Indiach z drewna Mango.   W zestawie znajdziesz kadzidła, w losowo wybranym, relaksującym łagodnym zapachu.','','wieza-drewniana-z-podstawka-i-kadzidelkami','','','','Wieża drewniana z podstawką i kadzidełkami','','','',''),
(279,1,1,'Luna to kobiece uosobienie księżyca, to to co ukryte, emocje. W zależności od tego, w jakim cyklu jest księżyc możesz przyciągnąć to, czego potrzebujesz (nów) lub pozbyć się tego, co Ci nie służy (pełnia).  \"La Luna\" to rytuał, który uzdrowi Twoje emocje. Zrób listę swoich pragnień lub stanów, których nie chcesz doświadczać i przeprowadź rytuał La Luna by wzmocnić swoje intencje.  Szukasz nowej pracy lub miłości? (nów) Chcesz się skutecznie odchudzić, zakończyć toksyczny związek lub spłacić kredyt (pełnia) – ten rytuał możesz zastosować również do wszystkich materialnych pragnień.   Co znajdziesz w rytuale \"La Luna\"?  1. Białą szałwię, która uzdrawia oraz oczyszcza energię i przestrzeń.  2. Pióro do pożegnania złych, niesprzyjających energii.  3. Święte drewienko Palo Santo do przypieczętowania dobrej energii i powitania pozytywnego nastawienia.  4. Białą świecę na oczyszczanie i przywitanie dobrych energii.  5. Czarną świecę na oczyszczanie i pozbycie się złych energii i niskich wibracji.  6. Czarny turmalin, który jest potężnym kamieniem mocy. Potrafi uleczyć nas na każdym planie: emocjonalnym, fizycznym, duchowym i mentalnym. Oczyszcza i chroni złymi energiami, bytami astralnymi, wampirami energetycznymi, transformując negatywne energie w szczęście i zdrowie.  7. Kryształ biały ma najsilniejsze działanie oczyszczające i jest kamieniem o uniwersalnym zastosowaniu. Można go dowolnie programować za pomocą wybranej afirmacji. Dzięki temu będzie przyciągał to, czego pragniemy. Oprócz tego, że oczyszcza i przyciąga dobre energie, kryształ wzmacnia wszystkie inne kamienie, które znajdą się w jego pobliżu lub są razem z nim stosowane.  8. Prostą instrukcję dla Twojego Osobistego rytuału wraz z kojącą afirmacją. Zrób rytuał La Luna w każdy nów i pełnię, by pozbyć się tego co Ci nie służy i przyciągnąć energie których Ci brakuje.  Uwaga! Podczas kadzenia, bardzo ważne jest zachowanie bezpieczeństwa! Należy zadbać o bezpieczne podłoże i podczas kadzenia otworzyć okno. Dokładnie tak samo postępowali nasi przodkowie – pozwalali uciec diabłom, demonom i wszystkim ciemnym, ciężkim, niesłużącym nam energiom.','','rytual-ksiezycowy-na-now-i-pelnie-la-luna','','','','Rytuał księżycowy na Nów i Pełnię -  La Luna','','','',''),
(280,1,1,'Czakra to ośrodek energetyczny odpowiadający za energię wybranego obszaru w ciele. Każda z 7 czakr posiada własną barwę i odpowiada za inną sferę emocjonalną. Dobre zdrowie i samopoczucie zależy od prawidłowego przepływy energii między czakrą: korony, trzeciego oka, gardła, serca, splotu słonecznego, krzyżową i korzenia. Lepsze funkcjonowanie czakr ma zbawienny wpływ na wiele obszarów naszego życia od samopoczucia, przez zdrowie, kończąc na efektywności w działaniu i kreatywności.  Czakra Korzenia zablokowana: brak spokoju wewnętrznego, lęk, niepewność, niestabilność finansowa, złość, strach, ospałość, poczucie zagubienia, brak asertywności hiperaktywna: chciwość, żądza władzy, agresywność, materializm, cyniczność zbalansowana: poczucie bezpieczeństwa, obfitość, uziemienie, radość życia, szczęście, zdrowe ciało, odporność Czakra Sakralna zablokowana: niskie libido, strach przed intymnością, brak kreatywności, nieumiejętność odpoczynku, zazdrość, tłumienie uczuć, poczucie wstydu hiperaktywna: nad emocjonalność, manipulacja, seksoholizm, hedonizm, zależność emocjonalna od innych zbalansowana: umiejętność panowania nad sobą, kreatywność, pasja, zdrowie intymne, akceptacja swojego ciała, optymizm Czakra Splotu Słonecznego zablokowana: niedowartościowanie, poczucie braku wpływu na swoje życie, kompleks niższości, wiara w zły los, brak zaufania, próżność, osądzanie hiperaktywna: potrzeba władzy, dominacja, krytycyzm, napady gniewu, kontrolowanie innych, zaborczość, zazdrość, pracoholizm, kłótliwość zbalansowana: poczucie własnej wartości i sprawczości, zapał, dobry wizerunek siebie, odwaga do wprowadzania zmian, równowaga emocjonalna, poczucie humoru, bezinteresowność Czakra Serca zablokowana: brak empatii, zawiść, posępność, brak tolerancji, brak zaufania, złość, żal, poczucie osamotnienia hiperaktywna: zazdrość, nadmierne poświęcanie, brak niezależności zbalansowana: spokój, miłość, tolerancja, otwarte serce na innych ludzi i świat, radość, umiejętność dawania i brania, dobroć Czakra Gardła zablokowana: problem z wyrażaniem siebie, problem z komunikowaniem się, niewłaściwy osąd, problem ze słuchaniem, uzależnienia, poddawanie się woli innych hiperaktywna: zbyt głośne mówienie, krytykanctwo, plotkarstwo, surowość, przytłoczenie emocjami, nieumiejętność wyciszenia się, chwalenie się zbalansowana: pewność, asertywność, przejrzystość komunikacji, dyplomacja, spełnienie w życiu zawodowym Czakra Trzeciego Oka zablokowana: słaby osąd, brak skupienia, słaba wyobraźnia, egocentryzm, dysharmonia w życiu hiperaktywna: koszmary, halucynacje, urojenia, obsesje, gonitwa myśli, problem z koncentracją zbalansowana: rozwinięta wyobraźnia, harmonia między intelektem a intuicją, wewnętrzna wiedza Czakra Korony zablokowana: depresja, trudności w nauce, kryzys wiary, brak poczucia sensu, trudności z podjęciem decyzji hiperaktywna: dogmatyzm, osądzanie, duchowe uzależnienie, nieuziemienie zbalansowana: poczucie spełnienia i szczęścia, tolerancja, miłość uniwersalna, inteligencja, samoświadomość, rozsądek, zrozumienie Zestaw czakralny, pomoże Ci zharmonizować wybraną czakrę, w jego składzie znajdziesz:    Kamień do medytacji z czakrą   Kadzidła zapachowe wspierające medytacje   Herbatę rytualną   Olejek do aromaterapii   Kolorową świece do harmonizacji czakry','','zestaw-do-pracy-z-czakrami-harmonizujacy-przeplyw-energii','','','','Zestaw do pracy z Czakrami - harmonizujący przepływ energii','','','',''),
(281,1,1,'Twin Flame to inaczej bliźniaczy płomień. Oznacza on osoby, które są dla siebie lustrzanym odbiciem. Cechy charakteru, temperament i osobowość tych osób są na tyle podobne, że można je nazwać „Duchowymi Bliźniakami”.  Rytuał \"Twin Flame\" ma rozpalić w Tobie ogień i otworzyć na energię miłości. To rytuał sprzyjający odnowieniu uczucia, płodności, namiętności, wyrównaniu energii damsko-męskiej w istniejącym związku lub w znalezieniu partnera u samotnych osób.  W rytuale \"Twin Flame\" znajdziesz polskie rodzime zioła, rośliny rosnące w naszym środowisku, w naszej strefie klimatycznej od stuleci. Z ich mocy czerpali nasi przodkowie. Mają zatem znacznie lepsze oddziaływanie zarówno we wszystkich rytuałach, magicznych, duchowych, czy zdrowotnych. Każde kadzidło przygotowywane jest przez naszą zielarkę – od momentu zerwania ziół po zawiązanie na nich moonsisterowej nitki.  Co znajdziesz w rytuale \"Twin Flame\"?  1. Święte Drewienko Palo Santo do przypieczętowania energii namiętności i powitania miłości oraz płodności.  2. Miotełkę do pożegnania energii braku.  3. Kadzidło witające Miłość i Namiętność, w którego skład wchodzą m.in: lawenda, róża, pędy jałowca, oraz liść laurowy z intencją miłości.  • Lawenda jest rośliną o bardzo szerokich właściwościach magicznych i zdrowotnych. Przypisuje się jej moc uzdrawiania, zarówno ciała jak i ducha (uzdrawianie żalu i poczucia winy), jest wykorzystywana w licznych rytuałach miłosnych, gdyż przyciąga miłość, szczęśliwe małżeństwo, dzieci oraz błogosławieństwo dla domu. Lawenda ma również właściwości relaksujące, kojące, wyciszające. Chroni i oczyszcza.  • Liść laurowy, ziele o bardzo szerokim zastosowaniu magicznym, będzie przede wszystkim gwarantem wierności i siły związku.  • Róża jest najczęściej wykorzystywanym kwiatem w miłosnej magii. Ma moc przyciągania miłości oraz utrzymywania namiętnej i zmysłowej atmosfery w związku. Róża ma moc odbudowy związku, wpływa także na podniesienie miłości własnej. Przyciąga szczęście i miłość.  • Rozmaryn wykorzystuje się w miłosnych rytuałach do uzdrowienia związku. Zapewni także jego ochronę.  • Młode pędy jałowca podniosą energię w związku (rozpalenie miłosnego ognia) oraz płodności. 3. Ręcznie laną świecę z naturalnego, wegańskiego wosku sojowego. Aromatyzowaną w 100% naturalnymi olejkami eterycznymi wzmacniającymi moc rytuału: geranium, lawendą, ylang-ylang. Udekorowaną wzmacniającymi moc rytuału płatkami róż oraz kamieniem miłości – kwarcem różowym.  2. Kwarc różowy, który działa na miłość jak magnes i wskazuje na głębokie, duchowe uczucie. Kwarc różowy otwiera czakrę serca, więc wspiera także Twoją miłość Własną. Kwarc otwiera na ludzi, pomaga wybaczać wyrządzone nam krzywdy. Łagodzi strach przed związkiem i daje nam wgląd w uczucia, które w nas tkwią. Uzdrawiające kamienie, które znajdziesz w tym rytuale zostały oczyszczone, energetycznie naładowane, słońcowane i pobłogosławione intencją.  3. Prostą instrukcję dla Twojego Osobistego rytuału wraz z afirmacją przyciągającą Dobrostan Przeprowadź rytuał Twin Flame, jeśli czujesz, że Twój związek gaśnie, brakuje mu namiętności, masz problem z akceptacją i pokochaniem siebie lub szukasz Drugiej Połówki. Uwaga! Kadzidła palą się inaczej niż szałwia lub palo santo! Podczas kadzenia, bardzo ważne jest zachowanie bezpieczeństwa! Należy zadbać o bezpieczne podłoże i podczas kadzenia otworzyć okno. Dokładnie tak samo postępowali nasi przodkowie – pozwalali uciec diabłom, demonom i wszystkim ciemnym, ciężkim, niesłużącym nam energiom.  Należy pamiętać również o tym, że małe dzieci, kobiety w ciąży, chorzy na padaczkę oraz osoby uczulone są bardziej wrażliwe na działanie kadzideł i olejków eterycznych i nie powinny ich stosować.  Rytuał duchowy nigdy nie zastąpi leczenia farmakologicznego.','','rytual-milosny-twin-flame','','','','Rytuał miłosny - Twin Flame','','','',''),
(282,1,1,'Kadziło i świeczka do wykonania rytuału otwierającego drzwi do Nowych Początków. Przy pomocy zestawu zaproś energię szczęścia i obfitości do Ciebie i Twojej przestrzeni. To rytuał dla każdego, kto jest na początku dużego projektu, potrzebuje nowych energii w działaniu lub rozpoczyna właśnie swoją drogę rozwoju duchowego.  Energie ziół, które weszły w skład kadzidła oraz świeczki, wesprą Twoje PRZEBUDZENIE oraz wejście na Nową Ścieżkę, zmotywują Cię do zajrzenia w głąb siebie, do rozwoju duchowego, nauki, przebudzenia świadomości i Twojej mocy. Energie te, będą Cię motywowały do nauki, umacniania struktury duchowej, pracy nad sobą, uwalniania się od niesprzyjających przekonań, uwalniania karmy, w tym rodowej. dodadzą Ci siły do pójścia na przód i wiary w \"projekty\", które chcesz rozpocząć!  Opis rytuału, który możesz wykonać za pomocą świecy i kadzidła \"Przebudzenie\" Rozpal kadzidło, następnie zdmuchnij płomień, tak, aby kadzidło się jedynie tliło. Okadź siebie i przestrzeń wkoło. Później kadzidło można odłożyć na bezpieczną podstawkę. Postaraj się oczyścić myśli, skupić na czystej intencji i zapal świeczkę. Świeczka powinna wypalić się do końca.   Kadzidło PRZEBUDZENIE , skład:  - Bylica pospolita (Artemisia vulgaris L.), Krwawnik pospolity (łac. Achillea millefolium), Wrotycz pospolity (łac. Tanacetum vulgare). - Bylica pospolita (Artemisia vulgaris L.) To magiczne ziele od stuleci wspiera swoimi magicznymi właściwościami. Jej żywiołem jest powietrze. Bylica to bardzo magiczna, silnie oczyszczająca i ochronna roślina. Nasila zdolność do przewidywania przyszłości, wzmacnia zdolności paranormalne, sprowadza prorocze wizje, pozwala uwierzyć we własne siły i zdolności. Spanie na poduszce wypełnionej bylicą sprowadza prorocze sny. Palona w kadzielnicy oczyszcza z negatywnych energii, wzmacnia intelekt, uspokaja i poprawia nastrój. Palona podczas wróżenia ułatwia prognozowanie przyszłości. Bylica w domu i ogrodzie chroni przed negatywną energią i agresją psychoenergetyczną.  - Krwawnik pospolity (łac. Achillea millefolium), nazywany również zielem stolarzy, polnym chmielem, złocieniem, czy strzelistym korzeniem. Do jego magicznych mocy należą silna ochrona energetyczna, egzorcyzmy, czy rozbudzanie mocy psychicznych. Krwawnik oddala lęki i obdarza odwagą do realizowania swoich celów.  Używany jest do oczyszczeń energetycznych oraz egzorcyzmów. - Wrotycz pospolity (łac. Tanacetum vulgare) wzmacnia kondycję psychiczną, wycisza, uspokaja, pomaga skoncentrować się na celu. Świeczka ,   skład: - naturalny wosk sojowy - naturalne olejki zapachowe: mięta pieprzowa (pobudza procesy myślowe, orzeźwia, przyciąga pieniądze, sukces, zdrowie, silnie oczyszcza, pobudza świadomość),  trawa cytrynowa (wspiera koncentrację i intensywną, wzmożoną pracę umysłową, pozytywne nastawienie do życia)   - Kamień księżycowy - kamień wewnętrznego wzrostu i siły. Nazywany też klejnotem intuicji. Otacza troskliwą wspierającą, „matczyną” energią, w drodze do sukcesu i szczęścia.','','kadzidlo-przebudzenie-i-swieca-z-kamien-ksiezycowym-do-rytualu-na-nowy-poczatek','','','','Kadzidło \"Przebudzenie\" i świeca z kamień księżycowym do rytuału na \"Nowy Początek\"','','','',''),
(283,1,1,'Słowo jest wyrazicielem i nośnikiem twojej woli, ma zatem ogromną moc energetyczną.  To jak myślisz o sobie i jakie masz przekonania dotyczące pieniędzy, wpływa na sytuację w której się znajdujesz. Jeśli na przykład uważasz, że „nigdy nie będę bogaty!”, nie oczekuj, że pieniądze do Ciebie przyjdą.  „Traktuj pieniądz jak mile widzianego gościa” – uczy japoński Warren Buffet, Wahei Takeda, który pozwalają pieniądzom przychodzić i odchodzić z szacunkiem, wypowiadając krótkie „Arigato”.  To słowo oznacza „dziękuję” w języku japońskim i jest niczym więcej jak podziękowaniem za energię pieniądza, która nam służyła i zaproszeniem jej ponownie.  Rytuał sukcesu ma być duchowym środkiem na przyciągnięcie energii obfitości finansowej i sukcesu.  W rytuale \"Arigato\" znajdziesz polskie rodzime zioła, rośliny rosnące w naszym środowisku, w naszej strefie klimatycznej od stuleci. Z ich mocy czerpali nasi przodkowie. Mają zatem znacznie lepsze oddziaływanie zarówno we wszystkich rytuałach, magicznych, duchowych, czy zdrowotnych. Każde kadzidło przygotowywane jest przez naszą zielarkę – od momentu zerwania ziół po zawiązanie na nich moonsisterowej nitki.  Co znajdziesz w rytuale \"Arigato\"?  1. Święte Drewienko Palo Santo do przypieczętowania energii obfitości i powitania sukcesu.  2. Miotełkę do pożegnania energii braku.  3. Kadzidło witające Sukces i Dobrobyt, w którego skład wchodzą m.in. igły sosny, laska cynamonu, plaster suszonej mandarynki oraz liść laurowy z intencją odniesienia sukcesu.  • Żywotnik zachodni, to drzewo z rodziny cyprysowatej o bardzo wyjątkowych właściwościach. Igły żywotnika pięknie, cytrusowa pachną i mają moc przyciągania dobrobytu, działają ochronnie, przynoszą komfort, uzdrawiają. Drzewo to wytwarza olejek zwany tujonem, któremu przypisuje się właściwości przeciwgrzybiczne i antybakteryjne, pogłębia oddychanie i oczyszcza umysł. Palony z intencją obfitości przyniesie spokój, spełnienie i dobrostan.  • Cynamon ma moc uzdrawianie, przynosi sukces, oczyszcza, przyciąga pieniądze oraz wzmacnia działanie innych elementów kadzidła. Zapach tej niezwykłej rośliny wywiera dobroczynny wpływ na siły witalne. Cynamon to bardzo popularna roślina stosowana przy rytuałach związanych z sukcesem, działaniem i koncentracją.  • Mandarynka, jak i inne rośliny cytrusowate, jest owocem, który przynosi radość, pozytywizm, dobrą, ożywczą energię. To jeden z najczęściej stosowanych owoców w rytuałach na sukces i dobrostan.  • Liść laurowy, czyli ziele o bardzo szerokim zastosowaniu magicznym, będzie przede wszystkim dodawał siły, mocy do osiągnięcia założonego celu i sukcesu.  4. Ręcznie laną świecę z naturalnego, wegańskiego wosku sojowego. Aromatyzowaną w 100% naturalnymi olejkami eterycznymi wzmacniającymi moc rytuału: cynamon, goździk, drzewo cedrowe, olejek pomarańczowy. Udekorowaną wzmacniającymi moc rytuału nasionami anyżu, goździkami oraz kryształem górskim, który jest najlepiej programującym się kamieniem, a co za tym idzie – wzmacnia moc wypowiadanej intencji. To swoisty „wzmacniacz energetyczny” działający jak akumulator. Kryształ górski to kamień o uniwersalnych właściwościach - przynosi optymizm, jasność umysłu, zdolność do koncentracji oraz pozytywną energię i wzmacnia moc kamieni, które występują w rytuale.  5. Naturalne Tygrysie Oko, czyli Kamień Biznesmenów, który przyciąga bogactwo i powodzenie, przynosi odwagę w realizacji planów i pewność siebie. Zapewnia stabilizację finansową, otacza opieką zgromadzone bogactwo. Moc tygrysiego oka sprzyja także rozsądnemu gospodarowaniu pieniędzmi i mądrym inwestycjom.  6. Prostą instrukcję dla Twojego Osobistego rytuału wraz z afirmacją przyciągającą Dobrostan.  Zrób rytuał \"Aritago\" zawsze kiedy potrzebujesz rozwagi w biznesie, rozpoczynasz nową działalność lub potrzebujesz szybko spłacić kredyt, masz poczucie, że Twoja sytuacja finansowa jest niestabilna lub chciałabyś, by była lepsza.  Uwaga! Kadzidła palą się inaczej niż szałwia lub palo santo! Podczas kadzenia, bardzo ważne jest zachowanie bezpieczeństwa! Należy zadbać o bezpieczne podłoże i podczas kadzenia otworzyć okno. Dokładnie tak samo postępowali nasi przodkowie – pozwalali uciec diabłom, demonom i wszystkim ciemnym, ciężkim, niesłużącym nam energiom.  Należy pamiętać również o tym, że małe dzieci, kobiety w ciąży, chorzy na padaczkę oraz osoby uczulone są bardziej wrażliwe na działanie kadzideł i olejków eterycznych i nie powinny ich stosować. Rytuał duchowy nigdy nie zastąpi leczenia farmakologicznego.','','rytual-sukcesu-i-obfitosci-finansowej-arigato','','','','Rytuał sukcesu i obfitości finansowej - Arigato','','','',''),
(284,1,1,'Biała Magia lub tzw. magia lecznicza obejmuje czary działające na korzyść innych, wykorzystywane z dobrą intencją, używane do dobrych celów.  \"White Magic\" to najbardziej uniwersalny z rytuałów, który możesz stosować z dowolną intencją. Jego głównym przeznaczeniem jest jednak oczyszczanie przestrzeni lub swojej osoby. Rytuał uwalnia od złych mocy, negatywnych uczuć, chroni przed wampirami energetycznymi, odcina istniejące połączenia, rzucone, uroki ochrania przed astralnymi bytami. Jeśli cierpisz na przemęczenie, bóle głowy, masz wrażenie że żyjesz lub pracujesz w „dusznej” przestrzeni, rytuał \"White Magic\" pomoże Ci odpędzić złe energie i przywołać te sprzyjające.   Co znajdziesz w rytuale \"White Magic\"?  1. Białą szałwię, która uzdrawiania, oczyszczania energię i przestrzeń.  2. Pióro do pożegnania złych, niesprzyjających energii.  3. Święte drewienko Palo Santo do przypieczętowania dobrej energii i powitania pozytywnego nastawienia.  4. Białą świecę na oczyszczanie.  5. Naturalny, księżycowany selenit, który pomoże odnowić energię.  6. Prostą instrukcję dla Twojego Osobistego rytuału wraz z kojącą afirmacją. Zrób rytuał White Magic zawsze kiedy czujesz potrzebę oczyszczenia swojej przestrzeni lub osoby  Uwaga! Podczas kadzenia, bardzo ważne jest zachowanie bezpieczeństwa! Należy zadbać o bezpieczne podłoże i podczas kadzenia otworzyć okno. Dokładnie tak samo postępowali nasi przodkowie – pozwalali uciec diabłom, demonom i wszystkim ciemnym, ciężkim, niesłużącym nam energiom.','','rytual-oczyszczajacy-energie-white-magic','','','','Rytuał oczyszczający energię White Magic','','','',''),
(285,1,1,'To, że kolczyki \"Zodiac\" przeznaczone są dla Ciebie, zapisane jest w gwiazdach!  Baranie, Twoim atrybutem jest odwaga, inicjatywa i talenty przywódcze. Kochasz wyzwania, a Twoja spontaniczność i siła charakteru wprawiają w osłupienie. Wyrównaj energię życiową qi, ułóż emocje, przyjmij wysokie wibracje, wzmocnij najlepsze potencjały swojego znaku solarnego i wyglądaj uroczo!','','kolczyk-ze-znakiem-zodiaku-dla-barana','','','','Kolczyk ze znakiem zodiaku dla Barana','','','',''),
(286,1,1,'Zestaw zodiakalny dla Ciebie lub kogoś bliskiego!  W zestawie znajdziesz narzędzia specjalnie dobrane do wybranego znaku zodiaku, które pomogą odnaleźć właściwy balans zodiakalnego żywiołu oraz wesprą wszystkie, nawet najbardziej ukryte, potencjały znaku zodiaku!  W skład zestawu wchodzą:    nitka w kolorze harmonizującym Twój żywioł oraz kamieniem wspierającym znak   zapachowa świeca sojowa   kadzidła o zapachu dobranym do potencjału znaku   skarpetki z wzorem zodiakalnym   kartka z opisem zestawu i instrukcją','','zestaw-zodiac-odkryj-potencjaly-swojego-znaku','','','','Zestaw Zodiac - odkryj potencjały swojego znaku!','','','',''),
(287,1,1,'To, że kolczyki \"Zodiac\" przeznaczone są dla Ciebie, zapisane jest w gwiazdach!  Rybko, dla Ciebie świat energii jest tak samo realny jak świat fizyczny, dzięki temu zawsze widzisz i słyszysz więcej niż inni. Masz doskonałą intuicję i wyobraźnię. Wyrównaj energię życiową qi, ułóż emocje, przyjmij wysokie wibracje, wzmocnij najlepsze potencjały swojego znaku solarnego i wyglądaj uroczo!','','kolczyk-ze-znakiem-zodiaku-dla-ryb','','','','Kolczyk ze znakiem zodiaku dla Ryb','','','',''),
(288,1,1,'Gwiazda północna to symbol ochronny dla podróżujących, źródło światła i punkt docelowy wędrówki. Jest drogowskazem na krętej drodze życia. Gwiazda ma niesamowicie bogatą symbolikę. Reprezentuje boską ideę, ideał, sukces, szczęście, nadzieję, światło, a także 4 żywioły i ducha.  Cyrkonia symbolizuje światło, do którego podąża Twoja dusza. Dotarcie do niego wymaga jednak transformacji i pokonania wielu wyzwań. Kolor różowy oraz pomarańczowy, wesprą Twoją pewność siebie oraz relacje.   Załóż kolczyk Polaris Star, gdy brak Ci wiary w siebie, potrzebujesz światła na swojej Drodze Życia oraz  ochrony podczas życiowej podróży.','','kolczyk-z-cyrkonia-polaris-star','','','','Kolczyk z cyrkonią Polaris Star','','','',''),
(289,1,1,'To, że kolczyki \"Zodiac\" przeznaczone są dla Ciebie, zapisane jest w gwiazdach!  Byku, cenisz piękno i dobrą jakość, dlatego żyjesz pełną piersią. Cechuje Cię wytrwałość i honorowość. Dzięki swojej konsekwencji zwykle osiągasz swoje cele. Wyrównaj energię życiową qi, ułóż emocje, przyjmij wysokie wibracje, wzmocnij najlepsze potencjały swojego znaku solarnego i wyglądaj uroczo!','','kolczyk-ze-znakiem-zodiaku-dla-byka','','','','Kolczyk ze znakiem zodiaku dla Byka','','','',''),
(290,1,1,'Kwiat jest symbolem ulotności życia. Odpowiednio zadbany rozkwita swoim pięknem i zapachem, by po kilku dniach przekwitnąć. Życie ziemskie jest tak samo ulotne i kruche jak płatki delikatnych kwiatów. Dlatego powinniśmy przejść je z uważnością i wdzięcznością, tak by nasze piękno mogło rozkwitać każdego dnia, pamiętając o tym, że dar życia to wystarczający powód do bycia szczęśliwym.  Kolor różowy wzmacnia miłość, przyjaźń, pojednanie, pomaga stanąć w świetle kobiecej energii. Ułatwia wybaczenie, wzmacnia tez miłość własną.  Załóż kolczyk Pink Flower by cieszyć się tym co tu i teraz, dostrzegać piękno obecnej chwili i żyć w zgodzie ze sobą i innymi.','','kolczyk-z-cyrkonia-pink-flower','','','','Kolczyk z cyrkonią Pink Flower','','','',''),
(291,1,1,'Każdy z nas bywa na życiowym zakręcie, kiedy życie traci kolory i wszystko widzimy w czarnych barwach. Kolczyk Colorful Life pomoże Ci dostrzec światło mimo trudnych chwil i odzyskać swoją wewnętrzną moc.   Dbaj o swój kolczyk! Colorful Life nie lubi być moczony i mieć kontaktu z chemią (farba, lakier do włosów).','','kolczyk-wiszacy-z-cyrkoniami-colorful-life','','','','Kolczyk wiszący z cyrkoniami Colorful Life','','','',''),
(292,1,1,'Lotos jest jednym z najpopularniejszych symboli oświecenia w buddyzmie, jest także ważny w wielu buddyjskich tradycjach. Według legendy kwiaty lotosu kwitły wszędzie, gdzie stanął mały Budda. Ponieważ lotos rośnie w mulistej wodzie, reprezentuje czystość oświeconego umysłu wyłaniającego się pośród cierpień samsary. Symbolizuje nowy początek, życie wieczne, czystość, kobiecą energię i seksualność, sukces finansowy i szczęście.  Załóż kolczyk Silver Lotos, gdy rozwijasz się duchowo lub chcesz wydobyć z siebie kobiecość oraz przyciągnąć dobrobyt.','','kolczyk-kwiatek-z-cyrkoniami-silver-lotos','','','','Kolczyk kwiatek z cyrkoniami Silver Lotos','','','',''),
(293,1,1,'Pióra są świętymi darami od niebios, atrybutem siły boskiej, znakiem, że nasze prośby i modlitwy zostały wysłuchane. To symbol uznania, że   Twoi Duchowi Przewodnicy troszczą się o Ciebie, zapewniając Ci bezpieczeństwo i wsparcie na każdej ścieżce, którą podążasz.  Załóż kolczyk Angel, aby wnieść do swojego życia światło oraz gdy, chcesz pozbyć się negatywnych myśli, które w Twoim życiu nie pozwalały Ci na rozwój i zadowolenie.   Dbaj o swój kolczyk! Angel nie lubi być moczony i mieć kontaktu z chemią (farba, lakier do włosów).','','kolczyk-srebrny-z-piorami-angel','','','','Kolczyk srebrny z piórami Angel','','','',''),
(294,1,1,'Kwiat jest symbolem ulotności życia. Odpowiednio zadbany rozkwita swoim pięknem i zapachem, by po kilku dniach przekwitnąć. Życie ziemskie jest tak samo ulotne i kruche jak płatki delikatnych kwiatów. W codziennym pędzie zapominamy o tym i bierzemy za pewnik nasze zdrowie i szczęście. Dlatego powinniśmy przejść je z uważnością i wdzięcznością, tak by nasze piękno mogło rozkwitać każdego dnia, pamiętając o tym, że dar życia to wystarczający powód do bycia szczęśliwym.  Załóż kolczyk \"Flower Power\" by cieszyć się tym co tu i teraz, dostrzegać piękno obecnej chwili i być wdzięcznym za możliwość doświadczania.','','kolczyk-z-lancuszkiem-i-cyrkoniami-flower-power','','','','Kolczyk z łańcuszkiem i cyrkoniami Flower Power','','','',''),
(295,1,1,'Kolczyk Cornucopia to róg obfitości, który symbolizuje wszelakie zasoby, które są potrzebne do pokonania przeszkód na Drodze Życia i dotarcia do celu.  Cyrkonie symbolizują światło do którego dąży Twoja dusza. Dotarcie do niego wymaga jednak pokonania wielu wyzwań i transformacji.   Załóż kolczyk Cornucopia, jeśli chcesz uzyskać dostęp do swoich ukrytych możliwości i  łatwiej spełniać marzenia oraz podążać przez życie zgodnie ze swoim przeznaczeniem.','','kolczyk-wiszacy-cornucopia','','','','Kolczyk wiszący Cornucopia','','','',''),
(296,1,1,'Zestaw do warsztatów z możliwością wyboru wahadła.   Wahadło podstawowe zaleca się jako pierwsze wahadło do ćwiczeń w początkowym rozwoju osób zainteresowanych ezoteryką. Używa się go do codziennej pracy z energiami. Jest spolaryzowane dodatnio, przez co nie ma negatywnego wpływu na osobę z niego korzystającą i nie wymaga od niej specjalistycznej wiedzy lub doświadczenia.  Wahadło Izys swoją formą symbolizuje Krzyż Życia, należy do wahadeł egipskich. Wzmocnione baterią złożoną z czterech ogniw. Wykazuje dużą czułość radiostezyjną. Może pełnić rolę zarówno nadajnika, jak i odbiornika, każdego rodzaju promieniowania. Wahadło samoczynnie się oczyszcza, co znacznie ułatwia pracę przy jego użyciu.   Apatyt wspiera dostęp do poprzednich wcieleń.','','zestaw-podroz-duszy-wahadlo-i-kamien-do-warsztatow','','','','Zestaw Podróż Duszy- wahadło i kamień do warsztatów','','','',''),
(297,1,1,'Słońce reprezentuje ogień. To żywioł oczyszczający, który wypala negatywne emocje i sprzyja otwieraniu nowego rozdziału w życiu. To również symbol wszelkiego życia na Ziemi, źródło siły, jasności i dobrostanu.   Załóż kolczyk Mystic Sun, kiedy brakuje Ci motywacji lub cierpisz na słomiany zapał, masz problem z ukończeniem projektów, rozpoczynasz nowy, wymagający etap w życiu.','','kolczyk-z-cyrkoniami-mystic-sun','','','','Kolczyk z cyrkoniami Mystic Sun','','','',''),
(298,1,1,'Nów oznacza nowe początki, to czas zaangażowania energii życiowej w nowe cele, manifestację marzeń i inicjowania nowych planów. Księżyc symbolizuje też kobiecą energię, intuicję i emocje. Załóż kolczyk Moonlight, gdy potrzebujesz zainicjować nowy pomysł i chcesz tchnąć w niego mocną energię powodzenia. Moonlight pomaga też przepracować emocje i odkryć w sobie kobiecość.','','kolczyk-przewlekany-z-ksiezycem-z-cyrkoniami-moonlight','','','','Kolczyk przewlekany z księżycem z cyrkoniami Moonlight','','','',''),
(299,1,1,'Wąż reprezentuje reinkarnację, nieśmiertelność i czystość. Ma potężne połączenie z pierwotną siłą życiową i energią. W większości kulturach jest symbolem reprezentujący źródło życia. To atrybut energii, ważnych przejść i zmian, niezależnie od tego, czy zachodzą one na poziomie duchowym, emocjonalnym czy fizycznym. Cyrkonia symbolizuje światło na drodze życia, do którego dąży Twoja dusza. Dotarcie do niego wymaga jednak pokonania wielu wyzwań i transformacji, tak jak wąż zrzuca skórę, by odrodzić się na nowo.  Załóż kolczyk Crystal Serpent, gdy jesteś na etapie transformacji, lub potrzebujesz dodatkowych sił witalnych.','','kolczyk-z-cyrkoniami-crystal-serpent','','','','Kolczyk z cyrkoniami Crystal Serpent','','','',''),
(300,1,1,'Stresy, lęki i niepokoje zaburzają naszą energetykę, blokują meridiany i kanały nadii. Są one jak rzeki lub strumienie, które przenoszą energię życiową w całym ciele fizycznym, aby nas odżywiać i pomagać w równoważeniu systemów i funkcji naszego ciała. Utrzymywanie energii życiowej w harmonii zapewnia źródło ogólnej równowagi, zdrowia i spokoju.  Kolczyk Perfect Harmony to talizman, który wzmocni Cię energetycznie, pomoże odzyskać wewnętrzny spokój, w trudnych momentach życia, doda Ci sił do dostrzegania światła i pokonywania lęków.','','kolczyk-wiszacy-perfect-harmony','','','','Kolczyk wiszący Perfect Harmony','','','',''),
(301,1,1,'Wąż reprezentuje reinkarnację, nieśmiertelność i czystość. Ma potężne połączenie z pierwotną energią i siłą życiową. W większości kulturach jest uważany za potężny symbol reprezentujący źródło życia. To atrybut energii, ważnych przejść i zmian, niezależnie od tego, czy zachodzą one na poziomie duchowym, emocjonalnym czy fizycznym. Tak jak wąż zrzuca skórę, by odrodzić się na nowo, tak samo Ty nosząc kolczyk Snake wspierasz swoją transformację.','','kolczyk-waz-snake','','','','Kolczyk wąż Snake','','','',''),
(302,1,1,'To, że kolczyki \"Zodiac\" przeznaczone są dla Ciebie, zapisane jest w gwiazdach!  Lwie, jesteś bezsprzecznie królem zodiaku. Kochasz życie, a życie kocha Ciebie. Cechuje Cię dostojeństwo, opiekuńczość i ambicja. Wyrównaj energię życiową qi, ułóż emocje, przyjmij wysokie wibracje, wzmocnij najlepsze potencjały swojego znaku solarnego i wyglądaj uroczo!','','kolczyk-ze-znakiem-zodiaku-dla-lwa','','','','Kolczyk ze znakiem zodiaku dla Lwa','','','',''),
(303,1,1,'Bogini to uosobienie żeńskiego bóstwa. Reprezentuje cnoty takie jak piękno, miłość, seksualność, macierzyństwo. W niektórych wyznaniach święta postać kobiety zajmuje centralne miejsce w religijnej modlitwie i kulcie.  Cyrkonia symbolizuje światło na drodze życia, do którego dąży Twoja dusza, a także nadzieję i pozytywne spojrzenie.  Załóż kolczyk Big Goddess by wydobyć z siebie kobiecą energię - bez względu na to, czy jest to energia uwodzicielki, czy opiekuńczej matki - oraz aby z odwagą stanąć w świetle swojej mocy.','','kolczyk-wiszacy-z-cyrkoniami-big-goddess','','','','Kolczyk wiszący z cyrkoniami Big Goddess','','','',''),
(304,1,1,'Pozwól rozbłysnąć gwiazdom na Twoim uchu! Te maleńkie konstelacje są jak światło, które rozświetla drogę życia i prowadzi za rękę podczas życiowych zakrętów. Gwiazda ma niesamowicie bogatą symbolikę. Reprezentuje boską ideę, ideał, szczęście, sukces, nadzieję, światło, a także 4 żywioły i ducha.  Kolor różowy wzmacnia miłość, przyjaźń, pojednanie, pomaga stanąć w świetle kobiecej energii. Ułatwia wybaczenie, wzmacnia tez miłość własną.  Załóż kolczyk \"Pink Constellation\", gdy potrzebujesz światła na swojej Drodze Życia oraz chcesz rozwinąć miłość do siebie i innych!   Dbaj o swój kolczyk! Nie powinien być moczony ani mieć kontaktu z chemią i kosmetykami.','','kolczyk-z-rozowymi-cyrkoniami-pink-constellation','','','','Kolczyk z różowymi cyrkoniami Pink Constellation','','','',''),
(305,1,1,'Oko Ajna zwane też Trzecim okiem lub okiem bogów jest symbolem oświecenia i wysokiego duchowego przebudzenia. To furtka do głębokiej świadomości. To też jeden z najważniejszych symboli hinduizmu.  Trzecie oko pozwala zobaczyć i poznać prawdy uniwersalne. Wzmacnia jasne myślenie, duchową kontemplację i autorefleksję. Jest to najwyższa czakra w ciele fizycznym, dzięki czemu zapewnia wizjonerską perspektywę.  Według wierzeń wiążą się z nim niesamowite zdolności – wprowadzanie w stan hipnozy, dar jasnowidzenia, telepatia, oraz możliwość pobierania wiedzy bezpośrednio od Rozumu Kosmicznego.  Załóż kolczyk Third Eye, jeśli zależy Ci na rozwoju intuicji i mocy parapsychicznych.','','kolczyk-z-cyrkoniami-i-okiem-ajna-third-eye','','','','Kolczyk z cyrkoniami i okiem Ajna Third-eye','','','',''),
(306,1,1,'Gwiazda ma niesamowicie bogatą symbolikę. Reprezentuje boską ideę, ideał, szczęście, sukces, nadzieję, światło, a także 4 żywioły i ducha. Załóż kolczyk Royal Star, gdy potrzebujesz światła na swojej Drodze Życia, chcesz tchnąć powodzenie w swoje przedsięwzięcia oraz potrzebna Ci motywacja do działania.  Dbaj o swój kolczyk! Royal Star nie lubi być moczony i mieć kontaktu z chemią (farba, lakier do włosów).','','kolczyk-z-gwiazda-royal-star','','','','Kolczyk z gwiazdą Royal Star','','','',''),
(307,1,1,'Esencją sodalitu jest logika, prawda i światło. Wzmacnia intuicję i odwołuje się do autentycznej prawdy. Jasność umysłu i równowaga emocjonalna, którą dzięki niemu zyskasz rozwinie Twoją pewność siebie.   Kolczyk Universal Truth wzmocni zaufanie do Twojej prawdy oraz pomoże Ci zdefiniować odczucia względem danej osoby lub sytuacji, zanim nasz umysł włączy funkcje analityczne. Dzięki niemu łatwiej wyciszysz się i polepszysz komunikację.   Załóż kolczyk  Universal Truth , gdy odczuwasz niepokój, chcesz zwiększyć poczucie własnej wartości i czuć się pewnie w wyjątkowych sytuacjach.','','kolczyk-z-sodalitem-universal-truth','','','','Kolczyk z sodalitem Universal Truth','','','',''),
(308,1,1,'Każdy człowiek przeżywa zakręty życiowe na swojej drodze. Każdy z nas się czegoś boi, walczy ze swoimi demonami, miewa gorszy nastrój lub ma wrażenie, że wszystko spada na jego barki. U każdego z nas są chwile, którym brakuje światła, nadziei i pozytywnego spojrzenia.  Kolczyk \"Ray of light II\" doda Ci wiary w siebie, poprawi nastrój i poprowadzi Cię w kierunku światła, by na Twoim niebie znów zaświeciło Słońce.','','kolczyk-z-lancuszkiem-i-cyrkoniami-ray-of-light-ii','','','','Kolczyk z łańcuszkiem i cyrkoniami Ray of Light II','','','',''),
(309,1,1,'Kwiat symbolizuje ulotności życia. Dzięki odpowiedniej trosce i opiece rozkwita swoim pięknem i zachwyca zapachem, by po kilku dniach przekwitnąć. Nasze życie ziemskie jest tak samo kruche i ulotne jak delikatne płatki kwiatów. W codziennym pędzie zdarza nam się o tym zapomnieć, a nasze zdrowie i szczęście wziąć za pewnik. Dlatego powinniśmy przebyć je z wdzięcznością i uważnością, tak by nasze piękno mogło rozkwitać każdego dnia, nie zapominając o tym, że dar życia to wystarczający powód do bycia szczęśliwym.  Załóż kolczyk Mini Flower by dostrzegać piękno obecnej chwili, cieszyć się tym co tu i teraz i być wdzięcznym za możliwość doświadczania.','','kolczyk-z-rozowymi-cyrkoniami-mini-flower','','','','Kolczyk z różowymi cyrkoniami Mini Flower','','','',''),
(310,1,1,'Gwiazda północna to symbol ochrony dla podróżujących, źródło światła i cel wędrówki. Jest drogowskazem na krętej drodze życia. Nausznica Inner Wisdom przypomina Ci, że wewnętrzna mądrość to wiedza, która nosisz w sobie, która pochodzi z wyciszenia umysłu, odsunięcia na bok ego, wyzbycia się oczekiwań co do tego, jak powinno być.  Cyrkonia symbolizuje światło, do którego podąża Twoja dusza. Dotarcie do niego wymaga jednak transformacji i pokonania wielu wyzwań.   Załóż nausznicę Inner Wisdom, by odnaleźć Źródło wiedzy w sobie, połączyć się ze swoim Wyższym Ja i usłyszeć cichy głos Duszy.','','nausznica-srebrna-z-cyrkoniami-inner-wisdom','','','','Nausznica srebrna z cyrkoniami Inner Wisdom','','','',''),
(311,1,1,'Concordia to rzymska bogini zgody, ładu i harmonii. Swoja opieką obejmowała porządek w społeczeństwie oraz związkach małżeńskich. Przedstawiano ją, jako kobietę trzymającą w rękach róg obfitości i gałązkę oliwną.  Róg obfitości symbolizował  wszelakie zasoby, które są potrzebne do pokonania przeszkód na Drodze Życia i dotarcia do celu. Gałązka oliwna to symbol pokoju, harmonii, pojednania i nadziei na lepszą przyszłość.   Załóż kolczyk Concordia, jeśli chcesz uzyskać dostęp do swoich ukrytych możliwości i  łatwiej spełniać marzenia oraz podążać przez życie w harmonii i spokoju.','','kolczyk-wiszacy-concordia','','','','Kolczyk wiszący Concordia','','','',''),
(312,1,1,'Lotos jest jednym z najbardziej rozpoznawalnych symboli oświecenia buddyzmu i jest ważny w wielu buddyjskich tradycjach. Według legendy wszędzie, gdzie stanął mały Budda, kwitł kwiat lotosu. Ponieważ lotos rośnie w mulistej wodzie, symbolizuje czystość oświeconego umysłu powstającego pośród cierpień samsary. Symbolizuje nowy początek, czystość, kobiecą energię i seksualność, życie wieczne, sukces finansowy, dobrobyt i szczęście.  Załóż kolczyk Lotos Flower zawsze by wydobyć z siebie kobiecość i przyciągnąć dobrobyt.','','kolczyk-z-cyrkoniami-lotus-beauty','','','','Kolczyk z cyrkoniami Lotus Beauty','','','',''),
(313,1,1,'Od dawnych czasów Magowie i Alchemicy używali symboli serca do zaklęć związanych z miłością, związkami lub romansem. Symbol ten wykorzystywano również w rytuałach mających na celu wzmocnienie istniejących relacji. Obecnie, serce kojarzone jest w różnych kulturach z miłością, miłosierdziem, empatią i radością.  Załóż kolczyk Pure Heart, by  otworzyć się na bezwarunkową miłość oraz szczęśliwe relacje.   Dbaj o swój kolczyk! Pure Heart nie lubi być moczony i mieć kontaktu z chemią (farba, lakier do włosów','','kolczyk-srebrny-wiszacy-z-sercem-pure-heart','','','','Kolczyk srebrny wiszący z sercem Pure Heart','','','',''),
(314,1,1,'Koło symbolizuje harmonię, równowagę, doskonałość, nieskończoność oraz niezmienny cykl życia. W buddyzmie jest również symbolem najwyższego stopnia oświecenia.   Załóż kolczyk Harmony, jeśli rozwijasz się duchowo, chcesz poczuć spokój i harmonię oraz czujesz, że brak Ci wiary w realizację swoich marzeń i planu życia.','','srebrny-kolczyk-wiszacy-kolo-harmony','','','','Srebrny kolczyk wiszący koło Harmony','','','',''),
(315,1,1,'Bogini to uosobienie żeńskiego bóstwa. Reprezentuje cnoty takie jak piękno, miłość, seksualność, macierzyństwo. W niektórych wyznaniach święta postać kobiety zajmuje centralne miejsce w religijnej modlitwie i kulcie.  Załóż kolczyk Goddess, by wydobyć z siebie kobiecą siłę, bez względu na to, czy jest to energia uwodzicielki, czy opiekuńczej matki oraz by wspomóc swoje relacje i ponieść wibracje.','','kolczyk-wiszacy-z-lancuszkiem-goddess','','','','Kolczyk wiszący z łańcuszkiem Goddess','','','',''),
(316,1,1,'Gwiazda ma niesamowicie bogatą symbolikę. Reprezentuje boską ideę, ideał, szczęście, sukces, nadzieję i światło. Pięcioramienna gwiazda nawiązuje do 4 żywiołów i ducha, wyraża bycie kompletnym i zbalansowanym. Można jej symbolikę również oprzeć na pięciu głównych zasadach: miłości, mądrości, prawdy, sprawiedliwości i cnoty, którymi powinien kierować się człowiek, aby stanąć w pełni swojej mocy.   Załóż kolczyk \"Supernova\" kiedy chcesz odnaleźć wewnętrzną siłę i poszukujesz ugruntowania oraz powodzenia w działaniu.','','kolczyk-wiszacy-z-gwiazda-i-cyrkoniami-supernova','','','','Kolczyk wiszący z gwiazdą i cyrkoniami Supernova','','','',''),
(317,1,1,'To, że kolczyki \"Zodiac\" przeznaczone są dla Ciebie, zapisane jest w gwiazdach!  Skorpionie, jako znak nielubiący półśrodków jesteś bardzo konkretny i odważny. Twoja godna podziwu dociekliwość i motywacja pozwala Ci odczuwać więcej i silniej. Masz wielki dar transformacji i wychodzenia silniejszym z kryzysów. Wyrównaj energię życiową qi, ułóż emocje, przyjmij wysokie wibracje, wzmocnij najlepsze potencjały swojego znaku solarnego i wyglądaj uroczo!','','kolczyk-ze-znakiem-zodiaku-dla-skorpiona','','','','Kolczyk ze znakiem zodiaku dla Skorpiona','','','',''),
(318,1,1,'To, że kolczyki \"Zodiac\" przeznaczone są dla Ciebie, zapisane jest w gwiazdach!  Wodniku, jesteś zodiakalnym innowatorem i buntownikiem. Uwielbiasz wybiegać myślami w przyszłość. Jesteś zawsze o parę kroków przed innymi. Cechuje Cię duża niezależność i upartość. Wyrównaj energię życiową qi, ułóż emocje, przyjmij wysokie wibracje, wzmocnij najlepsze potencjały swojego znaku solarnego i wyglądaj uroczo!','','kolczyk-ze-znakiem-zodiaku-dla-wodnika','','','','Kolczyk ze znakiem zodiaku dla Wodnika','','','',''),
(319,1,1,'Nów oznacza nowe początki, to czas zaangażowania energii życiowej w nowe cele, manifestację marzeń i inicjowania nowych planów. Księżyc symbolizuje też kobiecą energię, intuicję i emocje.  Gwiazda reprezentuje boską ideę, ideał, szczęście, sukces, nadzieje i światło, a także 4 żywioły i ducha.  Załóż kolczyk Starlight, gdy potrzebujesz zainicjować nowy pomysł i chcesz tchnąć w niego mocną energię powodzenia. Starlight pomaga też przepracować emocje i odkryć w sobie kobiecość oraz odzyskać poczucie bezpieczeństwa.','','kolczyk-wiszacy-z-ksiezycem-i-gwiazda-starlight','','','','Kolczyk wiszący z księżycem i gwiazdą Starlight','','','',''),
(320,1,1,'Nów oznacza nowe początki, to czas zaangażowania energii życiowej w nowe cele, manifestację marzeń i inicjowania nowych planów. Księżyc symbolizuje też kobiecą energię, intuicję i emocje.  Gwiazda reprezentuje boską ideę, ideał, szczęście, sukces, nadzieje i światło, a także 4 żywioły i ducha.  Załóż kolczyk Moondust, gdy potrzebujesz zainicjować nowy pomysł i chcesz tchnąć w niego mocną energię powodzenia. Moondust pomaga też przepracować emocje i odkryć w sobie kobiecość oraz odzyskać poczucie bezpieczeństwa.','','kolczyk-wiszacy-z-ksiezycem-i-gwiazda-moondust','','','','Kolczyk wiszący z księżycem i gwiazdą Moondust','','','',''),
(321,1,1,'Klejnoty są symbolem bogactwa, dobrobytu i obfitości. Kolor różowy to kolor miłości, kobiecości i romansów. Wspiera nas w związkach i w budowaniu relacji opartych na bezwarunkowych uczuciach.  Załóż nausznicę Precious w zapewnić sobie obfitość uczuć w istniejącym związku, otworzyć się na miłość własną lub na nowego partnera.','','nausznica-z-cyrkoniami-precious','','','','Nausznica z cyrkoniami Precious','','','',''),
(322,1,1,'Kolczyk Power of Three posiada trzy cyrkonie. Trzy to wyjątkowa liczba, kojarzona ze światem spirytualnym i rozwojem duchowym. Numerologicznie, 3 to liczba talentów artystycznych, spontaniczności, komunikacji i szczęścia.  Cyrkonie symbolizują światło na drodze życia, do którego dąży Twoja dusza, a także nadzieję i pozytywne spojrzenie.  Załóż kolczyk Power of Three by wesprzeć swoje talenty, przepracować problemy z komunikacją lub wspomóc się na drodze poszukiwania szczęścia.','','kolczyk-kolko-z-cyrkoniami-do-ucha-lub-chrzastki-ucha-power-of-three','','','','Kolczyk kółko z cyrkoniami do ucha lub chrząstki ucha Power of Three','','','',''),
(323,1,1,'To, że kolczyki \"Zodiac\" przeznaczone są dla Ciebie, zapisane jest w gwiazdach!  Panno, jesteś bardzo skrupulatna i pomocna. Twoimi atutami jest wytrwałość, pracowitość i wnikliwość. Jesteś geniuszem porządkowania i ulepszania. Wyrównaj energię życiową qi, ułóż emocje, przyjmij wysokie wibracje, wzmocnij najlepsze potencjały swojego znaku solarnego i wyglądaj uroczo!','','kolczyk-ze-znakiem-zodiaku-dla-panny','','','','Kolczyk ze znakiem zodiaku dla Panny','','','',''),
(324,1,1,'Hamsa jest związana z wieloma tradycjami - islamem, judaizmem, hinduizmem i buddyzmem. W hinduizmie jest często używana jako synonim najwyższego ducha lub ostatecznej rzeczywistości, która nazywa się „Brahmanem”. W buddyzmie reprezentuje uniwersalnego ducha i wyzwolenie z cyklu odrodzenia. Do naszej kultury przeszła jako symbol odpierania zła i negatywnych energii.  Załóż kolczyk Hamsa dla ochrony swojego biopola.','','kolczyk-srebrny-hamsa','','','','Kolczyk srebrny Hamsa','','','',''),
(325,1,1,'Oko Ajna zwane też Trzecim okiem lub okiem bogów jest symbolem oświecenia i wysokiego duchowego przebudzenia. To furtka do głębokiej świadomości. To też jeden z najważniejszych symboli hinduizmu.  Trzecie oko pozwala zobaczyć i poznać prawdy uniwersalne. Wzmacnia jasne myślenie, duchową kontemplację i autorefleksję. Jest to najwyższa czakra w ciele fizycznym, dzięki czemu zapewnia wizjonerską perspektywę.  Według wierzeń wiążą się z nim niesamowite zdolności – wprowadzanie w stan hipnozy, dar jasnowidzenia, telepatia, oraz możliwość pobierania wiedzy bezpośrednio od Rozumu Kosmicznego.  Załóż kolczyk \"Third Eye\", jeśli zależy Ci na rozwoju intuicji i mocy parapsychicznych.','','kolczyk-wiszacy-z-trzecim-okiem-third-eye','','','','Kolczyk wiszący z trzecim okiem Third Eye','','','',''),
(326,1,1,'To, że kolczyki \"Zodiac\" przeznaczone są dla Ciebie, zapisane jest w gwiazdach!  Strzelcu, jako zodiakalny mędrzec, podróżnik i filozof, zawsze kierujesz się wyższymi wartościami i optymizmem. Twoją domeną jest rozwój i ekspansja. Wyrównaj energię życiową qi, ułóż emocje, przyjmij wysokie wibracje, wzmocnij najlepsze potencjały swojego znaku solarnego i wyglądaj uroczo!','','kolczyk-ze-znakiem-zodiaku-dla-strzelca','','','','Kolczyk ze znakiem zodiaku dla Strzelca','','','',''),
(327,1,1,'Energia żeńska to energia kreowania, jest związana z podświadomością i odpowiada za manifestację. Gdy masz brak tej energii w sobie, doświadczasz niepewności siebie, nieumiejętności przyjmowania darów od Wszechświata, braku poczucia wartości, problemów z miłością własną, rollercoastera emocjonalnego i niemożności osiągania własnych celów.  Załóż kolczyk Womanity aby wzmocnić swoją pewność siebie, stabilizację emocjonalną, kreowanie i inicjowanie celów.','','kolczyk-wiszacy-z-cyrkonia-womanity','','','','Kolczyk wiszący z cyrkonią Womanity','','','',''),
(328,1,1,'Gwiazda północna to symbol ochrony dla podróżujących, źródło światła i cel wędrówki. Jest drogowskazem na krętej drodze życia. Nausznica Inner Wisdom przypomina Ci, że wewnętrzna mądrość to wiedza, która nosisz w sobie, która pochodzi z wyciszenia umysłu, odsunięcia na bok ego, wyzbycia się oczekiwań co do tego, jak powinno być.  Cyrkonia symbolizuje światło, do którego podąża Twoja dusza. Dotarcie do niego wymaga jednak transformacji i pokonania wielu wyzwań.   Załóż nausznicę Inner Wisdom, by odnaleźć Źródło wiedzy w sobie, połączyć się ze swoim Wyższym Ja i usłyszeć cichy głos Duszy.','','nausznica-z-cyrkoniami-inner-wisdom','','','','Nausznica z cyrkoniami Inner Wisdom','','','',''),
(329,1,1,'Kolczyk Boho wesprze Twoje połączenie ze wszechświatem oraz naturą! Pomoże Ci poczuć jedność z otaczającym światem oraz  odnaleźć harmonię i spokój w codziennej rzeczywistości.  Załóż kolczyk Boho, gdy odczuwasz chaos i zwątpienie, brakuje Ci poczucia zrozumienia, chcesz stać się częścią jedności oraz odnieść sukces w podjętych wyzwaniach.','','kolczyk-na-sztyfcie-boho','','','','Kolczyk na sztyfcie Boho','','','',''),
(330,1,1,'To, że kolczyki \"Zodiac\" przeznaczone są dla Ciebie, zapisane jest w gwiazdach!  Wago, jesteś mistrzynią dyplomacji i harmonii. Cechuje Cię wielki czar i urok. Znasz się na sztuce i cenisz piękno.Wyrównaj energię życiową qi, ułóż emocje, przyjmij wysokie wibracje, wzmocnij najlepsze potencjały swojego znaku solarnego i wyglądaj uroczo!','','kolczyk-ze-znakiem-zodiaku-dla-wagi','','','','Kolczyk ze znakiem zodiaku dla Wagi','','','',''),
(331,1,1,'Aura jest niewidzialną emanacją lub polem energetycznym wokół człowieka, które odzwierciedla poziom jego energii. Idealnie jednolita aura jest wyrazem sił witalnych i harmonii Twojego wnętrza. Gdy chorujemy, żyjemy w stresie, przebywamy w dużych skupiskach ludzkich lub otaczają nas niskie wibracje, nasze ciało eteryczne się osłabia. Jesteśmy podatni na ataki wampirów energetycznych, czujemy, że ludzie i sytuacje dosłownie wysysają z nas energię, chorujemy.  Kolczyk Gold Aura toamulet ochronny. Załóż ją, jeśli chcesz chronić swoją energetykę, potrzebujesz znaleźć w sobie wewnętrzny spokój, radość życia lub odzyskać zdrowie psychiczne bądź fizyczne.','','kolczyk-wiszacy-gold-aura','','','','Kolczyk wiszący Gold Aura','','','',''),
(332,1,1,'To, że kolczyki \"Zodiac\" przeznaczone są dla Ciebie, zapisane jest w gwiazdach!  Koziorożcu, jesteś pracowity, wytrwały i zaradny. Cechuje Cię odpowiedzialność, nie tylko za siebie, ale i za innych. Zawsze konsekwentnie dążysz do celu, który doskonale wiesz jak osiągnąć. Wyrównaj energię życiową qi, ułóż emocje, przyjmij wysokie wibracje, wzmocnij najlepsze potencjały swojego znaku solarnego i wyglądaj uroczo!','','kolczyk-ze-znakiem-zodiaku-dla-koziorozca','','','','Kolczyk ze znakiem zodiaku dla Koziorożca','','','',''),
(333,1,1,'Słońce symbolizuje męską energię, odpowiedzialną za działanie. Energię, która sprawia, że jesteśmy pełni sił i pewności siebie na co dzień i w dalekosiężnych celach.  Załóż kolczyk \"Sunny Days\", jeśli w Twoim życiu brakuje optymizmu, ciężko Ci znaleźć energię na co dzień, chciałabyś odzyskać poczucie sprawczości.','','kolczyk-srebrny-slonce-sunny-days','','','','Kolczyk srebrny słońce Sunny Days','','','',''),
(334,1,1,'To, że kolczyki \"Zodiac\" przeznaczone są dla Ciebie, zapisane jest w gwiazdach!  Bliźniaku, jako posłaniec informacji Twoim talentem jest dobra komunikacja. Jesteś niezmiernie inteligentny i ciekawski. Wyrównaj energię życiową qi, ułóżcie emocje, przyjmijcie wysokie wibracje, wzmocnijcie najlepsze potencjały swojego znaku solarnego i wyglądajcie uroczo!','','kolczyk-ze-znakiem-zodiaku-dla-blizniat','','','','Kolczyk ze znakiem zodiaku dla Bliźniąt','','','',''),
(335,1,1,'Gwiazda północna to symbol ochronny dla podróżujących, źródło światła i punkt docelowy wędrówki. Jest drogowskazem na krętej drodze życia. Gwiazda ma niesamowicie bogatą symbolikę. Reprezentuje boską ideę, ideał, sukces, szczęście, nadzieję, światło, a także 4 żywioły i ducha.  Cyrkonia symbolizuje światło, do którego podąża Twoja dusza. Dotarcie do niego wymaga jednak transformacji i pokonania wielu wyzwań. Kolor różowy oraz pomarańczowy, wesprą Twoją pewność siebie oraz relacje.   Załóż kolczyk Polaris Star, gdy brak Ci wiary w siebie, potrzebujesz światła na swojej Drodze Życia oraz  ochrony podczas życiowej podróży.','','kolczyk-srebrny-z-cyrkonia-polaris-star','','','','Kolczyk srebrny z cyrkonią Polaris Star','','','',''),
(336,1,1,'Łza to kropla która jest symbolem oczyszczenia. Pojawia się jako materialny objaw smutku, który odczuwamy, gdy przeżywamy trudne emocje. Krople mają jednak w sobie ogromną siłę - reprezentują ducha wytrwałości. Chociaż pojedyncza kropla jest bardzo niepozorna, a jej siła jest bardzo słaba, gdy kapie jedna po drugiej potrafi drążyć nawet skałę. Nasza wewnętrzna moc rownież drzemie właśnie w takich małych rzeczach, małych gestach, małych doświadczeniach i małych krokach, które robimy.  Załóż kolczyk \"Mystic Drop\" jeśli potrzebujesz oczyszczenia i chcesz znaleźć w sobie siłę do pójścia naprzód!','','kolczyk-lza-z-cyrkoniami-mystic-drop','','','','Kolczyk łza z cyrkoniami Mystic Drop','','','',''),
(337,1,1,'To, że kolczyki \"Zodiac\" przeznaczone są dla Ciebie, zapisane jest w gwiazdach!  Raku, jako bardzo opiekuńczy znak zodiaku jesteś głównym strażnikiem ogniska domowego. Drzemie w Tobie wielka ukryta siła i bezinteresowność... ale uwaga! Potrafisz być bardzo waleczny. Wyrównaj energię życiową qi, ułóż emocje, przyjmij wysokie wibracje, wzmocnij najlepsze potencjały swojego znaku solarnego i wyglądaj uroczo!','','kolczyk-ze-znakiem-zodiaku-dla-raka','','','','Kolczyk ze znakiem zodiaku dla Raka','','','',''),
(338,1,1,'Lotos jest jednym z najbardziej znanych symboli buddyzmu i bardzo ważna częścią tradycji. Według legendy wszędzie, gdzie stanął mały Budda, kwitł kwiat lotosu. Symbolizuje on czystość oświeconego umysłu, nowy początek, kobiecą energię i seksualność, życie wieczne, sukces finansowy, dobrobyt i szczęście.  Załóż kolczyk \"Crystal Lotos\" zawsze by wydobyć z siebie kobiecość i przyciągnąć dobrobyt. Intencję wzmocnij kolorem dla ukojenia wewnętrznej pustki i strachu oraz dla rozjaśnienia drogi życia.','','kolczyk-srebrny-z-cyrkoniami-crystal-lotos','','','','Kolczyk srebrny z cyrkoniami Crystal Lotos','','','',''),
(339,1,1,'Gwiazda ma niezwykle bogatą symbolikę. Reprezentuje ideał, boską ideę, szczęście, sukces, nadzieję i światło. Pięcioramienna gwiazda nawiązuje do 4 żywiołów i ducha, wyraża bycie zbalansowanym i kompletnym. Można jej symbolikę również oprzeć na pięciu głównych zasadach: miłości, mądrości, prawdy, sprawiedliwości i cnoty, którymi powinien kierować się człowiek, aby stanąć w pełni swojej mocy.   Załóż kolczyk Tiny Star, kiedy chcesz rozbudzić wewnętrzną siłę i poszukujesz ugruntowania oraz powodzenia w działaniu.','','kolczyk-kolko-z-gwiazda-do-ucha-lub-chrzastki-ucha-tiny-star','','','','Kolczyk kółko z gwiazdą do ucha lub chrząstki ucha Tiny Star','','','',''),
(340,1,1,'Symbol trójkąta skierowanego wierzchołkiem do góry to żywioł ognia-działania, odwagi, wiary inicjatywy, siły przebicia, erotyki, entuzjazmu, radości życia. To najsilniejszy ze wszystkich żywiołów. Zakładając go uzupełniasz braki żywiołu ognia w życiu, otwierasz się na przepływ wewnętrznej mocy i siłę działania. Symbolika pereł w wielu kulturach na całym świecie jest tak silna, że reprezentuje kogoś potężnego i odnoszącego sukcesy. To atrybut najwyższej mądrości, wartościowych relacji i poczucie bezpieczeństwa. Załóż kolczyk \"Pearl Trinity\" jeśli brakuje Ci żywiołu ognia w horoskopie, brak Ci energii i mocy w działaniu, potrzebujesz zaufać sobie i być mniej podatny na opinie innych i chcesz być autorytetem sama dla siebie.','','kolczyk-wiszacy-z-perlami-pearl-trinity','','','','Kolczyk wiszący z perłami Pearl Trinity','','','',''),
(341,1,1,'Koło symbolizuje harmonię, równowagę, doskonałość, nieskończoność oraz niezmienny cykl życia. W buddyzmie jest również symbolem najwyższego stopnia oświecenia.   Załóż kolczyk Harmony, jeśli rozwijasz się duchowo, chcesz poczuć spokój i harmonię oraz czujesz, że brak Ci wiary w realizację swoich marzeń i planu życia.','','kolczyk-wiszacy-kolo-harmony','','','','Kolczyk wiszący koło Harmony','','','',''),
(342,1,1,'Korona jako symbol monarchy symbolizuje odpowiedzialność, władzę, autorytet i obowiązek. Noszona tradycyjnie również przez bóstwa była znakiem niematerialnego triumfu ducha nad ciałem, sprawiedliwości i nieśmiertelności.   Załóż kolczyk The Crown, gdy rozwijasz się duchowo, potrzebujesz dostępu do dojrzałej mądrości, walczysz z trudnymi emocjami i chcesz zapanować nad swoimi lękami.','','kolczyk-korona-z-cyrkoniami-the-crown','','','','Kolczyk korona z cyrkoniami The Crown','','','',''),
(343,1,1,'Gwiazda ma niesamowicie bogatą symbolikę. Reprezentuje boską ideę, ideał, sukces, szczęście, nadzieję, światło, a także 4 żywioły i ducha.  Cyrkonia symbolizuje światło, do którego podąża Twoja dusza. Dotarcie do niego wymaga jednak transformacji i pokonania wielu wyzwań.   Załóż nausznice Stardust, gdy brak Ci wiary w siebie, potrzebujesz światła na swojej Drodze Życia oraz ochrony podczas życiowej podróży.','','nausznica-z-gwiazdami-i-cyrkoniami-stardust','','','','Nausznica z gwiazdami i cyrkoniami Stardust','','','',''),
(344,1,1,'Hamsa jest związana z wieloma tradycjami - islamem, judaizmem, hinduizmem i buddyzmem. W hinduizmie jest często używana jako synonim najwyższego ducha lub ostatecznej rzeczywistości, która nazywa się „Brahmanem”. W buddyzmie reprezentuje uniwersalnego ducha i wyzwolenie z cyklu odrodzenia. Do naszej kultury przeszła jako symbol odpierania zła i negatywnych energii.  Załóż kolczyk Hamsa dla ochrony swojego biopola.','','kolczyk-hamsa','','','','Kolczyk Hamsa','','','',''),
(345,1,1,'Od dawnych czasów Magowie i Alchemicy używali symboli serca do zaklęć związanych z miłością, związkami lub romansem. Symbol ten wykorzystywano również w rytuałach mających na celu wzmocnienie istniejących relacji. Obecnie, serce kojarzone jest w różnych kulturach z miłością, miłosierdziem, empatią i radością.  Załóż kolczyk Pure Heart, by  otworzyć się na bezwarunkową miłość oraz szczęśliwe relacje.   Dbaj o swój kolczyk! Pure Heart nie lubi być moczony i mieć kontaktu z chemią (farba, lakier do włosów','','kolczyk-wiszacy-z-sercem-pure-heart','','','','Kolczyk wiszący z sercem Pure Heart','','','',''),
(346,1,1,'Kwiat symbolizuje ulotności życia. Dzięki odpowiedniej trosce i opiece rozkwita swoim pięknem i zachwyca zapachem, by po kilku dniach przekwitnąć. Nasze życie ziemskie jest tak samo kruche i ulotne jak delikatne płatki kwiatów. W codziennym pędzie zdarza nam się o tym  zapomnieć, a nasze zdrowie i szczęście wziąć za pewnik. Dlatego powinniśmy przebyć je z wdzięcznością i uważnością, tak by nasze piękno mogło rozkwitać każdego dnia, nie zapominając o tym, że dar życia to wystarczający powód do bycia szczęśliwym.  Załóż kolczyk Crystal Flower by dostrzegać piękno obecnej chwili, cieszyć się tym co tu i teraz i być wdzięcznym za możliwość doświadczania.','','kolczyk-z-cyrkoniami-crystal-flower','','','','Kolczyk z cyrkoniami Crystal Flower','','','',''),
(347,1,1,'Księżyc w nowiu jest symbolem nowych początków, pozwala na zaangażowanie energii życiowej w nowe cele, manifestowanie marzeń oraz inicjowanie nowych planów. Księżyc symbolizuje kobiecą energię, intuicje i emocje. Gwiazda reprezentuje boską ideę, ideał, szczęście, sukces, nadzieje i światło, a także 4 żywioły i ducha.  Opal to energia słońca, pobudza kreatywność, a „taniec” jego ognia może pomóc ludziom cieszyć się życiem. To żywioł oczyszczający, wypala negatywne emocje i sprzyja otwieraniu nowego rozdziału.  Załóż kolczyk Moon&amp;Star jeżeli potrzebujesz światła na swojej Drodze Życia, energii i optymizmu lub jesteś na etapie rozpoczynania nowych przedsięwzięć i obierania celów.','','kolczyk-wiszacy-z-ksiezycem-i-gwiazda-z-opalem-moonstar','','','','Kolczyk wiszący z księżycem i gwiazdą z opalem Moon&Star','','','',''),
(348,1,1,'Gwiazda północna to symbol ochrony dla podróżujących, źródło światła i cel wędrówki. Jest drogowskazem na krętej drodze życia. Gwiazda ma niesamowicie bogatą symbolikę. Reprezentuje boską ideę, ideał, szczęście, sukces, nadzieję, światło, a także 4 żywioły i ducha.  Cyrkonia symbolizuje światło, do którego dąży Twoja dusza. Dotarcie do niego wymaga jednak pokonania wielu wyzwań i transformacji.  Załóż kolczyk Lodestar, gdy potrzebujesz światła na swojej Drodze Życia oraz ochrony podczas życiowej podróży.','','kolczyk-wiszacy-z-cyrkoniami-i-gwiazda-lodestar','','','','Kolczyk wiszący z cyrkoniami i gwiazdą Lodestar','','','',''),
(349,1,1,'Lakshmi to piękna hinduska bogini szczęścia, powodzenia oraz bogactwa, zarówno duchowego, jak i materialnego. Filozofia z nią związana nawiązuje do z poznaniem siebie i celu swojego życia. Sprzyja zrozumieniu wewnętrznego ja oraz poznaniu i zrozumieniu własnych potrzeb, co pozwala spojrzeć na dotychczasowe doświadczenia z innej perspektywy. Przynosi szczęście w podjętych działaniach i ułatwia doprowadzenie ich do pozytywnego zakończenia.   Załóż kolczyk Lakshmi, gdy czujesz się zagubiona i potrzebujesz światła na swojej drodze życia oraz chcesz osiągnąć sukces w podjętych przedsięwzięciach i działaniach.','','kolczyk-wiszacy-lakshmi','','','','Kolczyk wiszący Lakshmi','','','',''),
(350,1,1,'Wąż reprezentuje nieśmiertelność, reinkarnacje i czystość. Jest symbolem mającym niebywałe połączenie z pierwotną energią i siłą życiową. W większości kultur reprezentuje źródło życia. Jest pomocny, gdy brak Ci energii lub jesteś na etapie ważnych przejść i zmian, niezależnie od tego, czy zachodzą one na poziomie emocjonalnym, duchowym czy fizycznym.  Załóż kolczyk Mystic Cobra, gdy jesteś na etapie transformacji, chcesz zmienić swoje życie w jakimś obszarze lub potrzebujesz dodatkowych sił witalnych.','','kolczyk-z-wezem-mystic-cobra','','','','Kolczyk z wężem Mystic Cobra','','','',''),
(351,1,1,'Pióra są świętymi darami od niebios, atrybutem siły boskiej, znakiem, że nasze prośby i modlitwy zostały wysłuchane. To symbol uznania, że   Twoi Duchowi Przewodnicy troszczą się o Ciebie, zapewniając Ci bezpieczeństwo i wsparcie na każdej ścieżce, którą podążasz.  Załóż kolczyk Angel, aby wnieść do swojego życia światło oraz gdy, chcesz pozbyć się negatywnych myśli, które w Twoim życiu nie pozwalały Ci na rozwój i zadowolenie.   Dbaj o swój kolczyk! Angel nie lubi być moczony i mieć kontaktu z chemią (farba, lakier do włosów).','','kolczyk-z-piorami-angel','','','','Kolczyk z piórami Angel','','','',''),
(352,1,1,'Kolczyk Circle of Joy, sprzyja komunikacji, pewności siebie oraz czerpaniu większej radości z życia i beztroskiej pozytywnej energii. Sprawi, że łatwiej wyjdziesz poza strefę komfortu oraz podejmiesz kolejne wyzwania z optymizmem i ufnością.   Koło symbolizuje harmonię, równowagę, doskonałość, nieskończoność oraz duszę.   Załóż kolczyk Circle of Joy, jeśli chcesz poczuć harmonię i spokój w swoim życiu, oraz czujesz, że brak Ci wiary w siebie i realizację swoich pragnień','','kolczyk-wiszacy-z-kolorowymi-cyrkoniami-circle-of-joy','','','','Kolczyk wiszący z kolorowymi cyrkoniami Circle of Joy','','','',''),
(353,1,1,'Każdy z nas marzy by sięgnąć gwiazd, jednak często czujemy się zablokowani przez własne ograniczenia - brak pewności siebie, niewiara w odniesienie sukcesu, brak zaufania w swoją intuicję, błędne wzorce i przekonania, na które pracujemy całe życie.  Kolczyk Crystal Star pomoże Ci przetransformować cienie w światło. Gwiazda reprezentuje boską ideę, ideał, szczęście, sukces, nadzieję, światło, a także 4 żywioły i ducha.  Załóż kolczyk Crystal Star by wspomóc pewność siebie i odwagę oraz dodać żywioł ognia do Twoich działań. Uwierz, że nie ma dla Ciebie rzeczy nie możliwych!','','kolczyk-z-cyrkoniami-i-gwiazda-crystal-star','','','','Kolczyk z cyrkoniami i gwiazdą Crystal Star','','','',''),
(354,1,1,'Talizman sprzyja czerpaniu większej radości z życia, dziecięcej energii oraz łatwości komunikacji. Sprawi, że łatwiej wyjdziesz poza strefę komfortu oraz podejmiesz kolejne wyzwania z optymizmem i ufnością. Znów poczujesz pewność siebie i przypomnisz sobie o wewnętrznej mocy.  Gwiazda ma niesamowicie bogatą symbolikę. Reprezentuje boską ideę, ideał, szczęście, sukces, nadzieję, światło, a także 4 żywioły i ducha.  Załóż kolczyk Magic Colors, jeśli czujesz, że nie masz dość wiary w siebie i realizację swoich pragnień oraz potrzebujesz światła na swojej Drodze Życia.','','kolczyk-z-kolorowymi-cyrkoniami-magic-colors','','','','Kolczyk z kolorowymi cyrkoniami Magic Colors','','','',''),
(355,1,1,'Gwiazda ma niesamowicie bogatą symbolikę. Reprezentuje boską ideę, ideał, szczęście, sukces, nadzieję i światło. Pięcioramienna gwiazda nawiązuje do 4 żywiołów i ducha, wyraża bycie kompletnym i zbalansowanym. Można jej symbolikę również oprzeć na pięciu głównych zasadach: miłości, mądrości, prawdy, sprawiedliwości i cnoty, którymi powinien kierować się człowiek, aby stanąć w pełni swojej mocy.   Opal to żywioł oczyszczający, wypala negatywne emocje i sprzyja otwieraniu nowego rozdziału w życiu.  Załóż kolczyk \"Little Star\" kiedy chcesz odnaleźć wewnętrzną siłę i poszukujesz ugruntowania oraz powodzenia w działaniu.','','kolczyk-gwiazdka-z-opalami-little-star','','','','Kolczyk gwiazdka z opalami Little Star','','','',''),
(356,1,1,'Motyl jest powszechnie uważany za symbol transformacji, przemiany i odrodzenia. Każdy z etapów rozwoju motyla jest różny i zwiastuje duże zmiany, które mogę odnosić się do różnych sfer w życiu człowieka- psychicznej, duchowej, fizycznej. Gdy dołożymy starań, aby wzrastać i rozwijać się, jesteśmy w stanie jak motyl, przejść przez różne etapy życia by osiągnąć naszą najwyższą formę rozwoju i żyć w harmonii, spokoju, miłości i szczęściu. Motyl niesie ze sobą również lekkość, radość i oświecenie.   Załóż pierścionek Magic Butterfly, gdy jesteś na etapie transformacji, chcesz zmienić swoje życie w jakimś obszarze i potrzebujesz w tym celu dodatkowej inspiracji i siły oraz chcesz tchnąć trochę optymizmu w swoje działania.','','pierscionek-z-motylem-talizman-transformacji-i-inspiracji-magic-butterfly','','','','Pierścionek z motylem - Talizman transformacji i inspiracji Magic Butterfly','','','',''),
(357,1,1,'Pozwól zabłysnąć gwiazdom na Twoim palcu! Są jak światło, które rozświetla drogę życia i prowadzi za rękę podczas życiowych zakrętów. Gwiazda ma niesamowicie bogatą symbolikę. Reprezentuje boską ideę, ideał, szczęście, sukces, nadzieję, światło, a także 4 żywioły i ducha.  Cyrkonia zaś symbolizuje światło na drodze życia, do którego dąży Twoja dusza, a także nadzieję i pozytywne nastawienie.  Kolor lazurowy sprzyja relaksowi i wyciszeniu, wprowadza harmonię oraz spokój.   Pierścionek Silver Starlight to talizman, który doda światła na Twojej drodze oraz wesprze Cię w podejmowaniu dobrych decyzji, pomoże przyciągnąć szczęście oraz spokój i harmonię.','','pierscionek-srebrny-z-gwiazdami-i-rozowa-cyrkonia-talizman-szczescia-i-harmonii-silver-starlight','','','','Pierścionek srebrny z gwiazdami i różową cyrkonią - Talizman szczęścia i harmonii Silver Starlight','','','',''),
