(363,1,1,'Od wieków wierzono, że lustra przepowiadają przyszłość, są portalami między światem duchów a światem fizycznym, odzwierciedlają znacznie więcej niż obraz w odbiciu. Lustra służyły jako metafory o niezliczonych znaczeniach, jako symbole boskości i mocy, narzędzia zniekształceń i narzędzia autorefleksji. W duchowości lustro symbolizuje nasze duchowe odbicie.  Rodochrozyt to kamień szeroko pojętej miłości i uczuć. Szczególnie uwrażliwia na miłość własną i uleczenie ran emocjonalnych. Koi duszę i pomaga uzyskać wewnętrzny spokój.   Załóż pierścionek Self-care Mirror, aby znaleźć głębsze połączenie wyższym Ja, zwiększyć miłość własną, wyleczyć dawne rany oraz nawiązać kontakt ze swoją Duszą.','','pierscionek-z-rodochrozytem-talizman-milosci-wlasnej-self-care-mirror','','','','Pierścionek z rodochrozytem - Talizman miłości własnej Self Care Mirror','','','',''),
