(376,1,1,'Korona jako symbol monarchy symbolizuje odpowiedzialność, władzę, autorytet i obowiązek. Noszona tradycyjnie również przez bóstwa była znakiem niematerialnego triumfu ducha nad ciałem, sprawiedliwości i nieśmiertelności.   Załóż piercing The Crown, gdy rozwijasz się duchowo, potrzebujesz dostępu do dojrzałej mądrości, walczysz z trudnymi emocjami i chcesz zapanować nad swoimi lękami.','','piercing-korona-z-cyrkoniami-the-crown','','','','Piercing korona z cyrkoniami The Crown','','','',''),
(377,1,1,'Unikalne kadzidło wykonane ręcznie w Argentynie z Palo Santo, węgla i soli, sklejonych spoiwem pochodzenia roślinnego.  Palo Santo od dawna jest używane przez różne kultury podczas świętych ceremonii i jest znane ze swoich oczyszczających efektów. Dym Palo Santo służy do usuwania negatywnych energii z przestrzeni i aur oraz przynosi wewnętrzny spokój i dobre samopoczucie.  Sagrada Madre to innymi słowy  „Święta Matka”, nazwa firmy odzwierciedla sposób, w jaki podchodzą do zasobów Ziemi. Do zbiorów Palo Santo Sagrada Madre używa tylko starych gałęzi drzew, które naturalnie spadły z drzewa. Współpracują bezpośrednio ze społecznościami tubylczymi w Peru i Argentynie, aby sadzić drzewa Palo Santo i walczyć z wylesianiem. Ponadto Sagrada Madre dba o to, aby sadzić więcej drzew niż zużywają.','','kadzidla-naturalne-sagrada-madre-palo-santo','','','','Kadzidła naturalne Sagrada Madre - Palo Santo','','','',''),
(378,1,1,'Słońce reprezentuje ogień. To żywioł oczyszczający, który wypala negatywne emocje i sprzyja otwieraniu nowego rozdziału w życiu. To również symbol wszelkiego życia na Ziemi, źródło siły, jasności i dobrostanu.  Zielony turkus afrykański nazywany jest również kamieniem zwycięzców - przypisuje się mu nadzwyczaj szczęśliwe właściwości. Kolor zielony symbolizuje wzrost i obfitość finansową, a także uziemienie, by mądrze prosperować gromadzonym majątkiem.  Prosperity jest idealnym pierścionkiem dla osób, które rozpoczynają nowy biznes, chcą mądrze zainwestować, przyciągnąć do siebie dobre okazje, sprzyjających ludzi i otworzyć się na obfitość finansową.','','pierscionek-z-turkusem-afrykanskim-talizman-obfitosci-prosperity-ring','','','','Pierścionek z turkusem afrykańskim - Talizman obfitości Prosperity Ring','','','',''),
(379,1,1,'Ganesha to jedno z najbardziej znanych hinduskich bóstw. Jest Panem Szczęścia, który zapewnia radość, dobrobyt i sukces. Jest też Panem Początków, usuwa przeszkody, które pojawiają się na Twojej drodze, zarówno materialne, jak i duchowe. Jego atrybuty to mądrość i spryt. Cyrkonie zaś symbolizują światło na drodze życia, do którego dąży Twoja dusza, a także nadzieję i pozytywne nastawienie.  Załóż piercing Ganesha, gdy rozpoczynasz nowe przedsięwzięcie i potrzebujesz usunąć wszelkie przeszkody na swojej drodze oraz jeśli rozwijasz się duchowo i chcesz intuicyjnie podążać ścieżką swojego przeznaczenia.','','piercing-z-cyrkoniami-ganesha','','','','Piercing z cyrkoniami Ganesha','','','',''),
(380,1,1,'Sagrada Madre siedem kadzideł w formie dymiących bomb, po jednej do oczyszczania i regeneracji każdej czakry:  Czakra Korzenia – Instynkt – Storax/Kamfora Czakra Sakralna – Seksualność – Pomarańcza/Rozmaryn Czakra Splotu Słonecznego – Moc – Yagra/Cynamon Czakra Serca – Miłość – Lawenda/Olibanum Czakra Gardła – Komunikacja – Mirra/Olibanum Czakra Trzeciego Oka – Intuicja – Benzoes/Olibanum Czakra Korony – Transcendencja – Róża/Olibanum Kadzidła są wytwarzane ręcznie w Argentynie z naturalnych ziół i żywic, olejków eterycznych i drewna sosnowego. Sklejone spoiwem roślinnym. Każde opakowanie zawiera 7 bomb.  Kadzidło wystarczy dłuższą chwilę podpalać płomieniem, aż zacznie się tlić i położyć na żaroodpornej podstawce lub umieścić je na rozgrzanym węgielku trybularzowym, bez wcześniejszego podpalania.   Sagrada Madre to innymi słowy  „Święta Matka”, nazwa firmy odzwierciedla sposób, w jaki podchodzą do zasobów Ziemi. Do zbiorów Palo Santo Sagrada Madre używa tylko starych gałęzi drzew, które naturalnie spadły z drzewa. Współpracują bezpośrednio ze społecznościami tubylczymi w Peru i Argentynie, aby sadzić drzewa Palo Santo i walczyć z wylesianiem. Ponadto Sagrada Madre dba o to, aby sadzić więcej drzew niż zużywają.','','kadzidla-naturalne-sagrada-madre-7-chakra-smudge-bombs','','','','Kadzidła naturalne Sagrada Madre -  7 Chakra Smudge Bombs','','','',''),
(381,1,1,'Nów oznacza nowe początki. To czas zaangażowania energii życiowej w nowe cele, manifestację marzeń i inicjowania nowych planów. Księżyc symbolizuje też kobiecą energię, intuicję i emocje. Gwiazda ma niesamowicie bogatą symbolikę. Reprezentuje boską ideę, ideał, szczęście, sukces, nadzieję, światło, a także 4 żywioły i ducha.  Załóż piercing Starry Moon, gdy potrzebujesz światła na swojej Drodze Życia, chcesz tchnąć powodzenie w swoje przedsięwzięcia oraz potrzebna Ci motywacja do działania.  Dbaj o swój Piercing! Starry Moon nie powinien być moczony ani pryskany chemią, np. lakierem do włosów.','','piercing-polksiezyc-z-cyrkoniami-do-chrzastki-ucha-starry-moon','','','','Piercing półksiężyc z cyrkoniami do chrząstki ucha Starry Moon','','','',''),
