(383,1,1,'Unikalne kadzidło wykonane ręcznie w Argentynie z Palo Santo, olejku eterycznego z jaśminu, węgla i soli, sklejonych spoiwem pochodzenia roślinnego.  Palo Santo od dawna jest używane przez różne kultury podczas świętych ceremonii i jest znane ze swoich oczyszczających efektów. Dym Palo Santo służy do usuwania negatywnych energii z przestrzeni i aur oraz przynosi wewnętrzny spokój i dobre samopoczucie.  Jaśmin słynie ze swoich właściwości uspokajających i relaksujących. Jest pomocny w przypadku problemów ze snem oraz nadmiernej nerwowości.   Sagrada Madre to innymi słowy  „Święta Matka”, nazwa firmy odzwierciedla sposób, w jaki podchodzą do zasobów Ziemi. Do zbiorów Palo Santo Sagrada Madre używa tylko starych gałęzi drzew, które naturalnie spadły z drzewa. Współpracują bezpośrednio ze społecznościami tubylczymi w Peru i Argentynie, aby sadzić drzewa Palo Santo i walczyć z wylesianiem. Ponadto Sagrada Madre dba o to, aby sadzić więcej drzew niż zużywają','','kadzidla-naturalne-sagrada-madre-palo-santo-z-jasminem','','','','Kadzidła naturalne Sagrada Madre - Palo Santo z Jaśminem','','','',''),
