(385,1,1,'Kadzidła Sagrada Madre wytwarzane są ręcznie w Argentynie. Zostały wykonane z liści eukaliptusa, liści laurowych, drewna cedrowego i węgla, sklejonych spoiwem pochodzenia roślinnego.  Aromat eukaliptusa otwiera drogi oddechowe. Wawrzyn (liść laurowy) jest znany ze swoich właściwości odkażających, a drzewo cedrowe wnosi do tego uziemiającego i równoważącego kadzidła ciepłe ziemiste nuty. Sagrada Madre to innymi słowy  „Święta Matka”, nazwa firmy odzwierciedla sposób, w jaki podchodzą do zasobów Ziemi. Do zbiorów Palo Santo Sagrada Madre używa tylko starych gałęzi drzew, które naturalnie spadły z drzewa. Współpracują bezpośrednio ze społecznościami tubylczymi w Peru i Argentynie, aby sadzić drzewa Palo Santo i walczyć z wylesianiem. Ponadto Sagrada Madre dba o to, aby sadzić więcej drzew niż zużywają.','','kadzidla-naturalne-sagrada-madre-z-eukaliptusem-lisciem-laurowym-i-cedrem','','','','Kadzidła naturalne Sagrada Madre z eukaliptusem, liściem laurowym i cedrem.','','','',''),
(386,1,1,'Unikalne kadzidło wykonane ręcznie w Argentynie z olejków eterycznych z magnolii, węgla i soli, sklejonych spoiwem pochodzenia roślinnego.     Magnolie uważa się za jedne z najstarszych roślin kwitnących. Ich zapach ma właściwości uspokajające oraz relaksujące, wyzwala uczucie przyjemności i sprzyja jasności umysłu.   Sagrada Madre to innymi słowy  „Święta Matka”, nazwa firmy odzwierciedla sposób, w jaki podchodzą do zasobów Ziemi. Do zbiorów Palo Santo Sagrada Madre używa tylko starych gałęzi drzew, które naturalnie spadły z drzewa. Współpracują bezpośrednio ze społecznościami tubylczymi w Peru i Argentynie, aby sadzić drzewa Palo Santo i walczyć z wylesianiem. Ponadto Sagrada Madre dba o to, aby sadzić więcej drzew niż zużywają','','kadzidla-naturalne-sagrada-madre-botanico-magnolie','','','','Kadzidła naturalne Sagrada Madre Botanico - Magnolie','','','',''),
(387,1,1,'Unikalne kadzidło wykonane ręcznie w Argentynie z Palo Santo, kwiatów i olejku z lawendy, węgla i soli, sklejonych spoiwem pochodzenia roślinnego.  Palo Santo od dawna jest używane przez różne kultury podczas świętych ceremonii i jest znane ze swoich oczyszczających efektów. Dym Palo Santo służy do usuwania negatywnych energii z przestrzeni i aur oraz przynosi wewnętrzny spokój i dobre samopoczucie.  Lawenda. Oczyszcza przestrzeń i pomaga odzyskać spokój. Zapewnia harmonię oraz zgodę w relacjach. Kadzidła z jej dodatkiem przynoszą radość i ukojenie.   Sagrada Madre to innymi słowy  „Święta Matka”, nazwa firmy odzwierciedla sposób, w jaki podchodzą do zasobów Ziemi. Do zbiorów Palo Santo Sagrada Madre używa tylko starych gałęzi drzew, które naturalnie spadły z drzewa. Współpracują bezpośrednio ze społecznościami tubylczymi w Peru i Argentynie, aby sadzić drzewa Palo Santo i walczyć z wylesianiem. Ponadto Sagrada Madre dba o to, aby sadzić więcej drzew niż zużywają.','','kadzidla-naturalne-sagrada-madre-palo-sano-lawenda','','','','Kadzidła naturalne Sagrada Madre Palo Sano - Lawenda','','','',''),
(388,1,1,'Kadzidło zostało wytworzone wyłącznie z naturalnych składników. W jego skład wchodzi suszona ruta, suszone liście rozmarynu, naturalna żywica kadzidłowca, węgiel oraz sól, sklejone spoiwem roślinnym.  Połączenie ruty, rozmarynu oraz kadzidłowca oczyszcza i chroni otoczenie, a także sprzyja wprowadzaniu spokoju i harmonii w Twoim domowym sanktuarium.   Sagrada Madre to innymi słowy  „Święta Matka”, nazwa firmy odzwierciedla sposób, w jaki podchodzą do zasobów Ziemi. Do zbiorów Palo Santo Sagrada Madre używa tylko starych gałęzi drzew, które naturalnie spadły z drzewa. Współpracują bezpośrednio ze społecznościami tubylczymi w Peru i Argentynie, aby sadzić drzewa Palo Santo i walczyć z wylesianiem. Ponadto Sagrada Madre dba o to, aby sadzić więcej drzew niż zużywają.','','kadzidla-naturalne-sagrada-madre-z-ruta-rozmarynem-i-kadzidlowcem','','','','Kadzidła naturalne Sagrada Madre z rutą, rozmarynem i kadzidłowcem.','','','',''),
(389,1,1,'Kadzidła Sagrada Madre wytwarzane są ręcznie w Argentynie. Zostały wykonane z kwiatów nagietka, kwiatów rumianku, olibanum, olejku eterycznego z rumianku i nagietka oraz węgla, sklejonych spoiwem roślinnym. Rumianek znany jest ze swoich właściwości uspokajających, które przynoszą spokój i ciszę. Nagietek aktywuje kreatywność i pasję. Olibanum ma właściwości oczyszczające oraz uspokajające, które aktywizują odnowę ducha oraz ciała.   Sagrada Madre to innymi słowy  „Święta Matka”, nazwa firmy odzwierciedla sposób, w jaki podchodzą do zasobów Ziemi. Do zbiorów Palo Santo Sagrada Madre używa tylko starych gałęzi drzew, które naturalnie spadły z drzewa. Współpracują bezpośrednio ze społecznościami tubylczymi w Peru i Argentynie, aby sadzić drzewa Palo Santo i walczyć z wylesianiem. Ponadto Sagrada Madre dba o to, aby sadzić więcej drzew niż zużywają.','','kadzidla-naturalne-sagrada-madre-z-rumiankiem-nagietkiem-i-olibanum','','','','Kadzidła naturalne Sagrada Madre z rumiankiem, nagietkiem i olibanum.','','','',''),
(390,1,1,'W kadzidle \"Sukces\" znajdziesz polskie rodzime zioła, rośliny rosnące w naszym środowisku, w naszej strefie klimatycznej od stuleci. Z ich mocy czerpali nasi przodkowie. Mają zatem znacznie lepsze oddziaływanie zarówno we wszystkich rytuałach, magicznych, duchowych, czy zdrowotnych.  Każde kadzidło przygotowywane jest przez naszą zielarkę Olę – od momentu zerwania ziół po zawiązanie na nich moonsisterowej nitki.','','kadzidlo-naturalne-sukces','','','','Kadzidło naturalne Sukces','','','',''),
(391,1,1,'W kadzidle \"Miłość\" znajdziesz polskie rodzime zioła, rośliny rosnące w naszym środowisku, w naszej strefie klimatycznej od stuleci. Z ich mocy czerpali nasi przodkowie.  Mają zatem znacznie lepsze oddziaływanie zarówno we wszystkich rytuałach, magicznych, duchowych, czy zdrowotnych. Każde kadzidło przygotowywane jest przez naszą zielarkę Olę – od momentu zerwania ziół po zawiązanie na nich moonsisterowej nitki.','','kadzidlo-naturalne-milosc','','','','Kadzidło naturalne Miłość','','','',''),
(392,1,1,'W kadzidle \"Dobrostan i Pomyślność\" znajdziesz polskie rodzime zioła, rośliny rosnące w naszym środowisku, w naszej strefie klimatycznej od stuleci. Z ich mocy czerpali nasi przodkowie. Mają zatem znacznie lepsze oddziaływanie zarówno we wszystkich rytuałach, magicznych, duchowych, czy zdrowotnych.  Każde kadzidło przygotowywane jest przez naszą zielarkę Olę – od momentu zerwania ziół po zawiązanie na nich moonsisterowej nitki.','','kadzidlo-naturalne-dobrostan-i-pomyslnosc','','','','Kadzidło naturalne Dobrostan I Pomyślność','','','',''),
(393,1,1,'W kadzidle \"Zdrowie\" znajdziesz polskie rodzime zioła, rośliny rosnące w naszym środowisku, w naszej strefie klimatycznej od stuleci. Z ich mocy czerpali nasi przodkowie. Mają zatem znacznie lepsze oddziaływanie zarówno we wszystkich rytuałach, magicznych, duchowych, czy zdrowotnych.  Każde kadzidło przygotowywane jest przez naszą zielarkę Olę – od momentu zerwania ziół po zawiązanie na nich moonsisterowej nitki','','kadzidlo-naturalne-zdrowie','','','','Kadzidło naturalne Zdrowie','','','',''),
(394,1,1,'Smocze drzewo palmowe rośnie na bagnach Azji, Afryki i Australii. Żywica tego drzewa ma wyjątkowe właściwości lecznicze (m.in. zabija patogeny) i krwistoczerwony kolor, czemu zawdzięcza swoją nazwę.  Jej stosunkowo mocny, ziemisty, lekko słodkawy zapach przywodzi na myśl mieszankę wanilii i przypraw korzennych. Ma właściwości ochronne, dodaje mocy zaklęciom, doskonale sprawdza się podczas medytacji i oczyszczania przestrzeni ze złych energii.  Wierzy się, że smoczą krew wzmacnia miłość i pobudza potencję.  Sposób użycia: Podpal koniec pęczka i zgaś po chwili ogień mocnym dmuchnięciem. Pozostaw pęczek na odpornej na nagrzewanie podstawce. Nigdy nie pozostawiaj zapalonego kadzidła bez nadzoru. Nie używaj w małych, zamkniętych pomieszczeniach, a gdy masz astmę lub cierpisz na choroby płuc nie stosuj bez zgody swojego lekarza. Po skończonym rytuale zgaś pęczek i użyj go ponownie w razie potrzeby.','','kadzidlo-smocza-krew-dragon-s-blood','','','','Kadzidło Smocza Krew - Dragon\'s Blood','','','',''),
(395,1,1,'Liście Yerba Santa są uważane za święte w kulturach rdzennych Amerykanów i Hiszpanii. To „święte zioło” wydziela przyjemny i podnoszący wibracje zapach. W tradycyjnej praktyce kadzenia używa się ich w celu ochrony, oczyszczenia, uzdrowienia człowieka lub przestrzeni, podniesienia siły duchowej, odwagi, zdolności psychicznych i odnalezienia najgłębszego ja. Yerba Santa jest też używana do miłości, wzrostu, wzmocnienia i piękna oraz uwolnienia emocjonalnego bólu przechowywanego w czakrze serca. Roślina ta używana jest w leczeniu schorzeń górnych dróg oddechowych w celu rozrzedzenia śluzu.','','kadzidlo-yerba-santa','','','','Kadzidło Yerba Santa','','','',''),
(396,1,1,'Czasami mamy wrażenie, że nasz dom spowija gęsta mgła, kąty są bardziej cieniste, a w pomieszczeniach panuje ciężka atmosfera. Domownicy gorzej się czują, źle śpią, kłócą się i nie mają energii.W takiej sytuacji warto oczyścić przestrzeń szałwią. Salvia apiana od wieków używana jest przez rdzennych amerykanów przy rytuałach uzdrawiania i oczyszczania osób, rzeczy oraz pomieszczeń z negatywnej energii. Uważa się, że ma silne magiczne właściwości, doskonale sprawdza się przy medytacjach i jako naturalne kadzidło oraz podwyższa wibracje użytkownika.  Sposób użycia: Zapal koniec wiązki szałwi zapałką. Zdmuchnij płomień.  Końcówki liści powinny powoli się tlić, uwalniając gęsty dym. Nie dmuchaj w kadzidło, by je rozpalić - w ten sposób pozbywasz się swojej energii.  Oczyszczanie domu:  Oczyszczanie najlepiej robić w każdą pełnię księżyca. Sprzątnij i odkurz dom. Okadź każde pomieszczenie przeciwnie do ruchu wskazówek zegara. Zacznij od najniższego piętra, skończ na najwyższym. Szczególnie skup się na kątach - gdzie zbiera się najwięcej cienia. Gdy skończysz, otwórz okna. Zapal nasze Palo Santo, ulubione Kadzidło stożkowe lub białą świecę od Moonsister w celu zaproszenia dobrych energii do środka.  Jak oczyścić przedmiot?  Jesteś w posiadaniu przedmiotu, który jest bardzo stary? Dostałeś coś od osoby, której intencje nie koniecznie są czyste? Jeśli masz wrażenie, że obecność jakiegoś przedmiotu Ci nie służy, wystarczy że skąpiesz go w dymie z szałwii z intencją oczyszczenia ze złych energii.  Jak oczyścić osobę/aurę?  Oczyszczanie najlepiej robić każdorazowo w pełnię księżyca. Weź długą kąpiel z peelingiem z intencją oczyszczenia. Pełen opis rytuału na pełnię znajdziesz na naszym Instagramie. Ciało okadzamy ruchem okrężnym w przeciwnym kierunku niż ruch wskazówek zegara, zatrzymując się przy każdej czakrze i robiąc 7 obrotów. Robimy to od dołu w kierunku głowy, nie zapominając o bokach i tyle ciała.','','szalwia-biala','','','','Szałwia biała','','','',''),
(397,1,1,'Dym wydzielany z kadzideł naturalnych był od wieków używany podczas rytuałów, obrzędów oraz w celu usuwania negatywnych energii. W skład zapachu Meditation wchodzi trawa cytrynowa. Kadziło to jest wskazane do stosowania podczas medytacji, pozwala pogłębić stan medytacyjny oraz jego utrzymanie.   Kadzidło należy palić wysypując kilka kawałków ziela na podpalony węgielek trybularzowy w naczyniu żaroodpornym.','','kadzidlo-zielne-meditation','','','','Kadzidło zielne Meditation','','','',''),
