ze i robiąc 7 obrotów. Robimy to od dołu w kierunku głowy, nie zapominając o bokach i tyle ciała.','','szalwia-biala-z-lawenda-i-ametystem-oczyszczenie-i-uzdrowienie','','','','Szałwia biała z lawendą i ametystem - Oczyszczenie i Uzdrowienie','','','',''),
