czakrze i robiąc 7 obrotów. Robimy to od dołu w kierunku głowy, nie zapominając o bokach i tyle ciała.','','szalwia-biala-z-platami-kwiatow-dobra-atmosfera','','','','Szałwia biała z płatami kwiatów Dobra Atmosfera','','','',''),
