ąc się przy każdej czakrze i robiąc 7 obrotów. Robimy to od dołu w kierunku głowy, nie zapominając o bokach i tyle ciała.','','szalwia-biala-z-roza-i-kwarcem-rozowym-milosc-i-balans','','','','Szałwia biała z różą i kwarcem różowym - Miłość i Balans','','','',''),
(401,1,1,'Kadzidła zostały wykonane w Nepalu z ziół i innych składników aromatycznych zbieranych w Himalajach. Używane są często w świątyniach oraz buddyjskich stupach. Produkt został wykonany ręcznie. Proces wytwarzania kadzidełek sznurkowych polega na odpowiednim zawinięciu i skręceniu aromatycznej mieszanki w papierze ryżowym.  Sandałowiec wyróżnia się bogatym zapachem, zawiera słodkie i drzewne nuty. Ma właściwości uspokajające i relaksujące.   Ilość: ok. 50 szt   Czas palenia: 15-20 min   Kadzidełko powinno być palone na przeznaczonej do tego podstawce. Kadzidła mogą wytwarzać sporą ilość dymu.','','kadzidla-sznurkowe-o-zapachu-sandalowca-i-przypraw','','','','Kadzidła sznurkowe o zapachu Sandałowca i przypraw','','','',''),
