(404,1,1,'Indyjska tradycja ręcznego wyrabiania kadzideł sięga tysięcy lat. Otrzymuje się je poprzez mieszanie suszonych kwiatów, ziół, i przypraw i łącznie w całość dzięki aromatycznym żywicom z tropikalnych drzew. Podczas palenia stożkowych kadzideł wydziela się głęboki aromat, nieco cięższy od klasycznych kadzidełek w pałeczkach.   Należy zachować ostrożność podczas palenia i nigdy nie pozostawiać zapalonego kadzidła bez nadzoru.','','kadzidla-stozkowe-o-zapachu-zielonej-herbaty-powodzenie','','','','Kadzidła stożkowe o zapachu zielonej herbaty \"Powodzenie\"','','','',''),
(405,1,1,'Kadzidła zostały wykonane w Nepalu z ziół i innych składników aromatycznych zbieranych w Himalajach. Używane są często w świątyniach oraz buddyjskich stupach. Produkt został wykonany ręcznie. Proces wytwarzania kadzidełek sznurkowych polega na odpowiednim zawinięciu i skręceniu aromatycznej mieszanki w papierze ryżowym.  Cedr charakteryzuje się drzewnym, żywicznym zapachem. Jest ceniony w aromaterapii, jego woń odświeża i relaksuje.   Ilość: ok. 50 szt   Czas palenia: 15-20 min   Kadzidełko powinno być palone na przeznaczonej do tego podstawce. Kadzidła mogą wytwarzać sporą ilość dymu.','','kadzidla-sznurkowe-o-zapachu-cedru','','','','Kadzidła sznurkowe o zapachu Cedru','','','',''),
(406,1,1,'Indyjska tradycja ręcznego wyrabiania kadzideł sięga tysięcy lat. Otrzymuje się je poprzez mieszanie suszonych kwiatów, ziół, i przypraw i łącznie w całość dzięki aromatycznym żywicom z tropikalnych drzew. Podczas palenia stożkowych kadzideł wydziela się głęboki aromat, nieco cięższy od klasycznych kadzidełek w pałeczkach.   Należy zachować ostrożność podczas palenia i nigdy nie pozostawiać zapalonego kadzidła bez nadzoru.','','kadzidla-stozkowe-o-zapachu-rozy-milosc','','','','Kadzidła stożkowe o zapachu róży \"Miłość\"','','','',''),
