(411,1,1,'Pięknie zapakowane luksusowe kadzidła stożkowe w 7 wariantach, dedykowane do pracy z czakrami. Duże opakowanie pozwoli przez miesiąc pracować z wybranym ośrodkiem energetycznym. Kadzidła mają za zadanie unormować przepływ energii w danej czakrze.   Sprawdź czy Twoje czakry są zablokowane, hiperaktywne czy zbalansowane.     Kolor czerwony  - c zakra korzenia   Kolor pomarańczowy  - c zakra sakralna    Kolor żółty  - c zakra splotu słonecznego    Kolor turkusowy  - c zakra serca    Kolor błękitny  - c zakra gardła    Kolor fioletowy  - c zakra trzeciego oka    Kolor różowy  - c zakra korony','','kadzidla-stozkowe-na-czakry-duze','','','','Kadzidła stożkowe na czakry - duże','','','',''),
(412,1,1,'Pięknie zapakowane luksusowe kadzidła patyczkowe w 7 wariantach, dedykowane do pracy z czakrami. Duże opakowanie pozwoli przez miesiąc pracować z wybranym ośrodkiem energetycznym. Kadzidła mają za zadanie unormować przepływ energii w danej czakrze.     Kolor czerwony  - c zakra korzenia   Kolor pomarańczowy   - c zakra sakralna    Kolor żółty   - c zakra splotu słonecznego    Kolor turkusowy   - c zakra serca    Kolor błękitny   - c zakra gardła    Kolor fioletowy   - c zakra trzeciego oka    Kolor różowy   - c zakra korony','','kadzidla-patyczkowe-na-czakry-duze','','','','Kadzidła patyczkowe na czakry - duże','','','',''),
(413,1,1,'Kadzidełka SATYA SAI BABA to najpopularniejsze kadzidła na świecie. Wytwarzane są ręcznie z mieszanki ziół, żywic, kwiatów i olejków. Zapach „Nag Champa” jest słodki, ziemisty, kwiatowy i korzenny jednocześnie. Kadzidło to zabierze Cię do hinduskich i buddyjskich świątyń Indii i Nepalu. Zawiera ono aromaty drzewa sandałowego, a także kwiatu drzewa champak, należącego do rodziny magnolii. Orientalny zapach kadzidła pomoże Ci wejść w stan medytacji, odpręży i oczyści atmosferę w Twoim Domowym Sanktuarium.  Kobiety w ciąży, astmatycy oraz dzieci poniżej 12 roku życia powinny skonsultować się z lekarzem przed użyciem kadzidełka..','','kadzidelko-nag-champa','','','','Kadzidełko \"Nag Champa\"','','','',''),
(414,1,1,'Ziołowe kadzidełka Song of India, są wytwarzane zgodnie ze starożytną tradycyjną indyjską, w której palenie kadzideł jest praktykowane ze względu na jego terapeutyczne i uspokajające korzyści. Według Ajurwedy aromaterapia kadzidłami wytworzonymi z ziół, żywic, przypraw oraz olejków eterycznych jest skutecznym sposobem na oczyszczenie powietrza i wypełniania go pięknym zapachem, oczarowującym nasze zmysły.   Kadzidełko wypełni Twoje Domowe Sanktuarium pięknym kwiatowym zapachem, który sprzyja harmonii.','','kadzidelka-ziolowe-o-zapachu-rozy-i-kwiatow-z-podstawka-harmony','','','','Kadzidełka ziołowe o zapachu róży i kwiatów, z podstawką \"Harmony\"','','','',''),
