(416,1,1,'Ziołowe kadzidełka Song of India, są wytwarzane zgodnie ze starożytną tradycyjną indyjską, w której palenie kadzideł jest praktykowane ze względu na jego terapeutyczne i uspokajające korzyści. Według Ajurwedy aromaterapia kadzidłami wytworzonymi z ziół, żywic, przypraw oraz olejków eterycznych jest skutecznym sposobem na oczyszczenie powietrza i wypełniania go pięknym zapachem, oczarowującym nasze zmysły.   Orientalny zapach kadzidła pomoże Ci się zrelaksować oraz oczyści atmosferę w Twoim Domowym Sanktuarium.','','kadzidelka-ziolowe-o-zapachu-olibanum-z-nuta-drzewa-z-podstawka-health','','','','Kadzidełka ziołowe o zapachu olibanum z nutą drzewa, z podstawką \"Health\"','','','',''),
