(418,1,1,'Ziołowe kadzidełka Song of India, są wytwarzane zgodnie ze starożytną tradycyjną indyjską, w której palenie kadzideł jest praktykowane ze względu na jego terapeutyczne i uspokajające korzyści. Według Ajurwedy aromaterapia kadzidłami wytworzonymi z ziół, żywic, przypraw oraz olejków eterycznych jest skutecznym sposobem na oczyszczenie powietrza i wypełniania go pięknym zapachem, oczarowującym nasze zmysły.   Orientalny zapach kadzidła  przeniesie Cię w klimat pachnących Indii w zaciszu Twojego domowego Sanktuarium.','','kadzidelka-ziolowe-o-zapachu-drzewa-sandalowego-z-nuta-drewna-z-podstawka-happiness','','','','Kadzidełka ziołowe o zapachu drzewa sandałowego z nutą drewna, z podstawką \"Happiness\"','','','',''),
(419,1,1,'Kadzidełka SATYA SAI BABA to najpopularniejsze indyjskie kadzidła na świecie. Wytwarzane są ręcznie z naturalnych składników takich jak mieszanki ziół, żywic, kwiatów i olejków.   Wybierz swój ulubiony zapach:   Wanilia  Róża  Jaśmin  Rozmaryn  Piżmo   Tropikalna trawa cytrynowa  Aarruda (zapach kwiatowy)  Ciemny cynamon  Olibanum (Frankincense)  Indyjski las tropikalny   Mirra  Paczuli      Kobiety w ciąży, astmatycy oraz dzieci poniżej 12 roku życia powinny skonsultować się z lekarzem przed użyciem kadzidełka.  Opakowanie zawiera 15g kadzidełek.','','kadzidelka-satya-sai-baba','','','','Kadzidełka SATYA SAI BABA','','','',''),
(420,1,1,'Ziołowe kadzidełka Song of India, są wytwarzane zgodnie ze starożytną tradycyjną indyjską, w której palenie kadzideł jest praktykowane ze względu na jego terapeutyczne i uspokajające korzyści. Według Ajurwedy aromaterapia kadzidłami wytworzonymi z ziół, żywic, przypraw oraz olejków eterycznych jest skutecznym sposobem na oczyszczenie powietrza i wypełniania go pięknym zapachem, oczarowującym nasze zmysły.   Orientalny zapach kadzidła pomoże Ci się odprężyć oraz ociepli atmosferę w Twoim Domowym Sanktuarium.','','kadzidelka-ziolowe-o-fantazyjnym-zapachu-fougere-z-podstawka-sensuality','','','','Kadzidełka ziołowe o fantazyjnym zapachu fougere, z podstawką \"Sensuality\"','','','',''),
(421,1,1,'Ziołowe kadzidełka Song of India, są wytwarzane zgodnie ze starożytną tradycyjną indyjską, w której palenie kadzideł jest praktykowane ze względu na jego terapeutyczne i uspokajające korzyści. Według Ajurwedy aromaterapia kadzidłami wytworzonymi z ziół, żywic, przypraw oraz olejków eterycznych jest skutecznym sposobem na oczyszczenie powietrza i wypełniania go pięknym zapachem, oczarowującym nasze zmysły.   Orientalny zapach kadzidła wspomoże Cię energetycznie i wypełni Twoje Domowe sanktuarium orzeźwiającym zapachem.','','kadzidelka-ziolowe-o-zapachu-cytrusow-z-wytrawna-nuta-drewna-z-podstawka-energy','','','','Kadzidełka ziołowe o zapachu cytrusów z wytrawną nutą drewna, z podstawką \"Energy\"','','','',''),
(422,1,1,'Kadzidełka patyczkowe Goloka wytwarzane są ręcznie z mieszanki ziół, żywic, kwiatów i olejków. Olejek z Patchouli pozyskuje się ze świeżych lub suszonych liści. Jego zapach jest bogaty, słodki i dość intensywny, zawiera ziołowe i korzenne nuty.      Kobiety w ciąży, astmatycy oraz dzieci poniżej 12 roku życia powinny skonsultować się z lekarzem przed użyciem kadzidełka.','','kadzidelka-patyczkowe-goloka-patchouli','','','','Kadzidełka patyczkowe Goloka Patchouli','','','',''),
(423,1,1,'Kadzidełka patyczkowe Goloka wytwarzane są ręcznie z mieszanki ziół, żywic, kwiatów i olejków. Kadzidełka Goodearth mają piękny, dość słodki zapach, zawierający w sobie nuty wanilii, jaśminu i drzewa sandałowego. Idealne do użycia podczas medytacji lub relaksu.      Kobiety w ciąży, astmatycy oraz dzieci poniżej 12 roku życia powinny skonsultować się z lekarzem przed użyciem kadzidełka.','','kadzidelka-patyczkowe-goloka-goodearth','','','','Kadzidełka patyczkowe Goloka Goodearth','','','',''),
(424,1,1,'Kadzidełka patyczkowe Goloka wytwarzane są ręcznie z mieszanki ziół, żywic, kwiatów i olejków. Zapach lotosu, charakteryzuje się dość delikatną i słodkawą wonią o działaniu relaksującym i odprężającym.      Kobiety w ciąży, astmatycy oraz dzieci poniżej 12 roku życia powinny skonsultować się z lekarzem przed użyciem kadzidełka.','','kadzidelka-patyczkowe-goloka-lotus','','','','Kadzidełka patyczkowe Goloka Lotus','','','',''),
(425,1,1,'Naturalne i ręcznie wykonane, kadzidełka patyczkowe w 7 wariantach zapachowych, dedykowane do pracy z czakrami. Każde z opakowań, powoli Ci pracować z wybranym ośrodkiem energetycznym przy jodze lub medytacji. Kadzidełka mają za zadanie unormować przepływ energii w danej czakrze. Na opakowaniu znajdziesz również mantrę odpowiadającą danej czakrze oraz dobraną do niej pozycję jogi.    Kolor czerwony  - c zakra korzenia - drzewo sandałowe, cedr, goździki, róża   Kolor pomarańczowy   - c zakra sakralna - pomarańcz, ylang-ylang, jaśmin, neroli    Kolor żółty   - c zakra splotu słonecznego - cytrusy, pieprz, rozmaryn, geranium    Kolor zielony   - c zakra serca - róża, bergamotka, lawenda, cyprys    Kolor niebieski   - c zakra gardła - mięta, bergamotka, bazylia, geranium    Kolor granatowy   - c zakra trzeciego oka - jaśmin, szałwia, paczula, lawenda    Kolor fioletowy   - c zakra korony - angelica, paczula, lotos, szałwia, olibanum','','kadzidelka-patyczkowe-do-medytacji-z-czakrami','','','','Kadzidełka patyczkowe do medytacji z czakrami','','','',''),
(426,1,1,'Kadzidełka patyczkowe Goloka wytwarzane są ręcznie z mieszanki ziół, żywic, kwiatów i olejków. Podstawą zapachu Divine są żywice, ale także rzadkie zioła, kwiaty, a nawet miód. Aromat ten stwarza atmosferę spokoju i relaksacji, a także pomaga w koncentracji. Jest to popularne kadzidło do medytacji i kontemplacji.  Ilość: 12-15 szt  Czas palenia: ok. 30-40min   Kobiety w ciąży, astmatycy oraz dzieci poniżej 12 roku życia powinny skonsultować się z lekarzem przed użyciem kadzidełka.','','kadzidelka-patyczkowe-goloka-devine','','','','Kadzidełka patyczkowe Goloka Devine','','','',''),
(427,1,1,'Kadzidełka patyczkowe Goloka wytwarzane są ręcznie z mieszanki ziół, żywic, kwiatów i olejków.  Chandan masala są przygotowywane przy użyciu olejku sandałowego i specjalnego proszku sandałowego, zapewniają relaksujący i łagodny zapach sandałów.     Kobiety w ciąży, astmatycy oraz dzieci poniżej 12 roku życia powinny skonsultować się z lekarzem przed użyciem kadzidełka.','','kadzidelka-patyczkowe-goloka-chandan','','','','Kadzidełka patyczkowe Goloka Chandan','','','',''),
(428,1,1,'Kadzidełka patyczkowe wytwarzane są ręcznie z mieszanki ziół, żywic, kwiatów i olejków. Zapach z serii „Relaxing” skomponowany jest w taki sposób, by łagodnie wprowadzić Cię w stan relaksu i wsparł medytację oraz odpoczynek. Zawiera kardamon, drzewo cedrowe i paczuli. Orientalny zapach kadzidła wpłynie relaksująco na zmysły, pomoże Ci ukoić myśli, odpręży i oczyści atmosferę w Twoim Domowym Sanktuarium.  Kobiety w ciąży, astmatycy oraz dzieci poniżej 12 roku życia powinny skonsultować się z lekarzem przed użyciem kadzidełka. Ilość sztuk w opakowaniu: 20.','','kadzidelka-patyczkowe-do-aromaterapii-relaks','','','','Kadzidełka patyczkowe do Aromaterapii \"Relaks\"','','','',''),
(429,1,1,'Kadzidełka patyczkowe wytwarzane są ręcznie z mieszanki ziół, żywic, kwiatów i olejków. Zapach z serii „Stress Relief” skomponowany jest w taki sposób, by przyniósł ukojenie po ciężkim dniu lub w chwilach napięcia i stresu. Zawiera nuty lawendy, kwiatu pomarańczy i tymianku. Orientalny zapach kadzidła wpłynie kojąco na zmysły, pomoże Ci wejść w stan medytacji, odpręży, uspokoi i oczyści atmosferę w Twoim Domowym Sanktuarium.  Kobiety w ciąży, astmatycy oraz dzieci poniżej 12 roku życia powinny skonsultować się z lekarzem przed użyciem kadzidełka.','','kadzidelka-patyczkowe-do-aromaterapii-ulga-w-stresie','','','','Kadzidełka patyczkowe do Aromaterapii  \"Ulga w stresie\"','','','',''),
(430,1,1,'Kadzidełka patyczkowe wytwarzane są ręcznie z mieszanki ziół, żywic, kwiatów i olejków. Zapach z serii „Sensuality” skomponowany jest w taki sposób, by rozpalić sensualną, miłosną atmosferę. Zawiera nuty ylang ylang, gałki muszkatołowej i paczuli. Orientalny zapach kadzidła wpłynie pobudzająco na zmysły, pomoże Ci zintegrować się ze swoją seksualnością, odpręży i oczyści atmosferę w Twoim Domowym Sanktuarium.  Kobiety w ciąży, astmatycy oraz dzieci poniżej 12 roku życia powinny skonsultować się z lekarzem przed użyciem kadzidełka.','','kadzidelka-patyczkowe-do-aromaterapii-zmyslowosc','','','','Kadzidełka patyczkowe do Aromaterapii  \"Zmysłowość\"','','','',''),
(431,1,1,'Kadzidełka patyczkowe wytwarzane są ręcznie z mieszanki ziół, żywic, kwiatów i olejków. Zapach z serii „Refreshing” skomponowany jest w taki sposób, by przyniósł odświeżenie ciała i umysłu po ciężkim dniu lub gdy potrzebujesz odświeżyć energię w pomieszczeniu. Zawiera nuty mięty, szałwii i goździków. Orientalny zapach kadzidła pomoże Ci wejść w stan medytacji, odpręży i oczyści atmosferę w Twoim Domowym Sanktuarium.  Kobiety w ciąży, astmatycy oraz dzieci poniżej 12 roku życia powinny skonsultować się z lekarzem przed użyciem kadzidełka.','','kadzidelka-patyczkowe-do-aromaterapii-odswiezenie','','','','Kadzidełka patyczkowe do Aromaterapii  \"Odświeżenie\"','','','',''),
(432,1,1,'Kadzidełka patyczkowe wytwarzane są ręcznie z mieszanki ziół, żywic, kwiatów i olejków. Zapach z serii „Meditation” skomponowany jest w taki sposób, by łagodnie wprowadzić Cię w stan relaksu i  medytacji. Zawiera nuty wanilii, rumianku i drzewa sandałowego. Orientalny zapach kadzidła wpłynie kojąco na zmysły, pomoże Ci wejść w stan medytacji, odpręży podczas sesji jogi i oczyści atmosferę w Twoim Domowym Sanktuarium wprowadzając do niego spokój.  Kobiety w ciąży, astmatycy oraz dzieci poniżej 12 roku życia powinny skonsultować się z lekarzem przed użyciem kadzidełka. Ilość sztuk w opakowaniu: 20','','kadzidelka-patyczkowe-do-aromaterapii-medytacja','','','','Kadzidełka patyczkowe do Aromaterapii  \"Medytacja\"','','','',''),
(433,1,1,'Kadzidełka patyczkowe wytwarzane są ręcznie z mieszanki ziół, żywic, kwiatów i olejków. Zapach z serii „Energising” skomponowany jest w taki sposób, by dodać energii, gdy nam jej brakuje. Zawiera nuty cytryny, limonki i grapefruita. Orientalny zapach kadzidła wpłynie pobudzająco na zmysły, napełni wnętrze stymulującą atmosferą i oczyści atmosferę w Twoim Domowym Sanktuarium.  Kobiety w ciąży, astmatycy oraz dzieci poniżej 12 roku życia powinny skonsultować się z lekarzem przed użyciem kadzidełka.','','kadzidelka-patyczkowe-do-aromaterapii-energia','','','','Kadzidełka patyczkowe do Aromaterapii  \"Energia\"','','','','');
