INSERT INTO `ps_cms_lang` VALUES
(1,1,1,'Dostawa','','Nasze warunki dostawy','conditions, delivery, delay, shipment, pack','<h2>Przesyłki i zwroty</h2>\n<h3>Wysyłka paczki</h3>\n<p>Paczki są zazwyczaj wysyłane w ciągu 2 dni od otrzymania płatności za pośrednictwem UPS z monitorowaniem i odbiorem bez podpisu. Jeśli wolisz dostawę przez UPS Extra z wymaganym podpisem, zostanie naliczona dodatkowa opłata, więc skontaktuj się z nami przed wybraniem tej metody. Niezależnie od wybranej metody wysyłki, udostępnimy link do śledzenia paczki online.</p>\n<p></p>\n<p>Opłaty za wysyłkę obejmują opłaty za obsługę i pakowanie, a także koszty wysyłki. Opłaty manipulacyjne są stałe, podczas gdy opłaty transportowe różnią się w zależności od całkowitej wagi przesyłki. Zalecamy grupowanie przedmiotów w jednym zamówieniu. Nie możemy zgrupować dwóch różnych zamówień złożonych osobno, a opłaty za wysyłkę będą miały zastosowanie do każdego z nich. Paczka zostanie wysłana na własne ryzyko, ale szczególną uwagę zwracamy na ochronę delikatnych przedmiotów.</p>\n<p></p>\n<p>Pudełka mają odpowiednie rozmiary, a przedmioty są dobrze chronione.</p>','dostawa'),
(2,1,1,'Polityka Cookies','Polityka Cookies','Polityka Cookies','notice, legal, credits','<div class=\"hero__rte body-size-4 aos-animate\">\n<div class=\"rte\">\n<h2 class=\"hero__title heading-size-8 aos-animate\">Polityka Cookies</h2>\n<h1></h1>\n<p></p>\n<p><strong>Co to jest Polityka cookies? </strong></p>\n<p>Niniejsza Polityka cookies, będąca rozszerzeniem Polityki Prywatności Sklepu Internetowego, dotyczy szczegółowych zagadnień z zakresu stosowania przez nas plików cookies, kodów pikselowych oraz wdrażania innych technologii internetowych i przetwarzania danych osobowych za ich pomocą.</p>\n<p> </p>\n<p><strong>W niniejszej Polityce znajdą Państwo informacje o tym:</strong></p>\n<p><strong> </strong></p>\n<ul>\n<li>czym są pliki cookies i jakie są ich rodzaje,</li>\n<li>jakie technologie internetowe są stosowane na naszej Stronie Internetowej,</li>\n<li>jakie dane przetwarzamy,</li>\n<li>w jaki sposób i do jakich celów wykorzystujemy dane,</li>\n<li>do kogo i w jaki sposób przesyłamy dane,</li>\n<li>przez jaki czas przechowujemy informacje zawarte w cookies.</li>\n</ul>\n<p> </p>\n<p><strong>Polityka cookies Sklepu Internetowego moonsister.pl nie stanowi źródła obowiązków dla Osoby Odwiedzającej, Klienta Sklepu Internetowego. Ma ona charakter wyłącznie informacyjny, nie jest umową ani regulaminem. We wszelkich kwestiach nieuregulowanych Polityką Cookies, znajduje zastosowanie Polityka Prywatności lub Regulamin Sklepu Internetowego</strong><strong>.</strong></p>\n<p><strong> </strong></p>\n<p><strong>Dane kontaktowe.</strong></p>\n<p>Moonsister D. Zielonka-Nowicka, S. Michajłow sp. k. z siedzibą w Łomianki przy ul. 11 Listopada 48D, wpisana do Krajowego Rejestru Sądowego przez Sąd Rejonowy dla m. st. Warszawy w Warszawie, XIV Wydział Gospodarczy Krajowego Rejestru Sądowego pod numerem KRS: 0000967402, NIP: 7010518251, REGON: 36286993800000, adres mailowy:  <a href=\"mailto:hello@moonsister.pl\">hello@moonsister.pl</a>.</p>\n<p> </p>\n<ol>\n<li><strong> </strong><strong>Czy nasza Strona Internetowa korzysta z cookies? </strong></li>\n</ol>\n<p>Tak, nasza Strona Internetowa, podobnie jak większość stron internetowych, wykorzystuje pliki cookies, czyli ciasteczka. Polityka cookies dotyczy zarówno Klientów Sklepu Internetowego, jak i Osób Odwiedzających Sklep Internetowy, czyli użytkowników, którzy przeglądają zawartość Sklepu, ale nie dokonują zakupów. Polityka dotyczy również Gościa, czyli Osoby Odwiedzającej nie będącej zarejestrowanym Klientem, która dokonuje zakupów w naszym Sklepie, jednak bez rejestracji konta.</p>\n<p> </p>\n<p>Strona Internetowa korzysta również z funkcjonalności zbliżonych do cookies. W związku z tym, poniższe zapisy Polityki cookies należy odnosić odpowiednio również do tych technologii.</p>\n<p> </p>\n<ol start=\"2\">\n<li><strong> </strong><strong>Czym są pliki cookies?</strong></li>\n</ol>\n<p>Pliki cookies są to dane informatyczne, w szczególności niewielkie informacje tekstowe, przechowywane na urządzeniu końcowym użytkowników, np. na komputerze, tablecie, czy telefonie komórkowym, które mogą być odczytywane przez nasz system teleinformatyczny (cookies własne) lub system teleinformatyczny podmiotów trzecich (cookies podmiotów trzecich). Pliki te pozwalają rozpoznać urządzenie użytkownika i odpowiednio wyświetlić stronę internetową dostosowaną do jego indywidualnych preferencji, umożliwiają wyświetlenie strony internetowej w języku użytkownika „zapamiętanym” przez te pliki, a także wykorzystanie innych ustawień Strony Internetowej wybranych przez użytkownika. „Cookies” zazwyczaj zawierają nazwę strony internetowej z której pochodzą, czas przechowywania ich na urządzeniu końcowym oraz unikalny numer.</p>\n<p> </p>\n<p><strong>Piksel</strong> to kod oprogramowania, który pozwala śledzić Osoby Odwiedzające Stronę Internetową i ich zachowanie na stronach internetowych, na których rozmieszczono piksele. Może to być podstawowe śledzenie, czy dana osoba odwiedziła Stronę Internetową, aż do szczegółowego śledzenia działań, takich jak dodanie produktu do koszyka, wybranie produktu, wysłanie formularza itp. Piksel może przesłać zgromadzone informacje stronie trzeciej, tj. do dostawcy kodu.</p>\n<p> </p>\n<ol start=\"3\">\n<li><strong> </strong><strong>W jakim celu wykorzystujemy cookies?</strong></li>\n</ol>\n<p>Wykorzystujemy stosowane przez nas cookies i inne technologie internetowe do:</p>\n<p> </p>\n<ol>\n<li>zapewnienia funkcjonowania, bezpieczeństwa i niezawodności naszej Strony Internetowej;</li>\n<li>dostosowania zawartości Strony Internetowej do preferencji Klienta lub Osoby Odwiedzającej oraz optymalizacji korzystania ze Strony Internetowej. Pliki te umożliwiają zapisanie wyborów użytkownika co do języka, przeglądarki, ustawień wybranych elementów Strony Internetowej czy rezygnacji z profilowanych reklam, a także zapisanie informacji o lokalizacji użytkownika;</li>\n<li>do zapewnienia ułatwienia logowania się do Konta Klienta;</li>\n<li>analizy i tworzenia statystyk, które pomagają zrozumieć, w jaki sposób Osoby Odwiedzające Stronę Internetową korzystają z jej funkcjonalności, co umożliwia ulepszanie jej struktury i zawartości;</li>\n<li>w celach reklamowych (w tym remarketingu, retargetingu) i łączenia się z mediami społecznościami, wyświetlania reklamy behawioralnej za pomocą narzędzia Google Ads, mającej dostarczać Osobom Odwiedzającym i Klientom treści reklamowej dostosowanej do ich zainteresowań lub profili, mogą być używane również do wyświetlania reklam poza stronami Serwisu (także z wykorzystaniem tzw. third party cookies), tj. u naszych partnerów reklamowych. Naszym celem jest opracowanie oferty reklamowej, która będzie atrakcyjna i korzystna dla naszych odbiorców, dlatego w ramach reklamy behawioralnej Klient i Osoba Odwiedzająca może zobaczyć przede wszystkim informacje o produktach lub usługach, które oglądał lub sprawdzał już na naszej Stronie.</li>\n</ol>\n<p> </p>\n<ol start=\"4\">\n<li><strong> </strong><strong>Czy w ramach plików cookies przetwarzane są dane osobowe?</strong></li>\n</ol>\n<p>Tak, wybrane pliki cookies mogą w niektórych sytuacjach przetwarzać Państwa dane osobowe. Przetwarzanie danych osobowych pochodzących z plików cookies lub podobnych technologii na naszej Stronie Internetowej odbywa się w celach zapewnienia funkcjonowania Strony, dostosowania Strony Internetowej do preferencji Osoby Odwiedzające i Klienta, czy celach analitycznych. Przetwarzanie odbywa się na podstawie naszego uzasadnionego interesu. Pragniemy zwrócić uwagę, że podstawą prawną przetwarzania danych osobowych w celach reklamowych, statystycznych będzie zawsze Państwa dodatkowa i wyraźna zgoda, wyrażona poprzez dokonanie wyboru i zaznaczenie checkboxa podczas procesu wyrażania zgody na cookies.</p>\n<p> </p>\n<p>Gdy Osoba Odwiedzająca lub Klient korzysta ze Sklepu Internetowego stosowane są pliki cookies umożliwiające identyfikację jego przeglądarki lub urządzenia - pliki cookies zbierają różnego rodzaju informacje, które co do zasady nie stanowią danych osobowych. Niektóre informacje, w zależności od ich zawartości i sposobu wykorzystania, mogą jednak zostać powiązane z konkretną osobą - przypisanie pewnych zachowań konkretnej Osobie Odwiedzającej lub Klientowi, np. poprzez powiązanie ich z danymi podanymi przy rejestracji Konta w Sklepie Internetowym, czy konkretnym adresem e-mail - a tym samym zostać uznane za dane osobowe.</p>\n<p> </p>\n<ol start=\"5\">\n<li><strong> </strong><strong>Jeśli cookies przetwarza dane osobowe, czy wówczas znajduje zastosowanie Polityka prywatności?</strong></li>\n</ol>\n<p>Tak, w stosunku do informacji zbieranych przez pliki cookies, które mogą zostać powiązane z konkretną osobą, zastosowanie znajdują postanowienia Polityki prywatności Sklepu Internetowego odnoszące się do danych osobowych, w szczególności dotyczące praw osoby, której dane dotyczą.</p>\n<p> </p>\n<ol start=\"6\">\n<li><strong> </strong><strong>Czy muszę wyrazić zgodę na stosowanie cookies?</strong></li>\n</ol>\n<p>Podczas pierwszej wizyty na naszej Stronie Internetowej wyświetlana jest Państwu informacja na temat stosowania przez nas plików cookies. Mogą się Państwo na nie zgodzić lub nie. Jeżeli nie zgodzą się Państwo na używanie przez nas plików cookies, wówczas będziemy stosować tylko niezbędne, techniczne cookies, konieczne do prawidłowego funkcjonowania Strony. Cookies, które nie należą do grupy plików technicznych, zostaną załadowane dopiero po wyrażeniu przez Państwa zgody na cookies (klauzula <em>opt-in</em>).</p>\n<p> </p>\n<ol start=\"7\">\n<li><strong> </strong><strong>Czy mogę zmienić zdanie odnośnie stosowanie cookies?</strong></li>\n</ol>\n<p>Oczywiście, że tak. Jeśli została wyrażona zgoda na używanie przez nas cookies, w każdej chwili mogą Państwo zmienić zdanie i nie wyrazić zgody, by w przyszłości były one stosowane. Wycofanie zgody nie wpływa na zgodność z prawem przetwarzania, którego dokonano na podstawie zgody przed jej wycofaniem. Należy mieć jednak na względzie, że wyłączenie lub ograniczenie obsługi plików cookies może powodować trudności w korzystaniu ze Sklepu Internetowego, jak również z wielu innych stron internetowych, które stosują cookies.</p>\n<p> </p>\n<ol start=\"8\">\n<li><strong> </strong><strong>W jaki sposób mogę dodatkowo zarządzać swoją prywatnością?</strong></li>\n</ol>\n<p>Jeżeli chcesz dodatkowo zarządzać swoją prywatnością, zamieszczamy listę narzędzi, które mogą być pomocne:</p>\n<p> </p>\n<ol>\n<li>ustawienia cookies w ramach przeglądarki internetowej;</li>\n</ol>\n<ul>\n<li>Google Chrome: Ustawienia -&gt; Pokaż ustawienia zaawansowane -&gt; Prywatność -&gt; Ustawienia treści -&gt; Pliki cookie.</li>\n<li>Internet Explorer pliki cookies można modyfikować z poziomu: Narzędzia -&gt; Opcje internetowe -&gt; Prywatność;</li>\n<li>Mozilla Firefox: Narzędzia -&gt; Opcje -&gt; Prywatność.</li>\n</ul>\n<ol>\n<li>wtyczki do przeglądarek wspierające zarządzanie plikami cookies np. ghostery,</li>\n<li>dodatkowe oprogramowanie zarządzające plikami cookies,</li>\n<li>tryb incognito w przeglądarce internetowej,</li>\n<li>ustawienia reklamy behawioralnej, np. youronlinechoices.com,</li>\n<li>mechanizm zarządzania plikami cookies z poziomu naszej strony,</li>\n<li>Google Analytics Opt-out: <a href=\"https://tools.google.com/dlpage/gaoptout\">https://tools.google.com/dlpage/gaoptout</a>,</li>\n<li>Google Ads Settings: <a href=\"https://adssettings.google.com/\">https://adssettings.google.com/</a></li>\n<li>Facebook Ads Settings: <a href=\"https://www.facebook.com/ads/settings\">https://www.facebook.com/ads/settings</a>,</li>\n</ol>\n<p> </p>\n<ol start=\"9\">\n<li><strong>Czy cookies są szkodliwe?</strong></li>\n</ol>\n<p>Wykorzystywane przez nas pliki cookies nie są szkodliwe ani dla Osoby Odwiedzającej i Klienta, ani dla komputera, telefonu komórkowego czy urządzenia końcowego wykorzystywanego przez nie, dlatego zalecamy niewyłączanie ich obsługi w przeglądarkach.</p>\n<p> </p>\n<p>Tzw. nieszkodliwe cookies są niezbędne do poprawnego działania Strony Internetowej, potrzebne do umożliwienia działania funkcjonalności strony internetowej, jednak ich działanie nie ma nic wspólnego ze śledzeniem użytkownika.</p>\n<p>Na naszej Stronie korzystamy również z tzw. cookies badających, które wykorzystujemy do śledzenia Osób Odwiedzających Stronę, jednak nie obejmują informacji pozwalających (bez posiadania innych danych) zidentyfikować konkretnego użytkownika. W określonych sytuacjach stosujemy profilowanie, o czym więcej w pkt. 12.</p>\n<p> </p>\n<ol start=\"10\">\n<li><strong> </strong><strong>Jakie stosujemy cookies własne?</strong></li>\n</ol>\n<p>Cookies własne (ang. first party cookies) wykorzystujemy w celu zapewnienia prawidłowego działania Strony Internetowej. Nasze cookies mają za zadanie ułatwić Państwu korzystanie z naszej Strony Internetowej, a w szczególności z funkcjonalności Sklepu.</p>\n<p> </p>\n<ol start=\"11\">\n<li><strong>Czy stosujemy cookies podmiotów trzecich?</strong></li>\n</ol>\n<p>Tak. Nasza Strona Internetowa, w celu optymalizacji jej funkcjonowania, korzysta również z cookies podmiotów trzecich (ang. third-party cookies). Cookies podmiotów trzecich stosujemy również w celach analitycznych, i statystycznych. Cookies pozwalają nam również dostosować reklamę i treści marketingowe do Państwa upodobań. Pliki cookies służą również zwiększeniu użyteczności i personalizacji zawartości Sklepu Internetowego.</p>\n<p> </p>\n<ol start=\"12\">\n<li><strong>Czy korzystamy z profilowania?</strong></li>\n</ol>\n<p>Tak. Dzięki cookies stosowanym w Sklepie Internetowym możliwe jest zapoznawanie się przez Administratora z preferencjami Osoby Odwiedzającej - np. poprzez analizę tego jak często odwiedza Sklep Internetowy oraz czy i jakie produkty kupuje. Profilowanie dotyczy w szczególności osób zalogowanych, czyli Klientów. Analiza zachowań w Internecie pomaga lepiej zrozumieć Państwa zwyczaje i oczekiwania oraz dostosować się do Waszych potrzeb i zainteresowań.</p>\n<p> </p>\n<p>W oparciu o pliki cookies, Administrator posługuje się również technologią pozwalającą na dotarcie z przekazem reklamowym do Osób Odwiedzających, które wcześniej odwiedziły Sklep Internetowy, podczas korzystania przez nie z innych stron internetowych, za pomocą narzędzia Google Ads.</p>\n<p> </p>\n<ol start=\"13\">\n<li><strong> </strong><strong>Jakie konkretnie cookies, piksele i narzędzia informatyczne stosujemy? </strong></li>\n</ol>\n<p><strong> </strong></p>\n<p><strong>Google Analytics.</strong> Korzystamy z narzędzia Google Analytics, dostarczanego przez Google LLC, 1600 Amphitheatre Parkway, Mountain View, CA 94043, USA.  Dzięki temu tworzymy statystyki i analizy w celu ulepszania działania Strony Internetowej.</p>\n<p>Google Analytics w sposób automatyczny gromadzi informacje o korzystaniu z naszej Strony. Co ważne, mamy włączoną anonimazcję IP. Dlatego też, Google nie otrzymuje od nas danych osobowych, które mogłyby zostać oparte na numerze IP w połączeniu z innymi danymi o Osobach Odwiedzających lub Klientach.</p>\n<p>W ramach Google Analytics zbieramy dane demograficzne oraz dane o zainteresowaniach. Zgromadzone informacje, nie będące jednak danymi osobowymi, są najczęściej przekazywane do serwera Google w USA i tam przechowywane.  </p>\n<p> </p>\n<p>Jeżeli jesteś zainteresowany szczegółami związanymi z przetwarzaniem danych w ramach Google Analytics, zachęcamy do zapoznania się z dokumentem opracowanym przez Google: https://support.google.com/analytics/answer/6004245.</p>\n<p><strong>Google Ads</strong> (poprzednio Google Adwords)– konwersja i remarketing. Korzystamy z narzędzia Google Ads, dostarczanego przez Google Ireland Limited (zarejestrowaną pod numerem: 368047) z siedzibą pod adresem: Gordon House, Barrow Street, Dublin 4, Irlandia. Dzięki temu przyciągamy uwagę do naszych treści oraz ofert za pomocą materiałów reklamowych na zewnętrznych stronach internetowych. Analizujemy dane z kampanii reklamowych, w celu optymalizacji działań reklamowych. Materiały reklamowe są dostarczone przez Google za pomocą tzw. „Ad Servers”. W tym celu, używamy cookies serwerowych, za pomocą których określone parametry mierzenia sukcesu dotarcia do odbiorców, takie jak zamieszczanie reklam lub kliknięć użytkowników mogą być mierzone. Jeśli wejdą Państwo na naszą stronę internetową przez reklamę Google, Google Ads przechowa plik cookie na Państwa urządzeniu. Dla tych plików cookies, w celu analizy wartości, są zazwyczaj przechowywane: unikalny identyfikator cookie, liczba wyświetleń na jedno lokowanie reklamy (częstotliwość), ostatnie wyświetlenie (istotne dla konwersji po wyświetleniu) oraz informacja opt-out (oznaczenie, który użytkownik nie życzy sobie by był dalej uwzględniany). Pliki cookies pozwalają Google na rozpoznawanie Państwa przeglądarki internetowej. Nie zbieramy ani nie przetwarzamy jakichkolwiek danych osobowych na podstawie w/w środków reklamowych. Nie uzyskujemy innych danych, nie możemy identyfikować użytkowników na podstawie uzyskanych informacji. Z uwagi na na użyte narzędzia marketingowe, Państwa przeglądarka automatycznie rozpoczyna połączenie z serwerem Google. Nawet jeśli nie są Państwo zarejestrowani w żadnej usłudze Google lub nie są Państwo zalogowani, istnieje możliwość, że dostawcy sieci mogą pozyskać i przechowywać Państwa adres IP.</p>\n<p>Używamy również narzędzia remarketingu w Google Ads, która umożliwia prezentowanie użytkownikom naszej strony internetowej reklam opartych na ich zainteresowaniach z innych stron internetowych należących do sieci reklamowej Google. W tym celu Google przechowuje cookies w przeglądarkach użytkowników, którzy odwiedzają określone serwisy Google lub strony internetowe w Google Display Network, by w unikalny sposób zidentyfikować przeglądarkę internetową na konkretnym urządzeniu.</p>\n<p>Zachęcamy do zapoznania się z dokumentów dot. RODO i Google Ads: <a href=\"https://ads.google.com/intl/pl_pl/home/faq/gdpr/\">https://ads.google.com/intl/pl_pl/home/faq/gdpr/</a>.</p>\n<p><strong>Google AdSense</strong> – personalizacja reklam. Korzystamy z narzędzia Google Ads, dostarczanego przez Google Ireland Limited (zarejestrowaną pod numerem: 368047) z siedzibą pod adresem: Gordon House, Barrow Street, Dublin 4, Irlandia. AdSense używa plików cookie, aby poprawiać jakość reklam. Jest to m.in. kierowanie reklam na podstawie produktów, które interesują danego użytkownika.</p>\n<p>Więcej informacji o sposobie działania znajduje się tutaj:</p>\n<p>https://www.google.com/intl/pl_pl/adsense/start/</p>\n<p><strong>Facebook - </strong>Korzystamy również z narzędzi marketingowych dostępnych w ramach serwisu Facebook i dostarczanych przez Facebook Ireland Ltd., 4 Grand Canal Square, Grand Canal Harbour, Dublin 2, Irlandia („Facebook“). W ramach tych narzędzi kierujemy do Państwa reklamy w serwisie Facebook. Działania w tym zakresie realizujemy, opierając się na naszym prawnie uzasadnionym interesie w postaci marketingu własnych produktów.</p>\n<p>W celu kierowania do Państwa reklam spersonalizowanych pod kątem Państwa zachowań na naszej Stronie, korzystamy z Pixel Facebooka, który w sposób automatyczny gromadzi informacje o Państwa korzystaniu z naszej Strony w zakresie przeglądanych stron.</p>\n<p>Nie przekazujemy danych osobowych. Informacje zbierane w ramach Pixela Facebooka są anonimowe, tj. nie pozwalają nam na Państwa identyfikację. Pozwalają nam wyłącznie uzyskać informacje jakie działania zostały podjęte w ramach naszej Strony. Zwracamy jednak uwagę, że Facebook może łączyć te informacje z innymi informacjami o Państwu zebranymi w ramach korzystania przez Państwa z serwisu Facebook i wykorzystywać dla swoich własnych celów, w tym marketingowych. Obecnie Pixel Facebooka oddziałuje również na dane z Instagrama. Takie działania Facebooka nie są już zależne od nas, a informacji o nich możesz szukać bezpośrednio w polityce prywatności Facebooka: https://www.facebook.com/privacy. Z poziomu swojego konta na Facebooku możesz również zarządzać swoimi ustawieniami prywatności.</p>\n<p> </p>\n<p><strong>Pintrest – </strong>na naszej stronie wykorzystujemy narzędzia marketingowe udostępniane przez Pinterest Europe Ltd., z siedzibą pod adresem: Palmerston House, 2nd Floor, Fenian Street, Dublin 2, Irlandia. Dzięki nim kierujemy do Państwa lepiej dopasowane do Państwa zainteresowań reklamy. <br /><br />Więcej informacji na temat sposobu przetwarzania danych przez Pintrest znajduje się tutaj:<br />https://policy.pinterest.com/pl/privacy-policy</p>\n<p><strong> </strong></p>\n<p> </p>\n<ol start=\"14\">\n<li><strong> </strong><strong>Jak długo przechowujemy cookies zawierające dane osobowe?</strong></li>\n</ol>\n<p>W zależności od rodzaju, celu i podstawy prawnej przetwarzania plików cookies czas przechowywania plików cookies wynosi od 1 sesji do 2 lat.</p>\n<p><strong> </strong></p>\n<p>Zebrane przez nas pliki cookies zawierające dane osobowe Osoby Odwiedzającej niebędącej Klientem, będą przechowywane do czasu wniesienia sprzeciwu. Administrator może usunąć Dane Osobowe, jeśli przez 2 lata nie zostaną one wykorzystane do celów marketingowych chyba, że przepisy prawa będą zobowiązywać Administratora do dłuższego przetwarzania danych osobowych.</p>\n<p><strong> </strong></p>\n<p>Część danych osobowych może być przechowywana dłużej na wypadek, gdyby Osoba Odwiedzająca miała wobec Administratora jakiekolwiek roszczenia lub w celu dochodzenia roszczeń przez Administratora lub obrony przed roszczeniami (również osób trzecich), przez okres ich przedawnienia określony przepisami prawa, w szczególności kodeksu cywilnego.</p>\n<p> </p>\n<p>W każdym wypadku decyduje dłuższy termin przechowywania Danych Osobowych.</p>\n<p><strong> </strong></p>\n<ol start=\"15\">\n<li><strong> </strong><strong>Z których narzędzi społecznościowych korzystamy?</strong></li>\n</ol>\n<p>Na naszej Stronie Internetowej używane są wtyczki i inne narzędzia społecznościowe udostępniane przez serwisy społecznościowe, takie jak Facebook, Instagram i Pintrest.</p>\n<p> </p>\n<p>Wyświetlając Stronę Internetową, zawierającą taką wtyczkę, Państwa przeglądarka nawiąże bezpośrednie połączenie z serwerami administratorów serwisów społecznościowych (usługodawców). Zawartość wtyczki jest przekazywana przez danego usługodawcę bezpośrednio do Państwa przeglądarki i integrowana ze Stroną. Dzięki tej integracji usługodawcy otrzymują informację, że Państwa przeglądarka wyświetliła naszą stronę, nawet jeśli nie posiadasz profilu u danego usługodawcy czy nie jesteś u niego akurat zalogowany. Taka informacja (wraz z Państwa adresem IP) jest przez Państwa przeglądarkę przesyłana bezpośrednio do serwera danego usługodawcy i tam przechowywana.</p>\n<p> </p>\n<p>Jeśli zalogowałaś się do jednego z serwisów społecznościowych, to usługodawca ten będzie mógł bezpośrednio przyporządkować wizytę na naszej Stronie do Twojego profilu w danym serwisie społecznościowym.  Jeśli użyjesz danej wtyczki, np. klikając w przycisk „Lubię to” lub „Udostępnij”, to odpowiednia informacja zostanie również przesłana bezpośrednio na serwer danego usługodawcy i tam zachowana.</p>\n<p>Ponadto, informacje te zostaną opublikowane w danym serwisie społecznościowym i ukażą się osobom dodanym jako Twoje kontakty. Cel i zakres gromadzenia danych oraz ich dalszego przetwarzania i wykorzystania przez usługodawców, w tym możliwość kontaktu oraz Państwa prawa w tym zakresie i możliwość dokonania ustawień zapewniających ochronę Państwa prywatności zostały opisane w polityce prywatności poszczególnych usługodawców.</p>\n<p> </p>\n<ul>\n<li>Facebook - <a href=\"https://pl-pl.facebook.com/about/privacy/update\">https://pl-pl.facebook.com/about/privacy/update</a></li>\n<li>Instagram-https://privacycenter.instagram.com/policy/?entry_point=ig_help_center_data_policy_redirect</li>\n<li>Pintrest - https://policy.pinterest.com/pl/privacy-policy</li>\n</ul>\n<p> </p>\n<p>Jeśli nie chcesz, aby serwisy społecznościowe przyporządkowywały dane zebrane w trakcie odwiedzin na naszej Stronie Internetowej bezpośrednio Państwa profilowi w danym serwisie, to przed wizytą na naszej Stronie Internetowej musicie się Państwo wylogować z tego serwisu. Możecie również całkowicie uniemożliwić załadowanie na stronie wtyczek stosując odpowiednie rozszerzenia w swojej przeglądarce, np. blokowanie skryptów.</p>\n<p> </p>\n<p>Polityka cookies 2.0 obowiązuje od dnia 22.12.2022 roku.  </p>\n</div>\n</div>','polityka-cookies-'),
(3,1,1,'Regulamin sklepu','','Regulamin sklepu','conditions, terms, use, sell','<h1>Warunki świadczenia usług</h1>\n<div class=\"shopify-policy__title\" style=\"margin:0px;padding:0px;border:0px;font-weight:400;font-size:17.1px;line-height:inherit;font-family:Montserrat, sans-serif;vertical-align:baseline;color:#333333;background-color:#ffffff;\"></div>\n<div class=\"shopify-policy__body\" style=\"margin:0px;padding:0px;border:0px;font-weight:400;font-size:17.1px;line-height:inherit;font-family:Montserrat, sans-serif;vertical-align:baseline;color:#333333;background-color:#ffffff;\">\n<div class=\"rte\" style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\">\n<p style=\"margin:0px 0px 0.5em;padding:0px;border:0px;font:inherit;vertical-align:baseline;\">Zapraszamy Cię do zapoznania się z zasadami korzystania ze sklepu internetowego Moonsister.pl.<br /><br />Dbamy o to, aby postanowienia naszego regulaminu były zgodne z obowiązującymi przepisami, ale również żeby w prosty i czytelny sposób opisywały Twoje prawa i obowiązki.<br /><br />Pamiętaj, że jeśli masz jakiekolwiek pytania związane z naszymi zasadami, możesz się z nami skontaktować mailowo:<span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span><a href=\"mailto:hello@moonsister.pl\" style=\"padding:0px 0px 5px;background:no-repeat 50% 86%;\">hello@moonsister.pl.</a></p>\n</div>\n</div>\n<h6 style=\"line-height:1.2;margin:0.5em 0px;\"></h6>\n<h6 style=\"line-height:1.2;margin:0.5em 0px;text-align:center;\"></h6>\n<div class=\"shopify-policy__body\" style=\"margin:0px;padding:0px;border:0px;font-weight:400;font-size:17.1px;line-height:inherit;font-family:Montserrat, sans-serif;vertical-align:baseline;color:#333333;background-color:#ffffff;\">\n<div class=\"rte\" style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\">\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"><br /><br />W tej części regulaminu wyjaśniamy najważniejsze definicje, których używamy w Regulaminie.</p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;text-align:center;\"><br /><br /><br /><span>§ 1.</span></p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;text-align:center;\"><span>POSTANOWIENIA OGÓLNE</span></p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"><br /><br />1. Sklep Internetowy jest dostępny pod adresem internetowym: moonsister.pl (dalej: Sklep Internetowy) oraz jego rozwinięciami.<br />2. Właścicielem Sklepu Internetowego jest MOONSISTER D.ZIELONKA-NOWICKA, S.MICHAJŁOW Sp.K., ul. 11 Listopada 48D, 05-092 Łomianki, Sąd Rejonowy dla m. st. Warszawy XIV Wydział Gospodarczy Krajowego Rejestru Sądowego, pod numerem KRS 0000967402, REGON 362869938, NIP 7010518251, adres mailowy:<span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span><a href=\"mailto:hello@moonsister.pl\" style=\"padding:0px 0px 5px;background:no-repeat 50% 86%;\">hello@moonsister.pl.</a><br />3. Niniejszy Regulamin jest skierowany zarówno do Klientów będących Konsumentami, jak i do Klientów niebędących Konsumentami, korzystających ze Sklepu Internetowego.<br />4. Akceptacja niniejszego Regulaminu jest dobrowolna, lecz konieczna w celu np. utworzenia Konta Klienta, a przede wszystkim w celu złożenia przez Klienta Zamówienia w Sklepie Internetowym.<br />5. Regulamin jest nieodpłatnie udostępniony przez Sprzedawcę w Sklepie Internetowym w sposób umożliwiający Klientom zapoznanie się z jego treścią i utrwalanie jego treści poprzez wydrukowanie lub zapisanie na nośniku zewnętrznym, np. pobrania w formie <a href=\"https://cdn.shopify.com/s/files/1/0690/1946/8054/files/Regulamin2023.pdf?v=1699354025\" style=\"padding:0px 0px 5px;background:no-repeat 50% 86%;\">PDF</a>. (kliknij PDF aby pobrać nasz regulamin)<br />6. Informacje prezentowane w Sklepie Internetowym stanowią jedynie zaproszenie do zawarcia umowy w rozumieniu art. 71 Kodeksu cywilnego, kierowane przez Sprzedawcę do Klientów, a nie ofertę w myśl przepisów Kodeksu cywilnego.<br />7.<span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span><span>DEFINICJE</span>. Ilekroć w dalszej części Regulaminu użyto niżej wymienionych zwrotów pisanych wielką literą, należy je rozumieć w podanym niżej znaczeniu, chyba że z kontekstu ich użycia wyraźnie wynika co innego:<br /><br />a.<span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span><span>AKCJA PROMOCYJNA</span>– szczególne warunki sprzedaży lub świadczenia usług, uregulowane na zasadach wyrażonych w ramach Sklepu Internetowego, proponowane przez Sprzedawcę w określonym czasie, z których Klient może skorzystać na zasadach tam określonych, takie jak na przykład obniżenie Ceny za Produkt lub Zestaw Promocyjny, czy też obniżenie / brak kosztów wysyłki. Szczegóły Akcji Promocyjnej reguluje Regulamin Akcji Promocyjnej, zgodnie z informacjami udostępnionymi w ramach Sklepu Internetowego.<br />b.<span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span><span>BOK</span><span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span>– Biuro Obsługi Klienta Sprzedawcy, które udziela Klientom informacji w zakresie prowadzonej przez Sklep Internetowy działalności, w szczególności na temat Produktów, działalności Sklepu Internetowego, Regulaminu oraz aktualnych Akcji Promocyjnych, w dni robocze, w godzinach wskazanych w Sklepie Internetowym, pod wskazanymi tam numerami telefonu i adresem e-mail.<br />c.<span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span><span>CENA</span><span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span>– określona w złotych polskich kwota wynagrodzenia brutto (uwzględniająca podatek) należnego Sprzedawcy tytułem przeniesienia własności Produktu na Klienta zgodnie z Umową Sprzedaży lub Umową Dostarczenia Treści Cyfrowych. Cena nie zawiera kosztów dostawy, chyba że warunki Akcji Promocyjnej obowiązującej w danym czasie w Sklepie Internetowym stanowią inaczej.<br />d.<span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span><span>KLIENT</span><span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span>– (1) osoba fizyczna; albo działająca przez osobę umocowaną (2) osoba prawna; albo (3) jednostka organizacyjna nieposiadająca osobowości prawnej, której ustawa przyznaje zdolność prawną; posiadająca pełną zdolność do czynności prawnych. W przypadku gdy Klientem jest osoba fizyczna o ograniczonej zdolności do czynności prawnych, zobowiązuje się ona uzyskać prawnie skuteczną zgodę swojego przedstawiciela ustawowego na zawarcie Umowy o Świadczenie Usług/Umowy Sprzedaży lub Umowy Dostarczenia Treści Cyfrowych oraz okazać taką zgodę na każde żądanie Sprzedawcy, przy czym co do zasady Umowy zawierane w ramach Sklepu Internetowego mają charakter umów powszechnie zawieranych w drobnych bieżących sprawach życia codziennego.<br />e.<span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span><span>KONSUMENT</span><span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span>– osoba fizyczna dokonująca z przedsiębiorcą czynności prawnej niezwiązanej bezpośrednio z jej działalnością gospodarczą lub zawodową.<br />f.<span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span><span>KONTO KLIENTA</span><span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span>– Usługa Elektroniczna; oznaczony indywidualną nazwą (Loginem) i Hasłem podanym przez Klienta zbiór zasobów w systemie teleinformatycznym Sprzedawcy, pozwalający na korzystanie przez Klienta z dodatkowych funkcjonalności/usług. Klient uzyskuje dostęp do Konta za pomocą Loginu i Hasła. Klient loguje się na swoje Konto po dokonaniu rejestracji w Sklepie Internetowym. Konto umożliwia zapisywanie i przechowywanie informacji o danych adresowych Klienta do wysyłki Produktów, śledzenie statusu Zamówienia, dostęp do historii Zamówień oraz innych usług udostępnianych przez Sprzedawcę.<br />g.<span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span><span>KOSZYK</span><span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span>– usługa udostępniana każdemu Klientowi, który korzysta ze Sklepu Internetowego, polegająca na umożliwieniu mu łatwego złożenia Zamówienia jednego lub kilku Produktów, wpisania kodów rabatowych umożliwiających obniżenie Ceny na zasadach określonych odrębnymi Regulaminami Akcji Promocyjnych, wyświetlenia podsumowania Ceny poszczególnych Produktów i wszystkich Produktów łącznie (w tym ew. kosztów wysyłki), przesłania Klientowi wiadomości o produktach pozostających w Koszyku lub nieudanej transakcji (mail transakcyjny). Koszyk gromadzi składane przez Klienta oferty zawarcia Umowy Sprzedaży oraz Umowy Dostarczania Treści Cyfrowych, tj. w ramach jednego Zamówienia można złożyć więcej niż jedną ofertę zawarcia Umowy.<br />h.<span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span><span>LOGIN</span><span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span>– nazwa użytkownika Klienta podana w ramach Sklepu podczas tworzenia Konta.<br />i.<span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span><span>NEWSLETTER</span><span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span>– Usługa Elektroniczna, która umożliwia wszystkim korzystającym z niej Klientom otrzymywanie od Sprzedawcy cyklicznych informacji w szczególności o Produktach, Sklepie Internetowym, w tym nowościach i Akcjach Promocyjnych, na podany przez Klienta adres e-mail, za wyraźną zgodą Klienta.<br />j.<span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span><span>PRODUKT</span><span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span>– dostępna w Sklepie Internetowym rzecz ruchoma będąca przedmiotem Umowy Sprzedaży między Klientem a Sprzedawcą, za zapłatą Ceny;<br />- dostępne w Sklepie Internetowym treści cyfrowe (tj. dane wytwarzane i dostarczane w formie cyfrowej), będące przedmiotem Umowy Dostarczenia Treści Cyfrowych za zapłatą Ceny.<br />k.<span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span><span>PRZEDSIĘBIORCA – KONSUMENT</span><span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span>- Klient, który jest osobą fizyczną zawierającą umowę bezpośrednio związaną z jego działalnością gospodarczą, gdy z treści tej umowy wynika, że nie posiada ona dla niego charakteru zawodowego, wynikającego w szczególności z przedmiotu wykonywanej działalności gospodarczej, udostępnionego na podstawie przepisów o Centralnej Ewidencji i Informacji Działalności Gospodarczej.<br />l.<span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span><span>REGULAMIN</span><span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span>– niniejszy dokument określający zasady zawierania Umów Sprzedaży, Umowy Dostarczania Treści Cyfrowych oraz zasady świadczenia i korzystania z usług udostępnianych przez Sprzedawcę za pośrednictwem Sklepu na rzecz Klientów. Regulamin określa prawa i obowiązki Klienta i Sprzedawcy. W zakresie usług świadczonych drogą elektroniczną niniejszy Regulamin jest regulaminem, o którym mowa w art. 8 ustawy z dnia 18 lipca 2002 r. o świadczeniu usług drogą elektroniczną.<br />m.<span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span><span>SPRZEDAWCA</span><span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span>–  <span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\">MOONSISTER  D.ZIELONKA-NOWICKA,  S.MICHAJŁOW  Sp.K., ul. 11 Listopada 48D, 05-092 Łomianki, Sąd Rejonowy dla m. st. Warszawy XIV Wydział Gospodarczy Krajowego Rejestru Sądowego, pod numerem KRS 0000967402, REGON 362869938, NIP 7010518251,</span><br />n.<span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span><span>TREŚĆ/TREŚCI</span><span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span>– elementy tekstowe, graficzne lub multimedialne (np. informacje o Produktach, zdjęcia Produktów, filmy promocyjne, opisy, komentarze) w tym utwory w rozumieniu ustawy o prawie autorskim i prawach pokrewnych oraz wizerunki osób fizycznych, jakie są zamieszczane i rozpowszechniane w ramach Sklepu Internetowego przez odpowiednio Sprzedawcę, kontrahentów Sprzedawcy, Klienta albo inną osobę korzystającą ze Sklepu Internetowego.<br />o.<span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span><span>UMOWA</span><span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span>– Umowa Sprzedaży oraz Umowa Dostarczania Treści Cyfrowych.<br />p.<span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span><span>UMOWA DOSTARCZANIA TREŚCI CYFROWYCH</span><span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span>– umowa, której przedmiotem jest dostarczenie Klientowi treści cyfrowych, które oznaczają dane wytwarzane i dostarczane w formie cyfrowej (np. e-booki, kursy), za zapłatą Ceny.<br />q.<span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span><span>UMOWA SPRZEDAŻY</span><span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span>– umowa sprzedaży w rozumieniu przepisów Kodeksu cywilnego, dotycząca sprzedaży przez Sprzedawcę na rzecz Klienta Produktu za zapłatą Ceny powiększonej o ew. opłaty dodatkowe, w tym koszty wysyłki, której warunki określa w szczególności niniejszy Regulamin. Umowa Sprzedaży jest zawierana pomiędzy Klientem a Sprzedawcą z wykorzystaniem środków porozumiewania się na odległość, po akceptacji Zamówienia przez Sprzedawcę na zasadach określonych w niniejszym Regulaminie. Umowa Sprzedaży określa w szczególności Produkt, jego główne cechy, Cenę, koszty wysyłki oraz inne istotne warunki. Każdy Produkt jest przedmiotem odrębnej Umowy Sprzedaży. Sprzedawca w ramach funkcjonalności Sklepu Internetowego z obiektywnych (rzeczowo uzasadnionych) przyczyn może zastrzec zawarcie wyłącznie jednej Umowy dla kilku Produktów z uwagi na bezpośredni związek pomiędzy Produktami – np. Zestawu Promocyjnego, według treści Regulaminu Akcji Promocyjnej.<br />r.<span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span><span>USŁUGA ELEKTRONICZNA</span><span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span>– świadczenie usług drogą elektroniczną w rozumieniu ustawy z dnia 18 lipca 2002 r. o świadczeniu usług drogą elektroniczną, przez Sprzedawcę na rzecz Klienta za pośrednictwem Sklepu Internetowego, zgodnie z Umową o Świadczenie Usług. W zakresie, w jakim usługi są świadczone przez podmioty współpracujące ze Sprzedawcą, odpowiednie postanowienia dotyczące zasad korzystania z tych usług znajdują się w regulaminach dotyczących świadczenia usług przez te podmioty.<br />s.<span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span><span>ZAMÓWIENIE</span><span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span>– oświadczenie woli Klienta wyrażające bezpośrednią wolę zawarcia Umowy Sprzedaży lub Umowy Dostarczenia Treści Cyfrowych na odległość składane z wykorzystaniem środków porozumiewania się na odległość, określające Produkt, co do którego Klient składa ofertę zawarcia Umowy oraz dane Klienta konieczne dla ewentualnego zawarcia i wykonania Umowy. Zamówienie każdego Produktu będzie traktowane jako niezależna oferta Klienta zawarcia Umowy (ułatwienie techniczne). Podczas trwania Akcji Promocyjnej, Sprzedawca w ramach funkcjonalności Sklepu Internetowego z obiektywnych przyczyn może uzależnić zawarcie jednej Umowy dla kilku Produktów w ramach Zestawu Promocyjnego, z uwagi na bezpośredni związek pomiędzy Produktami. Zamówieniu może zostać nadany jeden numer, a wszystkie oferty będą procedowane równolegle. Akceptacja Zamówienia oznacza zawarcie Umowy.</p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;text-align:center;\"><br /><br /><span>§ 2.</span></p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;text-align:center;\"><span>ZASADY KORZYSTANIA ZE SKLEPU INTERNETOWEGO</span></p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"><br /><br />W zasadach korzystania z naszego sklepu wyjaśniamy, jakie minimalne wymagania techniczne musisz spełnić, żeby bez problemów korzystać z naszego sklepu. Nie martw się, nie ma ich dużo.<br /><br />1. Korzystanie ze Sklepu Internetowego może odbywać się wyłącznie na zasadach i w zakresie wskazanym w Regulaminie.<br />2. Korzystanie ze Sklepu Internetowego wymaga spełnienia przez urządzenie końcowe i system teleinformatyczny, z którego korzysta Klient, odpowiednich wymagań technicznych. Minimalne wymagania techniczne urządzenia Użytkownika umożliwiające pełne i poprawne korzystanie ze Sklepu Internetowego:<br />a. urządzenie z dostępem do sieci Internet;<br />b. najnowsza wersja przeglądarki internetowej.<br />3. Sprzedawca oświadcza, iż dokłada wszelkich starań, aby zapewnić Użytkownikom stały dostęp do Sklepu Internetowego i świadczonych Usług. Jednakże Sprzedawca nie udziela gwarancji, że korzystanie ze Sklepu Internetowego będzie przebiegało bez błędów i przerw technicznych. Sprzedawca zastrzega sobie prawo do zawieszenia lub ograniczenia dostępu do Sklepu Internetowego w dowolnym terminie, bez konieczności uprzedniego informowania o tym Klientów.<br />4. Sprzedawca nie ponosi odpowiedzialności za zawartość i treści innych serwisów oraz portali, do których może zostać przekierowany Klient, korzystając z linków umieszczonych w Sklepie Internetowym.</p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;text-align:center;\"><br /><br /><span>§ 3.</span></p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;text-align:center;\"><span>USŁUGI ELEKTRONICZNE W SKLEPIE INTERNETOWYM</span></p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"><br /><br />W części trzeciej wskazujemy jakie usługi elektronicznym są dostępne w naszym sklepie. Usługa elektroniczna to np. koszyk, czy newsletter. Wyjaśniamy jak złożyć reklamacje na usługi elektroniczne.<br /><br />1. Sprzedawca świadczy za pośrednictwem Sklepu Internetowego nieodpłatnie następujące Usługi Elektroniczne na rzecz Klientów:<br />a. Konto Klienta, w przypadku jego rejestracji;<br />b. umożliwianie Klientom składania Zamówień, zawierania Umów Sprzedaży oraz Umowy Dostarczenia Treści Cyfrowych, na zasadach określonych w niniejszym Regulaminie;<br />c. prezentowanie Klientom dopasowanych do ich zainteresowań treści reklamowych;<br />d. umożliwienie Klientom korzystania z usług Koszyka;<br />e. umożliwienie przeglądania Treści umieszczonych w ramach Sklepu, w tym treści o charakterze marketingowym;<br />f. umożliwienie zamieszczania opinii o produkcie ;<br />g. Newsletter.<br />2. Sprzedawca dodatkowo, na rzecz Klientów którzy utworzyli Konto, świadczy nieodpłatnie za pośrednictwem Sklepu Internetowego następujące usługi:<br />a. podtrzymywanie sesji Klienta po zalogowaniu się przez niego do Konta (za pomocą przeglądarki);<br />b. przechowywanie i udostępnianie Klientowi za pośrednictwem Konta historii Zamówień;<br />c. śledzenie statusu Zamówienia;<br />d. umożliwienie zmiany danych Klienta w Koncie;<br />e. umożliwianie dodawanie produktów do Listy Marzeń;<br />f. przesyłanie wiadomości przypominającej o produktach znajdujących się w Koszyku Klienta.<br />3. Korzystanie z Konta możliwe jest po wykonaniu łącznie kolejnych kroków przez Klienta:<br />a. Wypełnieniu formularza rejestracji, wyrażeniu zgody na przetwarzanie danych osobowych, zaakceptowaniu postanowień niniejszego Regulaminu ;<br />b. Skutecznym zarejestrowaniu się, co zostanie potwierdzone mailem z BOK Sklepu Internetowego.<br />4. Umowa o Świadczenie Usług zostaje zawarta z chwilą otrzymania przez Klienta potwierdzenia rejestracji Konta Klienta, wysłanego przez Sprzedawcę na adres email podany przez Klienta w toku rejestracji. Konto świadczone jest nieodpłatnie przez czas nieoznaczony. Klient ma możliwość, w każdej chwili i bez podania przyczyny, usunięcia Konta (rezygnacji z Konta) poprzez wysłanie stosownego żądania do Sprzedawcy, w szczególności za pośrednictwem poczty elektronicznej na adres:<span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span><a href=\"mailto:hello@moonsister.pl\" style=\"padding:0px 0px 5px;background:no-repeat 50% 86%;\">hello@moonsister.pl</a><span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span>lub też pisemnie na adres Sprzedawcy. Założenie Konta nie jest wymagane aby złożyć Zamówienie w Sklepie Internetowym. Sprzedawca może jednak wprowadzić takie ograniczenie w ramach funkcjonalności Sklepu Internetowego, w szczególności z uwagi na związek danego Produktu lub rodzaju Produktów z usługami świadczonymi w ramach Konta.<br />5. Korzystanie z Koszyka rozpoczyna się z momentem dodania przez Klienta pierwszego Produktu do Koszyka.<br />6. Koszyk świadczony jest nieodpłatnie oraz ma charakter jednorazowy i ulega zakończeniu z chwilą złożenia Zamówienia za jego pośrednictwem albo z chwilą wcześniejszego zaprzestania składania Zamówienia za jego pośrednictwem przez Klienta.<br />7. Klient zobowiązany jest w szczególności do:<br />a. podawania w udostępnionych w ramach Sklepu Internetowego formularzach wyłącznie prawdziwych, aktualnych i wszystkich koniecznych danych Klienta;<br />b. niezwłocznego aktualizowania danych, w tym danych osobowych, podanych przez Klienta Sprzedawcy w związku z zawarciem Umowy o Świadczenie Usług, Umowy Sprzedaży lub Umowy Dostarczenia Treści Cyfrowych, w szczególności w zakresie w jakim jest to konieczne dla prawidłowego ich wykonania; Klient ma możliwość zmiany danych wprowadzonych podczas tworzenia Konta w każdym czasie korzystając z opcji dostępnych w ramach Konta;<br />c. korzystania z usług i funkcjonalności udostępnianych przez Sprzedawcę w sposób niezakłócający funkcjonowania Sprzedawcy i Sklepu Internetowego;<br />d. korzystania z usług i funkcjonalności udostępnianych przez Sprzedawcę w sposób zgodny z przepisami obowiązującego prawa, postanowieniami Regulaminu, a także z przyjętymi w danym zakresie zwyczajami i zasadami współżycia społecznego;<br />e. korzystania z usług i funkcjonalności udostępnianych przez Sprzedawcę w sposób nieuciążliwy dla pozostałych Klientów oraz dla Sprzedawcy;<br />f. terminowej zapłaty Ceny i innych ustalonych przez Klienta i Sprzedawcę kosztów w pełnej wysokości;<br />g. terminowego odbioru Produktów;<br />h. weryfikacji przy przewoźniku (kurierze), że towar został dostarczony w całości, bez usterek. W przypadku zniszczenia towaru przez przewoźnika, należy spisać protokół szkody oraz poinformować o tym Sprzedawcę;<br />i. niedostarczania i nieprzekazywania w ramach Sklepu jakichkolwiek Treści zabronionych, w szczególności Treści naruszających majątkowe prawa autorskie osób trzecich albo ich dobra osobiste;<br />j. niepodejmowania działań takich jak:<br />• rozsyłanie lub umieszczanie w Sklepie Internetowym Treści naruszających przepisy prawa (zakaz umieszczania treści bezprawnych);<br />• podejmowanie czynności informatycznych lub wszelkich innych czynności mających na celu wejście w posiadanie informacji nieprzeznaczonych dla Klienta, w tym danych innych Klientów lub ingerencję w zasady lub techniczne aspekty funkcjonowania Sklepu i realizowania płatności;<br />• modyfikowania w sposób nieuprawniony Treści dostarczanych przez Sprzedawcę, w szczególności podanych w ramach Sklepu Internetowego Cen lub opisów Produktów.<br />8. Reklamacje związane ze świadczeniem Usług Elektronicznych można składać mailowo lub na adres Sprzedawcy.<br />9. Zaleca się podanie przez Klienta w opisie reklamacji: (1) informacji i okoliczności dotyczących przedmiotu reklamacji, w szczególności rodzaju i daty wystąpienia nieprawidłowości; (2) żądania Klienta oraz (3) danych kontaktowych podmiotu, na który został nabyty towar oraz dane składającego reklamację (4) numer zamówienia – ułatwi to i przyspieszy rozpatrzenie reklamacji przez Sprzedawcę. Wymogi podane w zdaniu poprzednim mają formę jedynie zalecenia i nie wpływają na skuteczność reklamacji złożonych z pominięciem zalecanego opisu reklamacji.<br />10. Ustosunkowanie się do reklamacji przez Sprzedawcę następuje niezwłocznie, nie później niż w terminie 14 dni od dnia jej złożenia, chyba, że z przepisów prawa lub odrębnych regulaminów wynika inny termin.</p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;text-align:center;\"><br /><br /><span>§ 4.</span></p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;text-align:center;\"><span>WARUNKI ZAWIERANIA UMOWY</span></p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"><br /><br />To bardzo ważna część, w której wyjaśniamy w jaki sposób możesz nabyć produkty, czyli zawrzeć z nami umowę sprzedaży lub dostarczania treści cyfrowych.<br /><br />1. Główne cechy świadczenia z uwzględnieniem przedmiotu świadczenia oraz sposobu porozumiewania się z Klientem są określone na stronie Produktu lub w inny właściwy dla danego Produktu sposób, w ramach Sklepu Internetowego.<br />2. W ramach rozwoju dostępnych w Sklepie Internetowym Produktów lub usług oraz z uwagi na ich specyfikę, Sprzedawca może wprowadzić ograniczenia co do sposobów składania Zamówień na określone Produkty. W przypadku składania kilku Zamówień jednocześnie, z których wobec przynajmniej jednego zastosowanie znajduje ograniczenie, o którym mowa powyżej, może to wpłynąć na dostępność sposobów składania Zamówień również dla pozostałych z nich.<br />3. Zawarcie Umowy między Klientem, a Sprzedawcą następuje po uprzednim złożeniu przez Klienta Zamówienia.<br />4. Sprzedawca umożliwia Klientowi złożenie Zamówienia za pośrednictwem Sklepu Internetowego w następujący sposób, kolejno:<br />a. Klient dodaje wybrany/e Produkt/y do Koszyka po czym przechodzi do formularza zamówienia.<br />b. Klient posiadający Konto potwierdza w formularzu zamówienia aktualność danych koniecznych do zawarcia i realizacji Umowy. Użytkownik, który nie posiada Konta musi samodzielnie wypełnić formularz zamówienia w zakresie jego danych niezbędnych do zawarcia i realizacji Umowy . W każdym przypadku podanie nieaktualnych lub nieprawdziwych danych Klienta może uniemożliwić realizację Umowy. W formularzu zamówienia niezbędne jest podanie przez Klienta następujących danych dotyczących Klienta: imię i nazwisko, adres (ulica, numer domu/mieszkania, kod pocztowy, miejscowość, kraj), adres poczty elektronicznej, numer telefonu kontaktowego oraz danych dotyczących Umowy: Produkt/y, ilość Produktu/ów, w razie dostępności rodzaj, kolor i rozmiar Produktu, miejsce i sposób dostawy Produktu/ów, sposób płatności. W wypadku Klientów niebędących Konsumentami niezbędne jest także podanie firmy oraz numeru NIP. W przypadku Przedsiębiorców – Klientów, Sprzedawca może prosić o wskazanie numerów PKD przedsiębiorcy.<br />c. W przypadku Umowy Dostarczania Treści Cyfrowych Produkt zostanie udostępniony za pośrednictwem wiadomości mailowej zawierającej link do Produktu przesłanej przez Sprzedawcę na wskazany przez Klienta adres mailowy.<br />d. Klient wybiera sposób zapłaty Ceny i ewentualnych pozostałych wskazanych w formularzu zamówienia sumarycznych kosztów realizacji Umowy.<br />e. Klient przesyła Sprzedawcy Zamówienie (składa ofertę). W przypadku Klienta, który nie posiada Konta i nie akceptował wcześniej Regulaminu, wymagana jest akceptacja Regulaminu.<br />f. W trakcie składania Zamówienia, do momentu naciśnięcia przycisku potwierdzającego zamówienie Klient ma możliwość samodzielnego korygowania wprowadzonych danych w ramach panelu „Koszyk” poprzez dodanie lub usunięcie danej pozycji z Koszyka. Usunięcie danej pozycji może spowodować automatycznie usunięcie również innej pozycji z Koszyka z uwagi na bezpośredni związek pomiędzy Produktami.<br />g. W zależności od wybranego sposobu zapłaty, Klient może zostać przekierowany do stron zewnętrznego dostawcy usług płatniczych, w celu dokonania płatności;<br />5. Sprzedawca w odpowiedzi na Zamówienie niezwłocznie wysyła do Klienta automatyczną wiadomość na podany w tym celu przez Klienta adres e-mail z potwierdzeniem otrzymania Zamówienia.<br />6. Po zweryfikowaniu Zamówienia, bez nieuzasadnionego opóźnienia, Sprzedawca wysyła do Klienta na podany adres e mail wiadomość z:<br />a. potwierdzeniem przyjęcia jednej lub kilku poszczególnych ofert na Produkty, złożonych w ramach Zamówienia i potwierdzeniem zawarcia Umowy (akceptacja Zamówienia w zakresie Produktów wskazanych w wiadomości); albo<br />b. informacją o braku możliwości przyjęcia wszystkich ofert na Produkty, złożonych w ramach Zamówienia, z powodu braku płatności, albo<br />c. informacją, o nieodebraniu przesyłki.<br />7. Umowa zostaje zawarta z chwilą potwierdzenia ofert(y) tj. otrzymania przez Klienta wiadomości, o której mowa powyżej w zakresie wskazanych w niej Produktów.<br />8. W przypadku braku możliwości przyjęcia wszystkich lub niektórych złożonych w ramach Zamówienia ofert, BOK skontaktuje się z Klientem w celu :<br />a. poinformowania Klienta o braku możliwości przyjęcia wszystkich złożonych w ramach Zamówienia ofert zawarcia Umowy; albo<br />b. potwierdzenia przez Klienta woli realizacji Zamówienia w części, w jakiej Sprzedawca zgodził się przyjąć oferty zawarcia Umowy. Wówczas Klient może anulować w całości złożone Zamówienie (w zakresie wszystkich ofert), co nie narusza jego prawa do odstąpienia od umowy. Anulowanie Zamówienia przez Klienta zwalnia Sprzedawcę z obowiązku jego realizacji. W przypadku anulowania Zamówienia, odpowiednie zastosowanie znajduje poniższy pkt..<br />9. W przypadku braku możliwości przyjęcia ofert/y złożonych w ramach Zamówienia, Umowa w zakresie wskazanych przez BOK Produktów nie zostaje zawarta, a Sprzedawca niezwłocznie, nie później niż w ciągu 14 dni zwraca Klientowi uiszczone przez niego płatności, w zakresie w jakim Umowa nie została zawarta.<br />10. Niezależnie, Sprzedawca może informować Klienta o statusie Zamówienia, w szczególności wysyłając wiadomości na podany przez Klienta adres e-mail, SMS lub kontaktując się telefonicznie.<br />11. Sprzedawca dąży do zapewnienia dostępności wszystkich Produktów oraz realizacji Umowy. W przypadku braku możliwości spełnienia świadczenia oraz w innych sytuacjach określonych przepisami prawa, mogą mieć zastosowanie odpowiednie przepisy Kodeksu cywilnego, w tym art. 493-495 Kodeksu cywilnego, w szczególności dotyczące obowiązku niezwłocznego zwrotu świadczenia na rzecz Konsumenta.<br />12. Całkowita wartość Zamówienia obejmuje Cenę, koszty przesyłki oraz ew. inne koszty wybranych przez Klienta fakultatywnych płatnych usług. Sprzedawca może w wybranym przez siebie okresie określić próg minimalnej wartości Zamówienia, dla której przesyłka Produktów jest darmowa. O łącznej cenie wraz z podatkami Produktu będącego przedmiotem Zamówienia, a także o kosztach dostawy (w tym opłatach za transport, dostarczenie i usługi pocztowe) oraz o innych kosztach, a gdy nie można ustalić wysokości tych opłat – o obowiązku ich uiszczenia, Klient jest informowany w trakcie składania Zamówienia, w tym także w chwili wyrażenia przez Klienta woli związania się Umową.<br />13. Akcje Promocyjne obowiązujące w Sklepie Internetowym nie łączą się, o ile postanowienia Promocji wyraźnie nie stanowią inaczej.<br />14. Każda z przeprowadzanych Akcji Promocyjnych posiada odpowiedni Regulamin Akcji Promocyjnej. W przypadku obowiązywania Akcji Promocyjnej, przepisy Regulaminu Akcji Promocyjnej mają pierwszeństwo przed przepisami niniejszego Regulaminu. W kwestiach nieujętych w Regulaminie Akcji Promocyjnej, zastosowanie znajdują przepisy niniejszego Regulaminu.</p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;text-align:center;\"><br /><br /><span>§ 5.</span></p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;text-align:center;\"><span>SPOSOBY I TERMINY PŁATNOŚCI ZA PRODUKT</span></p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"><br /><br />Jeśli chcesz dowiedzieć się więcej o tym w jaki sposób możesz zapłacić za produkty w naszym sklepie – wszystkie informacje znajdziesz w części piątej naszych zasad.<br /><br />1. Sprzedawca udostępnia Klientowi rożne sposoby płatności z tytułu Umowy, w szczególności płatności elektroniczne i płatności kartą płatniczą, za pośrednictwem upoważnionych serwisów zewnętrznych, zgodnie z informacjami udostępnionymi w ramach Sklepu Internetowego.<br />2. Możliwe aktualne sposoby płatności określone są w Sklepie Internetowym, w chwili wyrażenia przez Klienta woli związania się Umową. Dostępne sposoby płatności mogą zależeć od wybranego przez Klienta sposobu dostawy lub Produktu. Dostępne sposoby płatności mogą ulegać zmianie w przypadku składania kilku Zamówień jednocześnie, w szczególności z uwagi na Produkty nimi objęte.<br />3. Rozliczenia transakcji płatnościami elektronicznymi i kartą płatniczą przeprowadzane są zgodnie z wyborem Klienta za pośrednictwem upoważnionych serwisów.<br />4. W przypadku nieotrzymania przez Sprzedawcę płatności Klienta, który wybrał płatność z góry, tj. blikiem, płatność elektroniczną albo płatność kartą płatniczą, BOK może skontaktować się z Klientem celem przypomnienia o płatności i porzuconym koszyku, w tym wysyłając wiadomość e-mail (mail transakcyjny). Nieuiszczenie płatności w ciągu 2 dni od złożenia Zamówienia, a następnie w dodatkowym 2 dniowym terminie spowoduje brak przyjęcia złożonej przez Klienta w ramach Zamówienia oferty. Klient może również do momentu otrzymania wiadomości o wysłaniu Zamówienia anulować je bez ponoszenia konsekwencji, kontaktując się ze Sprzedawcą przez BOK, co nie narusza jego prawa do odstąpienia od umowy.</p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;text-align:center;\"><br /><br /><span>§ 6.</span></p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;text-align:center;\"><span>KOSZT, SPOSOBY I TERMIN DOSTAWY PRODUKTU</span></p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"><br /><br />Dostawa produktu to bardzo istotka część transakcji. Staramy się dostarczyć do Ciebie produkt najszybciej, jak jest to możliwe.<br /><br />1. Dostawa Produktów zakupionych w ramach Umowy Sprzedaży odbywa się za pośrednictwem operatora pocztowego wybranego przez Klienta w trakcie składania zamówienia.<br />2. Dostawa Produktu do Klienta jest odpłatna, chyba że Umowa Sprzedaży stanowi inaczej. Dostępne aktualnie koszty dostawy Produktu są wskazywane Klientowi w Sklepie Internetowym w chwili wyrażenia przez Klienta woli związania się Umową Sprzedaży.<br />3. W przypadku zawarcia przez Klienta Umowy Dostarczenia Treści Cyfrowych Produkt zostanie udostępniony za pośrednictwem wiadomości mailowej zawierającej link do Produktu. Wiadomość mailowe zostanie skierowana na podany przez Klienta adres mailowy, a doręczenie Produktu będzie darmowe.<br />4. Dostępne sposoby dostawy mogą zależeć od wybranego przez Klienta sposobu płatności lub Produktu. Dostępne sposoby dostawy mogą ulegać zmianie w przypadku składania kilku Zamówień jednocześnie, w szczególności z uwagi na Produkty nimi objęte.<br />5. Na łączny termin oczekiwania na otrzymanie przez Klienta Produktu (termin dostawy) składa się czas przygotowania Zamówienia do wysyłki przez Sprzedawcę (do 7 dni roboczych od daty złożenia zamówienia) oraz w przypadku Produktów zakupionych w ramach Umowy Sprzedaży czas doręczania Produktu przez przewoźnika.<br />6. W przypadku zakupu Produktu w ramach przedsprzedaży (tj. przed wprowadzeniem go do oferty Sklepu Internetowego) termin oczekiwania na otrzymanie przez Klienta Produkt zostanie określony na karcie produktu.<br />7. W przypadki treści cyfrowych, Sprzedawca nie wprowadza ograniczeń terytorialnych w zakresie dostarczenia treści cyfrowych.<br />8. Doręczenie treści cyfrowych jest darmowe</p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;text-align:center;\"><br /><br /><span>§ 7.</span></p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;text-align:center;\"><span>REKLAMACJA PRODUKTU</span></p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"><br /><br />Przykładamy wielką uwagę do staranności wykonania naszych produktów. Jednak jeśli masz jakiekolwiek zastrzeżenia wobec zakupionego towaru – sprawdź jak w łatwy sposób złożyć u nas reklamację.<br /><br />1. Klient będący Konsumentem jest uprawniony do dokonania reklamacji zakupionego Produktu. Prawa zawarte w pkt. 8 przysługują również Przedsiębiorcom – Konsumentom.<br />2. Podstawa i zakres odpowiedzialności Sprzedawcy względem Klienta, jeżeli sprzedany Produkt ma wadę fizyczną lub prawną (rękojmia) są określone w przepisach ustawy Kodeks Cywilny, w szczególności w art. 556 i następnych Kodeksu Cywilnego.<br />3. Sprzedawca obowiązany jest dostarczyć Klientowi Produkt bez wad.<br />4. Reklamacja może zostać złożona przez Klienta na przykład<br />a. pisemnie na adres Sprzedawcy;<br />b. w formie elektronicznej za pośrednictwem poczty elektronicznej na adres:<span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span><a href=\"mailto:hello@moonsister.pl\" style=\"padding:0px 0px 5px;background:no-repeat 50% 86%;\">hello@moonsister.pl.</a><br />5. Jeżeli sprzedany Produkt ma wadę, Klient może:<br />a. złożyć oświadczenie o obniżeniu Ceny albo odstąpieniu od Umowy, chyba że Sprzedawca niezwłocznie i bez nadmiernych niedogodności dla Klienta wymieni wadliwy Produkt na wolny od wad albo wadę taką usunie. Obniżona cena powinna pozostawać w takiej proporcji do ceny wynikającej z umowy, w jakiej wartość Produktu z wadą pozostaje do wartości Produktu bez wady. Klient nie może odstąpić od umowy, jeżeli wada Produktu jest nieistotna;<br />b. żądać wymiany Produktu na wolny od wad albo usunięcia wady. Sprzedawca jest zobowiązany wymienić wadliwy Produkt na wolny od wad albo usunąć wadę w rozsądnym czasie bez nadmiernych niedogodności dla Klienta; z zastrzeżeniami i na zasadach określonych we właściwych przepisach Kodeksu cywilnego.<br />6. Klient może zamiast zaproponowanego przez Sprzedawcę usunięcia wady żądać wymiany Produktu na wolny od wad albo zamiast wymiany Produktu żądać usunięcia wady, chyba że doprowadzenie Produktu do zgodności z umową w sposób wybrany przez Konsumenta jest niemożliwe albo wymagałoby nadmiernych kosztów w porównaniu ze sposobem proponowanym przez Sprzedawcę. Przy ocenie nadmierności kosztów uwzględnia się wartość Produktu wolnego od wad, rodzaj i znaczenie stwierdzonej wady, a także bierze się pod uwagę niedogodności, na jakie narażałby Konsumenta inny sposób zaspokojenia.<br />7. Zaleca się podanie przez Klienta w opisie reklamacji: (1) informacji i okoliczności dotyczących przedmiotu reklamacji, w szczególności rodzaju i daty wystąpienia wady; (2) żądania sposobu doprowadzenia Produktu do zgodności z Umową lub oświadczenia o obniżeniu ceny albo odstąpieniu od Umowy; oraz (3) danych kontaktowych składającego reklamację – ułatwi to i przyspieszy rozpatrzenie reklamacji przez Sprzedawcę. Wymogi podane w zdaniu poprzednim mają formę jedynie zalecenia i nie wpływają na skuteczność reklamacji złożonych z pominięciem zalecanego opisu reklamacji.<br />8. Sprzedawca ustosunkuje się do reklamacji Klienta niezwłocznie, nie później niż w terminie 14 dni od dnia jej otrzymania. Jeżeli Klient zażądał wymiany rzeczy lub usunięcia wady albo złożył oświadczenie o obniżeniu ceny, określając kwotę, o którą cena ma być obniżona, a Sprzedawca nie ustosunkował się do tego żądania w terminie 14 dni od dnia jej otrzymania, uważa się, że żądanie to uznał za uzasadnione.<br />9. W przypadku, gdy do ustosunkowania się przez Sprzedawcę do reklamacji Klienta lub do wykonania uprawnień Klienta wynikających z rękojmi niezbędne będzie dostarczenie Produktu do Sprzedawcy, zgodnie z art. 5612 w zw. z art. 354 § 2 Kodeksu Cywilnego, Klient zobowiązany będzie dostarczyć Produkt na koszt Sprzedawcy.<br />10. Sprzedawca odpowiada z tytułu rękojmi, jeżeli wada fizyczna zostanie stwierdzona przed upływem dwóch lat od dnia wydania Produktu Klientowi. Roszczenie o usunięcie wady lub wymianę Produktu na wolny od wad przedawnia się z upływem roku licząc od dnia stwierdzenia wady, jednak w przypadku Zamówienia złożonego przez Konsumenta – bieg terminu przedawnienia nie może zakończyć się przed upływem terminu, o którym mowa w zdaniu pierwszym.</p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;text-align:center;\"><br /><br /><span>§ 8.</span></p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;text-align:center;\"><span>PRAWO ODSTĄPIENIA OD UMOWY</span></p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"><br /><br />Wiemy, że nie czasem konsumenci chcą skorzystać z ustawowego prawa do zwrotu. W pełni to rozumiemy. Sprawdź jak szybko i bez problemów możesz dokonać u nas odstąpienia od zawartej umowy.<br /><br />1. Klient, będący Konsumentem, który zawarł umowę na odległość, może odstąpić od niej bez podawania przyczyny i bez ponoszenia jakichkolwiek kosztów, poza tymi, które zostały przewidziane przez przepisy prawa, w terminie 14 dni od dnia objęcia w posiadanie zakupionego produktu. Regulacje niniejszej Polityki Zwrotów dotyczą również Przedsiębiorcy – Konsumenta, który oświadcza, że korzysta z uprawnienia do odstąpienia od umowy na podstawie art. 38a ustawy z dnia 30 maja 2014 r. o prawach konsumenta, gdyż zawarł umowę bezpośrednio związaną z jego działalnością gospodarczą, a sama umowa nie posiada dla niego charakteru zawodowego.<br />2. Do zachowania terminu wystarczy złożenie przez Konsumenta lub Przedsiębiorcę – Konsumenta oświadczenia Sprzedawcy przed jego upływem. Konsument lub Przedsiębiorca - Konsument może złożyć jakiekolwiek jednoznaczne oświadczenie, w którym poinformuje o swoim odstąpieniu od Umowy.<br />3. Oświadczenie o odstąpieniu od Umowy może zostać złożone na przykład w następujących formach:<br />a. pisemnie na adres: Moonsister.pl, ul. Zelwerowicza 11/2, 02-928 Warszawa;<br />b. w formie elektronicznej na adres:<span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </span><a href=\"mailto:hello@moonsister.pl\" style=\"padding:0px 0px 5px;background:no-repeat 50% 86%;\">hello@moonsister.pl.</a><br />4. Konsument i Przedsiębiorca - Konsument może skorzystać z wzoru Formularza Zwrotu, jednak nie ma takiego obowiązku.<br />5. Konsument i Przedsiębiorca – Konsument ponosi koszt dokonania zwrotu Produktu.<br />6. Bieg terminu do odstąpienia od Umowy rozpoczyna się od dnia objęcia produktów w posiadanie przez Konsumenta, Przedsiębiorcę - Konsumenta lub wskazaną przez niego osobę trzecią inną niż przewoźnik (pełnomocnika), a w przypadku Umowy, która obejmuje wiele produktów, które są dostarczane osobno, partiami lub w częściach – od objęcia w posiadanie ostatniego produktu, partii lub części.<br />7. Konsument i Przedsiębiorca - Konsument ma obowiązek niezwłocznie, nie później niż w terminie 14 dni od dnia, w którym odstąpił od Umowy, zwrócić produkt Sprzedawcy. Do zachowania terminu wystarczy odesłanie produktu przed jego upływem. Konsument musi zwrócić produkt na adres: Moonsister.pl, ul. Zelwerowicza 11/2, 02-928 Warszawa.<br />8. Konsument i Przedsiębiorca - Konsument powinien zabezpieczyć zwracany produkt w taki sposób, by nie uległ on zniszczeniu w czasie transportu.<br />9. W przypadku skutecznego odstąpienia od umowy zawartej na odległość umowę uważa się za niezawartą.<br />10. Sprzedawca ma obowiązek niezwłocznie, nie później jednak niż w terminie 14 dni od dnia otrzymania oświadczenia Konsumenta lub Przedsiębiorcy – Konsumenta o odstąpieniu od umowy, zwrócić Konsumentowi wszystkie dokonane przez niego płatności, w tym koszty dostawy produktu (z wyjątkiem dodatkowych kosztów wynikających z wybranego przez Klienta sposobu dostawy innego niż najtańszy zwykły sposób dostawy dostępny w Sklepie Internetowym). Możemy się wstrzymać z przesłaniem zwrotu środków do czasu odebrania zwracanych towarów lub przesłania nam potwierdzenia nadania paczki.<br />11. W przypadku skorzystania przez Konsumenta lub Przedsiębiorcę - Konsumenta z Ustawowego prawa odstąpienia, Sprzedawca dokonuje zwrotu płatności przy użyciu takiego samego sposobu płatności, jakiego użył Konsument, chyba że wyraźnie zgodził się na inny sposób zwrotu, który nie wiąże się dla niego z żadnymi kosztami.<br />12. W przypadku skorzystania przez Konsumenta lub Przedsiębiorcę - Konsumenta z Ustawowego prawa odstąpienia, Konsument lub Przedsiębiorca - Konsument ponosi odpowiedzialność za zmniejszenie wartości produktu będące wynikiem korzystania z niego w sposób wykraczający poza konieczny do stwierdzenia charakteru, cech i funkcjonowania produktu lub w związku z nieprawidłową pielęgnacją produktu lub niewłaściwego zapakowania produktu podczas jego odsyłania do Sprzedawcy. Odpowiedzialność Konsumenta lub Przedsiębiorcę – Konsumenta może obejmować w szczególności brak możliwości wprowadzenia produktu do sprzedaży jako produktu pełnowartościowego, koszty ponownego umieszczenia na produkcie metek i elementów zabezpieczających, a także koszty przywrócenia Produktu do stanu umożliwiającego jego ponowne wprowadzenie do sprzedaży w ramach Sklepu Internetowego, w tym koszty badania produktu przez specjalistę i koszty usunięcia wad stwierdzonych w wyniku takiego badania (w zakresie, w jakim wady te wynikają z korzystania przez Konsumenta z produktu w sposób wykraczający poza konieczny do stwierdzenia jego charakteru, cech i funkcjonowania).<br />13. Ustawowe prawo odstąpienia nie przysługuje Konsumentowi i Przedsiębiorcy – Konsumentowi w przypadku:<br />a. przekroczenia terminu 14 dni na poinformowanie Sprzedawcy o woli odstąpienia od umowy sprzedaży;<br />b. gdy przedmiotem umowy sprzedaży jest rzecz nieprefabrykowana, wyprodukowana według specyfikacji Klienta lub służąca zaspokojeniu jego zindywidualizowanych potrzeb;<br />c. gdy przedmiotem umowy sprzedaży jest produkt, który znajdował się w zapieczętowanych opakowaniach, których otwarcie uniemożliwia zwrot ze względów ochrony zdrowia lub/i higienicznych;<br />14. Prawo do odstąpienia od umowy nie przysługuje w odniesieniu do Umów Dostarczenia Treści Cyfrowych jeżeli spełnianie świadczenia rozpoczęło się za wyraźną zgodą Konsumenta przed upływem terminu do odstąpienia od umowy i po poinformowaniu go przez Sprzedawcę o utracie prawa odstąpienia od umowy. Chwilą rozpoczęcia świadczenia jest doręczenie Kupującemu wiadomości e-mail z instrukcją uzyskania dostępu do treści cyfrowych.<br /><br /></p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;text-align:center;\"><br /><span>§ 9.</span></p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;text-align:center;\"><span>OPINIE ZAMIESZCZONE W SKLEPIE INTERNETOWYM</span></p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"><br /><br />Nasz sklep, jak wiele innych podmiotów e-commerce zbiera opinie o produktach i transakcji. Staramy się, aby ten proces był maksymalnie transparentny. Zależy nam na rzetelnych opiniach od zweryfikowanych klientów. W związku z tym w tej części Regulaminu tłumaczmy, jakie zasady obowiązują w naszym sklepie odnośnie zamieszczania opinii i komentarzy.<br /><br />1. Klient Sklepu Internetowego po dokonaniu transakcji i otrzymaniu produktów ma możliwość zamieścić opinie:<br />a. na Stronie Internetowej, poprzez dodanie komentarza na karcie produktu;<br />b. lub może zostać poproszony przez BOK za pośrednictwem maila o dodanie opinii o zakupionym produkcie i przebiegu transakcji;<br />2. Dodanie opinii przez Klienta jest w pełni dobrowolne.<br />3. Wypełniając formularz opinii Klient wyraża zgodę na opublikowanie zawartych w nim treść w szczególności komentarza dotyczącego danego produktu oraz udostępnienie jego danych osobowych w zakresie niezbędnym do zamieszczenia opinii. Dane osobowe są chronione zgodnie z naszą Polityką prywatności.<br />4. Opinie zamieszczone w Sklepie Internetowym nie są w żaden sposób sponsorowane, a ich treść nie ma wpływu na warunki przyszłych umów zawieranych ze Sprzedawcą.<br />5. Jesteśmy rzetelni, na naszej Stronie Internetowej zamieszczamy wszystkie dodane opinie, zarówno pozytywne jak i negatywne, o ile ich treść nie narusza przepisów Regulaminu lub przepisów obowiązującego prawa. Nie publikujemy opinii, które zawierają słowa uznane za obelżywe, zniesławienie lub wzywają do nienawiści.<br />6. Opinie zamieszczane w naszym Sklepie Internetowym podlegają weryfikacji pod kątem sporządzania ich przez naszych Klientów, którzy rzeczywiście dokonali zakupu danego produktu. Ww. weryfikacji przeprowadzana jest poprzez porównanie danych Klientów dokonujących zakupu opiniowanych produktów z danymi osób zamieszczających opinię.</p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;text-align:center;\"><br /><br /><span>§ 10.</span></p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;text-align:center;\"><span>POZASĄDOWE SPOSOBY ROZPATRYWANIA REKLAMACJI I DOCHODZENIA ROSZCZEŃ ORAZ ZASADY DOSTĘPU DO TYCH PROCEDUR</span></p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"><br /><br />Wychodzimy z założenia, że w przypadku różnicy zdań z Klientem warto rozmawiać i dążyć do wzajemnego porozumienia na drodze polubownej. Zobacz, w jaki sposób możemy rozwiązać spór.<br /><br />Skorzystanie z pozasądowych sposobów rozpatrywania reklamacji i dochodzenia roszczeń ma charakter dobrowolny. Poniższe zapisy mają charakter informacyjny i nie stanowią zobowiązania Sprzedawcy do skorzystania z pozasądowych sposobów rozwiązywania sporów. Oświadczenie Sprzedawcy o zgodzie lub odmowie wzięcia udziału w postępowaniu w sprawie pozasądowego rozwiązywania sporów konsumenckich składane jest przez Sprzedawcę na papierze lub innym trwałym nośniku w przypadku, gdy w następstwie złożonej przez Konsumenta reklamacji spór nie został rozwiązany.<br />1. Zasady prowadzenia postępowań w sprawie pozasądowego rozwiązywania sporów konsumenckich oraz obowiązki przedsiębiorców w tym zakresie określone są odrębnie w przepisach prawa (w tym w szczególności w ustawie z dnia 23 września 2016 r. o pozasądowym rozwiązywaniu sporów konsumenckich) lub w regulacjach stosowanych przez odpowiednie podmioty właściwe w zakresie rozwiązywania sporów konsumenckich. Szczegółowe informacje dotyczące możliwości skorzystania przez Klienta będącego Konsumentem z pozasądowych sposobów rozpatrywania reklamacji i dochodzenia roszczeń oraz zasady dostępu do tych procedur mogą być dostępne w siedzibach oraz na stronach internetowych powiatowych (miejskich) rzeczników konsumentów, organizacji społecznych, do których zadań statutowych należy ochrona konsumentów, Wojewódzkich Inspektoratów Inspekcji Handlowej, w szczególności również pod następującym adresem internetowym Urzędu Ochrony Konkurencji i Konsumentów https://www.uokik.gov.pl/pozasadowe_rozwiazywanie_sporow_konsumenckich.php. Prezes Urzędu Ochrony Konkurencji i Konsumentów prowadzi jawny rejestr podmiotów uprawnionych do prowadzenia postępowania w sprawie pozasądowego rozwiązywania sporów konsumenckich.<br />2. Klient będący Konsumentem posiada następujące przykładowe możliwości skorzystania z pozasądowych sposobów rozpatrywania reklamacji i dochodzenia roszczeń:<br />b. Klient uprawniony jest do zwrócenia się do stałego polubownego sądu konsumenckiego, o którym mowa w art. 37 ustawy z dnia 15 grudnia 2000 r. o Inspekcji Handlowej, z wnioskiem o rozstrzygnięcie sporu wynikłego z zawartej Umowy Sprzedaży.<br />c. Klient uprawniony jest do zwrócenia się do wojewódzkiego inspektora Inspekcji Handlowej, zgodnie z art. 36 ustawy z dnia 15 grudnia 2000 r. o Inspekcji Handlowej, z wnioskiem o wszczęcie postępowania mediacyjnego w sprawie pozasądowego rozwiązywania sporu między Klientem, a Sprzedawcą.<br />d. Klient może uzyskać bezpłatną pomoc w sprawie rozstrzygnięcia sporu między Klientem a Sprzedawcą, korzystając także z bezpłatnej pomocy powiatowego (miejskiego) rzecznika konsumentów lub organizacji społecznej, do której zadań statutowych należy ochrona konsumentów (m.in. Federacja Konsumentów, Stowarzyszenie Konsumentów Polskich).<br />e. Pod adresem http://ec.europa.eu/consumers/odr Komisja Europejska udostępnia platformę̨ do rozwiazywania sporów konsumenckich online. Sprzedawca nie uczestniczy obecnie w tej dobrowolnej procedurze alternatywnego rozwiazywania sporów.</p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;text-align:center;\"><br /><br /><span>§ 11.</span></p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;text-align:center;\"><span>PRAWA WŁASNOŚCI INTELEKTUALNEJ</span></p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"><br /><br />W części dziesiątej wskazujemy jakie prawa własności intelektualnej chronimy na naszej stronie internetowej i jakich zasad musisz przestrzegać.<br /><br />1. Wszelkie prawa do Sklepu Internetowego, a w szczególności majątkowe prawa autorskie, prawa własności intelektualnej do jego nazwy, domeny internetowej, a także do formularzy, dokumentów prawnych, logotypów, znaków towarowych, tekstu, grafiki, zdjęć, i innych zamieszczonych przez Sprzedawcę treści należą do Sprzedawcy, a korzystanie z nich może następować wyłącznie w sposób zgodny z Regulaminem.<br />2. Szczególnej ochronie prawnej podlega zastrzeżony słowny znak towarowy Moon Sister (nr prawa wyłącznego: R.347843), słowny znak towarowy Moonsister (nr prawa wyłącznego: R.347841) oraz słowny znak towarowy Moonsisters (nr prawa wyłącznego R.347842).<br />3. Zabronione jest kopiowanie, powielanie, modyfikowanie, zwielokrotnianie czy rozpowszechnianie jakiejkolwiek części Sklepu Internetowego, Usługi lub jej elementów bez uprzedniej pisemnej zgody Sprzedawcy, poza przypadkami wyraźnie dozwolonymi przez przepisy obowiązującego prawa i niniejszego Regulaminu. Sprzedawca może podjąć kroki, w tym na drodze postępowania sądowego, w celu ochrony interesów własnych oraz Klientów Sklepu Internetowego.<br />4. Prawa do używania, kopiowania i rozpowszechniania danych dostępnych w serwisie podlegają przepisom Ustawy o prawie autorskim i prawach pokrewnych.<br />5. Wykorzystywanie danych Sklepu Internetowego w celach komercyjnych odbywać się może po uprzednim powiadomieniu o tym Sprzedawcy i uzyskaniu od niego pisemnej zgody.<br /><br /></p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;text-align:center;\"><span>§ 12.</span></p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;text-align:center;\"><span>OCHRONA DANYCH OSOBOWYCH</span></p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"><br /><br />1. Zasady ochrony danych osobowych określa dokument „Polityka Prywatności ”.<br />2. Zasady stosowania plików cookies na Stronie Internetowej określa dokument „Polityka Cookies”.</p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;text-align:center;\"><br /><br /><span>§ 13.</span></p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;text-align:center;\"><span>POSTANOWIENIA DOTYCZĄCE KLIENTÓW NIE BĘDĄCYCH KONSUMENTAMI</span></p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"><br /><br />Jeśli robisz zakupy w naszym sklepie, a nie jesteś konsumentem – ta część regulaminu jest skierowana właśnie do Ciebie.<br /><br />1. Niniejszy 13 punkt Regulaminu oraz postanowienia w nim zawarte dotyczą wyłącznie Klientów niebędących Konsumentami oraz Przedsiębiorcami – Konsumentami.<br />2. W przypadku zawarcia Umowy Sprzedaży z chwilą wydania przez Sprzedawcę Produktu przewoźnikowi przechodzą na Klienta niebędącego Konsumentem korzyści i ciężary związane z Produktem oraz niebezpieczeństwo przypadkowej utraty lub uszkodzenia Produktu. Sprzedawca w takim wypadku nie ponosi odpowiedzialności za utratę, ubytek lub uszkodzenie Produktu powstałe od przyjęcia go do przewozu aż do wydania go Klientowi oraz za opóźnienie w przewozie przesyłki. W przypadku zawarcia Umowy Dostarczenia Treści Cyfrowych ww. korzyści i obowiązki związane z Produktem przechodzą na Klienta niebędącego konsumentem z chwilą udostępnienia dostępu do Produktu w formie cyfrowej.<br />3. Zgodnie z art. 558 § 1 Kodeksu Cywilnego odpowiedzialność Sprzedawcy z tytułu rękojmi za Produkt wobec Klienta niebędącego Konsumentem zostaje wyłączona.<br />4. Ani Sprzedawca ani jego pracownicy, upoważnieni przedstawiciele i pełnomocnicy nie ponoszą odpowiedzialności wobec Klienta, jego podwykonawców, pracowników, upoważnionych przedstawicieli i/lub pełnomocników za wszelkie szkody, w tym utratę zysków, chyba że szkoda została spowodowana przez nich umyślnie.<br />5. W każdym przypadku ustalenia odpowiedzialności Sprzedawcy, jego pracowników, upoważnionych przedstawicieli i/lub pełnomocników, odpowiedzialność ta w stosunku do Klienta niebędącego Konsumentem, bez względu na jej podstawę prawną, jest ograniczona - zarówno w ramach pojedynczego roszczenia, jak również za wszelkie roszczenia w sumie - do wysokości zapłaconej Ceny oraz kosztów dostawy z tytułu ostatniej Umowy, nie więcej jednak niż do kwoty jednego tysiąca złotych.<br />6. Wszelkie spory powstałe pomiędzy Sprzedawcą, a Klientem niebędącym Konsumentem zostają poddane sądowi właściwemu ze względu na siedzibę Sprzedawcy.<br />7. W odniesieniu do Klientów niebędących Konsumentami Sprzedawca może dokonać zmiany Regulaminu w każdym czasie na podstawie powszechnie obowiązujących przepisów prawa.</p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"> </p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;text-align:center;\"><span>§ 14.</span></p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;text-align:center;\"><span>POSTANOWIENIA KOŃCOWE</span></p>\n<p style=\"margin:0.5em 0px 0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\"><br />1. Regulamin w wersji 2.0. wchodzi w życie z dniem 11.11.2023 r.<br />2. Regulamin jest dostępny w języku polskim<br />3. W sprawach nieuregulowanych niniejszym Regulaminem mają zastosowanie przepisy powszechnie obowiązującego prawa.<br />4. O ile bezwzględnie obowiązujące przepisy prawa nie stanowią inaczej, prawem właściwym dla rozstrzygania wszelkich sporów powstałych na gruncie niniejszego Regulaminu jest prawo polskie.<br />5. W przypadku, gdy regulacje bezwzględnie obowiązującego prawa kraju zwykłego pobytu Klienta przewidują dla niego korzystniejsze warunki niż przepisy prawa polskiego oraz zapisy niniejszego Regulaminu, zastosowanie znajdą przepisy prawa kraju zwykłego pobytu Klienta.<br />6. Treść niniejszego Regulaminu może ulec zmianie. O wszelkich zmianach Sklep Internetowy będzie informować poprzez zamieszczenie informacji na stronie Sklepu Internetowego.</p>\n</div>\n</div>','regulamin-sklepu'),
(4,1,1,'O nas','','Dowiedz się więcej o nas','about us, informations','<h2>O nas</h2>\n<h3><span style=\"color:#333333;font-family:Montserrat, sans-serif;font-size:14.4px;font-weight:400;background-color:#ffffff;\">Moonsister to przestrzeń pełna wysokich wibracji stworzona przez Sarę i Dorę, dwie Przyjaciółki, które profesjonalnie zajmują się astrologią i numerologią. W tym sklepie znajduje się wszystko, co jest najbliższe ich Duszom. Uwierz w magię talizmanów i rozwijaj się z nami duchowo!</span><br style=\"color:#333333;font-family:Montserrat, sans-serif;font-size:14.4px;font-weight:400;background-color:#ffffff;\" /><span style=\"color:#333333;font-family:Montserrat, sans-serif;font-size:14.4px;font-weight:400;background-color:#ffffff;\">Jesteś w Moonsister, a więc niech dzieje się magia!</span></h3>','o-nas'),
(5,1,1,'Zwroty','','Zwroty','secure payment, ssl, visa, mastercard, paypal','<h2><span><u>Zwroty</u></span></h2>\n<p><span><u></u></span></p>\n<h3 style=\"margin:0.5em 0px;padding:0px;border:0px;font-weight:400;font-size:17.1px;line-height:inherit;font-family:Montserrat, sans-serif;vertical-align:baseline;color:#333333;background-color:#ffffff;\"><span>Cześć!</span></h3>\n<h1 style=\"margin:0.5em 0px;padding:0px;border:0px;font-weight:400;font-size:17.1px;line-height:inherit;font-family:Montserrat, sans-serif;vertical-align:baseline;color:#333333;background-color:#ffffff;\"><span> </span></h1>\n<h1 style=\"margin:0.5em 0px;padding:0px;border:0px;font-weight:400;font-size:17.1px;line-height:inherit;font-family:Montserrat, sans-serif;vertical-align:baseline;color:#333333;background-color:#ffffff;\"><span>Zamówione produkty nie przypadły Ci do gustu? Nie ma problemu, w naszym sklepie masz 14 dni na odstąpienie od umowy.</span></h1>\n<h1 style=\"margin:0.5em 0px;padding:0px;border:0px;font-weight:400;font-size:17.1px;line-height:inherit;font-family:Montserrat, sans-serif;vertical-align:baseline;color:#333333;background-color:#ffffff;\"><span> </span></h1>\n<h3><span><u></u></span></h3>\n<h1 style=\"margin:0.5em 0px;padding:0px;border:0px;font-weight:400;font-size:17.1px;line-height:inherit;font-family:Montserrat, sans-serif;vertical-align:baseline;color:#333333;background-color:#ffffff;\"><span><u>Jak dokonać zwrotu w kilku, prostych krokach?</u></span></h1>\n<h1 style=\"margin:0.5em 0px;padding:0px;border:0px;font-weight:400;font-size:17.1px;line-height:inherit;font-family:Montserrat, sans-serif;vertical-align:baseline;color:#333333;background-color:#ffffff;\"><span> </span></h1>\n<p>Masz aż 14 dni na powiadomienie nas o odstąpieniu od umowy, czyli o chęci zwrotu zakupionych produktów. Możesz nas o tym poinformować w dowolny, wybrany przez Ciebie sposób, np.</p>\n<p>pisemnie na adres: Moonsister.pl, ul. Zelwerowicza 11 m. 2, 02-928 Warszawa;</p>\n<p>w formie elektronicznej na adres:<span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-size:inherit;line-height:inherit;font-family:inherit;vertical-align:baseline;\"> </span><a href=\"mailto:hello@moonsister.pl\" style=\"padding:0px 0px 5px;background:no-repeat 50% 86%;\">hello@moonsister.pl</a>;</p>\n<p>telefonicznie poprzez kontakt z numerem: +48 533 959 000.</p>\n<p><span></span><span>W ciągu 14 dni od poinformowania nas o zwrocie, odeślij na swój koszt zwracane towary na adres: pl, ul. Zelwerowicza 11 m. 2, 02-928 Warszawa. Dołącz do paczki formularz zwrotu, możesz na przykład wypełnić<span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-size:inherit;line-height:inherit;font-family:inherit;vertical-align:baseline;\"> </span><a href=\"https://cdn.shopify.com/s/files/1/0690/1946/8054/files/Formularz_zwrotu_b879e816-7aaa-477e-8242-d01a301f6ad2.pdf?v=1697197795\" style=\"padding:0px 0px 5px;background:no-repeat 50% 86%;\">ten</a></span><span>. Pamiętaj o zapakowaniu towaru w bezpieczny sposób, by uchronić go przed uszkodzeniem w transporcie. Będzie nam miło, gdy wykorzystasz oryginalne zabezpieczenia produktów.</span></p>\n<p>Oddamy Ci pieniądze w ciągu 14 dni od dnia Twojej rezygnacji. Ze zwrotem środków możemy wstrzymać się do momentu, gdy otrzymamy od Ciebie produkt lub dowód jego odesłania.</p>\n<p>Produkty sprzedawane na indywidualne zamówienia klienta nie podlegają zwrotowi.</p>\n<p>Produkty sprzedawane w zapieczętowanych opakowaniach nie podlegają zwrotowi jeśli zostały odpieczętowane przez Klienta. Zwrot może też zostać przez Nas nieuznany, jeśli okaże się, że produkty były przechowywane niezgodnie z zaleceniami co wpłynęło na ich właściwości.</p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font-weight:400;font-size:17.1px;line-height:inherit;font-family:Montserrat, sans-serif;vertical-align:baseline;color:#333333;background-color:#ffffff;\"> </p>\n<p>Prawo do odstąpienia od umowy nie przysługuje w odniesieniu do Umów Dostarczenia Treści Cyfrowych jeżeli spełnianie świadczenia rozpoczęło się za wyraźną zgodą Konsumenta przed upływem terminu do odstąpienia od umowy i po poinformowaniu go przez Sprzedawcę o utracie prawa odstąpienia od umowy.</p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font-weight:400;font-size:17.1px;line-height:inherit;font-family:Montserrat, sans-serif;vertical-align:baseline;color:#333333;background-color:#ffffff;\"> </p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font-weight:400;font-size:17.1px;line-height:inherit;font-family:Montserrat, sans-serif;vertical-align:baseline;color:#333333;background-color:#ffffff;\"><span>Chcesz dowiedzieć się więcej o procedurze zwrotów? Zapoznaj się z naszą Polityką Zwrotów w pełnej wersji, którą znajdziesz w naszym Regulaminie.</span></p>\n<p style=\"margin:0.5em 0px;padding:0px;border:0px;font-weight:400;font-size:17.1px;line-height:inherit;font-family:Montserrat, sans-serif;vertical-align:baseline;color:#333333;background-color:#ffffff;\"><span> </span></p>\n<p style=\"margin:0.5em 0px 0px;padding:0px;border:0px;font-weight:400;font-size:17.1px;line-height:inherit;font-family:Montserrat, sans-serif;vertical-align:baseline;color:#333333;background-color:#ffffff;\"><span>W razie pytań, napisz na nasz adres:<span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-size:inherit;line-height:inherit;font-family:inherit;vertical-align:baseline;\"> </span></span><a href=\"mailto:hello@moonsister.pl\" style=\"padding:0px 0px 5px;background:no-repeat 50% 86%;\"><span>hello@moonsister.pl</span></a><span><span style=\"margin:0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-size:inherit;line-height:inherit;font-family:inherit;vertical-align:baseline;\"> </span>- z pewnością Ci pomożemy.</span></p>','zwroty');
