INSERT INTO `ps_info_lang` VALUES
(1,1,1,'<h2 class=\"column__heading heading-size-4\" style=\"line-height:1.2;margin:0px 0px 7px;text-align:center;color:#333333;background-color:#ffffff;\">Biżuteria wysokoenergetyczna</h2>\n<div class=\"column__text rte body-size-3\" style=\"margin:0px;padding:0px;border:0px;font-weight:400;font-size:14.4px;line-height:inherit;font-family:Montserrat, sans-serif;vertical-align:baseline;text-align:center;color:#333333;background-color:#ffffff;\">\n<p style=\"margin:10px 0px 0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;font-size:inherit;line-height:1.5;font-family:inherit;vertical-align:baseline;\">Nasze talizmany energetyzowane są na wybraną intencję i mają za zadanie poruszyć energię oraz zjednoczyć Cię z wibracją pragnienia.</p>\n<p style=\"margin:10px 0px 0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;font-size:inherit;line-height:1.5;font-family:inherit;vertical-align:baseline;\"></p>\n</div>\n<h2 class=\"column__heading heading-size-4\" style=\"line-height:1.2;margin:0px 0px 7px;text-align:center;color:#333333;background-color:#ffffff;\">Atrybuty rozwoju duchowego</h2>\n<div class=\"column__text rte body-size-3\" style=\"margin:0px;padding:0px;border:0px;font-weight:400;font-size:14.4px;line-height:inherit;font-family:Montserrat, sans-serif;vertical-align:baseline;text-align:center;color:#333333;background-color:#ffffff;\">\n<div class=\"column__text rte body-size-3\" style=\"margin:0px;padding:0px;border:0px;font-size:14.4px;line-height:inherit;vertical-align:baseline;\">\n<p style=\"margin:10px 0px 0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;font-size:inherit;line-height:1.5;font-family:inherit;vertical-align:baseline;\">Wejdź do świata magii i zaproś wysokie wibracje do swojego życia oraz przestrzeni. Rytuały i narzędzia duchowe są dla każdego!</p>\n<p style=\"margin:10px 0px 0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;font-size:inherit;line-height:1.5;font-family:inherit;vertical-align:baseline;\"></p>\n</div>\n</div>\n<h2 class=\"column__heading heading-size-4\" style=\"line-height:1.2;margin:0px 0px 7px;text-align:center;color:#333333;background-color:#ffffff;\">Akademia Moonsister</h2>\n<div class=\"column__text rte body-size-3\" style=\"margin:0px;padding:0px;border:0px;font-weight:400;font-size:14.4px;line-height:inherit;font-family:Montserrat, sans-serif;vertical-align:baseline;text-align:center;color:#333333;background-color:#ffffff;\">\n<div class=\"column__text rte body-size-3\" style=\"margin:0px;padding:0px;border:0px;font-size:14.4px;line-height:inherit;vertical-align:baseline;\">\n<div class=\"column__text rte body-size-3\" style=\"margin:0px;padding:0px;border:0px;font-size:14.4px;line-height:inherit;vertical-align:baseline;\">\n<p style=\"margin:10px 0px 0px;padding:0px;border:0px;font-style:inherit;font-variant:inherit;font-weight:inherit;font-size:inherit;line-height:1.5;font-family:inherit;vertical-align:baseline;\">E-booki, masterclassy, szkolenia, medytacje - zgłębiaj duchową wiedzę z Moonsister. Wzrastaj i rozwijaj się każdego dnia. Kto stoi w miejscu, ten się cofa!</p>\n</div>\n</div>\n</div>');
