(1,14,3,5,'Moja Pierwsza Opinia','Trochę się stresuję, ponieważ to moja pierwsza opinia na Państwa sklepie. Bardzo dobra medytacja, umarłem a teraz żyję. W międzyczasie miałem czas na refleksje nad przemijaniem. Polecam','',5,0,0,'2023-11-21 16:29:34');
