INSERT INTO `ps_product_lang` VALUES
(1,1,1,'Możliwość dokonania odroczonej płatności PayPo lub rozłożenia  kwoty  na  raty . W sprawie  rat  napisz do nas na hello@moonsister.pl  UWAGA! Po tych warsztatach odkryjesz swoje prawdziwe PRZEZNACZENIE! Czy kiedykolwiek zastanawiałaś się jaki jest Plan Twojej Duszy na to wcielenie? Czy wierzysz w to, że Twoje życie ma Wyższy Cel? Zapraszam Cię do fascynującej podróży po planie przedurodzeniowym, gdzie krok po kroku będziemy odkrywać misję Twojej Duszy na to wcielenie.  Jeśli byłaś jedną z ponad 150 osób, które wzięły udział w PODRÓŻY DUSZY I POZIOM i poznały swoje poprzednie wcielenia -  wiesz, że tych Warsztatów nie można opuścić!!! Jeśli temat Planu Duszy na obecne wcielenie pociąga Cię tak bardzo jak mnie, czytaj dalej! „Ten, który zna swój cel, znajdzie do niego drogę” - Lao Tse    Koncepcja dharmy zakłada, że każdy z nas rodzi się z jakimś wyjątkowym talentem i sposobem wyrażania do świata. Podążając zgodnie z planem swojej Duszy nie tylko wiedziemy życie w poczuciu spełnienia i wyższego celu, ale zapewniamy sobie obfitość! Przeznaczeniem w naszej ziemskiej wędrówce jest odnalezienie wyjątkowej esencji, daru i supermocy oraz ucieleśnienie ich w swoim życiu. Tego będziemy uczyć się na warsztatach! Plan Twojej Duszy nie polega na tym, co robisz, ale na tym, dlaczego i jak to robisz. To Twoja wyjątkowa esencja, wibracja, z którą urodziłeś się, aby dzielić się nią ze światem!  *Warsztat Podróż Duszy II jest kontynuacją warsztatu Podróż Duszy I, który dotyczył wpływu poprzednich wcieleń na Twoją obecną inkarnację. Rekomendujemy przerobienie poziomu I, aby odczytać z Twojego Planu jak najwięcej szczegółów.','','warsztaty-podroz-duszy-ii-misja-duszy-na-obecne-wcielenie-odkryj-swoje-przeznaczenie','','','','Warsztaty Podróż Duszy II: Misja Duszy na obecne wcielenie - Odkryj swoje przeznaczenie','','','',''),
(2,1,1,'Skarpetki ze zodiakalnym wzorem, dla Ciebie lub kogoś bliskiego!  Zaopiekuj się swoim znakiem solarnym w  najmilszy, możliwy sposób! Twoje prywatne, zodiakalne skarpetki umilą wiele chłodnych wieczorów i otulą nie tylko Twoje stópki, ale i Piękną Duszę!','','skarpetki-zodiakalne-moonsister','','','','Skarpetki zodiakalne Moonsister','','','',''),
(3,1,1,'Naszyjnik Nature wesprze Twoje połączenie ze wszechświatem oraz naturą! Pomoże Ci poczuć jedność z otaczającym światem.   Agat mszysty jest kamieniem dedykowanym wszystkim, którzy chcą wzmocnić swoje połączenie z duchami natury oraz odnaleźć harmonię i spokój w codziennej rzeczywistości. Jest pomocny, gdy czujemy osłabienie organizmu. Dzięki niemu możemy poczuć przypływ sił witalnych.  Kwarc tygrysi przynosi szczęście i sukces, sprzyja zwiększeniu odwagi w działaniach.   Załóż talizman Nature, gdy odczuwasz chaos i zwątpienie, brakuje Ci poczucia zrozumienia, chcesz stać się częścią jedności oraz odnieść sukces w podjętych wyzwaniach.   Talizman energetyzowany, ten naszyjnik   naenergetyzuje   dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat!','','naszyjnik-z-kwarcem-tygrysim-i-agatem-mszystym-talizman-wyzwolenia-i-harmonii-z-przyroda-nature','','','','Naszyjnik z kwarcem tygrysim i agatem mszystym - Talizman wyzwolenia i harmonii z przyrodą Nature','','','',''),
(4,1,1,'Wąż reprezentuje reinkarnację, nieśmiertelność i czystość. Ma potężne połączenie z pierwotną energią i siłą życiową.  W większości kultura jest uważany za potężny symbol reprezentujący źródło życia. To atrybut energii, ważnych przejść i zmian, niezależnie od tego, czy zachodzą one na poziomie duchowym, emocjonalnym czy fizycznym.  Załóż bransoletkę Royal Cobra, gdy jesteś na etapie transformacji i dużych zmian życiowych lub potrzebujesz dodatkowych sił witalnych.   Talizman energetyzowany, ten naszyjnik  naenergetyzuje   dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','bransoletka-zmijka-talizman-transformacji-royal-cobra','','','','Bransoletka żmijka - Talizman transformacji Royal Cobra','','','',''),
(5,1,1,'Jedynko, jeśli wibrujesz w świetle Twoim atrybutem jest odwaga, inicjatywa i talenty przywódcze. Kochasz wyzwania, a Twoja spontaniczność i siła charakteru wprawiają w osłupienie. Jeśli dotykasz cienia, odczuwasz zaburzenia w opisanych obszarach. Przyjmij wysokie wibracje z talizmanem Numerology, wzmocnij najlepsze potencjały swojej liczby numerologicznej i wyglądaj magicznie zawieszając ten talizman na dowolnym naszyjniku lub bransoletce Moonsister.  Talizman Numerology został   naenergetyzowany   przez naszego Moonbrothera Mariusza, który z energią pracuje ponad 30 lat, aby wspomóc wyciągnięcie światła z archetypu wibracji Twojej Drogi Życia.','','charms-pozlacany-z-cyfra-1-talizman-numerologiczny','','','','Charms pozłacany z cyfrą 1 - Talizman numerologiczny','','','',''),
(6,1,1,'Dwójko, jeśli wibrujesz w świetle jesteś uosobieniem kobiecych energii. Twoim atrybutem jest umiejętność współpracy, dyplomacja, łagodność, tolerancja. Wiesz jak postępować z emocjami i masz silną intuicję. Jeśli dotykasz cienia, odczuwasz zaburzenia w opisanych obszarach. Przyjmij wysokie wibracje z talizmanem Numerology, wzmocnij najlepsze potencjały swojej liczby numerologicznej i wyglądaj magicznie zawieszając ten talizman na dowolnym naszyjniku lub bransoletce Moonsister.  Talizman Numerology został  naenergetyzowany  przez naszego Moonbrothera Mariusza, który z energią pracuje ponad 30 lat, aby wspomóc wyciągnięcie światła z archetypu wibracji Twojej Drogi Życia.','','charms-pozlacany-z-cyfra-2-talizman-numerologiczny','','','','Charms pozłacany z cyfrą 2 - Talizman numerologiczny','','','',''),
(7,1,1,'Trójko, jeśli wibrujesz w świetle Twoim atrybutem jest błyskotliwość, pomysłowość, towarzyskość i talent artystyczny. Jesteś wesoła, lubiana, wolna od przesądów i ograniczeń i umiesz cieszyć się życiem jak dziecko. Jeśli dotykasz cienia, odczuwasz zaburzenia w opisanych obszarach. Przyjmij wysokie wibracje z talizmanem Numerology, wzmocnij najlepsze potencjały swojej liczby numerologicznej i wyglądaj magicznie zawieszając ten talizman na dowolnym naszyjniku lub bransoletce Moonsister.  Talizman Numerology został  naenergetyzowany  przez naszego Moonbrothera Mariusza, który z energią pracuje ponad 30 lat, aby wspomóc wyciągnięcie światła z archetypu wibracji Twojej Drogi Życia.','','charms-pozlacany-z-cyfra-3-talizman-numerologiczny','','','','Charms pozłacany z cyfrą 3 - Talizman numerologiczny','','','',''),
(8,1,1,'Runy to starożytna forma wyroczni używana przez szukających porady. Mają długą historię, sięgającą starożytnych plemion germańskich i nordyckich, i nadal są szeroko stosowane w dzisiejszym społeczeństwie. Słowo „runa” oznacza po prostu tajemnicę lub szept i jest to forma wróżenia lub systemu wyroczni, która pomaga uzyskać odpowiedzi na pytania.  Onyks to kamień potężnej ochrony, siły, skupienia i siły woli. Chroni aurę przed negatywnymi bytami, oczyszcza ze złych energii. Łagodzi samotność, sprawia, że   jego użytkownik czuje się kochany i chroniony. Wspiera mediumizm i wzmacnia moce parapsychiczne, sprawiając, że Twój odczyt staje się jeszcze bardziej dokładny.','','zestaw-run-czarny-onyks','','','','Zestaw run - Czarny Onyks','','','',''),
(9,1,1,'Runy to starożytna forma wyroczni używana przez szukających porady. Mają długą historię, sięgającą starożytnych plemion germańskich i nordyckich, i nadal są szeroko stosowane w dzisiejszym społeczeństwie. Słowo „runa” oznacza po prostu tajemnicę lub szept i jest to forma wróżenia lub systemu wyroczni, która pomaga uzyskać odpowiedzi na pytania.  Lapis Lazuli to Kamień Bogów – kamień mądrości, intuicji i prawdy. Jest potężnym kryształem dla każdego, kto chce pogłębić swoją więź z sobą. Właściwości Lapisu Lazuli znane są z otwierania czakry trzeciego oka, centrum intuicji i wewnętrznej mądrości. Kamień ten wzmacnia zdolność introspekcji i odkrywania prawdy, ułatwia wkroczenie w swoją moc i poznanie autentycznego Ja.','','zestaw-run-lapis-lazuli','','','','Zestaw run - Lapis Lazuli','','','',''),
(10,1,1,'Runy to starożytna forma wyroczni używana przez szukających porady. Mają długą historię, sięgającą starożytnych plemion germańskich i nordyckich, i nadal są szeroko stosowane w dzisiejszym społeczeństwie. Słowo „runa” oznacza po prostu tajemnicę lub szept i jest to forma wróżenia lub systemu wyroczni, która pomaga uzyskać odpowiedzi na pytania.  Ametyst uwalnia od lęków, przywraca równowagę osobom podatnym na stres, przynosi spokój i uwolnienie umysłu od negatywnych myśli. Pomaga radzić sobie z emocjami, dodaje cierpliwości, uwalnia od codziennego zmęczenia i problemów. Przywraca harmonię ducha.','','zestaw-run-ametyst','','','','Zestaw run - Ametyst','','','',''),
(11,1,1,'Runy to starożytna forma wyroczni używana przez szukających porady. Mają długą historię, sięgającą starożytnych plemion germańskich i nordyckich, i nadal są szeroko stosowane w dzisiejszym społeczeństwie. Słowo „runa” oznacza po prostu tajemnicę lub szept i jest to forma wróżenia lub systemu wyroczni, która pomaga uzyskać odpowiedzi na pytania.  To kamień wewnętrznego wzrostu i siły. Łagodzi stres, stabilizuje emocje i zapewnia spokój. To kamień „nowych początków”, wzmacnia intuicję, przynosi sukces i szczęście w miłości i sprawach biznesowych. Kamień księżycowy jest również korzystny dla mężczyzn w otwieraniu emocjonalnego Ja.','','zestaw-run-kamien-ksiezycowy','','','','Zestaw run - Kamień Księżycowy','','','',''),
(12,1,1,'Karty te, zawierają potężne przesłanie uzdrawiających kryształów, które prowadzą do stanów wyższej świadomości. Łączenie się z kryształami w tej talii jest jak komunikowanie się z istotami światła, wysokich wibracji i energii; przewodnikami, którzy mają nam do zaoferowania opinie, pomysły, mądrość i specjalne dary. Piękne ilustracje do kart wykonała Jena Della Grottaglia. Tylko oryginalne karty Wyroczni Kryształowych Energii, które znajdziesz w naszym sklepie, mają piękne, składane opakowanie i drukowany przewodnik.','','karty-uzdrawiajaca-moc-krysztalow-wyrocznia','','','','Karty \"Uzdrawiająca moc kryształów wyrocznia\"','','','',''),
(13,1,1,'To jeden z najsilniejszych kryształów uziemiających. Kiedy trzymasz go w dłoniach lub nosisz przy ciele, jego energia jednoczy Cię energetycznie z Ziemią. Wyciąga nadmiar niechcianej lub negatywnej energii i oczyszcza pole energetyczne. To także kamień ochronny, który pomaga nam pozostać silnymi, zwłaszcza gdy mamy do czynienia z trudnymi sytuacjami i wokół nas panuje chaos. Kiedy pojawiają się stresy i kłótnie, pomaga nam rozładować napięcie, aby nie wpływało na nasze relacje ani zdrowie psychiczne.  Idealnie sprawdzi się jako kamień ochronny podczas retrogradacji Merkurego!  Ładuj i oczyszczaj swój kamień średnio raz w miesiącu lub zawsze wtedy, kiedy czujesz, że jest to potrzebne. Oczyszczanie: pod bieżącą wodą lub za pomocą białej szałwii czy Palo Santo Ładowanie: za pomocą światła księżyca lub słońca; UWAGA! Hematyt rozładowuje inne kamienie dlatego trzymaj go z dala od nich, powinien być przechowywany wyłącznie obok kryształu górskiego!  Kamienie są naturalne i mogą mieć drobne niedoskonałości, które czynią je unikalnymi.','','kamien-ochronny-i-uziemiajacy-hematyt','','','','Kamień ochronny i uziemiający - Hematyt','','','',''),
(14,1,1,'To kontrowersyjne doświadczenie – symboliczne przeżycie śmierci – jest niezwykłą transformacją. Symboliczne pochowanie starych, sabotujących nawyków, przekonań, działań… Spojrzenie na siebie i swoje życie z innej perspektywy, z dystansu. To ewolucja naszego rozwoju osobistego i duchowego.  Zadbaj o jak najwięcej światła w sobie... Zbuduj siebie na nowo. Porzuć warunkowanie swojego poczucia szczęścia od wszelkich czynników zewnętrznych – bo wszystko czego potrzebujesz masz w sobie – wydobądź to.  Gdy zaakceptujesz fakt, że Twoje ziemskie życie jest dość… kruche – przestaniesz trwonić swój cenny czas na zamartwianie, nieprzespane noce, kłótnie, nieporozumienia… a wniesiesz więcej lekkości, radości i miłości.  Celem tego doświadczenia jest to, abyś zdała sobie sprawę, że nasze życie jest w naszych rękach. To obudzenie motywacji do działania. To uświadomienie sobie tego – co nieuchronne. Medytacja nie ma na celu wpędzenia Ciebie w obawy czy podsycanie lęku, dlatego jeżeli jesteś obecnie w żałobie lub bierzesz leki przeciwdepresyjne / psychotropowe – nie rekomendujemy tej medytacji.   W IMIĘ DOBREJ KARMY, NIE KOPIUJ, NIE PRZESYŁAJ DALEJ,   WSZELKIE PRAWA ZASTRZEŻONE.','','medytacja-smierci-autorefleksja-nad-przemijaniem','','','','Medytacja śmierci - autorefleksja nad przemijaniem','','','',''),
(15,1,1,'Wsparcie podczas retrogradacji Merkurego. Zestaw magicznych kamieni ułatwiających komunikację, uziemiających i chroniących przed negatywną energią. Pomaga lepiej sobie radzić z wpływem Merkurego podczas retrogradacji.  Twój Magiczny Zestaw zawiera: 1. Amazonit 2. Hematyt 3. Kryształ górski 4. Fluoryt 5. Kwarc dymny 6. Informację i instrukcję dotyczącą kamieni  7. Kartę do ładowania kamieni 8.Miękki muślinowy woreczek na kamienie  Amazonit Sprzyja jasnej i precyzyjnej komunikacji. Zapewnia uspokajające i kojące energie, które wesprą Cię w czasie niepokoju i stresu. Pomaga mówić z głębi serca i zachować spokój, zwłaszcza, gdy sprawy nie idą zgodnie z planem. Fluoryt Emituje spokój i harmonię oraz pomaga uwolnić się od stresu i niepokoju. Często określany jest jako energetyczny odkurzacz, gdyż wysysa i neutralizuje negatywną energię, wprowadzając harmonię i równowagę. Wspiera skupienie i jasność umysłu, umożliwiając zmianę perspektywy. Może pomóc odróżnić to, co jest pod twoją kontrolą, a co nie. Hematyt To jeden z najsilniejszych kryształów uziemiających. Kiedy trzymasz go w dłoniach lub nosisz przy ciele, jego energia jednoczy Cię energetycznie z Ziemią. Wyciąga nadmiar niechcianej lub negatywnej energii i oczyszcza pole energetyczne. To także kamień ochronny, który pomaga nam pozostać silnymi, zwłaszcza gdy mamy do czynienia z trudnymi sytuacjami i wokół nas panuje chaos. Kiedy pojawiają się stresy i kłótnie, pomaga nam rozładować napięcie, aby nie wpływało na nasze relacje ani zdrowie psychiczne. Kwarc dymny   Pomaga uwolnić napięcie i toksyczne myśli. Jego uzdrawiająca energia działa na poprawę interakcji z innymi, pomagając naszym związkom przetrwać próby i udręki, które możemy napotkać podczas retrogradacji Merkurego. Ten kamień może być używany jako amulet przynoszący szczęście, zapobiegający wypadkom i przenikaniu negatywnej energii do naszej aury. Kryształ górski Zapewnia przejrzystość i skupienie. Wibruje czystym białym światłem, usuwając wszelkie blokady lub przeszkody, które leżą na Twojej drodze.','','magiczne-kamienie-na-retrogradacje-mercury-retrograde-safety-kit','','','','Magiczne kamienie na retrogradację - Mercury Retrograde Safety Kit','','','',''),
(16,1,1,'Poczuj głębię relaksu po wyczerpującym dniu. Wieczorna medytacja pomaga „rozpuścić” myśli i emocje nagromadzone w ciągu dnia. Zrzuć stres, doznaj ukojenia i zaśnij spokojnie poddając się regenerującemu odpoczynkowi. Zapewnij sobie uzdrawiający sen, który korzystnie wpłynie na Twoje zdrowie psychiczne i fizyczne oraz przygotuje na następny dzień.  W IMIĘ DOBREJ KARMY, NIE KOPIUJ, NIE PRZESYŁAJ DALEJ,  WSZELKIE PRAWA ZASTRZEŻONE.','','medytacja-na-uzdrawiajacy-sen','','','','Medytacja na \"Uzdrawiający Sen\"','','','',''),
(17,1,1,'Wybaczaj każdemu, kto sprawia Ci ból. Wybaczanie nie jest dla innych. Jest dla Ciebie! To nie zapominanie. To pamiętanie bez żalu. Wybaczanie uwalnia gniew, złość, żal, obniżony nastrój, smutek… Ulecza Twoje ciało i duszę. Otwiera nową ścieżkę do źródła spokoju, gdzie możesz przetrwać pomimo tego, co Cię spotkało i pomaga ruszyć do przodu.  Wybacz i podnieś swoje wibracje. Ta prawie 19 minutowa medytacja poprowadzi Cię w tym procesie.   Powtarzaj to ćwiczenie codziennie aż do poczucia całkowitego uwolnienia. Może to być kilka dni, kilka tygodni lub miesięcy. To bardzo indywidualny proces i każdy z nas potrzebuje innego czasu by uleczyć trudne emocje.  W IMIĘ DOBREJ KARMY, NIE KOPIUJ, NIE PRZESYŁAJ DALEJ,  WSZELKIE PRAWA ZASTRZEŻONE.','','medytacja-wybaczanie','','','','Medytacja \"Wybaczanie\"','','','',''),
(18,1,1,'Naucz się korzystać z wewnętrznej mocy! Sięgnij do głęboko skrywanych zasobów, poczuj się zaopiekowany i wspierany, otwórz się na dobrobyt w swoim życiu.  Medytacja „Siła podświadomości” pozwoli Ci zanurzyć się w głębokie warstwy umysłu, dotrzeć do zakamarków, które potrzebują uzdrowienia i przeprogramowania. To medytacja, która poprowadzi Cię ku zdrowiu, miłości, szczęściu, radości i bogactwu.   Pamiętaj, że tylko regularne medytowanie przyniesie efekty, których pragniesz.     W IMIĘ DOBREJ KARMY, NIE KOPIUJ, NIE PRZESYŁAJ DALEJ,  WSZELKIE PRAWA ZASTRZEŻONE.','','medytacja-sila-podswiadomosci','','','','Medytacja \"Siła Podświadomości\"','','','',''),
(19,1,1,'Praktykuj na co dzień medytację prowadzoną, która pomoże Ci dostroić się do Twojego wewnętrznego głosu, który zawsze chce dla Ciebie jak najlepiej. Obdarz swoją intuicję miłością, szacunkiem i pozwól, aby działała. W tę wyjątkową podróż brzegiem oceanu zabierze Cię Paula.     W IMIĘ DOBREJ KARMY, NIE KOPIUJ, NIE PRZESYŁAJ DALEJ, WSZELKIE PRAWA ZASTRZEŻONE.','','medytacja-intuicja','','','','Medytacja \"Intuicja\"','','','',''),
(20,1,1,'Bajkowa medytacja miłości dla każdej z nas – pomaga otworzyć się na miłość, pielęgnować relacje które mamy, a także pokochać samą siebie. Udaj się w tę uzdrawiającą, piętnastominutową podróż pełną bezwarunkowej miłości, na którą zasługujesz.  W IMIĘ DOBREJ KARMY, NIE KOPIUJ, NIE PRZESYŁAJ DALEJ, WSZELKIE PRAWA ZASTRZEŻONE.','','medytacja-milosc','','','','Medytacja \"Miłość\"','','','',''),
(21,1,1,'Świeca rytualna „Spokój” z naturalnego wosku pszczelego, która wydziela delikatny, klasyczny zapach. Wzmacnia  spokój, harmonię i równowagę wewnętrzną. Magia świec jest jedną z najprostszych metod wspierania manifestacji intencji lub woli. Odpowiedni kolor świecy umacnia żywioł ognia, zapewnia energetyczną ochronę oraz ułatwia znalezienie rozwiązań.','','niebieska-swieca-z-wosku-pszczelego-spokoj','','','','Niebieska świeca z wosku pszczelego Spokój','','','',''),
(22,1,1,'Od zarania dziejów Magowie i Alchemicy używali symboli serca do zaklęć związanych z miłością lub romansem. Symbol ten był również wykorzystywany w rytuałach mających na celu wzmocnienie istniejących relacji. Obecnie, serce kojarzone jest w różnych kulturach z miłością, miłosierdziem, radością i współczuciem.   W naszyjniku znajduje się 7 zawieszek z sercami. Atrybutem liczby 7 jest ogromna moc duchowa. Otwiera intuicję i zwiększa zdolność zrozumienia innych ludzi. Sprzyja rozwojowi i pogłębianiu wiedzy.   Talizman Spiritual Love pomaga otworzyć się na bezwarunkową miłość oraz zwiększyć porozumienie z innymi osobami i samym sobą. Załóż go by wzmocnić miłość własną, przyciągnąć drugą połówkę, a także wspomóc relacje z bliskimi.   Talizman energetyzowany, ten naszyjnik  naenergetyzuje   dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','naszyjnik-z-sercami-talizman-bezwarunkowej-milosci-spiritual-love','','','','Naszyjnik z sercami - Talizman bezwarunkowej miłości Spiritual Love','','','',''),
(23,1,1,'Każdy z nas marzy by sięgnąć gwiazd, jednak blokują nas w tym własne ograniczenia - niewiara w odniesienie sukcesu, brak pewności siebie, brak zaufania w swoją intuicję, błędne wzorce i przekonania, na które pracujemy całe życie.  Zakładając naszyjnik Reach the Stars transformujesz cienie w światło. Gwiazda reprezentuje boską ideę, ideał, szczęście, sukces, nadzieję, światło, a także 4 żywioły i ducha.  Ten talizman   naenergetyzuje   dla Ciebie nasz Moonbrother Mariusz na intencję pewności siebie i dodanie żywiołu ognia w działaniu, byś uwierzyła, że nie ma dla Ciebie rzeczy niemożliwych!','','naszyjnik-srebrny-z-gwiazdkami-talizman-pewnosci-siebie-reach-the-stars','','','','Naszyjnik srebrny z gwiazdkami - Talizman pewności siebie Reach the Stars','','','',''),
(24,1,1,'Czaszka to symbol wspierający naszą wewnętrzną transformację. Dzięki niej pozwalamy odejść czemuś, co nam nie służy i zrobić miejsce czemuś nowemu - otworzyć się na nowy etap w życiu.  Byk z kolei jest silnie związany z ziemią i posiadaniem, wartościami materialnymi. Lubi dobrą jakość. To te wartości, na które otwieramy się nosząc talizman dostatku i wygody Mystic Taurus. Dodatkowo naszyjnik został wzbogacony wibracją „3” w postaci złotych elementów, która nadaje lekkości bytu, sprzyja komunikacji i wnosi nieskrępowaną radość do naszego życia.  Talizman energetyzowany, ten naszyjnik  naenergetyzuje   dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat, abyś mogła wyciągnąć światło z archetypu Twojego znaku zodiaku.','','lancuszek-srebrny-z-zawieszka-glowa-byka-talizman-dostatku-i-wygody-taurus','','','','Łańcuszek srebrny z zawieszką głową byka - Talizman dostatku i wygody Taurus','','','',''),
(25,1,1,'Słońce reprezentuje ogień. To żywioł oczyszczający, który wypala negatywne emocje i sprzyja otwieraniu nowego rozdziału w życiu. To również symbol wszelkiego życia na Ziemi, źródło siły, jasności i dobrostanu. To również źródło energii dobrobytu i szczęścia. Słońce symbolizuje także męską energię, odpowiedzialną za działanie. Energię, która sprawia, że jesteśmy pełni sił i pewności siebie na co dzień i w dalekosiężnych celach.  Załóż talizman Energy of Sun, kiedy brakuje Ci motywacji lub cierpisz na słomiany zapał, masz problem z ukończeniem projektów, rozpoczynasz nowy, wymagający etap w życiu.  Naszyjnik   naenergetyzuje   dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','naszyjnik-z-ogniwami-talizman-sily-i-szczescia-energy-of-sun','','','','Naszyjnik z ogniwami - Talizman siły i szczęścia Energy of Sun','','','',''),
(26,1,1,'Każdy z nas ma w sobie duchowy drogowskaz, który prowadzi go na właściwą ścieżkę życia; przewodnika, który kieruje we właściwym kierunku i zapewnia poczucie bezpieczeństwa podczas życiowych zakrętów. Czasami jednak gubimy to połączenie i zbaczamy ze swojej Drogi. Gwiazda i cyrkonia symbolizuje światło, do którego dąży Twoja dusza. Dotarcie do niego wymaga jednak pokonania wielu wyzwań i transformacji.   Naszyjnik Stella Nova wesprze Cię w znalezieniu swojej Drogi siły do pokonania trudności, otworzy Cię na dostrzeganie znaków.  Załóż go, gdy jesteś na etapie transformacji, lub masz poczucie, że zboczyłaś ze swojej ścieżki.  Talizman energetyzowany, naszyjnik  naenergetyzuje   dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','naszyjnik-z-gwiazda-i-cyrkoniami-talizman-transformacji-i-rozwoju-duchowego-stella-nova','','','','Naszyjnik z gwiazdą i cyrkoniami - Talizman transformacji i rozwoju duchowego Stella Nova','','','',''),
(27,1,1,'Portal 08.08 zwany BRAMĄ LWA, jest bardzo ważnym kosmicznym wydarzeniem, które przez niektórych uważane jest za najszczęśliwszy dzień roku. Sekwencja ósemek sprawia, że tego dnia mamy ogromny przepływ energii, która wspiera nasze manifestacje! Przekaz jest mocniejszy, a intencje trafiają do źródła. Zasłona między światem duchowym, a materialnym opada, dając nam łatwość kreacji!  Puść swoje pragnienia z wiarą realizacji. Nie bój się marzyć. Stań w swojej mocy i otwórz się na nowe. Zdejmij dotychczasowe blokady, otwórz się na innowacyjne pomysły, porzuć wątpliwości! To dzień, w którym kreujesz z pola swojego serca!  8.08 nasz Moonbrother Mariusz naenergetyzuje dla Ciebie talizman na manifestację Twoich pragnień! Noś go przy sobie, by korzystać z tej wspierającej energii!','','brama-lwa-0808-naszyjnik-srebrny-z-gwiazdkami-starlet','','','','BRAMA LWA 08.08 - Naszyjnik srebrny z gwiazdkami Starlet','','','',''),
