(29,1,1,'Perły mają niezwykle bogatą symbolikę. W taoizmie, hinduizmie i buddyzmie „płonąca perła” symbolizuje wewnętrzną mądrość i wzmacnia nasze połączenie z boskimi energiami kosmosu. Perły są klejnotem, który zachęcająca do odkrycia prawdziwego JA i naszego prawdziwego celu na Ziemi. Wspierają w pracy z emocjami, przynosząc ukojenie, są amuletem chroniącym przed niepożądanymi energiami z nieziemskich źródeł. Odzwierciedlają także czystość, uczciwość i lojalność - czyli te wartości, które wspierają energię dobrostanu.  Załóż naszyjnik Protection Pearls, gdy potrzebujesz wsparcia w pracy z własnymi emocjami, chcesz żyć w zgodzie ze sobą i podążać właściwą drogą oraz chronić się przed negatywnymi wpływami.   Ten naszyjnik  naenergetyzuje  dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','naszyjnik-z-perlami-i-lancuszkiem-talizman-ochrony-i-wewnetrznej-prawdy-protection-pearls','','','','Naszyjnik z perłami i łańcuszkiem - Talizman ochrony i wewnętrznej prawdy Protection Pearls','','','',''),
(30,1,1,'Dla wojownika nie ma rzeczy niemożliwych. Sztylet to atrybut nieustraszonego pokonywania przeciwników i stawiania czoła bitwom bez wahania. Może również reprezentować wolność, umiejętności, spryt, oddanie celom, a także bystry intelekt. Symbolizuje odwagę i służy jako motywacja, by przejść przez życie bez strachu.  Ten naszyjnik  naenergetyzuje   dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat, na wsparcie w biznesie i życie w świetle męskiej energii. Załóż go, by poczuć się jak prawdziwy Wojownik i stanąć w pełni swojej mocy, a także gdy rozpoczynasz nową działalność i potrzebujesz determinacji, siły, asertywności oraz odwagi na co dzień.','','lancuszek-ze-sztyletem-talizman-odwagi-warrior','','','','Łańcuszek ze sztyletem - Talizman odwagi Warrior','','','',''),
(31,1,1,'W wielu wierzeniach serce jest symbolem odwagi moralnej, sumienia oraz źródła oświecenia duchowego. Symbol serca wykorzystywano również w rytuałach mających na celu wzmocnienie istniejących relacji. Obecnie, serce kojarzone jest w różnych kulturach z miłością, miłosierdziem, empatią i radością.  Ametyst  chroni przed niskimi wibracjami, atakami energetycznymi, stresem i złorzeczeniem. Sprzyja uwolnieniu od lęków, przywróceniu równowagi i uwolnieniu umysłu od negatywnych myśli. Ciemne energie transformuje w światło, które zwraca do Wszechświata.  Załóż naszyjnik Power of Love, jeżeli starasz się otworzyć na nowe relacje i miłość lub chcesz wzmocnić już te istniejące. A także, aby chronić się przed niskimi wibracjami, niechcianymi emocjami i wampirami energetycznymi.  Ten naszyjnik  naenergetyzuje  dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','naszyjnik-z-ametystem-i-sercem-talizman-milosci-i-ochrony-power-of-love','','','','Naszyjnik z ametystem i sercem - Talizman miłości i ochrony Power of Love','','','',''),
(32,1,1,'Gwiazda poranna, to jedna z nazw planety Wenus, która jest najdłużej widoczna na niebie przed wschodem słońca i zwiastuje nadejście nowego dnia. Według wierzeń Buddyjskich jej poranne promienie pomagają osiągnąć oświecenie i przejrzystość umysłu. Wenus to także bogini miłości i reprezentacja kwintesencji kobiecości. Jest Panią wszelkiego piękna i urodzaju, sprzyja także pomyślności w biznesie oraz wspiera wyrażanie uczuć.   Załóż naszyjnik Morning Star, gdy chcesz wspomóc swoją kobiecą energię i swobodniej wyrażać emocje. A także, gdy rozwijasz się duchowo i szukasz swojego wyższego celu oraz chcesz uzyskać dostęp do wewnętrznej mądrości.  Talizman energetyzowany, ten naszyjnik  naenergetyzuje   dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','naszyjnik-z-gwiazdkami-talizman-wewnetrznej-madrosci-morning-star','','','','Naszyjnik z gwiazdkami - Talizman wewnętrznej mądrości Morning Star','','','',''),
(33,1,1,'Dharma to ważna koncepcja hinduska i buddyjska, odnosząca się do prawa lub zasady rządzącej wszechświatem. Słowo to pochodzi od sanskryckiego dhri, które oznacza „trzymać”, „utrzymywać” lub „zachować”. We wczesnych Wedach i innych starożytnych tekstach hinduskich dharma odnosiła się do kosmicznego prawa, które stworzyło uporządkowany wszechświat z chaosu. Jest uważana za jeden z trzech klejnotów buddyzmu, obok sangi i buddy, które razem torują ścieżkę do oświecenia.   Na poziomie indywidualnym dharma może odnosić się do osobistej misji lub celu. Tradycyjnie uważa się, że dharma danej osoby jest z góry określona, a wszystkie istoty muszą zaakceptować swoją dharmę, aby na świecie panował ład i harmonia. Człowiek podążający za swoją dharmą, spełnia swoje najprawdziwsze powołanie. Służy wszystkim innym istotom we wszechświecie, odgrywa swoją prawdziwą rolę.  Załóż naszyjnik Dharma, jeśli chcesz żyć w zgodzie ze swoją własną dharmą. Tylko wtedy życie człowieka przynosi radość i spełnienie.  Ten naszyjnik  naenergetyzuje  dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','naszyjnik-boho-talizman-przeznaczenia-dharma','','','','Naszyjnik boho - Talizman przeznaczenia Dharma','','','',''),
(34,1,1,'Wydaje Ci się, że prześladuje Cię pech, potrzebujesz nieco farta do realizacji swoich planów lub jesteś przed ważnych życiowym wydarzeniem? Pomoże Ci nasz talizman szczęścia!  Good Luck Only jest wykonany z ametystu, który chroni przed niskimi wibracjami, atakami energetycznymi, stresem i złorzeczeniem. Uwalnia od lęków i negatywnych myśli, przywraca równowagę i spokój. Ciemne energie transformuje w światło, które zwraca do Wszechświata.  Załóż Good Luck Only, jeśli jesteś na etapie ważnych zmian w swoim życiu, stoisz w obliczu nowego wyzwania lub chcesz, żeby Twoje plany zakończyły się sukcesem. Talizman  naenergetyzuje  dla Ciebie Moonbrother Mariusz, aby dodał optymizmu i wiary w lepszą przyszłość, oczyścił z lęków i barier oraz otworzył Cię na powodzenie w przedsięwzięciach.','','lancuszek-z-ogniwami-i-fioletowymi-kamieniami-talizman-szczescia-good-luck-only','','','','Łańcuszek z ogniwami i fioletowymi kamieniami - Talizman szczęścia Good Luck Only','','','',''),
(35,1,1,'Hamsa jest związana z wieloma tradycjami. W hinduizmie jest często używana jako synonim najwyższego ducha lub ostatecznej rzeczywistości, która nazywa się „Brahmanem”. W buddyzmie reprezentuje uniwersalnego ducha i wyzwolenie z cyklu odrodzenia. Do naszej kultury przeszła jako symbol odpierania zła i negatywnych energii.  Załóż naszyjnik Hamsa jeśli miewasz spadki nastroju, czujesz, że uchodzi z Ciebie energia lub pracujesz w stresujących warunkach. Talizman sprzyja ochronie i wspiera wysokie wibracje.   Naszyjnik   naenergetyzuje   dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','naszyjnik-zloty-z-zawieszka-talizman-wysokich-wibracji-hamsa','','','','Naszyjnik złoty z zawieszką - Talizman wysokich wibracji Hamsa','','','',''),
(36,1,1,'Wenus to bogini miłości i reprezentacja kwintesencji kobiecości. Jest Panią wszelkiego piękna i urodzaju, sprzyja także pomyślności w biznesie oraz wspiera wyrażanie uczuć.   Kolor lazurowy sprzyja relaksowi i wyciszeniu, wprowadza harmonię oraz spokój.   Załóż naszyjnik Venus, gdy chcesz wspomóc swoją kobiecą energię i swobodniej wyrażać emocje. A także, gdy pragniesz wprowadzić do swojego życia więcej harmonii i spokoju oraz otworzyć się na powodzenie w przedsięwziętych działaniach.   Ten naszyjnik  naenergetyzuje   dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','naszyjnik-z-koralikami-i-hematytem-talizman-kobiecosci-i-harmonii-venus','','','','Naszyjnik z koralikami i hematytem - Talizman kobiecości i harmonii Venus','','','',''),
(37,1,1,'Twoje życie jest jak łańcuszek, w którym wszystkie ważne ogniwa powinny być w harmonii, żebyś była szczęśliwa. Rodzina, praca, pieniądze, zdrowie, przyjaźń - bez względu na to na jakim obszarze życia potrzebujesz wsparcia, pomoże Ci w tym łańcuszek szczęścia.  Rodochrozyt to kamień szeroko pojętej miłości i uczuć. Szczególnie uwrażliwia na miłość własną i uleczenie ran emocjonalnych. Koi duszę i pomaga uzyskać wewnętrzny spokój.   Naszyjnik Link of Love, otworzy Cię na miłość własną i wspomoże powodzenie w Twoich przedsięwzięciach. Załóż go, jeśli wydaje Ci się, że prześladuje Cię pech, potrzebujesz nieco farta i spokoju do realizacji swoich planów.   Tą bransoletkę  naenergetyzuje  dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','naszyjnik-z-ogniwami-i-rodochrozytem-talizman-szczescia-i-milosci-link-of-love','','','','Naszyjnik z ogniwami i rodochrozytem - Talizman szczęścia i miłości Link of Love','','','',''),
(38,1,1,'W chwili obecnej Jowisz nazywany „wielkim szczęściem” w horoskopie, króluje w znaku Barana i 02. marca spotka się na niebie z \"małym szczęściem\", czyli Wenus. To połączenie dwóch beneficznych planet sprzyja przyciąganiu szczęścia, ekspansji pragnień, odważnym inwestycjom, udanym spotkaniom, zakochaniu, ogromnej kreatywności, ambicji i negocjacjom. 02. marca 2023 to również dzień trójkowy, który jest pod władaniem Jowisza. Trójka to najbardziej zakochana w życiu wibracja, która odpowiada również za radość, szczęście, komunikację, artyzm i rozrywkę. Korzystając z tego sprzyjającego astronumerologicznego dnia, Moonbrother Mariusz naenergetyzuje dla Ciebie ten talizman, aby stał się uniwersalnym wsparciem płynącym z tych wibracji.','','talizman-astronumerologiczny-naszyjnik-z-opalem-rozowym-high-spirits','','','','Talizman astronumerologiczny - Naszyjnik z opalem różowym High Spirits','','','',''),
(39,1,1,'Mandala w języku hindi oznacza krąg i reprezentuje koło życia. To symbol doskonałości i harmonii, a także pierwiastka duchowego. Symbol słońca dodaje pewności siebie i ognia w działaniu. Sprawia, że łatwiej dostrzegamy okazje, wykorzystujemy możliwości, jesteśmy skuteczni w gromadzeniu zasobów, które pomagają osiągnąć cel i przyspieszają manifestację pragnień. Słońce symbolizuje to, co fizyczne. Warunkiem życia w dostatku jest balans między tym, co duchowe, a tym, co materialne.  Naszyjnik Fortune to potężny talizman, który wspomoże wiarę i moc w działaniu oraz otworzy Cię na dobrostan, obfitość i bogactwo. Pomoże uwierzyć Ci w swoją moc sprawczą i skuteczne działanie w biznesie.  Ten naszyjnik  naenergetyzuje  dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','naszyjnik-srebrny-ze-sloncem-talizman-mocy-i-wiary-w-dzialanie-fortune','','','','Naszyjnik srebrny ze słońcem - Talizman mocy i wiary w działanie Fortune','','','',''),
(40,1,1,'Mandala w języku hindi oznacza krąg i reprezentuje koło życia. To symbol doskonałości i harmonii, a także pierwiastka duchowego. Symbol słońca dodaje pewności siebie i ognia w działaniu. Sprawia, że łatwiej dostrzegamy okazje, wykorzystujemy możliwości, jesteśmy skuteczni w gromadzeniu zasobów, które pomagają osiągnąć cel i przyspieszają manifestację pragnień. Słońce symbolizuje to, co fizyczne. Warunkiem życia w dostatku jest balans między tym, co duchowe, a tym, co materialne.  Naszyjnik Fortune to potężny talizman, który wspomoże wiarę i moc w działaniu oraz otworzy Cię na dobrostan, obfitość i bogactwo. Pomoże uwierzyć Ci w swoją moc sprawczą i skuteczne działanie w biznesie.  Ten naszyjnik  naenergetyzuje  dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','naszyjnik-ze-sloncem-talizman-mocy-i-wiary-w-dzialanie-fortune','','','','Naszyjnik ze słońcem - Talizman mocy i wiary w działanie Fortune','','','',''),
(41,1,1,'Czterolistna koniczyna to symbol szczęścia, zwiastujący powodzenie we wszystkich obszarach życia. Według dawnych tradycji każdy z listków symbolizował inną wartość nadzieję, wiarę, miłość oraz szczęście. Na podstawie wierzeń celtyckich przypisywano jej również funkcję ochronną.   Załóż naszyjnik Good Luck, gdy chcesz wspomóc szczęście. Wydaje Ci się, że prześladuje Cię pech i potrzebujesz nieco farta do realizacji swoich planów oraz chcesz tchnąć trochę nadziei w swoje działania.   Talizman energetyzowany, tą bransoletkę  naenergetyzuje  dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','naszyjnik-z-koniczyna-talizman-pomyslnosci-i-nadziei-good-luck','','','','Naszyjnik z koniczyną - Talizman pomyślności i nadziei Good Luck','','','',''),
(42,1,1,'Wąż reprezentuje reinkarnację, nieśmiertelność i czystość. Ma potężne połączenie z pierwotną energią i siłą życiową.W większości kultura jest uważany za potężny symbol reprezentujący źródło życia. To atrybut energii, ważnych przejść i zmian, niezależnie od tego, czy zachodzą one na poziomie duchowym, emocjonalnym czy fizycznym.  Załóż talizman Cobra, gdy jesteś na etapie transformacji, lub potrzebujesz dodatkowych sił witalnych. Noś w duecie z jednym z naszych magicznych łańcuszków, żeby wzmocnić jej intencje.  Naszyjnik   naenergetyzuje  dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','naszyjnik-zmijka-srebrna-talizman-przemiany-cobra','','','','Naszyjnik żmijka srebrna - talizman przemiany Cobra','','','',''),
(43,1,1,'Świeca rytualna „Pewność siebie” z naturalnego wosku pszczelego, która wydziela delikatny, klasyczny zapach. Wzmacnia  pewność siebie, ambicję i kreatywność.  Magia świec jest jedną z najprostszych metod wspierania manifestacji intencji lub woli. Odpowiedni kolor świecy umacnia żywioł ognia, zapewnia energetyczną ochronę oraz ułatwia znalezienie rozwiązań.','','pomaranczowa-swieca-z-wosku-pszczelego-pewnosc-siebie','','','','Pomarańczowa świeca z wosku pszczelego Pewność siebie','','','',''),
(44,1,1,'Duża świeca do wykorzystania jako element wystroju lub podczas rytuałów w celu przyciągnięcia  dobrobytu, ambicji i mocy.  Świeca ma piękny zapach lawendy. Magia świec jest jedną z najprostszych metod wspierania manifestacji intencji lub woli. Odpowiedni kolor świecy umacnia żywioł ognia, zapewnia energetyczną ochronę oraz ułatwia znalezienie rozwiązań.  Niezależnie od tego, czy jest używana jako alternatywny wystrój, czy jako święte narzędzie rytualne, ta świeca sprzyja przyciąganiu wszystkiego, co boskie.  Wystarczy zapisać swoją intencję tym samym kolorem co świeca i spalić kartkę w bezpiecznym naczyniu. Można także wyryć szpilką intencję na świecy. Aby rytuał został ukończony, świeca musi zostać wypalona do końca.  Pamiętaj, że palenie świecy nie zmieni Twojego życia, jeśli Ty będziesz bierny. Skupienie się na intencji, sprecyzowanie celu i wejście w tą energię uczy Twoją podświadomość, co jest dla Ciebie dobre, do czego dążysz i na co jesteś gotowy.  Nasze świece mają jednolity kolor (nie są zanurzone) i są wykonane z parafiny.','','duza-swieca-ozdobna-rytualna-filetowa-bogactwo','','','','Duża świeca ozdobna/rytualna filetowa Bogactwo','','','',''),
(45,1,1,'Duża świeca do wykorzystania jako element wystroju lub podczas rytuałów w celu przyciągnięcia  przyjaźni i szczęśliwych, sprzyjających relacji.  Świeca ma urzekający kwiatowy zapach. Magia świec jest jedną z najprostszych metod wspierania manifestacji intencji lub woli. Odpowiedni kolor świecy umacnia żywioł ognia, zapewnia energetyczną ochronę oraz ułatwia znalezienie rozwiązań.  Niezależnie od tego, czy jest używana jako alternatywny wystrój, czy jako święte narzędzie rytualne, ta świeca sprzyja przyciąganiu wszystkiego, co boskie.  Wystarczy zapisać swoją intencję tym samym kolorem co świeca i spalić kartkę w bezpiecznym naczyniu. Można także wyryć szpilką intencję na świecy. Aby rytuał został ukończony, świeca musi zostać wypalona do końca.  Pamiętaj, że palenie świecy nie zmieni Twojego życia, jeśli Ty będziesz bierny. Skupienie się na intencji, sprecyzowanie celu i wejście w tą energię uczy Twoją podświadomość, co jest dla Ciebie dobre, do czego dążysz i na co jesteś gotowy.  Nasze świece mają jednolity kolor (nie są zanurzone) i są wykonane z parafiny.','','duza-swieca-ozdobna-rytualna-rozowa-relacje','','','','Duża świeca ozdobna/rytualna różowa Relacje','','','',''),
(46,1,1,'Świeca z pokrywką, nawiązująca do tradycyjnych wzorów kart tarota. Inspirowana kartą księżyc ma oryginalny wygląd i piękny zapach opium. Karta księżyc zwiastuje zmiany w postrzeganiu otaczającego nas świata. W świetle księżyca możemy dostrzec rzeczy wcześniej nam umykające i uzyskać połączenie z naszą podświadomością. W życiu poza rozumem, drogowskazami są także symbole, intuicja oraz przeczucia jakie nam towarzyszą.   Zachowaj ostrożność podczas palenia i nigdy nie zostawiaj zapalonej świecy bez nadzoru.','','swieca-o-zapachu-opium-tarot-the-moon','','','','Świeca o zapachu opium Tarot the Moon','','','',''),
(47,1,1,'Świeca z pokrywką, nawiązująca do tradycyjnych wzorów kart tarota. Inspirowana kartą gwiazda ma piękny wygląd oraz cudowny zapach lawendy. Karta gwiazda symbolizuje samorealizację, poznanie życiowego celu, wyzwolenie i spokój. Karta ta ma charakter motywacyjny, zachęca do podjęcia działań i kolejnych kroków na drodze życia. Przypomina by dostrzegać okazje i korzystać z otrzymanych szans.     Zachowaj ostrożność podczas palenia i nigdy nie zostawiaj zapalonej świecy bez nadzoru.','','swieca-o-zapachu-lawendy-tarot-the-star','','','','Świeca o zapachu lawendy Tarot The Star','','','',''),
(48,1,1,'Stworzyliśmy dla Ciebie pachnące, sojowe świece zodiakalne, dopasowane do każdego ze znaków zodiaku. Dzięki świecy możesz stworzyć cudowną atmosferę sprzyjającą relaksowi i wypełnić swoje domowe sanktuarium pięknym zapachem lub wysłać do wszechświata intencję wzmocnioną jej płomieniem.  Magia świec jest jedną z najprostszych metod wspierania manifestacji intencji lub woli.   Zapachy zodiakalne:   Baran - drzewo agarowe  Byk - bergamotka  Bliźnięta - orchidea  Rak - zielone jabłko  Lew - winogrona  Panna - paczula  Waga - mandarynka i jagoda  Skorpion - drzewo cedrowe  Strzelec - lawenda i cytryna  Koziorożec - tuberoza  Wodnik - kwiat bawełny  Ryby - zielona herbata','','zodiakalna-swieca-zapachowa','','','','Zodiakalna świeca zapachowa','','','',''),
(49,1,1,'Świeca z pokrywką, nawiązująca do tradycyjnych wzorów kart tarota. Inspirowana kartą kochanków ma piękny wygląd oraz cudowny zapach czerwonej róży. Karta kochankowie odnosi się do naszych relacji. Przedstawieni na niej kochankowie, są symbolem zjednoczenia z drugim człowiekiem, jednak należy mieć na uwadze, że mimo bliskich relacji zawsze pozostajemy oddzielnymi bytami.','','swieca-o-zapachu-rozanym-tarot-the-lovers','','','','Świeca o zapachu różanym Tarot The Lovers','','','',''),
(50,1,1,'Świeca z pokrywką, nawiązująca do tradycyjnych wzorów kart tarota. Inspirowana kartą słońce ma piękny wygląd oraz cudowny zapach białej szałwii. Karta słońce niesie ze sobą pozytywny przekaz, zazwyczaj zwiastuje radość, optymizm, oświecenie oraz realizację celów. Przypomina, że zdobyte w życiu doświadczenie, uświadamia człowiekowi posiadaną siłę i pomaga odnaleźć sens życia.      Zachowaj ostrożność podczas palenia i nigdy nie zostawiaj zapalonej świecy bez nadzoru.','','swieca-o-zapachu-bialej-szalwii-tarot-the-sun','','','','Świeca o zapachu białej szałwii Tarot the Sun','','','',''),
(51,1,1,'Duże świece do wykorzystania jako piękny element wystroju lub podczas rytuałów, w celu wzmocnienia afirmacji. Magia świec jest jedną z najprostszych metod wspierania manifestacji intencji lub woli. W świecach zatopiono naturalne kamienie, każdy z nich ma inne, wyjątkowe właściwości, wspierające wybrany obszar życia.','','duza-swieca-z-naturalnymi-kamieniami','','','','Duża świeca z naturalnymi kamieniami','','','',''),
(52,1,1,'Świeca rytualna „Szczęście” z naturalnego wosku pszczelego, która wspiera powodzenie w przedsięwzięciach, przyciąga szczęście oraz wydziela delikatny, klasyczny zapach. Pomaga urzeczywistnić ideały, otworzyć kanał mądrości, odnaleźć inspiracje, przenieść na nowy poziom rozwoju duchowego.  Magia świec jest jedną z najprostszych metod wspierania manifestacji intencji lub woli. Odpowiedni kolor świecy umacnia żywioł ognia, zapewnia energetyczną ochronę oraz ułatwia znalezienie rozwiązań.  Najważniejszą rzeczą w rytuale jest twoja szczerość i intencja, z jaką palisz świecę. Jednak pamiętaj, że nie zmienisz swojego życia, jeśli będziesz bierny. Skupienie się na intencji, sprecyzowanie celu i wejście w tą energię uczy Twoją podświadomość, co jest dla Ciebie dobre, do czego dążysz i na co jesteś gotowy.','','biala-swieca-z-wosku-pszczelego-szczescie','','','','Biała świeca z wosku pszczelego Szczęście','','','',''),
(53,1,1,'Świeca rytualna Ochrona z naturalnego wosku pszczelego, która wydziela delikatny, klasyczny zapach. Czarny kolor chroni i odbija negatywne energie. Świece w czarnym kolorze stosowane są podczas rytuałów ochronnych, a także rytuałów, które mają coś w naszym życiu zakończyć. Dodatkowo wykorzystywane są podczas medytacji do wyciszenia rozbieganego umysłu.  Magia świec jest jedną z najprostszych metod wspierania manifestacji intencji lub woli. Odpowiedni kolor świecy umacnia żywioł ognia, zapewnia energetyczną ochronę oraz ułatwia znalezienie rozwiązań.  Najważniejszą rzeczą w rytuale jest twoja szczerość i intencja, z jaką palisz świecę. Jednak pamiętaj, że nie zmienisz swojego życia, jeśli będziesz bierny. Skupienie się na intencji, sprecyzowanie celu i wejście w tą energię uczy Twoją podświadomość, co jest dla Ciebie dobre, do czego dążysz i na co jesteś gotowy.','','czarna-swieca-z-wosku-pszczelego-ochrona','','','','Czarna świeca z wosku pszczelego Ochrona','','','',''),
(54,1,1,'Świeca rytualna Bogactwo z naturalnego wosku pszczelego, która wspiera dobrobyt i siłę duchową oraz wydziela delikatny, klasyczny zapach. Pomaga urzeczywistnić ideały, otworzyć kanał mądrości, odnaleźć inspiracje, przenieść na nowy poziom rozwoju duchowego.  Magia świec jest jedną z najprostszych metod wspierania manifestacji intencji lub woli. Odpowiedni kolor świecy umacnia żywioł ognia, zapewnia energetyczną ochronę oraz ułatwia znalezienie rozwiązań.  Najważniejszą rzeczą w rytuale jest twoja szczerość i intencja, z jaką palisz świecę. Jednak pamiętaj, że nie zmienisz swojego życia, jeśli będziesz bierny. Skupienie się na intencji, sprecyzowanie celu i wejście w tą energię uczy Twoją podświadomość, co jest dla Ciebie dobre, do czego dążysz i na co jesteś gotowy.','','fioletowa-swieca-z-wosku-pszczelego-bogactwo','','','','Fioletowa świeca z wosku pszczelego Bogactwo','','','',''),
(55,1,1,'Świeca rytualna „Sukces” z naturalnego wosku pszczelego, która wydziela delikatny, klasyczny zapach. Świece w kolorach kremowym, złotym i kości słoniowej przyciągają sukces i szczęście. Są również szeroko stosowane do rytuałów słonecznych i przed podjęciem nowych kroków w życiu. Mają też moc przyciągania wysokich wibracji i anielskiej ochrony.   Magia świec jest jedną z najprostszych metod wspierania manifestacji intencji lub woli. Odpowiedni kolor świecy umacnia żywioł ognia, zapewnia energetyczną ochronę oraz ułatwia znalezienie rozwiązań.  Najważniejszą rzeczą w rytuale jest twoja szczerość i intencja, z jaką palisz świecę. Jednak pamiętaj, że nie zmienisz swojego życia, jeśli będziesz bierny. Skupienie się na intencji, sprecyzowanie celu i wejście w tą energię uczy Twoją podświadomość, co jest dla Ciebie dobre, do czego dążysz i na co jesteś gotowy.','','kremowa-swieca-z-wosku-pszczelego-sukces','','','','Kremowa świeca z wosku pszczelego Sukces','','','',''),
(56,1,1,'Świeca rytualna „Miłość” z naturalnego wosku pszczelego, która wydziela delikatny, klasyczny zapach. Wzmacnia miłość, pożądanie i namiętność, pomaga otworzyć na związek. Wzmacnia tez miłość własną.  Magia świec jest jedną z najprostszych metod wspierania manifestacji intencji lub woli. Odpowiedni kolor świecy umacnia żywioł ognia, zapewnia energetyczną ochronę oraz ułatwia znalezienie rozwiązań.','','czerwona-swieca-z-wosku-pszczelego-milosc','','','','Czerwona świeca z wosku pszczelego Miłość','','','',''),
(57,1,1,'Świeca rytualna Relacje z naturalnego wosku pszczelego, która wydziela delikatny, klasyczny zapach. Wzmacnia miłość, przyjaźń, pojednanie, pomaga stanąć w świetle kobiecej energii. Ułatwia wybaczenie, wzmacnia tez miłość własną.  Magia świec jest jedną z najprostszych metod wspierania manifestacji intencji lub woli. Odpowiedni kolor świecy umacnia żywioł ognia, zapewnia energetyczną ochronę oraz ułatwia znalezienie rozwiązań.','','rozowa-swieca-z-wosku-pszczelego-relacje','','','','Różowa świeca z wosku pszczelego Relacje','','','',''),
(58,1,1,'Duża świeca do wykorzystania jako element wystroju lub podczas rytuałów w celu przyciągnięcia ochrony oraz pozytywnych zakończeń, np. relacji. Świeca ma urzekający zapach opium. Idealna do wykorzystania podczas rytuałów ochronnych i przewodnictwa. Magia świec jest jedną z najprostszych metod wspierania manifestacji intencji lub woli. Odpowiedni kolor świecy umacnia żywioł ognia, zapewnia energetyczną ochronę oraz ułatwia znalezienie rozwiązań.  Niezależnie od tego, czy jest używana jako alternatywny wystrój, czy jako święte narzędzie rytualne, ta świeca sprzyja przyciąganiu wszystkiego, co boskie.  Wystarczy zapisać swoją intencję tym samym kolorem co świeca i spalić kartkę w bezpiecznym naczyniu. Można także wyryć szpilką intencję na świecy. Aby rytuał został ukończony, świeca musi zostać wypalona do końca.  Pamiętaj, że palenie świecy nie zmieni Twojego życia, jeśli Ty będziesz bierny. Skupienie się na intencji, sprecyzowanie celu i wejście w tą energię uczy Twoją podświadomość, co jest dla Ciebie dobre, do czego dążysz i na co jesteś gotowy.  Nasze świece mają jednolity kolor (nie są zanurzone) i są wykonane z parafiny.','','duza-swieca-ozdobna-rytualna-czarna-ochrona','','','','Duża świeca ozdobna/rytualna czarna Ochrona','','','',''),
