(72,1,1,'Duża świece do wykorzystania jako piękny element wystroju lub do pracy z czakrami. Świeca zawiera naturalne olejki eteryczne o zapachu wiciokrzewu oraz cedru. Została wykonana z wosku palmowego, pochodzącego z równoważonych upraw, jest opakowana w szkle recyklingowym.   Magia świec jest jedną z najprostszych metod wspierania manifestacji intencji lub woli.','','duza-swieca-o-zapachu-wiciokrzewu-i-cedru-7-czakr','','','','Duża świeca o zapachu wiciokrzewu i cedru 7 CZAKR','','','',''),
(73,1,1,'Zestaw 12 żółtych świec do wykorzystania podczas rytuałów w celu przyciągnięcia sukcesu, skupienia i intuicji. Magia świec jest jedną z najprostszych metod wspierania manifestacji intencji lub woli. Odpowiedni kolor świecy umacnia żywioł ognia, zapewnia energetyczną ochronę oraz ułatwia znalezienie rozwiązań.  Wystarczy zapisać swoją intencję tym samym kolorem co świeca i spalić kartkę w bezpiecznym naczyniu. Można także wyryć szpilką intencję na świecy. Aby rytuał został ukończony, świeca musi zostać wypalona do końca.  Pamiętaj, że palenie świecy nie zmieni Twojego życia, jeśli Ty będziesz bierny. Skupienie się na intencji, sprecyzowanie celu i wejście w tą energię uczy Twoją podświadomość, co jest dla Ciebie dobre, do czego dążysz i na co jesteś gotowy.','','zolte-swiece-rytualne-sukces','','','','Żółte świece rytualne Sukces','','','',''),
(74,1,1,'Czakry możesz synchronizować za pomocą olejków, medytacji, odpowiednich dźwięków lub przy pomocy świecy. Ich magia,  jest jedną z najprostszych metod wspierania manifestacji, intencji lub woli. Lepsze funkcjonowanie czakr ma zbawienny wpływ na wiele obszarów naszego życia od samopoczucia, przez zdrowie, kończąc na efektywności w działaniu i kreatywności.   Zapachy i kolory, które tu widzisz, nie są przypadkowe! Dobierz odpowiednią świecę do czakry, z którą chcesz pracować:    Kolor czerwony  - c zakra korzenia - cassia, goździki, gałka muszkatołowa   Kolor pomarańczowy   - c zakra sakralna - cedr, świerk, rozmaryn    Kolor żółty   - c zakra splotu słonecznego - bergamotka, cytryna, grejpfrut    Kolor zielony   - c zakra serca - lawenda, pomarańcza, mandarynka    Kolor błękitny   - c zakra gardła - marokańska róża, rumianek    Kolor granatowy   - c zakra trzeciego oka - lawenda, rumianek, jodła    Kolor fioletowy   - c zakra korony - paczula, olibanum, labdanum','','zapachowa-swieca-do-medytacji-i-pracy-z-czakra','','','','Zapachowa świeca do medytacji i pracy z czakrą','','','',''),
(75,1,1,'Życie w biegu, brak czasu na zatrzymanie się i głęboki oddech? Wieczorem padasz ze zmęczenia i brakuje Ci sił? Życie mija Ci dzień za dniem, a Ty nie potrafisz się nim cieszyć? Jeżeli tak, to ta medytacja jest idealna dla Ciebie. Pomoże Ci znaleźć chwilę dla siebie, dostrzec światło i wszelkie zasoby w sobie, aby móc sprostać wymaganiom dnia i się zregenerować.  W IMIĘ DOBREJ KARMY, NIE KOPIUJ, NIE PRZESYŁAJ DALEJ, WSZELKIE PRAWA ZASTRZEŻONE.','','medytacja-zatrzymaj-sie','','','','Medytacja \"Zatrzymaj się\"','','','',''),
(76,1,1,'Pakiet 2 medytacji!  Otwórz się na nowe doświadczenia i znajomości, siej ziarno, planuj, puść piękne intencje w świat podczas Nowiu.  Uwolnij się od niesłużących energii, oczyść siebie i swoje otoczenie, uzdrawiaj swoje emocje, celebruj swoje sukcesy i zbieraj plony swojej pracy podczas Pełni.  Format pliku: mp3  Czas Nów: 13:26 min.  Czas Pełnia: 15:02 min.  W IMIĘ DOBREJ KARMY, NIE KOPIUJ, NIE PRZESYŁAJ DALEJ,  WSZELKIE PRAWA ZASTRZEŻONE.','','medytacje-ksiezycowe-na-now-i-pelnie-2-pak','','','','Medytacje Księżycowe na Nów i Pełnię - 2-pak','','','',''),
(77,1,1,'Ta medytacja pozwoli Ci na wysłuchanie, zrozumienie i ukochanie swojej małej siebie. Możesz ją przytulić, uspokoić, uzdrowić, zapewnić opiekę - to Wasz czas na rozmowę. Praca z wewnętrznym dzieckiem pomoże Ci wzmocnić Ciebie dorosłą, poczuć się pewną siebie i silniejszą.  W IMIĘ DOBREJ KARMY, NIE KOPIUJ, NIE PRZESYŁAJ DALEJ,  WSZELKIE PRAWA ZASTRZEŻONE.','','medytacja-wewnetrzne-dziecko','','','','Medytacja \"Wewnętrzne Dziecko\"','','','',''),
(78,1,1,'Harmonizacja czakr pomoże Ci odblokować największe potencjały, wprowadzić do życia harmonię i wejść na najwyższe wibracje, które pokierują Cię do osiągnięcia sukcesu!   Praca z czakrami to nie tylko joga i medytacja z wykorzystaniem odpowiednich asan i mantr, ale również dźwięki. Muzyka w odpowiedniej częstotliwości, towarzysząca Ci przy medytacji, to sprawdzona i częsta technika,  wspomagają harmonizowanie centrów energetycznych i prawidłowy przepływ energii między nimi.   W IMIĘ DOBREJ KARMY, NIE KOPIUJ, NIE PRZESYŁAJ DALEJ, WSZELKIE PRAWA ZASTRZEŻONE.','','muzyka-do-medytacji-harmonizujaca-czakry','','','','Muzyka do medytacji harmonizująca czakry','','','',''),
(79,1,1,'Medytacja Nowego Początku Rozpoczynasz nowy etap w życiu? Być może  p rzed Tobą ślub, zmiana pracy, nowy związek, nowy rok albo urodziny? Zacznij ten etap rytualnie otwierając się na powiew świeżej energii. Przeprowadź prowadzoną medytację Nowego Początku i powitaj wszystko, co pojawi się w Twoim życiu. Uwierz, że masz Wsparcie Wszechświata i wszelkie zasoby niezbędne do tego, by żyć szczęśliwie.  W IMIĘ DOBREJ KARMY, NIE KOPIUJ, NIE PRZESYŁAJ DALEJ, WSZELKIE PRAWA ZASTRZEŻONE.','','medytacja-nowy-poczatek','','','','Medytacja \"Nowy Początek\"','','','',''),
(80,1,1,'Zbalansowane czakry to droga do odblokowania największych potencjałów, wprowadzenia do życia harmonii i wejścia na najwyższe wibracje, które pokierują Cię do osiągnięcia sukcesu!   Pracować z czakrami możesz nie tylko za pomocą jog i medytacji z wykorzystaniem odpowiednich asan i mantr, ale również za pomocą dźwięków. Muzyka o odpowiedniej częstotliwości, towarzysząca Ci przy medytacji, to wspaniała technika,   wspomagają harmonizowanie centrów energetycznych i prawidłowy przepływ energii między nimi.   Pakiet zawiera 7 utworów wykorzystujących odpowiednie Hz, dla każdej z siedmiu czakr.  W IMIĘ DOBREJ KARMY, NIE KOPIUJ, NIE PRZESYŁAJ DALEJ, WSZELKIE PRAWA ZASTRZEŻONE.','','muzyka-do-medytacji-harmonizujaca-czakry-pakiet-7-utworow','','','','Muzyka do medytacji harmonizująca czakry - PAKIET 7 UTWORÓW','','','',''),
(81,1,1,'Pakiet 2 ebooków i Medytacji w specjalnej cenie: \"Praca z Dziennikiem\"(100 str), dodatek \"Energia Pieniądza\"(53 str) i Medytacja \"Siła Podświadomości\"  Zmień swoje przekonania i zacznij świadomie kształtować swoje życie. \"Praca z Dziennikiem\" pomoże Ci podnieść Twoje wibracje, skutecznie manifestować, oczyścić głowę z codziennych problemów, wyznaczać cele i przepracować lęki. To potężne narzędzie stosowane i rekomendowane przez mentorów i świadomych multimilionerów tego świata, jakich jak: Tony Robbins, Oprah Winfrey, Deepak Chopra.  Dodatek \"Energia Pieniądza\" pomoże Ci zdiagnozować i radykalnie zmienić Twoje przekonania odnośnie pieniędzy oraz otworzyć się na przepływ finansowy. Medytacja \"Siła Podświadomości\" to klucz do Twojej wewnętrznej mocy i skrywanych zasobów! Zmień swój mindset!','','3-pak-e-book-praca-z-dziennikiem-dodatek-e-book-energia-pieniadza-medytacja-sila-podswiadomosci','','','','3-pak. e-book - Praca z Dziennikiem + dodatek e-book - Energia Pieniądza + medytacja \"Siła Podświadomości\"','','','',''),
(82,1,1,'Pakiet 2 ebooków w specjalnej cenie: \"Praca z Dziennikiem\" i dodatek \"Energia Pieniądza\".  Zmień swoje przekonania i zacznij świadomie kształtować swoje życie. \"Praca z Dziennikiem\" pomoże Ci podnieść Twoje wibracje, skutecznie manifestować, oczyścić głowę z codziennych problemów, wyznaczać cele i przepracować lęki. To potężne narzędzie stosowane i rekomendowane przez mentorów i świadomych multimilionerów tego świata, jakich jak: Tony Robbins, Oprah Winfrey, Deepak Chopra.  Dodatek \"Energia Pieniądza\" pomoże Ci zdiagnozować i radykalnie zmienić Twoje przekonania odnośnie pieniędzy oraz otworzyć się na przepływ finansowy. Poznaj zagadnienia, które całkowicie odmienią Twój mindset - jak zobaczysz pierwsze efekty, podziękujesz sobie, że zainwestowałeś w ten pakiet!','','pakiet-e-book-praca-z-dziennikiem-dodatek-e-book-energia-pieniadza','','','','Pakiet e-book - Praca z Dziennikiem + dodatek e-book Energia Pieniądza','','','',''),
(83,1,1,'Ebook \"Energia Pieniądza\" jest dodatkiem do ebooka \"Praca z Dziennikiem\". Dodatek pomoże Ci zdiagnozować i zmienić swoje przekonania odnośnie pieniędzy oraz otworzyć się na przepływ finansowy. Rekomendujemy, abyś w pierwszej kolejności zapoznał się z treścią ebooka \"Praca z Dziennikiem\", gdyż pomoże Ci to w pełni poznać zagadnienia i możliwości tego potężnego narzędzia.   Praca z Dziennikiem jest drogą do samorozwoju, pomaga osiągnąć sukces i radykalnie odmienić życie. To narzędzie jest rekomendowane i stosowane przez największych mentorów i świadomych multimilionerów tego świata, takich jak Tony Robbins, Oprah Winfrey, Deepak Chopra.  Poznaj zagadnienia, które całkowicie zmienią Twój finansowy mindset i przeprogramują Cię na przyjmowanie energii pieniądza.    Ebook zawiera 53 str.','','e-book-energia-pieniadza-dodatek-do-e-booka-praca-z-dziennikiem','','','','E-book - Energia Pieniądza - dodatek do e-booka - Praca z Dziennikiem','','','',''),
(84,1,1,'Zmień swoje przekonania i zacznij świadomie kształtować swoje życie. \"Praca z Dziennikiem\" (100 str.) pomoże Ci podnieść Twoje wibracje, skutecznie manifestować, oczyścić głowę z codziennych problemów, wyznaczać cele i przepracować lęki. To potężne narzędzie stosowane i rekomendowane przez znamienitych mentorów i świadomych multimilionerów tego świata, jakich jak: Tony Robbins, Oprah Winfrey, Deepak Chopra.  W \"Pracy z Dziennikiem\" znajdziesz zagadnienia, które całkowicie odmienią Twój mindset - jak zobaczysz pierwsze efekty, podziękujesz sobie, że zainwestowałeś w ten e-book!  Jeśli pieniądze, zarabianie i otworzenie się na obfitość to obszary, które są dla Ciebie wyzwaniem, zapoznaj się z dodatkiem \"Energia Pieniądza\", który pomoże Ci zaprosić przepływ finansowy do swojego życia.','','e-book-praca-z-dziennikiem','','','','E-book - Praca z Dziennikiem','','','',''),
(85,1,1,'SPRAWDŹ PRZED ZAKUPEM CZY WYBRAŁAŚ EBOOK DLA POPRAWNEJ LICZBY NUMEROLOGICZNEJ!  Workbook o energiach miesiąca jest jak prognoza pogody. Co prawda nie zmienisz tego, że pada deszcz, ale możesz wziąć ze sobą parasol! Jeśli chcesz, by każdy miesiąc pracował na Twoją korzyść, zaplanuj codzienne aktywności zgodnie z wspierającą energią! Dzięki temu osiągniesz więcej i unikniesz możliwych zagrożeń oraz wyciśniesz każdy miesiąc jak cytrynę! Będziesz dokładnie wiedziała, na co uważać, co zaplanować w danym czasie i jak wyciągnąć światło z wibracji w danym okresie. Dostrój się do wibracji miesiąca wraz z naszymi podpowiedziami, pytaniami do duszy i polecanymi praktykami. Dzięki temu Twoja prognoza z Alchemii Roku 2024 będzie jeszcze bardziej szczegółowa!','','alchemia-roku-workbook-do-pracy-z-energia-poszczegolnych-miesiecy','','','','Alchemia roku - Workbook do pracy z energią poszczególnych miesięcy','','','',''),
(86,1,1,'Silna intuicja i połączenie z duszą. Zestaw magicznych kamieni dla osób chcących zaufać intuicji, wzmocnić połączenie ze swoim Wyższym Ja, usłyszeć wewnętrzny głos.  Twój Magiczny Zestaw zawiera:  1. Lapis Lazuli 2. Sodalit 3. Labradoryt 4. Amazonit 5. Instrukcję dotyczącą dbania o kamienie 6. Kartę do ładowania kamieni 7. Miękki muślinowy woreczek na kamienie  Sodalit Esencją sodalitu jest logika, prawda i światło. Ten kamień jest ulubionym amuletem numerologów i tarocistów, gdyż pomaga wykorzystać zdolności parapsychiczne. Dzięki temu kamieniowi wzmocnisz intuicję i odwołasz się do autentycznej prawdy. Jasność umysłu i równowaga emocjonalna, którą zyskasz pracując z tym kamieniem rozwinie poczucie własnej wartości i pomoże odkryć autentyczną prawdę w tobie. Dzięki temu sodalit wzmacnia też zaufanie do naszej prawdy. Kamień ten pomaga dowiedzieć się, jak się czujemy z daną osobą czy sytuacją, zanim nasz umysł włączy funkcje analityczne. Podobnie jak lapis jest to kamień komunikacji, spokoju, wspiera czakrę trzeciego oka.  Lapis Lazuli  Ten piękny kamień w kolorze indygo to maskotka dla trzeciego oka.  Lapis Lazuli rozwija samoświadomość i jest również nazywany kamieniem mądrości. Ale przede wszystkim  Lapis Lazuli jest najbardziej ceniony za dostęp do Twojej wewnętrznej natury, stymulację intuicji i zdolności umysłowych. Mądrość, świadomość i intuicja to święta trójca, która potrzebna jest byś dostrzegła w sobie źródło prawdy. Lapis sprzyja harmonii, szczególnie jeśli jesteśmy nadpobudliwi, nerwowi lub lękliwi. Wspiera komunikację i dodaje odwagi, znany jest również ze swoich właściwości ochronnych, zatrzymujących negatywne energie. To kamień nieograniczonych możliwości! Labradoryt Labradoryt jak pozostałe kamienie wzmacnia intuicję i łączy się z czakrą trzeciego oka, ale także pomaga przebić się przez iluzje. Kamień ten dostarcza narzędzia potrzebne do odkrywania swojego przeznaczenia. Kiedy czujesz, że masz energiczny kryzys lub nie masz pewności, którą ścieżką iść, Labradoryt poprowadzi Cię we właściwym kierunku. Kamień ten jest silnie powiązany z wibracjami magii i percepcji. Wspiera osoby, które uważają, że nie mają połączenia z intuicją. Jeśli doświadczasz w życiu synchroniczności, np. widzisz te same godziny, kamień ten  pomoże odnaleźć  ukryte znaczenie tych znaków. Ochronny charakter labradorytu  pozwala pracować nad wzrostem duchowym w bezpiecznej aurze. Amazonit Amazonit jest potężnym kamieniem jeśli chodzi o korzystanie z intelektu i intuicji. Jego działanie  buduje inteligencję emocjonalną, zachęca do aktywnego myślenia i wspomaga intuicyjne dopasowanie Twoich decyzji do własnych wartości. Pomaga zobaczyć, co czuje nasze serce, podpowiada nam rozwiązania wolne od auto sabotujących myśli. Amazonit pięknie pracuje z czakrą serca, gardła i trzeciego oka. Pomaga łagodzić urazy emocjonalne i blokady w układzie nerwowym, równoważy energie męskie i żeńskie i pomaga płynąć przez życie z prądem, tak byśmy intuicyjnie podążali swoją ścieżką.  Informację w jaki sposób korzystać z energii kamieni znajdziesz na naszym Instagramie @moonsister.pl oraz blogu.','','magiczne-kamienie-na-wzmocnienie-intuicji-intuition','','','','Magiczne kamienie na wzmocnienie intuicji - Intuition','','','',''),
