(89,1,1,'Dzięki temu zestawowi zrobisz wodę klejnotową na dobre samopoczucie i harmonię. Możesz jej użyć jako wody pitnej, jako energetyzującego toniku do twarzy lub środka do harmonizowania aury. Kryształy mają potężną moc, a robienie z nich magicznego eliksiru pozwala Ci pełniej korzystać z ich właściwości.  Badanie przeprowadzone przez Centrum Konsultacji Higieny Pestel w Niemczech wykazało, że wzrost bakterii jest znacznie spowolniony, gdy woda jest wystawiona na działanie kryształów, w porównaniu ze zwykłą wodą z kranu. Co więcej, woda klejnotowa może wydawać się świeższa, a nawet smaczniejsza.  By cieszyć się właściwościami wody klejnotowej zamocz kryształy w wodzie na 24h. Raz w miesiącu zalecamy ładowanie kamieni w świetle słonecznym przez 15 min. na dołączonej karcie do ładowania.','','zestaw-magicznych-kamieni-do-produkcji-wody-klejnotowej','','','','Zestaw magicznych kamieni do produkcji Wody Klejnotowej','','','',''),
