(91,1,1,'Dobry sen. Zestaw magicznych kamieni na uzdrawiający sen dla osób cierpiących na bezsenność i inne problemy ze snem.  Twój Magiczny Zestaw zawiera:  1. Ametyst 2. Kwarc dymny 3. Kwarc różowy 4. Kamień księżycowy 5. Informacje i instrukcje dotyczące kamieni 6. Kartę do ładowania kamieni 7. Miękki muślinowy woreczek na kamienie  Ametyst Pomaga uwolnić się od lęków, przywrócić równowagę osobom podatnym na stres, przynosi spokój i uwolnienie umysłu od negatywnych myśli. Pomaga radzić sobie z emocjami, dodaje cierpliwości, uwalnia od codziennego zmęczenia i problemów. Kwarc dymny Uziemia, oczyszcza z negatywnej energii, chroni przed koszmarami. Odsyła z powrotem negatywną energię do jej źródła. Kwarc Różowy Koi, uwalnia od emocji, które nie pozwalają zasnąć. Kamień księżycowy  Uspokaja gonitwę myśli, wycisza i zapewnia dobry sen. Łagodzi stres, stabilizuje emocje i zapewnia spokój. Energia kobiecości ukryta w tym eterycznym kamieniu uspokoi nerwy i złagodzi lęki. Kamienie księżycowe kierują energię związaną z cyklami księżyca, aby uspokoić hormony i zrównoważyć umysł, zapewniając głębokie poczucie spokoju.','','magiczne-kamienie-na-uzdrawiajacy-sen-goodnight-sleep-tight','','','','Magiczne kamienie na uzdrawiający sen - Goodnight, Sleep Tight!','','','',''),
(92,1,1,'Pewność siebie i wysoka samoocena. Zestaw magicznych kamieni dla osób walczących z niskim poczuciem wartości, kompleksami i syndromem ofiary i bycia „ niczego niewartym”.  Twój Magiczny Zestaw zawiera:  1. Lapis Lazuli 2. Kwarc różowy 3. Fuchsyt z rubinem 4. Informacje i instrukcje dotyczące kamieni   5. Kartę do ładowania kamieni 6. Miękki muślinowy woreczek na kamienie  Fuchsyt z rubinem Pomaga w podniesieniu poczucia własnej wartości. Usamodzielnia, pomaga żyć     w zgodzie z własną prawdą, sprawia, że uniezależniamy się od opinii innych. Energia fuchsytu sprzyja asertywności, zdrowym zasadom w relacjach. Pomaga w docenianiu siebie osobom, którym wydaje się, że są niewystarczająco dobre, nie zasługują na szczęście i za wysoko stawiają wymagania wobec siebie. Pomaga spojrzeć na siebie jako wartościową osobę. Lapis lazuli  Lapis Lazuli przynosi poczucie wewnętrznej mocy i odwagę, wzmacnia pewność siebie u osób lękliwych i przezwycięża nieśmiałość. Wspiera zwalczanie swoich słabości. Kwarc różowy Kamień bezwarunkowej miłości, który uwalnia od złych emocji. Podnosi samoocenę i wiarę we własne możliwości, dodaje odwagi i wzmacnia miłość własną.','','magiczne-kamienie-na-pewnosc-siebie-selflove','','','','Magiczne kamienie na pewność siebie - Selflove','','','',''),
(93,1,1,'Spokój i pozytywne wibracje. Zestaw magicznych kamieni, który pomoże załagodzić stres i wprowadzić spokój do naszego życia.  Twój Magiczny Zestaw zawiera:  1. Ametyst 2. Howlit biały 3. Kwarc dymny 4. Informacje i instrukcje dotyczące kamieni 5. Kartę do ładowania kamieni 6. Miękki muślinowy woreczek na kamienie  Ametyst Kamień „harmonii i relaksu”. Pomaga w uwalnianiu od lęków, przywracaniu równowagi osobom podatnym na stres, przynosi spokój i uwolnienie umysłu od negatywnych myśli. Pomaga radzić sobie z emocjami, dodaje cierpliwości, uwalnia od codziennego zmęczenia i problemów. Przywraca harmonię ducha, pomaga walczyć z uzależnieniami. Howlit biały Ma działanie uspokajające. Jest kamieniem medytacji i spokojnego snu. Wycisza i eliminuje napięcia, uspokaja gonitwę myśli przed snem. Daje siłę do uwolnienia od niezdrowych przekonań i ran     emocjonalnych. Transformuje emocje i przynosi spokój i zadowolenie. Potrafi złagodzić gniew i agresję, szczególnie, jeśli doświadczamy jej od innych osób. Odpręża i zapewnia jasność umysłu. Uczy cierpliwości, pomaga w akceptacji. Kwarc dymny Blokuje niskie wibracje i  neutralizuje negatywne energie. Chroni ciało astralne i oczyszcza aurę, uziemia - wspiera odporność na stres, lęki i depresje, poprawia nastrój. Odsyła z powrotem negatywną energię do jej źródła.','','magiczne-kamienie-na-optymizm-i-pozytywne-wibracje-relax-take-it-easy','','','','Magiczne kamienie na optymizm i pozytywne wibracje - Relax, Take It Easy!','','','',''),
