(95,1,1,'Zestaw kamieni składa się z 7 minerałów, pomagających równoważyć czakry. Kamienie wspomagają harmonizowanie centrów energetycznych i prawidłowy przepływ życiodajnej energii chi. Lepsze funkcjonowanie czakr ma zbawienny wpływ na wiele obszarów naszego życia od samopoczucia, przez zdrowie, kończąc na efektywności w działaniu i kreatywności.   Twój Magiczny Zestaw zawiera:   Heliotrop - czakra korzenia  Karneol - czakra sakralna  Jaspis żółty - czakra splotu słonecznego  Amazonit - czakra serca  Sodalit - czakra gardła  Ametyst - czakra trzeciego oka  Howlit biały - czakra korony   Instrukcję wykorzystywania kamieni  Kartę do ładowania kamieni   Miękki muślinowy woreczek na kamienie','','magiczne-kamienie-pomagajace-rownowazyc-czakry-chakra-crystal-set','','','','Magiczne kamienie pomagające równoważyć czakry - Chakra Crystal Set','','','',''),
(96,1,1,'Balsam dla Twojego ciała i duszy. Zestaw kamieni łagodzących, przywracających harmonię .  Twój Magiczny Zestaw zawiera:  1. Kwarc różowy 2. Kamień księżycowy 3. Opal peruwiański 4. Informacje i instrukcje dotyczące kamieni 5. Kartę do ładowania kamieni 6. Miękki muślinowy woreczek na kamienie  Kwarc różowy Kamień bezwarunkowej miłości, który uwalnia od złych emocji. Podnosi samoocenę i wiarę we własne możliwości, dodaje odwagi i wzmacnia miłość własną. Przemawia bezpośrednio do czakry twojego serca, pomagając rozwiać lęki i urazy, budząc poczucie zadowolenia i otwierając na miłość. Opal peruwiański Często nazywany „Kamieniem Nadziei” lub „Kamieniem Anioła”. Różowy Opal ma moc przywrócenia równowagi emocjonalnej. Jego właściwości łagodzące działają jak balsam na wrażliwe nerwy, pomagają redukować stres i lęki. Chroni przed koszmarami. Podnosi   samopoczucie i dodaje radości. Uwalnia od poczucia winy, wstydu i zahamowani. Dodaje wiary w siebie. Kamień księżycowy Energia kobiecości ukryta w tym eterycznym kamieniu uspokoi nerwy i złagodzi lęki. Kamienie księżycowe kierują energię związaną z cyklami księżyca, aby uspokoić hormony i zrównoważyć umysł, zapewniając głębokie poczucie spokoju. To kamień wewnętrznego wzrostu i siły. Wspomaga łagodzenie stresu, stabilizację emocji i zapewnia spokój. Wzmacnia intuicję, otwiera na sukces i szczęście w miłości i sprawach biznesowych.','','magiczne-kamienie-na-wewnetrzny-spokoj-stay-balanced','','','','Magiczne kamienie na wewnętrzny spokój - Stay Balanced!','','','',''),
(97,1,1,'Zestaw specjalnie wybranych kamieni, które ułatwią Ci naukę i pomogą przynieść szczęście na egzaminach!  Twój Magiczny Zestaw zawiera:  1.  Fluoryt 2.  Sodalit 3.  Turmalin 4.  Informacje i instrukcje dotyczące kamieni  5.  Kartę do ładowania kamieni 6.  Miękki muślinowy woreczek na kamienie  Kamienie Good Luck! miej ze sobą na ważnych egzaminach oraz pod czas nauki!  Fluoryt Ten kamień to mistrz porządkowania. Świetnie wpływa na koncentrację i poprawia naszą organizację. Świeżo zdobyte informacje zostaną szybko poukładane w szufladkach naszego mózgu.  Fluoryt ze wszystkich kamieni najsilniej wspomaga uczenie się oraz pewność siebie. Dodatkowo emituje spokój i harmonię oraz pomaga uwolnić się od stresu i niepokoju. Często określany jest jako energetyczny odkurzacz, gdyż wysysa i neutralizuje negatywną energię, wprowadzając harmonię i równowagę Sodalit Przede wszystkim pomaga rozjaśnić umysł i polepszyć koncentrację. Jest to bowiem kamień logicznego myślenia. Przydaje się zwłaszcza podczas medytacji czy nauki. Pomaga wydobyć z siebie mądrość, spokój, realizm, pozwala spojrzeć na życie z nowej, lepszej perspektywy. Klarowność myśli i równowaga emocjonalna, którą zyskasz pracując z tym kamieniem rozwinie poczucie własnej wartości i pomoże odkryć autentyczną prawdę w tobie. Dzięki temu sodalit wzmacnia też zaufanie do naszej prawdy i intuicji. Turmalin Znany jest głównie jako kryształ ochronny, ale to także wspaniały kamień, który wyostrza nasz umysł oraz wzmacnia logiczne i racjonalne postrzeganie rzeczywistości. Z pewnością pomoże w rozwiązaniu niejednej matematycznej zagwozdki. Jest też niezwykle przydatny przy egzaminach! Pomaga odbić negatywne myśli, zarówno Twoje, jak i te u osoby egzaminującej Cię. Zaleca się go szczególnie osobom podatnym na negatywne emocje, przeżywającym stany lękowe i narażonym na napięciowe sytuacje. Podnosi ufność w to, że wszystko będzie dobrze. Twoje kryształy są delikatne, więc obchodź się z nimi łagodnie i trzymaj je w bezpiecznym miejscu. Kryształy są naturalne, każdy egzemplarz jest wyjątkowy i niepowtarzalny   By oczyścić kryształ, okadź go dymem z szałwii (malachit) lub włóż pod bieżącą wodę (karneol, kwarc tygrysi).  By naładować kryształ, połóż go na dołączonej karcie i wystaw na działanie słońca (turmalin max na 10 minut, fluoryt 30 minut, sodalit bez ograniczeń).','','magiczne-kamienie-na-szczescie-i-efektywna-nauke-good-luck','','','','Magiczne kamienie na szczęście i efektywną naukę - Good Luck!','','','',''),
(98,1,1,'Patrzyłeś kiedykolwiek na tatuaż w ujęciu mistycznym?  Tatuaż i duchowość mają wiele wspólnego. O czym musisz wiedzieć tatuując swoje lub czyjeś ciało? Jak tatuaż wpływa na Twoją energię życiową? Czym jest tatuaż w sensie energetycznym? Czego nie powinniśmy tatuować i dlaczego? Co zrobić, by tatuaż stał się osobistym talizmanem? Wszystkie wskazówki znajdziesz w tym webinarze! Bez względu na to, czy jesteś tatuatorem, czy entuzjastą ozdabiania ciała, musisz to zobaczyć!','','webinar-alchemia-tatuazu','','','','Webinar \"Alchemia Tatuażu\"','','','',''),
(99,1,1,'Miłość na wyciągnięcie ręki. Zestaw magicznych kamieni dla osób szukających drugiej połówki i szukających miłości własnej, chcących odkryć w sobie atrakcyjność.  Twój Magiczny Zestaw zawiera:  1. Kwarc różowy 2. Rodonit 3. Kamień księżycowy 4. Informacje i instrukcje dotyczące kamieni   5. Kartę do ładowania kamieni 6. Miękki muślinowy woreczek na kamienie  Kwarc różowy Kamień bezwarunkowej miłości, który uwalnia od złych emocji. Podnosi samoocenę i wiarę we własne możliwości, dodaje odwagi i wzmacnia miłość własną. Przemawia bezpośrednio do czakry twojego serca, pomagając rozwiać lęki i urazy, budząc poczucie zadowolenia i otwierając na miłość. Rodonit Rodonit to kamień szczęścia w związku. Jest też kamieniem współczucia, który pomaga zamknąć poprzedni rozdział, usuwa emocjonalne rany i blizny z przeszłości. Pomaga wybaczać, wspiera związki partnerskie. Pielęgnuje miłość własną, ugruntowuje miłość partnerską, równoważy yin-yang i pomaga w utrzymaniu dobrych relacji. Kamień księżycowy: Energia kobiecości ukryta w tym eterycznym kamieniu uspokoi nerwy i złagodzi lęki. Kamienie księżycowe kierują energię związaną z cyklami księżyca, aby uspokoić hormony i zrównoważyć umysł, zapewniając głębokie poczucie spokoju. To kamień wewnętrznego wzrostu i siły. Pomaga łagodzić stres, stabilizuje emocje i zapewnia spokój. Wzmacnia intuicję, otwiera na sukces i szczęście w miłości i sprawach biznesowych.','','magiczne-kamienie-na-milosc-lamour','','','','Magiczne kamienie na miłość - L’Amour','','','',''),
(100,1,1,'Ochrona na wszystkich poziomach. Zestaw kamieni oczyszczających i chroniących ciało astralne.  Twój Magiczny Zestaw zawiera:  1. Turmalin Czarny 2. Kwarc dymny 3. Prehnit 4. Informacje i instrukcje dotyczące kamieni 5. Kartę do ładowania kamieni 6. Miękki muślinowy woreczek na kamienie  Turmalin czarny Jest potężnym kamieniem mocy. Potrafi uleczyć nas na każdym planie: emocjonalnym, fizycznym, duchowym i mentalnym. Oczyszcza i chroni złymi energiami, bytami astralnymi, wampirami energetycznymi, transformując negatywne energie w     szczęście i zdrowie. Kwarc dymny Blokuje niskie wibracje i neutralizuje negatywne energie. Chroni ciało astralne i oczyszcza aurę, uziemia - wspiera odporność na stres,   lęki i depresje, poprawia nastrój. Odsyła z powrotem negatywną energię do jej źródła. Prehnit  Działa jak filtr – oczyszcza z wchłoniętej, negatywnej energii. Chroni przed jej absorbowaniem od innych. Pomaga łagodzić lęki, depresje i stres.','','magiczne-kamienie-na-ochrone-protect-me','','','','Magiczne kamienie na ochronę - Protect Me!','','','',''),
(101,1,1,'Granat zwany również \"kamieniem królów\", dodaje odwagi, pewności siebie, pomaga pozbyć się lęku przed zmianami, ale nie tylko! To również silny kamień miłości i seksualności. Wspiera stabilizację w związku i wzmacnia go, dodając przy okazji więcej namiętności do relacji. Wpływa również pozytywnie na emocje, zwłaszcza te powiązane z naszymi najbliższymi. Osoby poszukujące miłości wesprze w osiąganiu celów i spełnianiu nawet tych najskrytszych marzeń!  Ładuj i oczyszczaj swój kamień średnio raz w miesiącu lub zawsze wtedy, kiedy czujesz, że jest to potrzebne. Oczyszczanie: pod bieżąca wodą  Ładowanie: za pomocą światła słonecznego  Kamienie są naturalne i mogą mieć drobne niedoskonałości, które czynią je unikalnymi.','','kamien-odwagi-i-namietnosci-granat','','','','Kamień odwagi i namiętności - Granat','','','',''),
(102,1,1,'Sukces przedsięwzięć i powodzenie finansowe. Zestaw kamieni przyciągających powodzenie materialne i wspierających biznes.   Twój Magiczny Zestaw zawiera:  1. Kwarc tygrysi 2. Malachit 3. Karneol 4. Informacje i instrukcje dotyczące kamieni   5. Kartę do ładowania kamieni 6. Miękki muślinowy woreczek na kamienie  Kamienie Prosperity noś w torebce przy portfelu!  Kwarc tygrysi Kamień Biznesmenów, który przyciąga bogactwo i powodzenie, otwiera na odwagę w realizacji planów i pewność siebie. Wspiera stabilizację finansową, otacza opieką zgromadzone bogactwo. Moc tygrysiego oka sprzyja także rozsądnemu gospodarowaniu pieniędzmi i mądrym inwestycjom. Malachit  Energetyczny magnes na pieniądze. Jest kamieniem równowagi, obfitości, manifestacji i intencji. Dodaje siły i odwagi do zmiany wszelkich obaw i błędnych przekonań dotyczących pieniędzy. Może ochronić przed bankructwem. Karneol Kamień odwagi i szczęścia w biznesie. Zwiększa pewność siebie i podsyca apetyt na życie. Przyciąga klientów, wymarzoną pracę i okazje biznesowe. Pomaga zwiększyć efektywność działań w usługach i sprzedaży. Wspiera motywację, sprawia, że jesteśmy gotowi odważniej i lepiej działać w sferze biznesowej i patrzymy na życie bardziej optymistycznie.  Twoje kryształy są delikatne, więc obchodź się z nimi łagodnie i trzymaj je w bezpiecznym miejscu. Kryształy są naturalne, każdy egzemplarz jest wyjątkowy i niepowtarzalny   By oczyścić kryształ, okadź go dymem z szałwii (malachit) lub włóż pod bieżącą wodę (karneol, kwarc tygrysi). By naładować kamień, połóż go na dołączonej karcie i wystaw na działanie słońca (kwarc tygrysi) lub księżyca (malachit, karneol) na 15 min.','','magiczne-kamienie-na-sukces-i-powodzenie-finansowe-prosperity','','','','Magiczne kamienie na sukces i powodzenie finansowe - Prosperity','','','',''),
(103,1,1,'Ma działanie uspokajające. Jest kamieniem medytacji i spokojnego snu. Wycisza i eliminuje napięcia, uspokaja gonitwę myśli przed snem. Daje siłę do uwolnienia od niezdrowych przekonań i ran emocjonalnych. Transformuje emocje i przynosi spokój i zadowolenie. Potrafi złagodzić gniew i agresję, szczególnie, jeśli doświadczamy jej od innych osób. Odpręża i zapewnia jasność umysłu. Uczy cierpliwości, pomaga w akceptacji.  Ładuj i oczyszczaj swój kamień średnio raz w miesiącu lub zawsze wtedy, kiedy czujesz, że jest to potrzebne. Oczyszczanie: pod bieżącą wodą lub za pomocą białej szałwii czy Palo Santo Ładowanie: w świetle księżyca  Kamienie są naturalne i mogą mieć drobne niedoskonałości, które czynią je unikalnymi.','','kamien-wyciszenia-i-medytacji-howlit-bialy','','','','Kamień wyciszenia i medytacji - Howlit biały','','','',''),
(104,1,1,'Jaspis pomaga w niesieniu pomocy innym, wzmaga bezinteresowność, empatię i skromność. Wzmacnia motywację, poczucie sprawczości i dodaje cierpliwości. Ułatwia rozwiązywanie problemów, pomaga w walce ze stresem oraz w osiągnięciu spokoju wewnętrznego. Jaspis  oczyszcza aurę, ale także całe otoczenie z negatywnej energii dzięki czemu zapewnia ochronę w czasie pracy nad rozwojem duchowym.  Ładuj i oczyszczaj swój kamień średnio raz w miesiącu lub zawsze wtedy, kiedy czujesz, że jest to potrzebne. Oczyszczanie: pod bieżąca wodą lub za pomocą szałwii czy Palo Santo Ładowanie: za pomocą światła księżyca  Kamienie są naturalne i mogą mieć drobne niedoskonałości, które czynią je unikalnymi.','','kamien-cierpliwosci-i-empatii-jaspis-zolty','','','','Kamień cierpliwości i empatii - Jaspis żółty','','','',''),
(105,1,1,'Sokole oko, daje nam nową perspektywę, wspomagając wizję i wgląd w nasze sprawy oraz zwiększając świadomość zdolności psychicznych i połączenia z Wyższym Ja.   Kamień ten, przyciąga również dobro i dobrobyt. Może być pomocny w usuwaniu ograniczających i negatywnych wzorców myślowych oraz głęboko zakorzenionych lęków lub uprzedzeń. Pomaga spojrzeć na problemy z innej perspektywy i uwolnić nas od chęci obwiniania innych za własne problemy.   Ładuj i oczyszczaj swój kamień średnio raz w miesiącu lub zawsze wtedy, kiedy czujesz, że jest to potrzebne. Oczyszczanie: pod bieżącą wodą lub za pomocą białej szałwii czy Palo Santo Ładowanie: za pomocą promieni słonecznych, najlepiej porannych  Kamienie są naturalne i mogą mieć drobne niedoskonałości, które czynią je unikalnymi.','','kamien-dobrobytu-i-uzdrowienia-emocjonalnego-sokole-oko','','','','Kamień dobrobytu i uzdrowienia emocjonalnego - Sokole Oko','','','',''),
(106,1,1,'Rodonit to kamień szczęścia w związku. Jest też kamieniem współczucia, który pomaga zamknąć poprzedni rozdział, usuwa emocjonalne rany i blizny z przeszłości. Pomaga wybaczać, wspiera związki partnerskie. Pielęgnuje miłość własną, ugruntowuje miłość partnerską, równoważy yin-yang i pomaga w utrzymaniu dobrych relacji.  Ładuj i oczyszczaj swój kamień średnio raz w miesiącu lub zawsze wtedy, kiedy czujesz, że jest to potrzebne. Oczyszczanie: pod bieżącą wodą lub za pomocą białej szałwii czy Palo Santo Ładowanie: za pomocą kryształu górskiego lub w promieniach słońca  Kamienie są naturalne i mogą mieć drobne niedoskonałości, które czynią je unikalnymi.','','kamien-uzdrowienia-i-relacji-rodonit','','','','Kamień uzdrowienia i relacji - Rodonit','','','',''),
(107,1,1,'Czakra to ośrodek energetyczny odpowiadający za energię wybranego obszaru w ciele. Każda z 7 czakr posiada własną barwę i odpowiada za inną sferę emocjonalną. Dobre zdrowie i samopoczucie zależy od prawidłowego przepływy energii między czakrą: korony, trzeciego oka, gardła,     serca, splotu słonecznego, krzyżową i korzenia. Jednym ze sposobów przywrócenia harmonii czakr jest medytacja z kamieniami o barwie odpowiadającej wybranej czakrze.  Kamień w kolorze fuksji  do medytacji z wygrawerowany symbolem czakry korony, aby zwiększyć poczucie jedności ze światem duchowym, wewnętrzną mądrość i sens życia. Wybierz go, jeśli masz problem z akceptacją życia, jakim jest, czujesz osamotnienie i brak zrozumienia oraz sensu istnienia, chcesz odkryć swoją ścieżkę duchową, jesteś zamknięty na wiedzę wyższą i nową naukę.  Fioletowy kamień  do medytacji z wygrawerowany symbolem czakry trzeciego oka, aby wzmocnić poczucie intuicji, percepcji i wyobraźni. Wybierz go, jeśli cierpisz na bóle głowy, bezsenność lub masz problemy ze wzrokiem, masz w głowie nieustanną gonitwę myśli, nie potrafisz podejmować inaczej decyzji niż za sprawą logiki, chcesz rozwinąć intuicję i postrzeganie pozazmysłowe, masz problem z medytacją lub wizualizacją, jesteś pełny strachu, masz problem by marzyć i realizować swoje pragnienia lub zbytnio skupiasz się na świecie materialnym.  Niebieski kamień  do medytacji z wygrawerowany symbolem czakry gardła, aby zwiększyć łatwość komunikacji, wyrażania swoich emocji i kreatywność. Wybierz go, jeśli chorujesz na choroby gardła i jamy ustnej lub choroby tarczycy, masz problem z rozmową o uczuciach i emocjach, boisz się krytyki i odrzucenia, masz problem z asertywnością, kontakt z innymi powoduje w Tobie uczucie lęku lub stres, masz tendencje do krytykowania, gadulstwa lub wręcz przeciwnie – zamykasz się w sobie, masz problem z decyzyjnością, masz poczucie, że Twoje potrzeby nie są ważne, uciekasz przed rozmową na trudne tematy.    Zielony kamień  do medytacji z wygrawerowany symbolem czakry serca, aby wzmocnić poczucie miłości, współczucia i altruizmu. Wybierz go, jeśli borykasz się z bólem w górnej części ciała, chorujesz na serce, przestałeś odczuwać radość z życia, Twoja „szklanka jest zwykle do połowy pusta”, czujesz, że nie ma w Tobie empatii, odczuwasz samotność, lęk przed odrzuceniem, masz tendencję do czarnych scenariuszy i życia przeszłością, nie potrafisz wyrażać swoich emocji i uczuć, masz poczucie, że nie zasługujesz na nic i obca Ci jest miłość własna.  Żółty kamień  do medytacji z wygrawerowany symbolem czakry splotu słonecznego, aby wzmocnić siłę przebicia, samoocenę, wewnętrzną motywację. Wybierz go, jeśli borykasz się z problemami w układzie trawiennym, cukrzycą, rozchwianiem emocjonalnym, brakiem cierpliwości, wybuchami agresji, chęcią narzucania swojego zdania, silną potrzebą kontroli otoczenia, lękiem i brakiem silnej woli w realizacji zamierzeń, niskim poczuciem wartości.  Pomarańczowy kamień  do medytacji z wygrawerowany symbolem czakry sakralnej, aby wzmocnić poczucie seksualności, fizycznego wdzięku i przyjemności. Wybierz go, gdy czujesz się niespokojny i sfrustrowany, stawiasz siebie w roli ofiary, nieustannie wpędzasz się w poczucie winy, jesteś oziębły seksualnie lub bliski kontakt z partnerem nie sprawia ci przyjemności, sięgasz po używki takie jak alkohol lub narkotyki, cierpisz na choroby związane z zaburzeniami odżywiania, szukasz potwierdzenia swojej wartości u osób z zewnątrz.    Czerwony kamień  do medytacji z wygrawerowany symbolem czakry korzenia, aby zwiększyć poczucie stabilności, uziemienia i dobrobytu. Wybierz go, gdy masz bóle w dolnej części pleców i ciała, cierpisz na choroby przewlekłe lub niską odporność, masz zaburzone poczucie bezpieczeństwa, źle myślisz o sobie, chciałbyś żyć innym życiem, czujesz się nieszczęśliwy, masz problemy finansowe lub niekorzystne przekonania dotyczące pieniędzy, brakuje ci energii witalnej lub masz poczucie, że zboczyłeś ze swojej ścieżki.','','kamien-do-medytacji-z-czakrami','','','','Kamień do medytacji z czakrami','','','',''),
(108,1,1,'Amazonit sprzyja jasnej i precyzyjnej komunikacji. Odpędza niepowodzenia, zmartwienia oraz niższe wibracje. Zapewnia uspokajające i kojące energie, które wesprą Cię w czasie niepokoju i stresu. Pomaga mówić z głębi serca i zachować spokój, zwłaszcza, gdy sprawy nie idą zgodnie z planem. Jest symbolem wiary, nadziei i optymizmu. Przy natłoku zmartwień oraz emocji wywołujących lęk, warto medytować z udziałem tego kamienia.   Ładuj i oczyszczaj swój kamień średnio raz w miesiącu lub zawsze wtedy, kiedy czujesz, że jest to potrzebne. Oczyszczanie: pod bieżącą wodą lub za pomocą białej szałwii czy Palo Santo Ładowanie: za pomocą promieni słonecznych lub w wodzie księżycowej  Kamienie są naturalne i mogą mieć drobne niedoskonałości, które czynią je unikalnymi.','','kamien-optymizmu-i-komunikacji-amazonit','','','','Kamień optymizmu i komunikacji - Amazonit','','','',''),
(109,1,1,'Esencją sodalitu jest logika, prawda i światło. Jest ulubionym amuletem numerologów i tarocistów, gdyż pomaga wykorzystać zdolności parapsychiczne. Dzięki temu kamieniowi wzmocnisz intuicję i odwołasz się do autentycznej prawdy. Jasność umysłu i równowaga emocjonalna, którą zyskasz pracując z tym kamieniem rozwinie poczucie własnej wartości i pomoże odkryć autentyczną prawdę w Tobie. Dzięki temu sodalit wzmacnia też zaufanie do naszej prawdy. Kamień ten pomaga dowiedzieć się, jak się czujemy z daną osobą czy sytuacją, zanim nasz umysł włączy funkcje analityczne. Podobnie jak lapis jest to kamień komunikacji, spokoju, wspiera czakrę trzeciego oka.  Ładuj i oczyszczaj swój kamień średnio raz w miesiącu lub zawsze wtedy, kiedy czujesz, że jest to potrzebne. Oczyszczanie: pod bieżącą wodą lub za pomocą białej szałwii czy Palo Santo Ładowanie: za pomocą promieni słonecznych, najlepiej tych porannych  Kamienie są naturalne i mogą mieć drobne niedoskonałości, które czynią je unikalnymi.','','kamien-komunikacji-i-duchowosci-sodalit','','','','Kamień komunikacji i duchowości - Sodalit','','','',''),
(110,1,1,'Lapis lazuli ma pokojowy wpływ i wibracje, działa wyciszająco, dlatego też nadaje się doskonale do pracy nad sobą i własną duchowością. Dostarcza poczucie wewnętrznej mocy, wiary i nadziei, a także pozwala na odnalezienie w sobie odwagi, pewności siebie i przezwyciężenie wewnętrznej nieśmiałości. Lapis lazuli jest kamieniem stymulującym delikatność i łagodność i zapewniającym ochronę przede wszystkim przed atakami energetycznymi, psychicznymi oraz urokami. Jest to także kamień duchowej miłości, który wzmacnia więzi w relacjach. Dodatkowo wnosi jasność w nasze myśli, uspokaja ducha i pomaga rozpoznać nasze zadanie życiowe.  Ładuj i oczyszczaj swój kamień średnio raz w miesiącu lub zawsze wtedy, kiedy czujesz, że jest to potrzebne. Oczyszczanie: pod bieżącą wodą lub za pomocą białej szałwii czy Palo Santo Ładowanie: za pomocą kryształów górskich lub w świetle księżyca  Kamienie są naturalne i mogą mieć drobne niedoskonałości, które czynią je unikalnymi.','','kamien-spokoju-i-madrosci-lapis-lazuli','','','','Kamień spokoju i mądrości - Lapis Lazuli','','','',''),
(111,1,1,'Ametyst to kamień „harmonii i relaksu”. Pomaga uwolnić od lęków oraz przywrócić równowagę osobom podatnym na stres. Jego właściwości sprzyjają odczuciu spokoju i uwolnieniu umysłu od negatywnych myśli. Pomaga radzić sobie z emocjami, sprzyja  cierpliwości i uwolnieniu od codziennego zmęczenia i problemów. Przywraca harmonię ducha, pomaga walczyć z uzależnieniami.  Ładuj i oczyszczaj swój kamień średnio raz w miesiącu lub zawsze wtedy, kiedy czujesz, że jest to potrzebne. Oczyszczanie: pod bieżącą wodą lub za pomocą białej szałwii czy Palo Santo Ładowanie: w promieniach delikatnego słońca przez 15 minut  Kamienie są naturalne i mogą mieć drobne niedoskonałości, które czynią je unikalnymi.','','kamien-harmonii-i-relaksu-ametyst','','','','Kamień harmonii i relaksu - Ametyst','','','',''),
(112,1,1,'Obeliski posiadają kształt wzmacniający potencjały minerałów oraz koncentrują ich energię.   Energia kamieni:   Turmalin  -  jest potężnym kamieniem mocy. Potrafi uleczyć nas na każdym planie: emocjonalnym, fizycznym, duchowym i mentalnym. Pracując z człowiekiem, np. podczas medytacji, kamień oczyszcza i chroni przed złymi energiami, bytami astralnymi, wampirami energetycznymi, transformując negatywne energie w  szczęście i zdrowie. Turmalin wykazuje też silne działanie uziemiające, dlatego zaleca się go osobom podatnym na negatywne emocje, przeżywającym stany lękowe i narażonym napięciowe sytuacje. Podnosi ufność w to, że wszystko będzie dobrze.  Amazonit  -  sprzyja jasnej i precyzyjnej komunikacji. Odpędza niepowodzenia, zmartwienia oraz niższe wibracje. Zapewnia uspokajające i kojące energie, które wesprą Cię w czasie niepokoju i stresu. Pomaga mówić z głębi serca i zachować spokój, zwłaszcza, gdy sprawy nie idą zgodnie z planem. Jest symbolem wiary, nadziei i optymizmu. Przy natłoku zmartwień oraz emocji wywołujących lęk, warto medytować z udziałem tego kamienia  Kwarc Różowy  - to k amień bezwarunkowej miłości, który uwalnia od złych emocji. Podnosi samoocenę i wiarę we własne możliwości, dodaje odwagi i wzmacnia miłość własną. Przemawia bezpośrednio do czakry twojego serca, pomagając rozwiać lęki i urazy, budząc poczucie zadowolenia i otwierając na miłość.  Kryształ Górski  - ma silne działanie oczyszczające i jest kamieniem o uniwersalnym zastosowaniu. Można go dowolnie programować za pomocą wybranej afirmacji, gdyż ma właściwości wchłaniania energii. Dzięki temu będzie przyciągał to, czego pragniemy i stanie się silnym talizmanem. Oprócz tego, że oczyszcza i przyciąga dobre energie, kryształ wzmacnia wszystkie inne kamienie, które znajdą się w jego pobliżu lub są razem z nim stosowane.  Obsydian  - to silny kamień ochronny. Jego działanie odpędza złe energie oraz jest tarczą dla negatywnych wibracji od ludzi z zewnątrz. Pomaga także oczyścić umysł z nękających myśli oraz zachować optymizm. Wesprze Twoją duszę, ukoi lęki oraz wzmocnij motywację i determinację do podejmowania kolejnych wyzwań.  Ametyst  - kamień „harmonii i relaksu”. Pomaga uwolnić od lęków oraz przywrócić równowagę osobom podatnym na stres. Jego właściwości sprzyjają odczuciu spokoju i uwolnieniu umysłu od negatywnych myśli. Pomaga radzić sobie z emocjami, sprzyja  cierpliwości i uwolnieniu od codziennego zmęczenia i problemów. Przywraca harmonię ducha, pomaga walczyć z uzależnieniami.  Kwarc Tygrysi  - to Kamień Biznesmenów, który pomaga przyciągnąć bogactwo i powodzenie, odwagę w realizacji planów i pewność siebie. Wspiera stabilizację finansową, otacza opieką zgromadzony majątek. Moc tygrysiego oka sprzyja także rozsądnemu gospodarowaniu pieniędzmi i mądrym inwestycjom.  Labradoryt  - wzmacnia intuicję i łączy się z czakrą trzeciego oka, ale także pomaga przebić się przez iluzje. Kamień ten dostarcza narzędzia potrzebne do odkrywania swojego przeznaczenia. Kiedy czujesz, że masz energiczny kryzys lub nie masz pewności, którą ścieżką iść, Labradoryt poprowadzi Cię we właściwym kierunku. Kamień ten jest silnie powiązany z wibracjami magii i percepcji. Wspiera osoby, które uważają, że nie mają połączenia z intuicją. Jeśli doświadczasz w życiu synchroniczności, np. widzisz te same godziny, kamień ten  pomoże odnaleźć  ukryte znaczenie tych znaków. Ochronny charakter labradorytu  pozwala pracować nad wzrostem duchowym w bezpiecznej aurze.','','obelisk-z-naturalnego-kamienia','','','','Obelisk z naturalnego kamienia','','','',''),
(113,1,1,'Emituje spokój i harmonię oraz pomaga uwolnić się od stresu i niepokoju. Często określany jest jako energetyczny odkurzacz, gdyż wysysa i neutralizuje negatywną energię, wprowadzając harmonię i równowagę. Wspiera skupienie i jasność umysłu, umożliwiając zmianę perspektywy. Może pomóc odróżnić to, co jest pod twoją kontrolą, a co nie. Rozbudza intuicję, pozwala również odciążyć mózg od nadmiaru myśli, sprzyja też intensywnemu wysiłkowi umysłowemu.  Ładuj i oczyszczaj swój kamień średnio raz w miesiącu lub zawsze wtedy, kiedy czujesz, że jest to potrzebne. Oczyszczanie: pod bieżącą wodą lub za pomocą białej szałwii czy Palo Santo Ładowanie: za pomocą promieni słonecznych przez około 30 minut  Kamienie są naturalne i mogą mieć drobne niedoskonałości, które czynią je unikalnymi.','','kamien-oczyszczenia-i-umyslu-fluoryt','','','','Kamień oczyszczenia i umysłu - Fluoryt','','','',''),
(114,1,1,'Energetyczny magnes na pieniądze. Jest kamieniem równowagi, obfitości, manifestacji i intencji. Dodaje siły i odwagi do zmiany wszelkich obaw i błędnych przekonań dotyczących pieniędzy. Chroni przed bankructwem. Przypisuje mu się również działanie uspokajające, kojąca i wyciszające, przez co idealnie nadaje się do medytacji i pogłębiania jej stanów.   Ładuj i oczyszczaj swój kamień średnio raz w miesiącu lub zawsze wtedy, kiedy czujesz, że jest to potrzebne. Oczyszczanie: pod bieżąca wodą lub moczyć w solance Ładowanie: zakopać pod ziemią lub ładować w świetle słońca/księżyca, można też zastosować kryształy górskie   Kamienie są naturalne i mogą mieć drobne niedoskonałości, które czynią je unikalnymi.','','kamien-dobrobytu-i-rownowagi-malachit','','','','Kamień dobrobytu i równowagi - Malachit','','','',''),
(115,1,1,'Apatyt to kamień, który jak żaden inny, wesprze podróż do wnętrza siebie jak i odkrywanie poprzednich wcieleń. Otwiera również na duchowe prowadzenie przez naszych Przewodników. Oprócz tego, pomaga w skupieniu, porządkuje myśli i pomaga rozwiązywać problemy, dlatego idealnie sprawdza się przy sesjach regresingu.  Oprócz tego silnie wspiera czakrę gardła dzięki czemu, jest bardzo przydatny pod czas wystąpień publicznych czy wykładów, pomaga też w kontaktach międzyludzkich oraz usprawnia pracę w grupie.  Ładuj i oczyszczaj swój kamień średnio raz w miesiącu lub zawsze wtedy, kiedy czujesz, że jest to potrzebne. Oczyszczanie: pod bieżąca wodą, o pokojowej temperaturze Ładowanie: wystawiając go na świeże powietrze, w porannym słońcu  Kamienie są naturalne i mogą mieć drobne niedoskonałości, które czynią je unikalnymi.','','kamien-wspierajacy-podroze-duchowe-apatyt','','','','Kamień wspierający podróże duchowe - Apatyt','','','',''),
(116,1,1,'\"Palm Stone\" to gładki kamień wykonany z kryształu lub kamienia szlachetnego, który ma kształt owalu i wgłębienie dopasowane do kciuka.  \"Palm Stone\" używa się głównie jako talizmanu, który rozwiewa uczucie smutku i zwątpienia. Pomaga także pozbyć się negatywnej energii, która gromadzi się w twojej aurze.  Używa się go pocierając kciukiem w tę i z powrotem po wgłębieniu. Kiedy pocierasz kamień między palcami, uruchamiasz punkty akupresury, stymulujące zakończenia nerwowe, które aktywują różne części mózgu. Powoduje to uwolnienie endorfin, które w naturalny sposób uspokajają umysł i aktywują bardziej pozytywne uczucia.  Można nim również wykonywać masaż spiętych miejsc na ciele, natomiast podczas medytacji, dzięki wygodnej formie uchwytu, szybko odczuwamy silną energię kamienia, która łączy nas z energią Matki Ziemi.  Kiedy używa się \"Palm Stone\"?  1. Podczas medytacji. 2. W chwilach stresu i napięcia. 3. Podczas wyciszającej kąpieli i przed snem. 4. Podczas masażu czakr.  Pamiętaj aby regularnie oczyszczać kamień dymem z szałwii lub pod bieżącą wodą i wystawić go na chwilowe działanie rozproszonego światła słonecznego na dołączonej do zestawu karcie do ładowania kamieni.  Kryształy są naturalne, każdy egzemplarz jest wyjątkowy i niepowtarzalny, dlatego może nieco różnić się kolorem i kształtem.','','kamien-do-medytacji-palm-stone','','','','Kamień do medytacji Palm Stone','','','',''),
(117,1,1,'Czarny Turmalin jest potężnym kamieniem mocy. Potrafi uleczyć nas na każdym planie: emocjonalnym, fizycznym, duchowym i mentalnym. Pracując z człowiekiem, np. podczas medytacji, kamień oczyszcza i chroni przed złymi energiami, bytami astralnymi, wampirami energetycznymi, transformując negatywne energie w  szczęście i zdrowie.  Turmalin wykazuje też silne działanie uziemiające, dlatego zaleca się go osobom podatnym na negatywne emocje, przeżywającym stany lękowe i narażonym napięciowe sytuacje. Podnosi ufność w to, że wszystko będzie dobrze. Położony w domu np. przed wejściem chroni jego wnętrze i domowników przed negatywnymi energiami z zewnątrz.  To kamień doskonały na Retrogradację Merkurego - pomaga  w wyciąganiu wniosków z przeszłych lekcji, składnia do refleksji, analizy i medytacji, przypomina, żeby skupić się na odpuszczeniu i nadziei, pomaga przetransformować stare, zakopane żale i niesprzyjające przekonania.   Ładuj i oczyszczaj swój kamień średnio raz w miesiącu lub zawsze wtedy, kiedy czujesz, że jest to potrzebne. Oczyszczanie: pod bieżącą wodą lub za pomocą białej szałwii czy Palo Santo Ładowanie: za pomocą promieni słonecznych  Kamienie są naturalne i mogą mieć drobne niedoskonałości, które czynią je unikalnymi.','','kamien-uziemiajacy-turmalin','','','','Kamień uziemiający - Turmalin','','','',''),
(118,1,1,'Selenit, ma silne powiązania z księżycem. W starożytnych wierzeniach był nazwany kamieniem bogini Seleny, opiekunki księżyca. Jest doskonałym wyborem podczas rozwoju duchowego, sprzyja rozwijaniu intuicji oraz wrażliwości. Będzie pomocny przy natłoku niepożądanych emocji, dzięki niemu łatwiej dostrzec i zrozumieć prawdziwe uczucia. Pomoże Ci odnaleźć swoje miejsce na ziemi oraz zwiększyć poczucie bezpieczeństwa Jego działanie wycisza i uspokaja myśli. Wspiera także sen i jego jakość.   Selenit jest idealny do wykorzystania podczas medytacji, chroni również przed niskimi wibracjami.   Ładuj i oczyszczaj swój kamień średnio raz w miesiącu lub zawsze wtedy, kiedy czujesz, że jest to potrzebne. Oczyszczanie: za pomocą białej szałwii lub Palo Santo Ładowanie: za pomocą światła księżyca  Kamienie są naturalne i mogą mieć drobne niedoskonałości, które czynią je unikalnymi.','','kamien-intuicji-i-wrazliwosci-selenit','','','','Kamień intuicji i wrażliwości - Selenit','','','',''),
(119,1,1,'Energia kobiecości ukryta w tym eterycznym kamieniu pomoże uspokoić nerwy i złagodzić lęki. Kamienie księżycowe kierują energię związaną z cyklami księżyca, dzięki czemu pomagają również uspokoić hormony i zrównoważyć umysł, zapewniając głębokie poczucie spokoju. To kamień wewnętrznego wzrostu i siły. Może zagłodzić stres, ustabilizować emocje i zapewnić wewnętrzny spokój. Wzmacnia intuicję, otwiera na sukces i szczęście w miłości i sprawach biznesowych.  Ładuj i oczyszczaj swój kamień średnio raz w miesiącu lub zawsze wtedy, kiedy czujesz, że jest to potrzebne. Oczyszczanie: pod bieżącą wodą lub za pomocą białej szałwii czy Palo Santo Ładowanie: za pomocą światła księżyca, najlepiej pod czas Pełni  Kamienie są naturalne i mogą mieć drobne niedoskonałości, które czynią je unikalnymi.','','kamien-spokoju-i-intuicji-kamien-ksiezycowy','','','','Kamień spokoju i intuicji - Kamień księżycowy','','','',''),
(120,1,1,'Serpentynit znany jest jako kamień spokoju ducha i odwagi. Pomaga łagodzić uczucie strachu przed zmianami, zrównoważyć wahania nastroju i stany nerwowe lub stresowe. Chroni przed atakami energetycznymi, działa jak rozpuszczalnik na niskie wibracje. Wspomaga świadome kierowanie uzdrawiającej energii w kierunku obszarów problemowych. Mówi się też, że serpentynit koryguje zaburzenia równowagi psychicznej i emocjonalnej, pomaga poczuć większa kontrolę nad swoim życiem i z optymizmem patrzeć w przyszłość. Oczyszcza czakry i stymuluje czakrę korony, otwierając zdolności psychiczne. Współdziała z czakra serca i pobudza energię kundalini. Wspiera tez  w praktykach pracy z podświadomością, w medytacji, regresingu oraz podróżach szamańskich. Ułatwia dostęp do pamięci o poprzednich wcieleniach, praktyki wolności emocjonalnej oraz oczyszcza świadomość ze źródła negatywnych wzorców myślowych. Pomaga również w walce m.in, z infekcjami i problemami skórnymi.  Ładuj i oczyszczaj swój kamień średnio raz w miesiącu lub zawsze wtedy, kiedy czujesz, że jest to potrzebne. Oczyszczanie: pod bieżąca wodą lub przysypać suchym, czystym piaskiem Ładowanie: za pomocą promieni słonecznych, najlepiej tych porannych  Kamienie są naturalne i mogą mieć drobne niedoskonałości, które czynią je unikalnymi.','','kamien-rownowagi-i-swiadomosci-serpentynit','','','','Kamień równowagi i świadomości - Serpentynit','','','',''),
(121,1,1,'Pomaga uwolnić napięcie i toksyczne myśli, usuwa energetyczne blokady. Chroni ciało astralne i oczyszcza aurę, uziemia i ugruntowuje - wspiera odporność na stres, ataki paniki, poprawia nastrój. Jego uzdrawiająca energia działa na poprawę interakcji z innymi, pomagając naszym związkom przetrwać próby i udręki. Ten kamień może być używany jako talizman przynoszący szczęście, amulet zapobiegający wypadkom i przenikaniu negatywnej energii do naszej aury. Blokuje niskie wibracje i neutralizuje negatywne energie. Odsyła z powrotem negatywną energię do jej źródła. Wzmacnia wytrzymałość, pomaga wychodzić z nałogów, może również wpływać pozytywnie na płodność.   Ładuj i oczyszczaj swój kamień średnio raz w miesiącu lub zawsze wtedy, kiedy czujesz, że jest to potrzebne. Oczyszczanie: pod bieżąca wodą lub wystawiając na całą noc na działanie księżyca Ładowanie: za pomocą promieni słonecznych, najlepiej tych porannych, przez 15 minut  Kamienie są naturalne i mogą mieć drobne niedoskonałości, które czynią je unikalnymi.','','kamien-harmonii-i-szczescia-kwarc-dymny','','','','Kamień harmonii i szczęścia - Kwarc dymny','','','',''),
(122,1,1,'Czakra to ośrodek energetyczny odpowiadający za energię wybranego obszaru w ciele. Każda z 7 czakr posiada własną barwę i odpowiada za inną sferę emocjonalną. Dobre zdrowie i samopoczucie zależy od prawidłowego przepływy energii między czakrą: korony, trzeciego oka, gardła, serca, splotu słonecznego, krzyżową i korzenia. Jednym ze sposobów przywrócenia harmonii czakr jest medytacja z kamieniami odpowiadającymi danym czakrom.   W zestawie znajdziesz:   - kamień odpowiadający wybranej czakrze  - woreczek muślinowy  - kartę do ładowania kamienia   Czakra korzenia zablokowana: brak spokoju wewnętrznego, lęk, niepewność, niestabilność finansowa, złość, strach, ospałość, poczucie zagubienia, brak asertywności hiperaktywna: chciwość, żądza władzy, agresywność, materializm, cyniczność zbalansowana: poczucie bezpieczeństwa, obfitość, uziemienie, radość życia, szczęście, zdrowe ciało, odporność Czakra Sakralna zablokowana: niskie libido, strach przed intymnością, brak kreatywności, nieumiejętność odpoczynku, zazdrość, tłumienie uczuć, poczucie wstydu hiperaktywna: nad emocjonalność, manipulacja, seksoholizm, hedonizm, zależność emocjonalna od innych zbalansowana: umiejętność panowania nad sobą, kreatywność, pasja, zdrowie intymne, akceptacja swojego ciała, optymizm Czakra Splotu Słonecznego zablokowana: niedowartościowanie, poczucie braku wpływu na swoje życie, kompleks niższości, wiara w zły los, brak zaufania, próżność, osądzanie hiperaktywna: potrzeba władzy, dominacja, krytycyzm, napady gniewu, kontrolowanie innych, zaborczość, zazdrość, pracoholizm, kłótliwość zbalansowana: poczucie własnej wartości i sprawczości, zapał, dobry wizerunek siebie, odwaga do wprowadzania zmian, równowaga emocjonalna, poczucie humoru, bezinteresowność Czakra serca zablokowana: brak empatii, zawiść, posępność, brak tolerancji, brak zaufania, złość, żal, poczucie osamotnienia hiperaktywna: zazdrość, nadmierne poświęcanie, brak niezależności zbalansowana: spokój, miłość, tolerancja, otwarte serce na innych ludzi i świat, radość, umiejętność dawania i brania, dobroć Czakra Gardła zablokowana: problem z wyrażaniem siebie, problem z komunikowaniem się, niewłaściwy osąd, problem ze słuchaniem, uzależnienia, poddawanie się woli innych hiperaktywna: zbyt głośne mówienie, krytykanctwo, plotkarstwo, surowość, przytłoczenie emocjami, nieumiejętność wyciszenia się, chwalenie się zbalansowana: pewność, asertywność, przejrzystość komunikacji, dyplomacja, spełnienie w życiu zawodowym Czakra Trzeciego Oka zablokowana: słaby osąd, brak skupienia, słaba wyobraźnia, egocentryzm, dysharmonia w życiu hiperaktywna: koszmary, halucynacje, urojenia, obsesje, gonitwa myśli, problem z koncentracją zbalansowana: rozwinięta wyobraźnia, harmonia między intelektem a intuicją, wewnętrzna wiedza Czakra Korony zablokowana: depresja, trudności w nauce, kryzys wiary, brak poczucia sensu, trudności z podjęciem decyzji hiperaktywna: dogmatyzm, osądzanie, duchowe uzależnienie, nieuziemienie zbalansowana: poczucie spełnienia i szczęścia, tolerancja, miłość uniwersalna, inteligencja, samoświadomość, rozsądek, zrozumienie','','naturalny-kamien-do-medytacji-z-czakra','','','','Naturalny kamień do medytacji z czakrą','','','',''),
(123,1,1,'Kryształ biały ma najsilniejsze działanie oczyszczające i jest kamieniem o uniwersalnym zastosowaniu. Można go dowolnie programować za pomocą wybranej afirmacji, gdyż ma właściwości wchłaniania energii. Dzięki temu będzie przyciągał to, czego pragniemy i stanie się silnym talizmanem. Oprócz tego, że oczyszcza i przyciąga dobre energie, kryształ wzmacnia wszystkie inne kamienie, które znajdą się w jego pobliżu lub są razem z nim stosowane.  Ładuj i oczyszczaj swój kamień średnio raz w miesiącu lub zawsze wtedy, kiedy czujesz, że jest to potrzebne. Oczyszczanie: pod bieżąca zimną, wodą Ładowanie: za pomocą promieni słonecznych  Kamienie są naturalne i mogą mieć drobne niedoskonałości, które czynią je unikalnymi.','','kamien-do-wlasnego-zaprogramowania-krysztal-gorski','','','','Kamień do własnego zaprogramowania - Kryształ górski','','','',''),
(124,1,1,'Kamień bezwarunkowej miłości, który uwalnia od złych emocji. Podnosi samoocenę i wiarę we własne możliwości, dodaje odwagi i wzmacnia miłość własną. Przemawia bezpośrednio do czakry twojego serca, pomagając rozwiać lęki i urazy, budząc poczucie zadowolenia i otwierając na miłość.  Ładuj i oczyszczaj swój kamień średnio raz w miesiącu lub zawsze wtedy, kiedy czujesz, że jest to potrzebne. Oczyszczanie: pod bieżącą wodą lub za pomocą białej szałwii czy Palo Santo Ładowanie: za pomocą promieni słonecznych, najlepiej tych porannych  Kamienie są naturalne i mogą mieć drobne niedoskonałości, które czynią je unikalnymi.','','kamien-milosci-kwarc-rozowy','','','','Kamień miłości - Kwarc różowy','','','',''),
(125,1,1,'Kamień odwagi i szczęścia w biznesie. Wspiera pewność siebie i podsyca apetyt na życie. Pomaga przyciągnąć klientów, wymarzoną pracę i okazje biznesowe. Jest również wspierający dla efektywności działań w usługach i sprzedaży. Wspiera motywację, sprawia, że jesteśmy gotowi odważniej i lepiej działać w sferze biznesowej i możemy spojrzeć na życie bardziej optymistycznie.   Kamień ten otwiera także na zmysłowość, wzmacnia libido, reguluje cykl miesiączkowy oraz zmniejsza bóle miesiączkowe. Jest kamieniem wspierającym łatwiejszy poród, a u mężczyzn korzystnie wpływa na płodność. Karneol harmonizuje również czakrę podstawy.  Ładuj i oczyszczaj swój kamień średnio raz w miesiącu lub zawsze wtedy, kiedy czujesz, że jest to potrzebne. Oczyszczanie: pod bieżącą wodą lub za pomocą białej szałwii czy Palo Santo Ładowanie: w świetle księżyca  Kamienie są naturalne i mogą mieć drobne niedoskonałości, które czynią je unikalnymi.','','kamien-odwagi-i-szczescia-w-biznesie-karneol','','','','Kamień odwagi i szczęścia w biznesie - Karneol','','','',''),
(126,1,1,'Cytryn jest nazywany \"kamieniem sukcesu\", gdyż sprzyja osiągnięciu materialnego bogactwa, dobrobytu i powodzeniu w karierze zawodowej. To również kamień dedykowany wszystkim tym, którzy rozpoczynają nowy biznes – sprzyja robieniu interesów i wspiera nowe przedsięwzięcia. Wpiera w podejmowaniu nowych wyzwań, rozjaśnia umysł i pomaga w rozwiązywaniu problemów - nie tylko zawodowych. Otwiera na ludzi, którzy mogliby pomóc nam zarówno w rozwoju kariery, jak i rozwoju duchowym. Pomaga również zachować balans między między życiem prywatnym, a zawodowym. Wspiera także kreatywność oraz poziom energii, może zwiększyć motywację i dodać pewności siebie, a przy okazji poprawić samopoczucie.  Ładuj i oczyszczaj swój kamień średnio raz w miesiącu lub zawsze wtedy, kiedy czujesz, że jest to potrzebne. Oczyszczanie: pod bieżącą wodą lub za pomocą białej szałwii czy Palo Santo Ładowanie: za pomocą promieni słonecznych, najlepiej między godziną 11, a 13  Kamienie są naturalne i mogą mieć drobne niedoskonałości, które czynią je unikalnymi.','','kamien-kreatywnosci-i-przedsiebiorczosci-cytryn','','','','Kamień kreatywności i przedsiębiorczości - Cytryn','','','',''),
(127,1,1,'Tygrysie Oko to Kamień Biznesmenów, który pomaga przyciągnąć bogactwo i powodzenie, odwagę w realizacji planów i pewność siebie. Wspiera stabilizację finansową, otacza opieką zgromadzony majątek. Moc tygrysiego oka sprzyja także rozsądnemu gospodarowaniu pieniędzmi i mądrym inwestycjom.  W ezoteryce traktowany jest jako niezwykle silny amulet, który pozytywnie wpływa na zdrowie i życiową siłę, przynosi szczęśliwy los oraz chroni przez złymi mocami i klątwami. Aura, jaką wytwarza tygrysie oko przyciąga zdrowie, pomyślność i obfitość.  Ładuj i oczyszczaj swój kamień średnio raz w miesiącu lub zawsze wtedy, kiedy czujesz, że jest to potrzebne. Oczyszczanie: pod bieżącą wodą lub za pomocą białej szałwii czy Palo Santo Ładowanie: za pomocą promieni słonecznych, najlepiej porannych  Kamienie są naturalne i mogą mieć drobne niedoskonałości, które czynią je unikalnymi.','','kamien-bogactwa-i-obfitosci-tygrysie-oko','','','','Kamień bogactwa i obfitości - Tygrysie Oko','','','',''),
(128,1,1,'Zestaw w twardym pudełku: książka z opisem kart oraz 78 kart wraz z woreczkiem.   Tarot Thota Aleistera Crowley’a na swoich ob­ra­zach przedstawia szerokie spek­trum symboli. Rzuca światło na związki pomiędzy astrologią, nume­ro­logią i symboliką najróżniejszych kierunków duchowych. Jest wręcz stworzony do tego, aby stał się źródłem poznania.   Ten komplet jest odpowiedni również dla osób początkujących. Zawiera wszystko, byś mógł interpretować karty Tarota.','','karty-tarot-zwierciadlo-duszy-zestaw','','','','Karty Tarot zwierciadło duszy zestaw','','','',''),
(129,1,1,'Zestaw w twardym pudełku: książka z opisem kart oraz 79 kart o wymiarach 9x14cm, karty mają złocone brzegi.  Tarot, który masz przed sobą, jest niczym echo, wspomnienie snów zbiorowych z czasów, gdy znaczenie snów było o wiele większe niż dziś. Karty Tarota Snów przypominają nam o baśniach, mitach, legendach, fikcyjnych i historycznych postaciach, miejscach i przedmiotach, które pozostają w świadomości całej ludzkości. Zatem chcąc uzyskać świeże spojrzenie, musimy odwołać się do snów i do Tarota. Ze względu na swą uniwersalność, Tarot Snów jest idealny zarówno dla początkujących, jak i jego zaawansowanych miłośników.','','karty-tarot-snow','','','','Karty Tarot Snów','','','',''),
(130,1,1,'Talia 44 kart Wyroczni Wróżek wraz z instrukcją w języku angielskim z ilustracjami Ginger Kelly.  To talia dla każdego, kto kocha naturę i wie, że w życiu jest coś więcej niż świat fizyczny. Użyj tej wyroczni jako portalu do królestwa magii wróżek i znajdź swoją drogę do niewypowiedzianych cudów!  Wróżki chcą, aby każdy doświadczył ich starożytnej mądrości i poczuł się związany z Ziemią. Są strażnikami przyrody, magicznymi manifestantami - chcą tworzyć wyłącznie piękne błogosławieństwa w naszym życiu.  Stworzona przez znaną medium Karen Kay talia, poprowadzi właściciela do poszukiwania mądrości wróżek i daje konkretne odpowiedzi, które przyniosą inspirację i rozwiązania codziennych pytań. Każdy odczyt będzie zawierał pozytywne i praktyczne spostrzeżenia, bezpośrednio związane z wyjątkową energią wróżek i osobistymi okolicznościami ich użytkownika.','','karty-wyroczni-oracle-karen-kay','','','','Karty Wyroczni Oracle Karen Kay','','','',''),
(131,1,1,'Talia zawiera 44 karty oraz książkę.   Jednorożce, najbardziej urokliwe z mistycznych stworzeń, są symbolem cudów, czystości i magii. Wejdź do ich cudownego królestwa dzięki  Wyroczni Jednorożców   i obudź  na nowo intuicję, wewnętrzną mądrość i boski potencjał.   Jednorożce,  które widzisz na kartach tej talii, pomogą Ci Odkryć drzemiącą w Tobie magię. Pragną one, abyś stał się świadomym twórcą własnej rzeczywistości. Pomorze ci w tym nieskończona moc wszechświata, byś mógł czynić cuda. Przyjmij energię Jednorożców  i doświadcz większej radości, miłości, spokoju i dostatku.','','karty-wyrocznia-jednorozcow','','','','Karty \"Wyrocznia Jednorożców\"','','','',''),
(132,1,1,'Talia zawiera 53 karty oraz książkę.   Karty wyroczni mają za zadanie wspierać Cię na ścieżce Twojej duszy i wcielić w to, kim naprawdę jesteś. Pomagają ci połączyć się z portalem do serca, pamiętać, kim jesteś na poziomie duszy i odblokowywać dary swojej duszy. W dołączonym przewodniku znajdziesz instrukcje dostrajania się do kart Wyroczni Starseed, wewnętrznego przewodnictwa i kosmicznej energii poza nimi. Każda interpretacja karty zawiera wezwanie do działania Starseed, aby pomóc ci odblokować dary duszy, połączyć się z kosmicznym pochodzeniem i pamiętać, kim naprawdę jesteś.','','karty-wyrocznia-gwiezdnych-ziaren','','','','Karty \"Wyrocznia Gwiezdnych Ziaren\"','','','',''),
(133,1,1,'Znajdziesz tu 111 stronicową książkę z opisami oraz 44 karty.  Karty Wyroczni \"twoje Światło\" pomogą Ci usłyszeć szept duszy, wyostrzyć zmysły, uporządkować życie i ponownie wsłuchać się w rytm Wszechświata. Pracując regularnie z kartami zauważysz, że coraz wyraźniej słyszysz głos swojej intuicji, stając się bardziej pewna siebie.  Karty Wyroczni \"Twoje Światło\" to narzędzie, dzięki któremu pogłębisz swoją relację z własną duszą i ze Źródłem.','','karty-wyroczni-twoje-swiatlo','','','','Karty Wyroczni \"Twoje Światło\"','','','',''),
(134,1,1,'Talia zawiera 52 karty.   Karty Aniołów Światła wesprą Cię w pozbywaniu się negatywnych wzorców myślowych i blokad emocjonalnych, które w Twoim życiu nie pozwalały Ci na rozwój i zadowolenie. Do Twojej świadomości wniosą światło – a światło zawiera duchowe poznanie i informacje.  Każda z pięćdziesięciu dwóch kart tej talii przedstawia inny anielski przymiot. Wykorzystaj je jako źródło inspiracji i afirmacji. Codzienna praca z kartami Aniołów Światła ukierunkuje Twoje działanie i pomoże zrozumieć różne sytuacje życiowe.','','karty-anioly-swiatla','','','','Karty \"Anioły Światła\"','','','',''),
(135,1,1,'Zapach paczuli jest związany z żywiołem ziemi i czakrą korzenia. Jest bardzo mocny, głęboki i piżmowy, określa się go również jako drzewny, słodki i korzenny. Jest bardzo lubiany, a popularność zapachu paczuli sprawia, że możemy odnaleźć go w świecach, perfumach i kosmetykach. Wystarczy kilka kropli olejku, by Twoje Domowe Sanktuarium wypełniło się słodkim, otulającym zapachem. Olejek możesz wykorzystać do stworzenia domowego potpourri lub używać go w jednym z kominów zapachowych Moonsister.  Kobiety w ciąży, astmatycy oraz dzieci poniżej 12 roku życia powinny skonsultować się z lekarzem przed użyciem olejku.','','olejek-zapachowy-paczuli','','','','Olejek Zapachowy Paczuli','','','',''),
(136,1,1,'Czysty olejek aromatyczny o zapachu hiszpańskiego Rozmarynu. Rozmaryn to pięknie pachnące zioło, którego zapach pozwala odświeżyć pamięć i rozjaśnić umysł. Wystarczy kilka kropli olejku, by Twoje Domowe Sanktuarium wypełniło się miłym zapachem. Olejek możesz wykorzystać do stworzenia domowego potpourri lub używać go w jednym z kominów zapachowych Moonsister.  Kobiety w ciąży, astmatycy oraz dzieci poniżej 12 roku życia powinny skonsultować się z lekarzem przed użyciem olejku.','','olejek-aromatyczny-hiszpanski-rozmaryn','','','','Olejek aromatyczny Hiszpański Rozmaryn','','','',''),
(137,1,1,'Czysty olejek aromatyczny o zapachu cynamonu, który jest ciepły i kojący, szczególnie preferowany w okresie jesienno-zimowym. Wystarczy kilka kropli olejku, by Twoje Domowe Sanktuarium wypełniło się przyjemną wonią. Olejek możesz wykorzystać do stworzenia domowego potpourri lub używać go w jednym z kominów zapachowych Moonsister.  Kobiety w ciąży, astmatycy oraz dzieci poniżej 12 roku życia powinny skonsultować się z lekarzem przed użyciem olejku.','','olejek-aromatyczny-cynamon-ze-sri-lanki','','','','Olejek aromatyczny Cynamon ze Sri Lanki','','','',''),
(138,1,1,'Czysty olejek aromatyczny o zapachu białej szałwii. Oczyszcza przestrzeń i neutralizuje inne zapachy. Wystarczy kilka kropli olejku, by Twoje Domowe Sanktuarium wypełniło się przyjemną wonią. Olejek możesz wykorzystać do stworzenia domowego potpourri lub używać go w jednym z kominów zapachowych Moonsister.  Należy pamiętać, że produktu nie należy nakładać na skórę.  Kobiety w ciąży, astmatycy oraz dzieci poniżej 12 roku życia powinny skonsultować się z lekarzem przed użyciem olejku.','','olejek-aromatyczny-kalifornijska-biala-szalwia','','','','Olejek aromatyczny Kalifornijska Biała Szałwia','','','',''),
(139,1,1,'Zapach Magiczna Noc. Wystarczy kilka kropli olejku, by Twoje Domowe Sanktuarium wypełniło się ciepłym zapachem. Olejek możesz wykorzystać do stworzenia domowego potpourri lub używać go w jednym z kominów zapachowych Moonsister.   Kobiety w ciąży, astmatycy oraz dzieci poniżej 12 roku życia powinny skonsultować się z lekarzem przed użyciem olejku.','','olejek-zapachowy-magiczna-noc','','','','Olejek Zapachowy Magiczna Noc','','','',''),
(140,1,1,'Zapach Ylang-Ylang jest intensywny, słodki i kwiatowy. Przywodzi na myśl mistyczne wakacje i działa odprężająco. Wystarczy kilka kropli olejku, by Twoje Domowe Sanktuarium wypełniło się zapachem egzotyki. Olejek możesz wykorzystać do stworzenia domowego potpourri lub używać go w jednym z kominów zapachowych Moonsister.  Kobiety w ciąży, astmatycy oraz dzieci poniżej 12 roku życia powinny skonsultować się z lekarzem przed użyciem olejku.','','olejek-zapachowy-ylang-ylang','','','','Olejek Zapachowy Ylang-Ylang','','','',''),
(141,1,1,'Zapach Drzewo Sandałowe czaruje zapachem, który przeniesie Cię w klimat pachnących Indii w zaciszu Twojego domowego Sanktuarium. Olejek możesz wykorzystać do stworzenia domowego potpourri lub używać go w jednym z kominów zapachowych Moonsister. Kobiety w ciąży, astmatycy oraz dzieci poniżej 12 roku życia powinny skonsultować się z lekarzem przed użyciem olejku.','','olejek-zapachowy-drzewo-sandalowe','','','','Olejek Zapachowy Drzewo Sandałowe','','','',''),
(142,1,1,'Piżmo Arabskie to rozkosznie słodki orientalny zapach. Działa pobudzająco i energetyzująco, pomaga obudzić pozytywną energię. Drzewny aromat i urzekający zapach przywodzi na myśl spacer po egzotycznych targowiskach Bliskiego Wschodu. Wystarczy kilka kropli olejku, by Twoje Domowe Sanktuarium wypełniło się zapachem orientu. Olejek możesz wykorzystać do stworzenia domowego potpourri lub używać go w jednym z kominów zapachowych Moonsister.  Kobiety w ciąży, astmatycy oraz dzieci poniżej 12 roku życia powinny skonsultować się z lekarzem przed użyciem olejku.','','olejek-zapachowy-pizmo-arabskie','','','','Olejek Zapachowy Piżmo Arabskie','','','',''),
(143,1,1,'Czysty olejek aromatyczny o zapachu peruwiańskiego Palo Santo. Palo Santo to rzadkie i święte drewno pochodzące z Ameryki Południowej. Wystarczy kilka kropli olejku, by Twoje Domowe Sanktuarium wypełniło się ciepłym zapachem. Olejek możesz wykorzystać do stworzenia domowego potpourri lub używać go w jednym z kominów zapachowych Moonsister.   Kobiety w ciąży, astmatycy oraz dzieci poniżej 12 roku życia powinny skonsultować się z lekarzem przed użyciem olejku.','','olejek-aromatyczny-peruwianskie-palo-santo','','','','Olejek aromatyczny Peruwiańskie Palo Santo','','','',''),
(144,1,1,'Mieszanki olejków eterycznych, składają się z wybranych czystych olejków o harmonizujących ze sobą zapachach.  Mogą być używane do kominków, dyfuzorów, masażu, czy też po prostu do kąpieli. Wypełnij swoje domowe sanktuarium pięknym zapachem, który może poprawić Twoje samopoczucie.   Dostępne rodzaje:     Energia  (mięta pieprzowa, olibanum, cytryna) - orzeźwia i podnosi poziom energii    Szczęście  (bergamotka, ylang-ylang, grejpfrut) - poprawia samopoczucie    Relaks  (lawenda, mandarynka) - sprzyja rozluźnieniu i wypoczynkowi, ułatwia zasypanie    Zmysłowość  (paczuli, jagody jałowca, ylang-ylang) - sprzyja zwiększeniu libido i namiętności    Redukcja stresu  (szałwia muszkatołowa, cytryna, lawenda) - łagodzi stres i poprawia nastrój    Ponieważ produkt składa się z czystych mieszanek olejków eterycznych, osobom o wrażliwej skórze zalecamy rozcieńczenie ich olejami bazowymi przy stosowaniu do masażu lub smarowania.','','mieszanka-olejkow-eterycznych-energia-szczescie-relax-zmyslowosc-redukcja-stresu','','','','Mieszanka olejków eterycznych - Energia, Szczęście, Relax, Zmysłowość, Redukcja stresu','','','',''),
(145,1,1,'Mandala w języku hindi oznacza krąg i reprezentuje koło życia. To symbol doskonałości i harmonii, a także pierwiastka duchowego. Symbol słońca dodaje pewności siebie i ognia w działaniu. Sprawia, że łatwiej dostrzegamy okazje, wykorzystujemy możliwości, jesteśmy skuteczni w gromadzeniu zasobów, które pomagają osiągnąć cel i przyspieszają manifestację pragnień. Słońce symbolizuje to, co fizyczne. Warunkiem życia w dostatku jest balans między tym, co duchowe, a tym, co materialne.  W kominku Mandala możesz zapalić pachnący tealight i wlać ulubiony olejek eteryczny, a jego esencje wypełnią magią Twoją przestrzeń.  Uwaga! Produkt się mocno nagrzewa. Nie dotykaj produktu w użyciu lub po nim. Nie stawiaj na powierzchniach łatwo palnych! Trzymaj z dala od dzieci.','','kominek-zapachowy-mandala','','','','Kominek zapachowy Mandala','','','',''),
(146,1,1,'Budda to istota oświecona - ktoś kto przebudził się ze stanu niewiedzy, wykroczył poza cierpienie ludzkiej egzystencji, posiadł najwyższą mądrość i zerwał z wszelkim przywiązaniem.  „Deva” oznacza istotę świetlistą, jaśniejącą. W \"Devie\" możesz zapalić pachnący tealight, wlać ulubiony olejek eteryczny lub użyć pachnących wosków MOONSISTER, a ich esencje wypełnią magią Twoją przestrzeń.   Uwaga! Produkt się mocno nagrzewa. Nie dotykaj produktu w użyciu lub po nim. Nie stawiaj na powierzchniach łatwopalnych! Trzymaj z dala od dzieci.','','kominek-zapachowy-glowa-buddy','','','','Kominek zapachowy Głowa Buddy','','','',''),
(147,1,1,'Czakry możesz synchronizować za pomocą świec, medytacji, odpowiednich dźwięków lub przy pomocy zapachu!  Olejki mają za zadanie unormować przepływ energii w danym ośrodku energetycznym, wprowadzić balans i harmonię do ciała i duszy.  Możesz także wykorzystać je do stworzenia domowego potpourri i palić je w jednym z kominów zapachowych Moonsister.  Zapachy które tu znajdziesz, oczywiście nie są przypadkowe! Dobierz odpowiedni olejek do czakry, z którą chcesz pracować:    Kolor czerwony  - c zakra korzenia - paczula, wetiwera, cedr   Kolor pomarańczowy   - c zakra sakralna - drzewo sandałowe, pomarańcza, jaśmin    Kolor żółty   - c zakra splotu słonecznego - trawa cytrynowa, geranium, grejpfrut    Kolor zielony   - c zakra serca - róża, ylang-ylang, bergamotka    Kolor błękitny   - c zakra gardła - eukaliptus, lawenda, szałwia    Kolor granatowy   - c zakra trzeciego oka - jałowiec, rozmaryn, sosna    Kolor fioletowy   - c zakra korony - cedr, olibanum, lawenda    Kobiety w ciąży, astmatycy oraz dzieci poniżej 12 roku życia powinny skonsultować się z lekarzem przed użyciem olejku.','','olejek-do-aromaterapii-i-harmonizacji-czakry','','','','Olejek do aromaterapii i harmonizacji czakry','','','',''),
(148,1,1,'Budda to istota oświecona - ktoś kto przebudził się ze stanu niewiedzy, wykroczył poza cierpienie ludzkiej egzystencji, posiadł najwyższą mądrość i zerwał z wszelkim przywiązaniem.   W   kominku   możesz zapalić pachnący tealight i wlać ulubiony olejek eteryczny, a jego esencje wypełnią magią Twoją przestrzeń.   Uwaga! Produkt się mocno nagrzewa. Nie dotykaj produktu w użyciu lub po nim. Nie stawiaj na powierzchniach łatwo palnych! Trzymaj z dala od dzieci.','','kominek-zapachowy-glowa-buddy-rozowy','','','','Kominek zapachowy Głowa Buddy - różowy','','','',''),
(149,1,1,'Wahadełko podstawowe zaleca się jako pierwsze wahadło do ćwiczeń w początkowym rozwoju osób zainteresowanych ezoteryką. Używa się go do codziennej pracy z energiami. Jest spolaryzowane dodatnio, przez co nie ma negatywnego wpływu na osobę z niego korzystającą i nie wymaga od niej specjalistycznej wiedzy lub doświadczenia.  Ma szerokie zastosowanie - można je wykorzystywać w radiestezji, uzdrawianiu i dywinacji do testowania produktów spożywczych, ziół, wskazania cieków, odczytywania diagramów.','','wahadlo-mosiezne-podstawowe','','','','Wahadło mosiężne podstawowe','','','',''),
(150,1,1,'Wahadło Izys swoją formą symbolizuje Krzyż Życia, należy do wahadeł egipskich. Wzmocnione baterią złożoną z czterech ogniw. Wykazuje dużą czułość radiostezyjną. Może pełnić rolę zarówno nadajnika, jak i odbiornika, każdego rodzaju promieniowania. Wahadło samoczynnie się oczyszcza, co znacznie ułatwia pracę przy jego użyciu.   Wahadło może służyć do sprawdzania żywności, ziół, leków, sprawdza się również do celów diagnostycznych, mentalnych i poszukiwawczych (praca na mapach, planach).','','wahadlo-mosiezne-izys','','','','Wahadło mosiężne Izys','','','',''),
(151,1,1,'Wahadło mosiężne zaleca się zarówno jako pierwsze wahadło do ćwiczeń w początkowym rozwoju osób zainteresowanych ezoteryką, jak i do pracy dla osób bardziej zaawansowanych. Używa się go do codziennej pracy z energiami. Jest spolaryzowane dodatnio, przez co nie ma negatywnego wpływu na osobę z niego korzystającą i nie wymaga od niej specjalistycznej wiedzy lub doświadczenia.  Ma szerokie zastosowanie - można je wykorzystywać w radiestezji, uzdrawianiu i dywinacji do testowania produktów spożywczych, ziół, wskazania cieków, odczytywania diagramów. Dodatkowo wahadło 7 Czakr, ma za zadanie unormować przepływ energii w każdym ośrodku energetycznym, wprowadzić balans i harmonię do ciała i duszy.','','wahadlo-mosiezne-z-naturalnymi-kamieniami-7-czakr','','','','Wahadło mosiężne z naturalnymi kamieniami - 7 Czakr','','','',''),
(152,1,1,'Pozwól kryształowi wybrać Ciebie! To wahadło będzie dla Ciebie niespodzianką. Pozwól zadecydować przeznaczeniu, który kryształ będzie do Ciebie najlepiej dostrojony.  Na całym świecie wahadła były używane przez stulecia do różnych celów. Lekarze śledzili za ich pomocą, gdzie w ciele występują infekcje, górnicy dzięki nim odnajdywali złoża cennych minerałów, a nasze babcie za pomocą zawieszonej na nitce obrączki lub igły potrafiły określić płeć nienarodzonego jeszcze dziecka. Dziś jest to jedno z ulubionych narzędzi do pracy z wyższym JA, które pomaga chociażby w podjęciu ważnych życiowych decyzji.   Wybierając wahadło Mystery Pendulum trafi do Ciebie jeden z pięknych naturalnych kamieni: Kwarc różowy, Kryształ górski, Fluoryt, Tygrysie Oko, Unakit, Kalcyt, Szungit, Jaspis Mariam, Agat Mszysty, Serpentyn, Kwarc z Turmalinem, Obsydian mahoniowy.','','wahadlo-mystery-pendulum','','','','Wahadło Mystery Pendulum','','','',''),
(153,1,1,'Miejsca mocy bez wątpienia fascynują ludzi od tysiącleci, przyciągają osoby, które potrzebują oczyszczenia, uleczenia lub szukają źródła spokoju z dala od świata, w którym funkcjonują na co dzień. Mało ludzi zdaje sobie jednak sprawę, że takie miejsce możemy stworzyć w zaciszu swojego domu! Zastanów się, jakie miejsce w domu przyciąga Cię jak magnes, a następnie uczyń z niego magiczną przestrzeń.   W swoim magicznym zestawie do stworzenia miejsca mocy znajdziesz:   Święte drewienko Palo Santo   Kadzidło z Białej Szałwii  Świece rytualne na różne intencje   Podstawkę ceramiczną  Dzwoneczek do oczyszczania energii  Kartkę z dokładnym opisem i instrukcją użycia','','miejsce-mocy-stworz-swoja-magiczna-przestrzen','','','','Miejsce mocy - stwórz swoją magiczną przestrzeń!','','','',''),
(154,1,1,'Czwórko, jeśli wibrujesz w świetle Twoim atrybutem jest racjonalizm, pracowitość, perfekcjonizm i dyscyplina. Jesteś solidna i efektywna, bez wahania potrafisz poświęcić się osiąganiu stabilizacji finansowej. Można na Tobie polegać, gdyż jesteś uczciwa, szczera i lojalna. Jeśli dotykasz cienia, odczuwasz zaburzenia w opisanych obszarach. Przyjmij wysokie wibracje z talizmanem Numerology, wzmocnij najlepsze potencjały swojej liczby numerologicznej i wyglądaj magicznie zawieszając ten talizman na dowolnym naszyjniku lub bransoletce Moonsister.  Talizman Numerology został  naenergetyzowany  przez naszego Moonbrothera Mariusza, który z energią pracuje ponad 30 lat, aby wspomóc wyciągnięcie światła z archetypu wibracji Twojej Drogi Życia.','','charms-pozlacany-z-cyfra-4-talizman-numerologiczny','','','','Charms pozłacany z cyfrą 4 - Talizman numerologiczny','','','',''),
(155,1,1,'Dzwonki Tingsha to para dzwonków, połączonych ze sobą za pomocą sznurka. Każdy dzwonek jest ozdobiony oryginalnymi   tybetańskimi wzorami i symbolami.   Dzwonki fantastycznie harmonizują przestrzeń poprzez rozpraszanie negatywnych energii oraz koncentrowania uwagi podczas rytuału. Rozpoczynając i kończąc dźwiękiem dzwonka każdy rytuał dodatkowo wprowadzamy element sacrum i łatwiej nam ukierunkowywać pozytywne intencje, na których w danej chwili najbardziej nam zależy.  Dzwonki Tingsha są używane podczas praktyk medytacyjnych, wprowadzają w stan głębokiego relaksu i harmonii. Korzysta się z nich również podczas tybetańskich religijnych obrzędów i rytuałów, w celu oczyszczenia przestrzeni i przyciągnięcia pozytywnych wibracji.','','tybetanskie-dzwonki-tingsha','','','','Tybetańskie Dzwonki Tingsha','','','',''),
(156,1,1,'Miejsca mocy bez wątpienia fascynują ludzi od tysiącleci, przyciągają osoby, które potrzebują oczyszczenia, uleczenia lub szukają źródła spokoju z dala od świata, w którym funkcjonują na co dzień. Mało ludzi zdaje sobie jednak sprawę, że takie miejsce możemy stworzyć w zaciszu swojego domu! Zastanów się, jakie miejsce w domu przyciąga Cię jak magnes, a następnie uczyń z niego magiczną przestrzeń.   W swoim magicznym zestawie do stworzenia miejsca mocy znajdziesz:   Święte drewienko Palo Santo   Kadzidło z Białej Szałwii  Świece rytualne na różne intencje   Podstawkę ceramiczną  Dzwoneczek do oczyszczania energii  Kryształ górski to własnego zaprogramowania  Drewniana wieża z kadzidłami patyczkowymi  Kartkę z dokładnym opisem i instrukcją użycia','','miejsce-mocy-premium-stworz-swoja-magiczna-przestrzen','','','','Miejsce mocy Premium - stwórz swoją magiczną przestrzeń!','','','',''),
