(161,1,1,'Dziewiątko, jeśli wibrujesz w świetle odczuwasz misję służby. Jesteś wielkoduszna, szlachetna, idealistyczna i głęboko uduchowiona. Masz zdolności parapsychiczne i silną intuicję. Potrafisz bezwarunkowo kochać i pomagać. Lubisz się uczyć i podróżować. Umiesz jednocześnie być emocjonalna i myśleć racjonalnie. Jeśli dotykasz cienia, odczuwasz zaburzenia w opisanych obszarach. Przyjmij wysokie wibracje z talizmanem Numerology, wzmocnij najlepsze potencjały swojej liczby numerologicznej i wyglądaj magicznie zawieszając ten talizman na dowolnym naszyjniku lub bransoletce Moonsister.  Talizman Numerology został  naenergetyzowany   przez naszego Moonbrothera Mariusza, który z energią pracuje ponad 30 lat, aby wspomóc wyciągnięcie światła z archetypu wibracji Twojej Drogi Życia.','','charms-pozlacany-z-cyfra-9-talizman-numerologiczny','','','','Charms pozłacany z cyfrą 9 - Talizman numerologiczny','','','',''),
(162,1,1,'To, że talizman Zodiac przeznaczony jest dla Ciebie, zapisane jest w gwiazdach!  Panno, jesteś bardzo skrupulatna i pomocna. Twoimi atutami jest wytrwałość, pracowitość i wnikliwość. Jesteś geniuszem porządkowania i ulepszania. Wyrównaj energię życiową qi, ułóż emocje, przyjmij wysokie wibracje, wzmocnij najlepsze potencjały swojego znaku solarnego, takie jak: wnikliwość, uważność, perfekcjonizm, skrupulatność, szczerość, bycie wspierającą i godną zaufania.  Ten naszyjnik  naenergetyzuje  dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat, abyś mogła wyciągnąć światło z archetypu Twojego znaku zodiaku.','','naszyjnik-ze-znakiem-zodiaku-talizman-zodiac-dla-panny','','','','Naszyjnik ze znakiem zodiaku - Talizman Zodiac dla Panny','','','',''),
(163,1,1,'Zielony kolor, kojarzony z naturą i odrodzeniem, to wibracja wzrostu, nowych początków, zdrowia, odnowy, harmonii, nadziei i spokoju.  Stresy, lęki i niepokoje, które spotykają nas na co dzień, zaburzają naszą energetykę, blokują meridiany i kanały nadii. Są one jak strumienie, które przenoszą energię życiową w całym ciele fizycznym, aby nas odżywiać i pomagać w równoważeniu systemów i funkcji naszego ciała. Utrzymywanie energii życiowej w harmonii zapewnia źródło ogólnej równowagi, zdrowia i spokoju.  Naszyjnik „Harmony” to talizman, który wzmocni Cię energetycznie, pomoże odzyskać wewnętrzny spokój i żyć w harmonii, doda Ci sił do dostrzegania światła i pokonywania lęków.  Ten naszyjnik  naenergetyzował   dla Ciebie nasz Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','naszyjnik-z-malachitem-talizman-harmonii-i-spokoju-harmony','','','','Naszyjnik z malachitem - Talizman harmonii i spokoju Harmony','','','',''),
(164,1,1,'Talizman True Colors pomoże Ci czerpać więcej radości z życia, dziecięcej energii, łatwości komunikacji i światła na Drodze Życia. Sprawi, że łatwiej wyjdziesz poza strefę komfortu oraz podejmiesz kolejne wyzwania z ufnością i optymizmem. Znów poczujesz pewność siebie i przypomnisz sobie o wewnętrznej mocy.  Załóż naszyjnik True Colors, jeśli czujesz, że nie masz dość wiary w siebie, w poczucie własnej wartości i w realizację swoich pragnień.  Ten naszyjnik  naenergetyzuje   dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat, aby podnosił Twoje wibracje osobiste oraz ochronił przed wpływem niechcianych emocji.','','naszyjnik-z-kolorowymi-kamieniami-talizman-radosci-true-colors','','','','Naszyjnik z kolorowymi kamieniami - Talizman radości True Colors','','','',''),
(165,1,1,'Od zarania dziejów Magowie i Alchemicy używali symboli serca do zaklęć związanych z miłością lub romansem. Symbol ten był również wykorzystywany w rytuałach mających na celu wzmocnienie istniejących relacji. Obecnie, serce kojarzone jest w różnych kulturach z miłością, miłosierdziem, radością i współczuciem.  Naszyjnik miłości Love Lock to wyjątkowy talizman, który otwiera kanał bezwarunkowej miłości, wzmacnia miłość własną i pomaga otworzyć się na nowy związek lub wzmocnić istniejącą relację partnerską.  Buduj szczęśliwy i harmonijny związek ze sobą i bliskimi Ci ludźmi.   Talizman energetyzowany, ten naszyjnik  naenergetyzuje  dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','naszyjnik-pozlacany-z-zawieszka-serce-talizman-milosci-love-lock','','','','Naszyjnik pozłacany z zawieszką serce - Talizman miłości Love Lock','','','',''),
(166,1,1,'To, że talizman Zodiac przeznaczony jest dla Ciebie, zapisane jest w gwiazdach!  Wodniku, jesteś zodiakalnym innowatorem i buntownikiem. Uwielbiasz wybiegać myślami w przyszłość. Jesteś zawsze o parę kroków przed innymi. Cechuje Cię duża niezależność i upartość. Wyrównaj energię życiową qi, ułóż emocje, przyjmij wysokie wibracje, wzmocnij najlepsze potencjały swojego znaku solarnego, takie jak: kreatywność, wizjonerstwo, indywidualizm, niezależność, wierność i nietuzinkowość.  Ten naszyjnik   naenergetyzuje   dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat, abyś mogła wyciągnąć światło z archetypu Twojego znaku zodiaku.','','naszyjnik-ze-znakiem-zodiaku-talizman-zodiac-dla-wodnika','','','','Naszyjnik ze znakiem zodiaku - Talizman Zodiac dla Wodnika','','','',''),
(167,1,1,'Intencja, uważność i działanie to składniki każdego success story. Bez względu na to, czy chcesz osiągnąć sukces w przedsięwzięciu, żyć w dobrostanie, zmienić pracę czy dojść do zdrowia lub schudnąć, Twoja uwaga musi być skupiona na dostrzeganiu znaków i możliwości, a Twoje działanie skupione na dążeniu celu.   Naszyjnik Success Story jest silnym talizmanem manifestującym nasze upragnione cele. Noś go codziennie i nie bądź bierna, dostrój się do wibracji sukcesu, uwierz i zaufaj! Do naszyjnika wybierz dowolną energetyzowaną zawieszkę Moonsister, która wzmocni powodzenie wybranej przez Ciebie dowolnej intencji!  Ten naszyjnik  naenergetyzuje   dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat, aby podnosił Twoją wiarę i przyciągnął sukces wybranej przez Ciebie intencji.','','naszyjnik-z-karabinczykiem-na-charmsy-talizman-na-sukces-success-story','','','','Naszyjnik z karabińczykiem na charmsy - Talizman na sukces Success Story','','','',''),
(168,1,1,'Ametyst to kamień „harmonii i relaksu”. Pomaga uwolnić od lęków oraz przywrócić równowagę osobom podatnym na stres. Jego właściwości sprzyjają odczuciu spokoju i uwolnieniu umysłu od negatywnych myśli. Pomaga radzić sobie z emocjami, sprzyja  cierpliwości i uwolnieniu od codziennego zmęczenia i problemów. Przywraca harmonię ducha, pomaga walczyć z uzależnieniami.  Naszyjnik Chillout to potężny talizman, dzięki któremu możesz odnaleźć wewnętrzny spokój, odczuć większą odporność na stres i negatywne wiadomości. Pomoże ochronić Twoje wibracje i zmienić podejście na bardziej optymistyczne.  Ten naszyjnik  naenergetyzuje   dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','naszyjnik-z-ametystem-talizman-harmonii-i-relaksu-chillout','','','','Naszyjnik z ametystem - Talizman harmonii i relaksu Chillout','','','',''),
(169,1,1,'Na Twojej Życiowej Ścieżce towarzyszą Ci Przewodnicy Duchowi, którzy czuwają byś realizowała swój plan przed urodzeniowy. Proszeni o pomoc dają Ci znaki i rozwiązania problemów, ale nieproszeni nie mogą ingerować. Gdy rozwijasz się duchowo, kontakt z nimi staje się oczywisty i bardzo bliski. Słyszysz wtedy głos intuicji, żyjesz zgodnie z pragnieniem duszy, jesteś zestrojona ze swoim wyższym Ja.  Naszyjnik Spirituality to potężny talizman na kontakt z wyższą jaźnią i Przewodnikami. Wspomoże w rozwoju duchowym i otworzy na kontakt ze Źródłem.  Ten talizman  naenergetyzuje   dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat, abyś wspinała się coraz wyżej po ścieżce rozwoju duchowego i czuła się zaopiekowana przez Twoich opiekunów.','','naszyjnik-srebrny-z-zawieszkami-talizman-na-rozwoj-duchowy-spirituality','','','','Naszyjnik srebrny z zawieszkami - Talizman na rozwój duchowy Spirituality','','','',''),
(170,1,1,'Naszyjnik Inner Power przypomina Ci, że wewnętrzna moc to siła, którą nosisz w sobie, która pochodzi z wyciszenia umysłu, odsunięcia na bok ego, wyzbycia się oczekiwań co do tego, jak powinno być.  Onyks jest kamieniem symbolizującym wytrwałość, determinację oraz potężną mocy. Pomaga odnaleźć własną drogę i odzyskać kontrole nad życiem. Dzięki niemu możesz poczuć przypływ pewności siebie i wsparcie zdolności przywódczych. Kamień ten może być również talizmanem ochronnym.  Załóż naszyjnik Inner Power, by odnaleźć Źródło siły w sobie, wspomóc swoją motywację, spróbować połączyć się ze swoim Wyższym Ja i usłyszeć cichy głos Duszy oraz wzmocnić miłość własną.   Naszyjnik Inner Power  naenergetyzuje   dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','naszyjnik-srebrny-z-onyksem-talizman-wewnetrznej-mocy-i-odwagi-inner-power','','','','Naszyjnik srebrny z onyksem - Talizman wewnętrznej mocy i odwagi Inner Power','','','',''),
(171,1,1,'Twoje życie jest jak łańcuszek, w którym wszystkie ważne ogniwa powinny być w harmonii, żebyś była szczęśliwa. Rodzina, praca, pieniądze, zdrowie, przyjaźń - bez względu na to na jakim obszarze życia potrzebujesz wsparcia, pomoże Ci w tym łańcuszek szczęścia.  Naszyjnik Chain of Luck wspomoże powodzenie w Twoich przedsięwzięciach. Załóż go, jeśli wydaje Ci się, że prześladuje Cię pech, potrzebujesz nieco farta do realizacji swoich planów lub jesteś przed ważnym życiowym wydarzeniem. Naszyjnik można nosić w setach z innymi talizmanami, które wzmocnią jego intencje.   Talizman energetyzowany, ten naszyjnik  naenergetyzuje  dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','naszyjnik-srebrny-z-ogniwami-talizman-szczescia-i-powodzenia-chain-of-luck','','','','Naszyjnik srebrny z ogniwami - Talizman szczęścia i powodzenia Chain of luck','','','',''),
(172,1,1,'Energia żeńska to moc kreowania, odpowiada za manifestację i jest związana z podświadomością. Gdy brak Ci tej energii, doświadczasz niepewności, braku poczucia własnej wartości, nieumiejętności przyjmowania darów od Wszechświata, problemów z miłością własną, rollercoastera emocjonalnego i niemożności osiągania własnych celów.  Księżyc to matka, opiekunka, bezpieczeństwo, emocje i kobiecość, podświadomość i intuicja. Nów oznacza nowe początki, to czas zaangażowania energii życiowej w nowe cele i manifestację marzeń.  Załóż naszyjnik Crystal Cresent, aby wzmocnić pewność siebie, stabilizację emocjonalna, kreowanie i inicjowanie celów.   Talizman energetyzowany, ten naszyjnik  naenergetyzuje   dla Ciebie nasz Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','naszyjnik-z-ksiezycem-i-cyrkoniami-talizman-kobiecosci-crystal-cresent','','','','Naszyjnik z księżycem i cyrkoniami- Talizman kobiecości Crystal Cresent','','','',''),
(173,1,1,'Słońce reprezentuje ogień. To żywioł oczyszczający, który wypala negatywne emocje i sprzyja otwieraniu nowego rozdziału w życiu. To również symbol wszelkiego życia na Ziemi, źródło siły, jasności i dobrostanu. To źródło energii dobrobytu i szczęścia. Słońce symbolizuje także męską energię, odpowiedzialną za działanie. Energię, która sprawia, że jesteśmy pełni sił i pewności siebie na co dzień i w dalekosiężnych celach.  Załóż naszyjnik \"King Sun\", jeśli w Twoim życiu brakuje optymizmu, ciężko Ci znaleźć energię i chciałabyś odzyskać poczucie sprawczości.  Naszyjnik   naenergetyzuje   dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','naszyjnik-z-cyrkoniami-talizman-optymizmu-i-energii-king-sun','','','','Naszyjnik z cyrkoniami - talizman optymizmu i energii  King Sun','','','',''),
(174,1,1,'Łańcuszek i jego ogniwa, symbolizują wszystkie aspekty Twojego życia, które powinny być w harmonii, żebyś mogła czuć się szczęśliwa. Rodzina, praca, pieniądze, zdrowie, przyjaźń - w każdym z tych obszarów życia, wesprze Cię naszyjnik Lucky Stars. Oprócz tego, możesz liczyć również na pomoc trzech gwiazdek, które zadbają o radość życia, Twoje wewnętrzne dziecko, łatwości w komunikacji i światło na Twojej Drodze Życia.  Ten naszyjnik  naenergetyzuje   dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat, aby wspomóc powodzenie w Twoich przedsięwzięciach. Załóż go, jeśli wydaje Ci się, że prześladuje Cię pech, potrzebujesz farta do realizacji swoich planów, jesteś przed ważnym życiowym wydarzeniem lub brakuje Ci poczucia szczęścia i spełnienia na co dzień.','','lancuszek-srebrny-z-ogniwami-talizman-radosci-zycia-lucky-stars','','','','Łańcuszek srebrny z ogniwami - Talizman radości życia Lucky Stars','','','',''),
(175,1,1,'Czaszka w duchowości jest pozytywnym symbolem o wielu znaczeniach. Oznacza koniec etapu, przejść i zmian, niezależnie od tego, czy zachodzą one na poziomie duchowym, emocjonalnym czy fizycznym. W wielu kulturach to symbol wiedzy i wyższej mądrości.  W buddyzmie czaszka przedstawia koncepcję idealnej pustki, w której istnieje pole nieograniczonych możliwości. W hinduizmie oznacza zdolność do pokonania śmierci, dlatego jej wizerunek zdobił szyje bóstw.  Załóż talizman mądrości Spirit, gdy jesteś na etapie transformacji, poszukujesz wewnętrznej siły, zamykasz dany rozdział w życiu, rozwijasz się duchowo, potrzebujesz połączenia z intuicją i chcesz otworzyć się na mistyczne doznania.   Talizman   energetyzowany, ten naszyjnik  naenergetyzuje  dla Ciebie Moonbrother Mariusz.','','lancuszek-srebrny-meski-z-czaszka-talizman-madrosci-spirit','','','','Łańcuszek srebrny męski z czaszką - Talizman mądrości Spirit','','','',''),
(176,1,1,'Najbardziej magiczną częścią twojego życia jesteś Ty!  Z naszyjnikiem Power of Intention sama tworzysz wzmacniający talizman i wspierasz manifestację Twoich pragnień. Wyraź osobistą intencję zakładając na niego dowolny charms od Moonsister. Zmieniaj zawieszki w zależności od potrzeb i spraw, by magia działała dla Ciebie!   Ten naszyjnik  naenergetyzuje   dla Ciebie nasz Moonbrother Mariusz na wsparcie intencji Moonsisterowych zawieszek.','','naszyjnik-z-karabinczykiem-na-charmsy-talizman-manifestacji-power-of-intention','','','','Naszyjnik z karabińczykiem na charmsy - Talizman manifestacji Power of Intention','','','',''),
(177,1,1,'Naszyjnik Easy Going, pomoże Ci zmierzyć się z codziennymi zadaniami i ukoić stres.   Kwarc dymny pomaga wprowadzić do życia spokój i harmonię. Jest przydatny w chwilach wzmożonego stresu i napięcia. Dzięki niemu oddalisz negatywne emocje i niskie wibracje, uwolnisz napięcie i toksyczne myśli oraz usuniesz energetyczne blokady. Chroni ciało astralne i oczyszcza aurę, uziemia i ugruntowuje. Może być używany jako talizman przynoszący szczęście, amulet zapobiegający wypadkom i przenikaniu negatywnej energii do naszej aury.  Załóż talizman Easy Going, gdy towarzyszą Ci chwile napięcia i stresu, potrzebujesz ukojenia od nawracających myśli oraz chcesz wprowadzić harmonię do swojego życia.  Ten naszyjnik  naenergetyzuje  dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','naszyjnik-ze-zlotymi-koralikami-i-kwarcem-dymnym-talizman-spokoju-easy-going','','','','Naszyjnik ze złotymi koralikami i kwarcem dymnym - Talizman spokoju Easy Going','','','',''),
(178,1,1,'Serce jest symbolem czakry Anahata, która stanowi punkt centralny pomiędzy światem duchowym, a światem materii. Gwiazda to oświecenie, światło, przewodnictwo. Gdy żyjemy w stresie, chorujemy, bywamy w dużych skupiskach ludzkich lub odczuwamy niskie wibracje, nasze ciało eteryczne słabnie. Jesteśmy bardziej podatni na ataki wampirów energetycznych, czujemy, że ludzie i sytuacje  wysysają z nas energię. Światło w naszym sercu gaśnie.  Naszyjnik „Vitality” to mocny amulet ochronny. Załóż go, jeśli chcesz chronić swoją energetykę, zabezpieczyć się przed zazdrością innych i  potrzebujesz znaleźć w sercu wewnętrzny spokój oraz radość życia.   Ten naszyjnik  naenergetyzuje  dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','srebrny-naszyjnik-z-sercem-amulet-ochronny-vitality','','','','Srebrny naszyjnik z sercem - Amulet ochronny Vitality','','','',''),
(179,1,1,'Naszyjnik Safety Lock wspomoże Twoje poczucie bezpieczeństwa, które jest stanem wewnętrznym. Jeśli będziesz działać z dojrzałością, spokojem w sercu i zaufaniem do Wszechświata, będziesz w stanie przezwyciężyć wszelkie wyzwania!  Talizman Safety Lock symbolizuje poczucie bezpieczeństwa i pomaga poczuć się pewnie na wszystkich obszarach życia: kariery, rodzinnym, zdrowia, finansów i miłości.  Cyrkonie są źródłem światła, który pomaga Ci odnaleźć spokój w sercu i zaufanie.  Załóż talizman Safety Lock, gdy chcesz poczuć spokój, zwiększyć zaufanie i czuć się bezpiecznie.  Talizman energetyzowany, ten naszyjnik  naenergetyzował   dla Ciebie nasz Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','naszyjnik-z-cyrkoniami-i-klodka-talizman-bezpieczenstwa-safety-lock','','','','Naszyjnik z cyrkoniami i kłódką - Talizman bezpieczeństwa Safety Lock','','','',''),
(180,1,1,'Naszyjnik Self Care przypomni Ci jak ważna jest miłość własna i czerpanie radości z życia codziennego. Pomoże Ci dostrzec swoje potrzeby oraz otoczyć się opieką.   Rodonit, który znajduje się w talizmanie Self Care pomaga uzdrowić rany duchowe, które nabyłaś na swojej drodze życia. Pozwala się zdystansować i spojrzeć świeżym okiem na stare sprawy. Uwalnia od wątpliwości i wspiera podejmowanie trudnych decyzji. Może okazać się pomocny w odkryciu Twoich predyspozycji i wykorzystaniu potencjału.   Załóż naszyjnik Self Care, gdy brak Ci wiary w siebie, czujesz się zagubiona w otaczającym świecie i chcesz odkryć swoją moc.   Ten naszyjnik  naenergetyzuje   dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','naszyjnik-ze-zlotymi-koralikami-i-rodonitem-talizman-milosci-wlasnej-self-care','','','','Naszyjnik ze złotymi koralikami i rodonitem - Talizman miłości własnej Self Care','','','',''),
(181,1,1,'Gwiazda ma interesującą i niezwykle bogatą symbolikę. Reprezentuje boską ideę, ideał, sukces, szczęście, nadzieję i światło. Pięcioramienna gwiazda nawiązuje do 4 żywiołów i ducha, wyraża bycie kompletnym i zbalansowanym. Można jej symbolikę również oprzeć na pięciu głównych zasadach: miłości, mądrości, prawdy, sprawiedliwości i cnoty, którymi powinien kierować się człowiek, aby stanąć w pełni swojej mocy.  Naszyjnik Little Star ma 7 gwiazdek. W numerologii to liczba wyższej wiedzy i rozwoju duchowego.  Załóż talizman Little Star jeśli rozwijasz się duchowo i szukasz swojego wyższego celu oraz chcesz uzyskać dostęp do wewnętrznej mądrości.  Talizman energetyzowany, ten naszyjnik  naenergetyzuje   dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','naszyjnik-z-cyrkoniami-i-gwiazdami-talizman-wewnetrznej-madrosci-little-star','','','','Naszyjnik z cyrkoniami i gwiazdami - Talizman wewnętrznej mądrości Little Star','','','',''),
(182,1,1,'Naszyjnik Luxuriate jest bogato zdobiony dużymi cyrkoniami. Cyrkonie symbolizują światło na drodze życia, do którego dąży Twoja dusza, a także nadzieję i pozytywne nastawienie. Sprzyjają także praktyczności i przejrzystemu spojrzeniu na sytuację.   Talizman Luxuriate jest energetyzowany na przyciągniecie dóbr materialnych, podejmowanie dobrych decyzji finansowych i powodzenie w przedsięwzięciach biznesowych.   Załóż go, gdy chcesz osiągnąć sukces w przedsięwziętych działaniach, miewasz wątpliwości w podejmowaniu decyzji lub jesteś na etapie nowych wyzwań zawodowych i chcesz, aby Twoje działania przyniosły zamierzony efekt.   Naszyjnik Luxuriate to talizman energetyzowany. Naszyjnik  naenergetyzuje  dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','naszyjnik-z-cyrkoniami-talizman-przyciagania-i-powodzenia-finansowego-luxuriate','','','','Naszyjnik z cyrkoniami - Talizman przyciągania i powodzenia finansowego Luxuriate','','','',''),
(183,1,1,'Talizman Coronucopia to róg obfitości, który symbolizuje wszelakie zasoby, które są potrzebne do pokonania przeszkód na Drodze Życia i dotarcia do celu.  Cyrkonie symbolizują światło do którego dąży Twoja dusza. Dotarcie do niego wymaga jednak pokonania wielu wyzwań i transformacji. Turkus umieszczony na środku zawieszki, wspomoże odnalezienie właściwej drogi i określenie czego na prawdę pragniesz.  Załóż naszyjnik Cornucopia, jeśli chcesz uzyskać dostęp do nieograniczonych zasobów i możliwości, tak byś mogła spełniać swoje marzenia z lekkością oraz chcesz podążać przez życie zgodnie ze swoim przeznaczeniem.   Talizman energetyzowany, ten naszyjnik  naenergetyzuje   dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','naszyjnik-z-cyrkoniami-i-turkusem-talizman-wyzwan-i-mozliwosci-cornucopia','','','','Naszyjnik z cyrkoniami i turkusem - Talizman wyzwań i możliwości Cornucopia','','','',''),
(184,1,1,'Czaszka w duchowości jest pozytywnym symbolem o wielu znaczeniach. Oznacza koniec etapu, przejść i zmian, niezależnie od tego, czy zachodzą one na poziomie duchowym, emocjonalnym czy fizycznym. W wielu kulturach to symbol wiedzy i wyższej mądrości.  W buddyzmie czaszka przedstawia koncepcję idealnej pustki, w której istnieje pole nieograniczonych możliwości. W hinduizmie oznacza zdolność do pokonania śmierci, dlatego często zdobiła szyje bóstw.  Załóż talizman Spirit, gdy jesteś na etapie transformacji, poszukujesz wewnętrznej siły, zamykasz dany rozdział w życiu, rozwijasz się duchowo, potrzebujesz połączenia z intuicją i chcesz otworzyć się na mistyczne doznania.   Talizman energetyzowany, ten naszyjnik  naenergetyzuje  dla Ciebie Moonbrother Mariusz.','','lancuszek-pozlacany-meski-z-czaszka-talizman-madrosci-spirit','','','','Łańcuszek pozłacany męski z czaszką - Talizman mądrości Spirit','','','',''),
(185,1,1,'W wielu wierzeniach serce jest symbolem odwagi moralnej, sumienia oraz źródła oświecenia duchowego. Powszechnie jest ono kojarzone z miłością, miłosierdziem, radością i współczuciem.  Onyks natomiast jest kamieniem symbolizującym wytrwałość, determinację oraz potężną moc. Pomaga odnaleźć własną drogę i odzyskać kontrole nad życiem. Kamień ten może być również talizmanem ochronnym, sprzyja pochłanianiu negatywnej energii oraz przeistoczeniu jej w pozytywne wibracje.   Załóż naszyjnik \"Heart of Gold\" jeśli chcesz wzmocnić swoją miłość i akceptacje, zadbać o trwałość i zrozumienie w relacjach, jak również rozwinąć empatię względem otaczających osób i świata.   Ten naszyjnik   naenergetyzuje   dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','naszyjnik-z-karabinczykiem-na-charmsy-talizman-z-onyksem-i-sercem-heart-of-gold','','','','Naszyjnik z karabińczykiem na charmsy - Talizman z onyksem i sercem Heart of Gold','','','',''),
(186,1,1,'Talizman Golden Deal, sprzyja podejmowaniu nowych przedsięwzięć oraz jest wsparciem na ścieżce kariery.   Kwarc Tygrysi to kamień biznesmenów, który przyciąga bogactwo i powodzenie, przynosi odwagę w realizacji planów i pewność siebie. Zapewnia stabilizację finansową, otacza opieką zgromadzone bogactwo. Moc tygrysiego oka sprzyja także rozsądnemu gospodarowaniu pieniędzmi i mądrym inwestycjom.  Naszyjnik Golden Deal to talizman dla każdej osoby, która rozpoczyna nowy biznes, zmienia branżę lub decyduje się na otwarcie własnej działalności.  Talizman energetyzowany, ten naszyjnik  naenergetyzuje  dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','naszyjnik-z-kwarcem-tygrysim-talizman-wsparcia-w-biznesie-golden-deal','','','','Naszyjnik z kwarcem tygrysim - Talizman wsparcia w biznesie Golden Deal','','','',''),
(187,1,1,'Talizman Fortune Teller, jest pomocny podczas prowadzenia negocjacji i spotkań biznesowych.   Zielony jadeit sprzyja zwiększeniu wiary w siebie oraz realizowaniu przedsięwziętych zadań. Przyciąga szczęście oraz bogactwo. Jest pomocny w podjęciu ważnych decyzji biznesowych oraz ułatwia negocjacje. Poleca się go szczególnie osobą prowadzącym własne interesy oraz pracującym w działach związanych z handlem.     Naszyjnik Fortune Teller to talizman dla każdej osoby, która rozwija własny biznes, chce zwiększyć wiarę w siebie i pewniej prowadzić rozmowy na szczeblu finansowym.   Talizman energetyzowany, ten naszyjnik  naenergetyzuje   dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','naszyjnik-z-zielonym-jadeitem-talizman-sukcesu-i-negocjacji-fortune-teller','','','','Naszyjnik z zielonym jadeitem - Talizman sukcesu i negocjacji Fortune Teller','','','',''),
(188,1,1,'Problemy z komunikacją mogą być powodem: rozpadów związku, tego, że nie możemy znaleźć pracy, że czujemy się samotni. Czasami zamykamy swoje emocje w sobie, tłumiąc energię w obawie przed krytyką, niezrozumieniem lub ośmieszeniem.   Załóż bransoletkę Communication jeśli ciężko Ci otworzyć się przed drugim człowiekiem, uciekasz od trudnych tematów, masz problem z rozmowami o uczuciach lub nie jesteś asertywna. Ten talizman pomoże Ci otworzyć się na szczerą komunikację oraz rozumienie swoich potrzeb emocjonalnych.   Talizman energetyzowany, tą bransoletkę  naenergetyzuje  dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','bransoletka-srebrna-otwarta-talizman-porozumienia-i-komunikacji-communication','','','','Bransoletka srebrna otwarta - Talizman porozumienia i komunikacji Communication','','','',''),
(189,1,1,'Talizman Rich&amp;Royal jest energetyzowany na przyciągniecie dóbr materialnych, podejmowanie dobrych decyzji finansowych i powodzenie w przedsięwzięciach biznesowych.   Załóż go, gdy chcesz osiągnąć sukces w przedsięwziętych działaniach, miewasz wątpliwości w podejmowaniu decyzji lub jesteś na etapie nowych wyzwań zawodowych i chcesz, aby Twoje działania przyniosły zamierzony efekt.   Bransoletka Rich&amp;Royal to talizman, który pomoże przyciągnąć szczęście i bogactwo oraz energię dobrobytu i obfitości.  Ten talizman  naenergetyzuje   dla Ciebie nasz Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','sztywna-bransoletka-z-heksagonow-talizman-dobrobytu-i-obfitosci-richroyal','','','','Sztywna bransoletka z heksagonów - Talizman dobrobytu i obfitości Rich&Royal','','','',''),
(190,1,1,'Czterolistna koniczyna to symbol szczęścia, zwiastujący powodzenie we wszystkich obszarach życia. Według dawnych tradycji każdy z listków symbolizował inną wartość nadzieję, wiarę, miłość oraz szczęście. Na podstawie wierzeń celtyckich przypisywano jej również funkcję ochronną.   Załóż bransoletkę Good Luck II, gdy chcesz wspomóc szczęście. Wydaje Ci się, że prześladuje Cię pech i potrzebujesz nieco farta do realizacji swoich planów oraz chcesz tchnąć trochę nadziei w swoje działania.   Talizman energetyzowany, tą bransoletkę  naenergetyzuje  dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','srebrna-bransoletka-z-koniczyna-talizman-pomyslnosci-i-nadziei-good-luck-ii','','','','Srebrna bransoletka z koniczyną - Talizman pomyślności i nadziei Good Luck II','','','',''),
(191,1,1,'Hamsa jest związana z wieloma tradycjami. W hinduizmie jest często używana jako synonim najwyższego ducha lub ostatecznej rzeczywistości, która nazywa się „Brahmanem”. W buddyzmie reprezentuje uniwersalnego ducha i wyzwolenie z cyklu odrodzenia. Do naszej kultury przeszła jako symbol odpierania zła i negatywnych energii.  Załóż bransoletkę Hamsa jeśli miewasz spadki nastroju, czujesz, że uchodzi z Ciebie energia lub pracujesz w stresujących warunkach. Talizman sprzyja ochronie i wspiera wysokie wibracje.   Naszyjnik   naenergetyzuje   dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','bransoletka-zlota-z-zawieszka-talizman-wysokich-wibracji-hamsa','','','','Bransoletka złota z zawieszką - Talizman wysokich wibracji Hamsa','','','',''),
(192,1,1,'Bransoletka Manifestation to talizman wspierający manifestację osobistych pragnień. Często nie zdajemy sobie sprawy z tego, że sami sabotujemy swoje marzenia. Z jednej strony pragniemy czegoś dla siebie, a w głębi duszy czujemy, że nigdy tego nie osiągniemy, że \"i tak to się nie uda\", bądź że na to nie zasługujemy. W takiej sytuacji realizacja celu nie może się powieść. Nie możemy oczekiwać, że marzenie się spełni, jeśli wychodzimy z poziomu lęku. „Manifestation” wesprze Cię w kreowaniu rzeczywistości dostrajając Cię do wibracji Twojego pragnienia.  To talizman, który będzie przypominał, że nie ma rzeczy, której nie możesz osiągnąć. Pomoże Ci uwierzyć, że Twoje pragnienie już na Ciebie czeka, wesprze motywację do aktywnego osiągania zamierzonych celów.  Tę bransoletkę  naenergetyzuje   dla Ciebie nasz Moonbrother Mariusz, który z energią pracuje od ponad 30 lat na wsparcie w manifestacji Twoich pragnień, dostrzeganie znaków i kreatywność w dążeniu do celu. Załóż ją, aby pamiętać, że możesz wszystko - otwórz się i zaufaj.','','bransoletka-srebrna-regulowana-talizman-manifestacji-i-motywacji-manifestation','','','','Bransoletka srebrna regulowana - Talizman manifestacji i motywacji Manifestation','','','',''),
(193,1,1,'Uwolnij się od ograniczających przekonań, naucz się stawać w swoim świetle i patrz z optymizmem na życie!  Twoje życie jest jak łańcuszek, w którym wszystkie ważne ogniwa powinny być w harmonii, żebyś była szczęśliwa. Czasami wymaga to wyjścia poza strefę komfortu i pokonania lęków, które Cię ograniczają.  Załóż bransoletkę Unbound, jeśli boisz się wyjść ze strefy komfortu, borykasz się z lękami, brakuje Ci asertywności, nie możesz wydostać się z niekomfortowej dla Ciebie sytuacji i chcesz dostrzegać więcej pozytywów w swoim życiu.  Talizman energetyzowany, tą bransoletkę  naenergetyzuje  dla Ciebie nasz Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','bransoletka-z-czterech-lancuszkow-talizman-asertywnosci-i-optymizmu-unbound','','','','Bransoletka z czterech łańcuszków - Talizman asertywności i optymizmu Unbound','','','',''),
(194,1,1,'Każdy z nas marzy by sięgnąć gwiazd, jednak blokują nas w tym własne ograniczenia - niewiara w odniesienie sukcesu, brak pewności siebie, brak zaufania w swoją intuicję, błędne wzorce i przekonania, na które pracujemy całe życie.  Zakładając talizman Crystal Stars transformujesz cienie w światło. Gwiazda reprezentuje boską ideę, ideał, szczęście, sukces, nadzieję, światło, a także 4 żywioły i ducha. Bransoletka Crystal Stars wspomoże pewność siebie i odwagę oraz doda żywioł ognia do Twoich działań, żebyś uwierzyła, że nie ma dla Ciebie rzeczy nie możliwych!  Talizman energetyzowany, tą bransoletkę  naenergetyzuje   dla Ciebie nasz Moonbrother Mariusz, który pracuje z energią od 30 lat.','','bransoletka-z-gwiazdami-i-cyrkoniami-talizman-pewnosci-siebie-crystal-stars','','','','Bransoletka z gwiazdami i cyrkoniami - Talizman pewności siebie Crystal Stars','','','',''),
(195,1,1,'Twoje życie jest jak łańcuszek, w którym wszystkie ważne ogniwa powinny być w harmonii, żebyś była szczęśliwa. Rodzina, zdrowie, praca, pieniądze, przyjaźń - bez względu na to na jakim obszarze życia potrzebujesz wsparcia, pomoże Ci w tym łańcuszek szczęścia.  Bransoletka Chain of Luck wspomoże powodzenie w Twoich przedsięwzięciach. Załóż ją, jeśli wydaje Ci się, że prześladuje Cię pech, potrzebujesz nieco szczęścia do realizacji swoich planów lub jesteś przed ważnym życiowym wydarzeniem. Bransoletkę można nosić w setach z innymi talizmanami, które wzmocnią jej intencje.   Talizman energetyzowany, tą bransoletkę  naenergetyzuje  dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','bransoletka-srebrna-z-ogniwami-talizman-szczescia-i-powodzenia-chain-of-luck','','','','Bransoletka srebrna z ogniwami - Talizman szczęścia i powodzenia Chain of Luck','','','',''),
(196,1,1,'Lapis lazuli ma pokojowy wpływ i wibracje, działa wyciszająco, dlatego też nadaje się doskonale do pracy nad sobą i własną duchowością. Dostarcza poczucie wewnętrznej mocy, wiary i nadziei, a także pozwala na odnalezienie w sobie odwagi, pewności siebie i przezwyciężenie wewnętrznej nieśmiałości. Lapis lazuli jest kamieniem stymulującym delikatność i łagodność i zapewniającym ochronę przede wszystkim przed atakami energetycznymi, psychicznymi oraz urokami. Jest to także kamień duchowej miłości, który wzmacnia więzi w relacjach. Dodatkowo wnosi jasność w nasze myśli, uspokaja ducha i pomaga rozpoznać nasze zadanie życiowe.  Onyks jest kamieniem symbolizującym wytrwałość, determinację oraz potężną mocy. Pomaga odnaleźć własną drogę i odzyskać kontrole nad życiem. Dzięki niemu możesz poczuć przypływ pewności siebie i wsparcie zdolności przywódczych. Kamień ten może być również talizmanem ochronnym.  Załóż bransoletkę Spiritual Growth by wspomóc swój rozwój duchowy, odwagę i wiarę w swoją moc oraz gdy chcesz uchronić się przed wpływem negatywnych wibracji.   Tę bransoletkę  naenergetyzuje  dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','bransoletka-meska-z-lapis-lazuli-i-onyksem-talizman-spokoju-i-duchowosci-spiritual-growth-ii','','','','Bransoletka męska z lapis lazuli i onyksem - Talizman spokoju i duchowości Spiritual Growth II','','','',''),
(197,1,1,'To wysokie wibracje powodują, że jesteś szczęśliwy, wdzięczny, uważny, żyjesz w dobrej energii i zgodzie ze Światem. Nie czujesz urazów, nie stresujesz się, a ludzie w Twoim otoczeniu czują się dobrze. Wysokie wibracje to jasna, świetlista i czysta energia, którą symbolizują cyrkonie w bransoletce. Gdy chorujesz, przeżywasz trudne emocje lub żyjesz z poziomu lęku, Twoje wibracje spadają.  Załóż bransoletkę Shining Vibes, aby pamiętać, że każda lekcja służy Twojemu rozwojowi i dodać sobie energii w pokonywaniu trudnych doświadczeń.  To talizman, który będzie przypominał, żebyś dbał o swoje wysokie wibracje. Pomoże Ci wyjść z gorszego okresu silniejszą, pokonać lęki, dostrzec światło w trudnych doświadczeniach i wrócić do wewnętrznej harmonii.   Tę bransoletkę  naenergetyzuje   dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','sztywna-bransoletka-z-cyrkoniami-talizman-wysokich-wibracji-shining-vibes','','','','Sztywna bransoletka z cyrkoniami - Talizman wysokich wibracji Shining Vibes','','','',''),
(198,1,1,'Nasze życie jest jak łańcuch, w którym wszystkie ważne ogniwa powinny być w harmonii, abyś czuć się szczęśliwym i spełnionym. Rodzina, zdrowie, praca, pieniądze, przyjaźń - bez względu na to na jakim obszarze życia potrzebujesz wsparcia, talizman \"Illumination\" może okazać się pomocny.  Załóż bransoletkę Illumination, kiedy potrzebujesz zwiększyć wiarę w siebie lub mierzysz się z niskim poczuciem wartości. Blask ogniw doda Ci odwagi i siły przebicia. Bransoletkę  naenergetyzuje  dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','bransoletka-srebrna-z-ogniwami-talizman-odwagi-i-wiary-w-siebie-illumination','','','','Bransoletka srebrna z ogniwami - talizman odwagi i wiary w siebie Illumination','','','',''),
(199,1,1,'Bransoletka Celestial Stars to talizman wspierający szczęście i optymizm. Każdy w życiu przechodzi kryzysy i gorsze momenty, ale też każda taka sytuacja jest lekcją, która ma za zadanie nas wzmocnić. Celestial Stars wesprze Cię i doda wiatru w żagle kiedy tego potrzebujesz. To Twoje szczęśliwe gwiazdy przypominające Ci, że po każdej burzy wychodzi słońce, a żaden strach nie zdoła Cię powstrzymać przed działaniem.   Załóż ją, aby wspomóc odwagę obfitość i dobry los. Pamiętaj, że Wszechświat Ci sprzyja - otwórz się i zaufaj.   Talizman energetyzowany, tą bransoletkę  naenergetyzuje  dla Ciebie nasz Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','bransoletka-sztywna-z-gwiazdami-i-cyrkoniami-talizman-szczescia-i-optymizmu-celestial-stars','','','','Bransoletka sztywna z gwiazdami i cyrkoniami - Talizman szczęścia i optymizmu Celestial Stars','','','',''),
(200,1,1,'Dharma to ważna koncepcja hinduska i buddyjska, odnosząca się do prawa lub zasady rządzącej wszechświatem. Słowo to pochodzi od sanskryckiego dhri, które oznacza „trzymać”, „utrzymywać” lub „zachować”. We wczesnych Wedach i innych starożytnych tekstach hinduskich dharma odnosiła się do kosmicznego prawa, które stworzyło uporządkowany wszechświat z chaosu. Jest uważana za jeden z trzech klejnotów buddyzmu, obok sangi i buddy, które razem torują ścieżkę do oświecenia.   Na poziomie indywidualnym dharma może odnosić się do osobistej misji lub celu. Tradycyjnie uważa się, że dharma danej osoby jest z góry określona, a wszystkie istoty muszą zaakceptować swoją dharmę, aby na świecie panował ład i harmonia. Człowiek podążający za swoją dharmą, spełnia swoje najprawdziwsze powołanie. Służy wszystkim innym istotom we wszechświecie, odgrywa swoją prawdziwą rolę.  Załóż bransoletkę Dharma, jeśli chcesz żyć w zgodzie ze swoją własną dharmą. Tylko wtedy życie człowieka przynosi radość i spełnienie.  Ten naszyjnik  naenergetyzuje  dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','bransoletka-boho-talizman-przeznaczenia-dharma','','','','Bransoletka boho - Talizman przeznaczenia Dharma','','','',''),
(201,1,1,'Zoisyt jest silnym kamieniem transformującym negatywną energie w pozytywne wibracje. Może okazać się pomocny w czasie dużych życiowych zmian, niepowodzeń i wzmożonego stresu. Pomaga wyrównać energetykę i otworzyć się na pozytywne energie, pomimo trudnych doświadczeń.   Rubin otwiera na chęć do działania i realizowania swoich pasji. Uważa się także, że ma właściwości ochronne oraz wspomaga w sprawach finansowych. Sprzyja pomnażaniu majątku oraz podejmowaniu właściwych decyzji biznesowych.  Załóż bransoletkę High Vibration, gdy chcesz chronić się przed wpływem niskich wibracji, rozwinąć skrzydła i bez uprzedzeń rozwijać swoje zainteresowania. Potrzebujesz tchnąć trochę optymizmu do życia oraz wesprzeć swoje działania biznesowe.   Bransoletkę  naenergetyzuje   dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','bransoletka-meska-z-zoisytem-i-rubinem-talizman-transformacji-i-pozytywnych-wibracji-high-vibration','','','','Bransoletka męska z zoisytem i rubinem - Talizman transformacji i pozytywnych wibracji High Vibration','','','',''),
(202,1,1,'Serce symbolizujące czakrę Anahata, stanowi punkt centralny pomiędzy światem ducha, a światem materii. Gwiazda to światło, przewodnictwo, oświecenie. Gdy chorujemy, żyjemy w stresie, przebywamy w dużych skupiskach ludzkich lub otaczają nas niskie wibracje, nasze ciało eteryczne się osłabia. Jesteśmy podatni na ataki wampirów energetycznych, czujemy, że ludzie i sytuacje dosłownie wysysają z nas energię. Światło w naszym sercu gaśnie.  Bransoletka Vitality to silny amulet ochronny. Załóż go, jeśli chcesz chronić swoją energetykę, chronić się przed zazdrością innych, potrzebujesz znaleźć w sercu wewnętrzny spokój, radość życia lub odzyskać zdrowie psychiczne bądź fizyczne.  Ten naszyjnik   naenergetyzuje  dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','bransoletka-z-sercem-talizman-ochronny-vitality','','','','Bransoletka z sercem - Talizman ochronny Vitality','','','',''),
