(207,1,1,'W wielu wierzeniach serce jest symbolem odwagi moralnej, sumienia oraz źródła oświecenia duchowego. Powszechnie jest ono kojarzone z miłością, miłosierdziem, radością i współczuciem.  Turkus to jeden z bardziej znanych i docenianych kamieni. Od wieków przypisuje mu się właściwości ochronne. Poza tym uważany jest za kamień wpływający pozytywne na nastrój oraz samopoczucie, łagodzi stres i pomaga się wyciszyć. Otwiera na kreatywność i tworzenie.   Załóż bransoletkę Balm to my heart, jeśli pragniesz  otworzyć się na pozytywne uczucia i  uzyskać wsparcie na swojej drodze lub jesteś w stresującym okresie życia i chcesz uspokoić swoje emocje oraz przyciągnąć więcej harmonii.   Talizman energetyzowany, ten naszyjnik  naenergetyzuje   dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','bransoletka-z-turkusem-i-sercem-talizman-uzdrowienia-i-milosci-balm-to-my-heart','','','','Bransoletka z turkusem i sercem - Talizman uzdrowienia i miłości Balm to my Heart','','','',''),
(208,1,1,'Miłość i Przyjaźń są jak drzewo - gdy dbamy o nie, zapuszcza głębokie korzenie i jest silne. Burze, grady, śniegi i chmury na niebie nie są w stanie nim poruszyć.  Bransoletka To the Moon to talizman wspierający w miłości i przyjaźni. Każda relacja przechodzi kryzysy i gorsze momenty, ale też każda przepracowana wspólnie lekcja je wzmacnia. To The Moon wspiera komunikację i zrozumienie partnera w związku, sprawia, że podchodzimy do relacji w dojrzały sposób i jesteśmy otwarci na drugiego człowieka. Jest też pięknym prezentem dla bliskiej Moonsisterki, mamy lub siostry.  Tę bransoletkę  naenergetyzuje  dla Ciebie nasz Moonbrother Mariusz na zdrowe i szczęśliwe relacje. Załóż ją, gdy chcesz wzmocnić istniejącą przyjaźń lub miłość, przechodzisz kryzys w relacji i chcesz ją uzdrowić lub gdy jesteś singielką i szukasz szczęśliwej i wspierającej miłości bądź przyjaźni.','','sztywna-bransoletka-talizman-milosci-i-przyjazni-to-the-moon','','','','Sztywna bransoletka - Talizman miłości i przyjaźni To The Moon','','','',''),
(209,1,1,'Perły mają niezwykle bogatą symbolikę. W taoizmie, hinduizmie i buddyzmie „płonąca perła” symbolizuje wewnętrzną mądrość i wzmacnia nasze połączenie z boskimi energiami kosmosu. Perły są klejnotem, który zachęcająca do odkrycia prawdziwego JA i naszego prawdziwego celu na Ziemi. Wspierają w pracy z emocjami, przynosząc ukojenie, są amuletem chroniącym przed niepożądanymi energiami z nieziemskich źródeł. Odzwierciedlają także czystość, uczciwość i lojalność - czyli te wartości, które wspierają energię dobrostanu.  Załóż bransoletkę Protection Pearls, gdy potrzebujesz wsparcia w pracy z własnymi emocjami, chcesz żyć w zgodzie ze sobą i podążać właściwą drogą oraz chronić się przed negatywnymi wpływami.   Ten naszyjnik  naenergetyzuje  dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','bransoletka-z-perlami-i-lancuszkiem-talizman-ochrony-i-wewnetrznej-prawdy-protection-pearls','','','','Bransoletka z perłami i łańcuszkiem - Talizman ochrony i wewnętrznej prawdy Protection Pearls','','','',''),
(210,1,1,'Tygrysie Oko jest nazywane kamieniem biznesmenów. Pomaga przyciągnąć powodzenie i bogactwo, odwagę w realizacji planów i pewność siebie. Wspiera stabilizację finansową oraz otacza opieką zgromadzony majątek. Moc tygrysiego oka sprzyja również rozsądnemu gospodarowaniu pieniędzmi i mądrym inwestycjom.  Jest też niezwykle silnym amuletem, który pozytywnie wpływa na zdrowie i życiową siłę, przynosi szczęśliwy los oraz chroni przez złymi intencjami i klątwami. Aura, jaką wytwarza przyciąga zdrowie, pomyślność i obfitość.  Załóż bransoletkę Tiger Eye by wesprzeć powodzenie w biznesie, pewność siebie oraz dobre samopoczucie.   Bransoletkę  naenergetyzuje   dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','bransoletka-meska-z-kwarcem-tygrysim-talizman-bogactwa-i-obfitosci-tiger-eye','','','','Bransoletka męska z kwarcem tygrysim - Talizman bogactwa i obfitości Tiger Eye','','','',''),
(211,1,1,'Problemy z komunikacją mogą być powodem: rozpadów związku, tego, że nie możemy znaleźć pracy, że czujemy się samotni. Czasami zamykamy swoje emocje w sobie, tłumiąc energię w obawie przed krytyką, niezrozumieniem lub ośmieszeniem.   Załóż bransoletkę Communication jeśli ciężko Ci otworzyć się przed drugim człowiekiem, uciekasz od trudnych tematów, masz problem z rozmowami o uczuciach lub nie jesteś asertywna. Ten talizman pomoże Ci otworzyć się na szczerą komunikację oraz rozumienie swoich potrzeb emocjonalnych.   Talizman energetyzowany, tą bransoletkę  naenergetyzuje  dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','bransoletka-otwarta-talizman-porozumienia-i-komunikacji-communication','','','','Bransoletka otwarta - Talizman porozumienia i komunikacji Communication','','','',''),
(212,1,1,'Twoje życie jest jak łańcuszek, w którym wszystkie ważne ogniwa powinny być w harmonii, żebyś była szczęśliwa. Rodzina, praca, pieniądze, zdrowie, przyjaźń - bez względu na to na jakim obszarze życia potrzebujesz wsparcia, pomoże Ci w tym talizman Lucky Stars. Trzy gwiazdy na zawieszce dodadzą Ci radości życia, dziecięcej energii, łatwości komunikacji i światła na Drodze Życia.  Tę bransoletkę  naenergetyzuje   dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat, aby wspomóc powodzenie w Twoich przedsięwzięciach, poczucie szczęścia i spełnienia. Załóż ją, jeśli wydaje Ci się, że prześladuje Cię pech, potrzebujesz farta do realizacji swoich planów, jesteś przed ważnym życiowym wydarzeniem lub brakuje Ci poczucia szczęścia i spełnienia na co dzień.','','bransoletka-z-blaszka-talizman-szczescia-lucky-stars','','','','Bransoletka z blaszką - Talizman szczęścia Lucky Stars','','','',''),
(213,1,1,'Lapis lazuli ma pokojowy wpływ i wibracje, działa wyciszająco, dlatego też nadaje się doskonale do pracy nad sobą i własną duchowością. Dostarcza poczucie wewnętrznej mocy, wiary i nadziei, a także pozwala na odnalezienie w sobie odwagi, pewności siebie i przezwyciężenie wewnętrznej nieśmiałości. Lapis lazuli jest kamieniem stymulującym delikatność i łagodność i zapewniającym ochronę przede wszystkim przed atakami energetycznymi, psychicznymi oraz urokami. Jest to także kamień duchowej miłości, który wzmacnia więzi w relacjach. Dodatkowo wnosi jasność w nasze myśli, uspokaja ducha i pomaga rozpoznać nasze zadanie życiowe.  Załóż bransoletkę Spiritual Growth by wspomóc swój rozwój duchowy, odwagę i wiarę w swoją moc oraz gdy chcesz uchronić się przed wpływem negatywnych wibracji.   Tę bransoletkę  naenergetyzuje  dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','bransoletka-z-lapis-lazuli-talizman-spokoju-i-duchowosci-spiritual-growth','','','','Bransoletka z lapis lazuli - Talizman spokoju i duchowości Spiritual Growth','','','',''),
(214,1,1,'Rodonit, pomaga uzdrowić rany duchowe, które nabyłaś na swojej drodze życia. Pozwala się zdystansować i spojrzeć świeżym okiem na stare sprawy. Uwalnia od wątpliwości i wspiera podejmowanie trudnych decyzji. Może okazać się pomocny w odkryciu Twoich predyspozycji i wykorzystaniu potencjału.   Załóż bransoletkę Self Healing, gdy czujesz się zagubiona i chcesz zyskać pewność w podejmowaniu decyzji. Masz za sobą trudne przeżycia na które chcesz spojrzeć z nowej perspektywy i śmiało iść w przyszłość.   Ten naszyjnik  naenergetyzuje   dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','bransoletka-z-rodonitem-talizman-uzdrowienia-i-oczyszczenia-self-healing','','','','Bransoletka z rodonitem - Talizman uzdrowienia i oczyszczenia Self Healing','','','',''),
(215,1,1,'Każdy z nas ma swoich Przewodników Duchowych i Aniołów, którzy towarzyszą nam na Życiowej Ścieżce i czuwają byśmy realizowali swój plan przed urodzeniowy. Proszeni o pomoc dają nam znaki i rozwiązania problemów, ale nieproszeni nie mogą ingerować.   Bransoletka Spirit Guide to potężny amulet na kontakt z wyższą jaźnią i Przewodnikami Duchowymi. Oko Ajna, zwane też Trzecim Okiem, jest symbolem oświecenia i wysokiego duchowego przebudzenia. Pozwala zobaczyć i poznać prawdy uniwersalne.   Załóż bransoletkę Spirit Guide jeśli chcesz znaleźć sposób na kontakt z Przewodnikami Duchowymi, potrzebujesz ich wsparcia, mądrości i przewodnictwa w obecnej sytuacji życiowej.  Tę bransoletkę  naenergetyzuje  dla Ciebie nasz Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','bransoletka-z-trzecim-okiem-i-z-cyrkonia-talizman-duchowego-przebudzenia-spirit-guide','','','','Bransoletka z Trzecim Okiem i z cyrkonią - Talizman duchowego przebudzenia Spirit Guide','','','',''),
(216,1,1,'Wąż reprezentuje reinkarnację, nieśmiertelność i czystość. Ma potężne połączenie z pierwotną energią i siłą życiową. W większości kulturach jest uważany za potężny symbol reprezentujący źródło życia. To atrybut energii, ważnych przejść i zmian, niezależnie od tego, czy zachodzą one na poziomie duchowym, emocjonalnym czy fizycznym.  \"Magic Snake\" to potężny talizman na etap transformacji, kiedy chcesz zmienić swoje życie w jakimś obszarze lub potrzebujesz dodatkowych sił witalnych, np. po chorobie lub traumatycznych przeżyciach.  Tę bransoletkę  naenergetyzował   dla Ciebie nasz Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','bransoleta-waz-talizman-transformacji-magic-snake','','','','Bransoleta wąż - Talizman transformacji Magic Snake','','','',''),
(217,1,1,'Sojowe Woski wypełnią Twoje Domowe Sanktuarium zapachem świątecznych przypraw. Są delikatniejsze od klasycznych olejków i kadzideł. Podgrzane płomieniem świeczki w podgrzewaczu (np. w naszym Devie) rozpuszczają się i uwalniają swój zapach, wypełniając nim pomieszczenie. Woski nie zawierają parafiny.','','wosk-zapachowy-do-kominka-swiateczny','','','','Wosk zapachowy do kominka - świąteczny','','','',''),
(218,1,1,'Zielony jadeit sprzyja zwiększeniu wiary w siebie oraz realizowaniu przedsięwziętych zadań. Przyciąga szczęście oraz bogactwo. Jest pomocny w podjęciu ważnych decyzji biznesowych oraz ułatwia negocjacje. Jego działanie równoważy nerwy i łagodzi stres. Poleca się go szczególnie osobą prowadzącym własne interesy oraz pracującym w działach związanych z handlem.  Załóż bransoletkę Confidence, gdy chcesz zwiększyć pewność siebie oraz spokojnie i bez nerwów pochodzić do nowych zadań. A także by wesprzeć swoje działania i negocjacje biznesowe.  Talizman energetyzowany, ten naszyjnik  naenergetyzuje  dla Ciebie Moonbrother Mariusz, który z energią pracuje od ponad 30 lat.','','bransoletka-z-zielonym-jadeitem-talizman-pewnosci-siebie-i-negocjacji-confidence','','','','Bransoletka z zielonym jadeitem - Talizman pewności siebie i negocjacji Confidence','','','',''),
(219,1,1,'Sojowe Woski wypełnią Twoje Domowe Sanktuarium zapachem dyni. Są delikatniejsze od klasycznych olejków i kadzideł. Podgrzane płomieniem świeczki w podgrzewaczu (np. w naszym Devie) rozpuszczają się i uwalniają swój zapach, wypełniając nim pomieszczenie. Woski nie zawierają parafiny.','','wosk-zapachowy-do-kominka-dyniowy','','','','Wosk zapachowy do kominka - dyniowy','','','',''),
(220,1,1,'Drzewo Sandałowe czaruje aromatem, który przeniesie Cię w klimat pachnących Indii w zaciszu Twojego domowego Sanktuarium. Sandałowiec wyróżnia się bogatym zapachem, zawiera słodkie i drzewne nuty. Ma właściwości uspokajające i relaksujące.  Jest to w pełni naturalny produkt wytworzony z wosku sojowego i olejków eterycznych. Woski są delikatniejsze od klasycznych kadzideł. Podgrzane płomieniem świeczki w podgrzewaczu (np. w naszym Devie) rozpuszczają się i uwalniają swój zapach, wypełniając nim pomieszczenie.','','wosk-zapachowy-do-komina-mysore-chandan-sandalwood','','','','Wosk zapachowy do komina Mysore Chandan - Sandalwood','','','',''),
(221,1,1,'Wypełni swoje domowe sanktuarium pięknym i mistycznym zapachem żywicy drzewa agarowego, zwanego również oudh.  Agar posiada charakterystyczną woń o słodko-drzewnym aromacie, od wieków był wykorzystywany w wielu obrzędach i ceremoniach kultury wschodniej, a także do produkcji kadzideł.   Jest to w pełni naturalny produkt wytworzony z wosku sojowego i olejków eterycznych. Woski są delikatniejsze od klasycznych kadzideł. Podgrzane płomieniem świeczki w podgrzewaczu (np. w naszym Devie) rozpuszczają się i uwalniają swój zapach, wypełniając nim pomieszczenie.','','wosk-zapachowy-do-komina-dehl-al-oudh','','','','Wosk zapachowy do komina Dehl al Oudh','','','',''),
(222,1,1,'Wypełni swoje domowe sanktuarium świeżym i podnoszącym na duchu zapachem pomarańczy, który jednocześnie ma właściwości wyciszające i relaksujące.   Jest to w pełni naturalny produkt wytworzony z wosku sojowego i olejków eterycznych. Woski są delikatniejsze od klasycznych kadzideł. Podgrzane płomieniem świeczki w podgrzewaczu (np. w naszym Devie) rozpuszczają się i uwalniają swój zapach, wypełniając nim pomieszczenie.','','wosk-zapachowy-do-kominka-orange','','','','Wosk zapachowy do kominka Orange','','','',''),
(223,1,1,'Wypełni swoje domowe sanktuarium pięknym i słodkim zapachem jaśminu. Jaśmin słynie ze swoich właściwości uspokajających i relaksujących. Jest pomocny w przypadku problemów ze snem oraz nadmiernej nerwowości.   Jest to w pełni naturalny produkt wytworzony z wosku sojowego i olejków eterycznych. Woski są delikatniejsze od klasycznych kadzideł. Podgrzane płomieniem świeczki w podgrzewaczu (np. w naszym Devie) rozpuszczają się i uwalniają swój zapach, wypełniając nim pomieszczenie.','','wosk-zapachowy-do-komina-madurai-jasmine','','','','Wosk zapachowy do komina Madurai Jasmine','','','',''),
(224,1,1,'Uwaga! To nie jest zwykłe lustro! Ten unikalny talizman ścienny nie tylko ozdobi Twoją magiczną przestrzeń, lecz także wniesie do niej wyjątkową energię i podniesie wibracje dzięki ukrytej z tyłu runie, która nada mu dodatkową funkcję. Runy mają potężną moc ze względu na częstotliwość kształtu, którym wibrują i dlatego na nas wpływają. To Ty decydujesz, jakie będzie przeznaczenie tej dekoracji! Lustro może być amuletem ochronnym lub talizmanem wnoszącym obfitość do Twojej wyjątkowej przestrzeni.   Twój egzemplarz może nieco różnić się od tego na zdjęciu. To produkt 100% hand made. Postaramy się, aby Twój Talizman był gotowy jak najszybciej. Maksymalny czas oczekiwania: 3 tygodnie.   Zalecamy czyszczenie na sucho, bez stosowania produktów chemicznych.','','talizman-do-domu-magiczne-lustro-mystic-eye-premium','','','','Talizman do domu - magiczne lustro Mystic Eye Premium','','','',''),
