(230,1,1,'Są takie momenty, kiedy doświadczasz dziwnych zbiegów okoliczności, które wykraczają poza normalny przypadek i masz wrażenie, że Wszechświat do Ciebie przemawia. Być może są jakieś określone godziny, które zawsze dostrzegasz, lub nieustannie śledzą Cię wybrane liczby albo widzisz i czujesz, że twoje życie to nieustanny dialog z Siłą Wyższą?    Dzięki webinarowi „Synchroniczności - zrozum język jakim przemawia do Ciebie Wszechświat!” nauczysz się dekodować tajemnice tych magicznych znaków!','','warsztaty-synchronicznosci-zrozum-jezyk-jakim-przemawia-do-ciebie-wszechswiat','','','','Warsztaty Synchroniczności - zrozum język jakim przemawia do Ciebie Wszechświat!','','','',''),
(231,1,1,'Herbata magiczna! Nie tylko ze względu na swój niepowtarzalny delikatny owocowy aromat z wyczuwalną nutą kokosa, lecz także na niebiesko-ametystowy kolor nocy. Pochodzący z Azji Kwiat Klitorii Ternateńskiej, wykorzystywany jest w tradycyjnej medycynie ajurwedyjskiej. Herbata oczyszcza duszę i ciało oraz jest naturalnym antydepresantem. Ekstrawagancka i wykwintna jednocześnie, ze względu na swoje relaksujące właściwości doskonale sprawdzi się w chwilach, które chcesz celebrować!','','herbata-rytualna-moontea','','','','Herbata Rytualna \"MOONtea\"','','','',''),
(232,1,1,'Czy chcesz wprowadzić do swojego życia więcej harmonii?   Czy zależy Ci na dobrym zdrowiu, wysokich wibracjach i energii, która pomoże Ci odnieść sukces na każdym obszarze życia?   Czy chcesz mieć dostęp do swoich największych potencjałów?   Jeśli tak, ten kurs jest dla Ciebie!   Jesteś czymś więcej niż ciałem fizycznym. W Twoich kanałach energetycznych płynie praną - energia życiowa, która determinuje Twoją rzeczywistość - emocje, zachowania, zdrowie fizyczne. Gdy nasze czakry są zablokowane możesz odczuwać lęki, mieć gorszy nastrój, problemy z wyrażaniem, energią seksualną, chorujesz. Blokady w czakrach sprawiają też, że brakuje Ci mocy, masz niższą pewność siebie, problemy z budowaniem relacji oraz odniesieniem sukcesu w karierze zawodowej. Jak widzisz czakry mają ogromny wpływ na Twoje życie! Pracuj z czakrami, by to zmienić!','','warsztaty-o-czakrach-masterclass-odzyskaj-harmonie-i-odblokuj-swoj-maksymalny-potencjal','','','','Warsztaty o Czakrach - Masterclass: Odzyskaj harmonię i odblokuj swój maksymalny potencjał','','','',''),
(233,1,1,'Możliwość dokonania odroczonej płatności PayPo lub rozłożenia  kwoty  na  raty . W sprawie  rat  napisz do nas na hello@moonsister.pl      UWAGA! Po tych warsztatach odkryjesz swoją prawdziwą DUCHOWĄ ISTOTĘ!    Czy kiedykolwiek zastanawiałaś się jakie były Twoje poprzednie wcielenia i jaki mają one wpływ na Twoją ziemską wędrówkę?  Zapraszam Cię do fascynującej podróży między życiem a życiem, gdzie krok po kroku będziemy zagłębiać się w znaki, symbole, sny, numerologię i inne potężne narzędzia, które odsłonią przed Tobą część Ciebie, a która do tej pory była owiana tajemnicą.  Jestem przekonana, że takiego warsztatu jak ten, nie znajdziesz nigdzie w Polsce… a być może i na świecie!   Jeśli temat Poprzednich Wcieleń, pociąga Cię tak bardzo jak mnie, czytaj dalej!   „Odkrycie reinkarnacji uspokoiło mój umysł. Chciałbym zarażać innych spokojem, jaki daje nam perspektywa patrzenia na życie z dystansu”  -  Henry Ford                        Naszą prawdziwą tożsamością jest wewnętrzny duch, który odbywa długą wędrówkę doświadczając zaplanowanych inkarnacji na Ziemi. Postrzeganie siebie w ten sposób, absolutnie zmienia całe nasze spojrzenie na życie!    Zaakceptowanie tego, że obecne życie które prowadzimy nie jest jedyne, natychmiast poszerza poczucie tego, kim naprawdę jesteśmy!  Staje się jasne, że nasza prawdziwa tożsamość nie jest codzienną rolą, którą widzi świat. Postaci, którymi jesteśmy w różnych inkarnacjach, są jak ubrania. Pod koniec każdego życia Dusza zrzuca je i kiedy jesteśmy gotowi na powrót do ziemskich doświadczeń, mądrzy przewodnicy pomagają nam wybrać okoliczności i warunki, które sprzyjać będą naszemu wzrostowi. Tak przywdziewamy nowe szaty.   Twoja Dusza zachowuje informacje z całej swojej wędrówki o tym, co jest ważnym zasobem dla jej obecnego wcielenia!    Tworzymy bezpieczną przestrzeń, w zamkniętej grupie, gdzie będziesz miała doskonałe warunki do tego, aby zanurzyć się w procesie odkrywania swojej DUCHOWEJ ISTOTY!    Wszystko co musisz wiedzieć - masz w sobie! Proces odkrywania poprzednich wcieleń opiera się na Twojej otwartości na przepływ informacji od Duszy!    Ostatnim punktem warsztatów jest międzywymiarowa sesja regresingu. To podróż do poprzednich wcieleń lub wcielenia, które miało istotny wpływ na Twoje obecne życie. To szansa na zanurkowanie głębiej i odkrycie więcej. Ten stan wracania do poprzednich inkarnacji w fazie mocnego relaksu przez wielu terapeutów uważany jest za podstawę uzdrawiających terapii.    Gdy raz nauczysz się dostrzegać gdzie szukać informacji z poprzednich wcieleń, już zawsze będzie towarzyszyło Ci poczucie, że nic nie jest przypadkowe!   *Wiedza z warsztatów Podróż Duszy jest niezbędna by skorzystać z kolejnego poziomu - Cel Duszy, który będzie dostępny wkrótce.','','warsztaty-podroz-duszy-poziom-i-poprzednie-wcielenia-i-ich-wplyw-na-twoja-ziemska-wedrowke','','','','Warsztaty Podróż Duszy poziom I - Poprzednie wcielenia i ich wpływ na Twoją ziemską wędrówkę','','','',''),
(234,1,1,'Specjalnie wyselekcjonowane mieszanki naturalnych ziół i herbat organicznych, wspierających przepływ energii przez główne jej ośrodki w ciele, zwane czakrami.    Kolor czerwony  - c zakra korzenia - imbir, cynamon, łuski kakao   Kolor pomarańczowy   - c zakra sakralna - rooibos, łuski kakao, wanilia    Kolor żółty   - c zakra splotu słonecznego - czarna herbata, cynamon, kardamon    Kolor zielony   - c zakra serca - rumianek, koper włoski, róża    Kolor błękitny   - c zakra gardła - trawa cytrynowa, hibiskus, imbir    Kolor granatowy   - c zakra trzeciego oka - mięta pieprzowa, pokrzywa, koper włoski    Kolor fioletowy   - c zakra korony - zielona herbata, kardamon, anyż gwiaździsty    Filozofia Solarisa  Solaris Tea to firma rodzinna z siedzibą w Irlandii, specjalizująca się w mieszaniu nagradzanych na całym świecie herbat organicznych i naparów ziołowych. Solaris zapewnia, że herbaty są produkowane na najwyższym poziomie zrównoważonego rozwoju i jakości, a wszystkie mieszanki są wolne od dodanych aromatów.','','herbata-ziolowa-wspierajaca-czakry','','','','Herbata ziołowa wspierająca czakry','','','',''),
(235,1,1,'Oryginalna podstawka do kadzidełek w kształcie dłoni, może służyć także do przechowywania drobnych magicznych przedmiotów lub biżuterii. Idealnie sprawdzi się również jako cudowna ozdoba w Twoim domowym sanktuarium. Podstawka posiada otwór na jedno kadzidełko.   Produkt został wykonany przez indonezyjskich rzemieślników. Podstawki dostępne w dwóch wzorach - z Buddą lub Ganeshą.   Budda to istota oświecona - ktoś kto przebudził się ze stanu niewiedzy, wykroczył poza cierpienie ludzkiej egzystencji, posiadł najwyższą mądrość i zerwał z wszelkim przywiązaniem.  Ganesha to jedno z najbardziej znanych hinduskich bóstw. Jest Panem Szczęścia, który zapewnia radość, dobrobyt i sukces. Jest też Panem Początków, usuwa przeszkody, które pojawiają się na Twojej drodze, zarówno materialne, jak i duchowe. Jego atrybuty to mądrość i spryt.','','podstawka-do-kadzidelek-dlon-i-budda-ganesha','','','','Podstawka do kadzidełek -  Dłoń i Budda/Ganesha','','','',''),
(236,1,1,'Mosiężny trybularz idealny do palenia kadzideł żywicznych doda uroku Twojemu domowemu sanktuarium. Można go wykorzystać również do palenia innych rodzajów kadzideł np. naturalnych, stożkowych, czy też po wsypaniu do środka niewielkiej ilości piasku patyczkowych.  Trybularz jest wykonany z mosiądzu przez co nagrzewa się, należy upewnić się, że znajduje się na powierzchni opornej na ciepło.','','mosiezny-trybularz-do-kadzidel','','','','Mosiężny trybularz do kadzideł','','','',''),
