(245,1,1,'Piękna ozdoba do Twojego domowego sanktuarium z misternym wzorem z Hamsą, może pełnić funkcję podstawki do kadzidełek lub służyć do trzymania magicznych przedmiotów i biżuterii. Podstawka posiada otwór na jedno kadzidełko.   Hamsa jest związana z wieloma tradycjami. W hinduizmie jest często używana jako synonim najwyższego ducha lub ostatecznej rzeczywistości, która nazywa się „Brahmanem”. W buddyzmie reprezentuje uniwersalnego ducha i wyzwolenie z cyklu odrodzenia. Do naszej kultury przeszła jako symbol odpierania zła i negatywnych energii.','','podstawka-do-kadzidelek-hamsa','','','','Podstawka do kadzidełek Hamsa','','','',''),
(246,1,1,'Hamsa to starożytny amulet z Bliskiego Wschodu, symbolizujący Rękę Boga. We wszystkich wierzeniach jest to znak ochronny.  Przynosi swojemu właścicielowi szczęście, zdrowie i dobrobyt.  Turkusowy kolor jest uważany za mistrza uzdrawiania, ponieważ promuje energiczny przepływ miłości. Kojarzy się z mocą i ochroną nieba. Hamsa to piękna ozdoba do trzymania magicznej biżuterii lub palenia Palo Santo.  Podstawka Hamsa to piękna ozdoba do trzymania magicznej biżuterii lub palenia Palo Santo.','','ceramiczna-podstawka-hamsa','','','','Ceramiczna podstawka Hamsa','','','',''),
(247,1,1,'Poduszka do jogi/medytacji zwiększy Twoją wygodę, dzięki czemu możesz spokojnie zagłębić się w swojej codziennej praktyce medytacyjnej lub jodze. Dodatkowy komfort, pozwoli Ci na większą koncentrację i swobodny rozwój duchowości oraz ciała, bez rozpraszania się.      Czakra Korony  - kolor fioletowy  Czakra Trzeciego Oka  - kolor indygo  Czakra Gardła  - kolor niebieski  Czakra Serca  - kolor zielony  Czakra Splotu Słonecznego  - kolor żółty  Czakra Sakralna  - kolor pomarańczowy  Czakra Korzenia  - kolor czerwony','','poduszka-do-jogi-medytacji-z-symbolem-czakry','','','','Poduszka do jogi/medytacji z symbolem czakry','','','',''),
(248,1,1,'Kadzidło Copal jest wspaniałym narzędziem energetycznym do medytacji. Zapach łączy z czakrą korony, pogłębia świadomość i zachęca do czystych myśli podczas medytacji. Copal pomaga również wzmocnić aurę, usuwając wszelkie blokady energetyczne. Jest szczególnie przydatny w sytuacjach stresowych, a nawet w łagodzeniu złych nastrojów, ponieważ pomaga zmienić nastawienie. Zapach jest ziemisty, drzewny z lekkimi nutami cytrusów.   Bryłki kadzidła mają zróżnicowaną wielkość i kolor. Kadzidło należy palić wysypując kilka „rodzynek” na podpalony węgielek trybularzowy w naczyniu żaroodpornym.  U nas pali się co najmniej kilka razy w tygodniu, szczególnie kiedy potrzebujemy oczyścić się z ciężkiej energii, potrzebujemy wyciszenia lub pragniemy podnieść swoje wibracje.','','kadzidlo-zywiczne-copal-kopal','','','','Kadzidło żywiczne Copal/Kopal','','','',''),
(249,1,1,'Dym wydzielany z kadzideł z żywicy był od wieków używany do usuwania negatywnych energii, a biała szałwia ma szczególne właściwości oczyszczające i wspomagające sen. Kadzidło sprawi, że Twój dom wypełni się pięknym egzotycznym zapachem, przywołującym na myśl Indyjskie świątynie i obrzędy.   Bryłki kadzidła mają zróżnicowaną wielkość i kolor. Kadzidło należy palić wysypując kilka „rodzynek” na podpalony węgielek trybularzowy w naczyniu żaroodpornym.','','kadzidlo-zywiczne-white-sage','','','','Kadzidło żywiczne White Sage','','','',''),
(250,1,1,'Dym wydzielany z kadzideł z żywicy był od wieków używany do usuwania negatywnych energii. Frankincense lub inaczej Olibanum jest używane podczas obrzędów i rytuałów oczyszczających. Pomaga głębiej wchodzić w stany medytacyjne oraz uzyskać silniejsze połączenie z siłami wyższymi.   Bryłki kadzidła mają zróżnicowaną wielkość i kolor. Kadzidło należy palić wysypując kilka „rodzynek” na podpalony węgielek trybularzowy w naczyniu żaroodpornym.','','kadzidlo-zywiczne-frankincense','','','','Kadzidło żywiczne Frankincense','','','',''),
(251,1,1,'Dym wydzielany z kadzideł z żywicy był od wieków używany do usuwania negatywnych energii. Kadzidło Egyptian Goddess wydziela piękny zapach, który działa oczyszczająco oraz ochronnie. Pomaga utrzymać nasze ciało i ducha w równowadze i harmonii.   Bryłki kadzidła mają zróżnicowaną wielkość i kolor. Kadzidło należy palić wysypując kilka „rodzynek” na podpalony węgielek trybularzowy w naczyniu żaroodpornym.','','kadzidlo-zywiczne-egyptian-goddess','','','','Kadzidło żywiczne Egyptian Goddess','','','',''),
(252,1,1,'Zestaw 10 węgielków trybularzowych do palenia naturalnych kadzideł żywicznych, kadzideł sypkich, ziołowych, proszkowych i mineralnych. To rodzaj węgla o organicznym pochodzeniu, który rozpala się w bardzo łatwy i szybki sposób i nie wpływa na zapach kadzidła. Korzystanie z węgielka jest bardzo proste. Wystarczy umieścić go w żaroodpornym naczyniu (np. na soli lub piasku, które zapewniają dodatkową izolację), podpalić ogniem węgielek, który rozpala się niemal natychmiastowo i położyć na nim wybrane kadzidło. Węgielki nadają się także do palenia w fajkach wodnych.  Otwarte opakowanie należy chronić przed wilgocią.','','wegiel-trybularzowy-do-kadzidel-zywicznych','','','','Węgiel trybularzowy do kadzideł żywicznych','','','',''),
(253,1,1,'Dym wydzielany z kadzideł z żywicy był od wieków używany do usuwania negatywnych energii, a Guggal jest szczególnie przydatny w celu polepszenia witalności i ochrony przed chorobami. Guma Guggal jest używana w ajurwedyjskiej medycynie od 3 tysięcy lat. Kadzidło odpędza złe duchy i podtrzymuje wysokie wibracje, a także dostarcza sił witalnych.   Bryłki kadzidła mają zróżnicowaną wielkość i kolor. Kadzidło należy palić wysypując kilka „rodzynek” na podpalony węgielek trybularzowy w naczyniu żaroodpornym.','','kadzidlo-zywiczne-guggal','','','','Kadzidło żywiczne Guggal','','','',''),
(254,1,1,'Dym wydzielany z kadzideł z żywicy był od wieków używany do usuwania negatywnych energii, a Nag Champa jest popularnym wyborem do wielu zastosowań. Zapach „Nag Champa” jest słodki, ziemisty, kwiatowy i korzenny jednocześnie. Kadzidło to zabierze Cię do hinduskich i buddyjskich świątyń Indii i Nepalu. Zawiera ono aromaty drzewa sandałowego, a także kwiatu drzewa champak, należącego do rodziny magnolii. Orientalny zapach kadzidła pomoże Ci wejść w stan medytacji, odpręży i oczyści atmosferę w Twoim Domowym Sanktuarium.  Bryłki kadzidła mają zróżnicowaną wielkość i kolor. Kadzidło należy palić wysypując kilka „rodzynek” na podpalony węgielek trybularzowy w naczyniu żaroodpornym.','','kadzidlo-zywiczne-nag-champa','','','','Kadzidło żywiczne Nag Champa','','','',''),
(255,1,1,'Pięknie zapakowane luksusowe kadzidła patyczkowe w 6 wariantach z wzorami mandali. Duże opakowanie pozwoli długo cieszyć się ulubionym zapachem. Produkt dodatkowo zawiera podstawkę do kadzidełek.   Dostępne zapachy:    róża   paczuli   wanilia  lawenda   drzewo sandałowe  jaśmin','','duze-kadzidla-patyczkowe-z-podstawka-mandala','','','','Duże kadzidła patyczkowe z podstawką - Mandala','','','',''),
(256,1,1,'Indyjska tradycja ręcznego wyrabiania kadzideł sięga tysięcy lat. Otrzymuje się je poprzez mieszanie suszonych kwiatów, ziół, i przypraw i łącznie w całość dzięki aromatycznym żywicom z tropikalnych drzew. Podczas palenia stożkowych kadzideł wydziela się głęboki aromat, nieco cięższy od klasycznych kadzidełek w pałeczkach.  Olibanum i mirra pochodzą z tej samej rodziny roślin i rosną jako małe krzewiaste drzewa w suchym klimacie - takich jak Indie, Oman, Etiopia, Somalia, Jemen i Arabia Saudyjska. Żywica obu roślin była używana w medycynie i do praktyk duchowych od ponad 5000 lat.','','kadzidlo-stozkowe-olibanum-mirra','','','','Kadzidło stożkowe \"Olibanum-Mirra\"','','','',''),
(257,1,1,'Indyjska tradycja ręcznego wyrabiania kadzideł sięga tysięcy lat. Otrzymuje się je poprzez mieszanie suszonych kwiatów, ziół, i przypraw i łącznie w całość dzięki aromatycznym żywicom z tropikalnych drzew. Podczas palenia stożkowych kadzideł wydziela się głęboki aromat, nieco cięższy od klasycznych kadzidełek w pałeczkach.   Zapach kokosa, ze względu na swoje silne moce relaksujące jest idealny do medytacji, ale także do codziennego użytku.  Wierzy się, że jego dym oczyszcza, wzmacniania moce psychiczne, wabi miłość, zatrzymuje koszmary, a nawet przyciąga dobrobyt.','','kadzidlo-stozkowe-kokos','','','','Kadzidło stożkowe \"Kokos\"','','','',''),
(258,1,1,'Kadzidło stożkowe Drzewo Sandałowe Indyjska tradycja ręcznego wyrabiania kadzideł sięga tysięcy lat. Otrzymuje się je poprzez mieszanie suszonych kwiatów, ziół, i przypraw i łącznie w całość dzięki aromatycznym żywicom z tropikalnych drzew. Podczas palenia stożkowych kadzideł wydziela się głęboki aromat, nieco cięższy od klasycznych kadzidełek w pałeczkach.  Drewno sandałowe pochodzi z Azji Południowo-Wschodniej. To wolnorosnące drzewo o bogatym, złożonym zapachu, ma długą historię stosowania w duchowych praktykach zarówno na Wschodzie, jak i na Zachodzie. W Indiach zapach drzewa sandałowego rozchodzi się po każdym domu i świątyni.','','kadzidlo-stozkowe-drzewo-sandalowe','','','','Kadzidło stożkowe \"Drzewo Sandałowe\"','','','',''),
(259,1,1,'Kadzidła zostały wykonane w Nepalu z ziół i innych składników aromatycznych zbieranych w Himalajach. Używane są często w świątyniach oraz buddyjskich stupach. Produkt został wykonany ręcznie. Proces wytwarzania kadzidełek sznurkowych polega na odpowiednim zawinięciu i skręceniu aromatycznej mieszanki w papierze ryżowym.  Spikenard, to inaczej Nardostachys jest to roślina kwitnąca, rosnąca w Himalajach. Kadzidło o tym zapachu zawiera olejek nardowy, pochodzący z tej rośliny, a także cynamon oraz goździki. Kompozycja ta, tworzy miły drzewno-korzenny zapach o działaniu uspakajającym i poprawiającym nastrój.   Ilość: ok. 50 szt   Czas palenia: 15-20 min   Kadzidełko powinno być palone na przeznaczonej do tego podstawce. Kadzidła mogą wytwarzać sporą ilość dymu.','','kadzidla-sznurkowe-o-zapachu-spikenard','','','','Kadzidła sznurkowe o zapachu Spikenard','','','',''),
(260,1,1,'Trójkąt wyraża harmonię, manifestację, oświecenie, objawienie i wyższą perspektywę.   Ilość cyrkonii w kolczyku wiąże się z liczbą trzy, która jest kojarzona ze światem spirytualnym i rozwojem duchowym. Numerologicznie, 3 to liczba talentów artystycznych, spontaniczności, komunikacji i szczęścia.  Załóż piercing \"Trinity\" by wesprzeć swoje talenty, przepracować problemy z komunikacją lub wspomóc się na drodze poszukiwania szczęścia.','','piercing-srebrny-z-cyrkoniami-trinity','','','','Piercing srebrny z cyrkoniami Trinity','','','',''),
(261,1,1,'Pierścionek Constellation II to talizman, który pomoże Ci odnaleźć właściwą drogą i podążać w kierunku obranego celu!  Gwiazdy rozbłysną na Twoim palcu! Te maleńkie konstelacje są jak jasność, która rozświetla drogę życia i prowadzi w chwilach życiowych zakrętów. Gwiazda ma niezwykle bogatą symbolikę. Reprezentuje ideał, szczęście, boską ideę, sukces, światło, nadzieję a także 4 żywioły i ducha.  Załóż pierścionek Constellation II, gdy potrzebujesz światła na swojej Drodze Życia oraz pragniesz tchnąć powodzenie w swoje przedsięwzięcia lub błądzisz w meandrach życia.   Dbaj o swój pierścionek! Nie powinien być moczony ani mieć kontaktu z chemią i kosmetykami.','','pierscionek-srebrny-z-cyrkoniami-talizman-swiatla-constellation-ii','','','','Pierścionek srebrny z cyrkoniami - Talizman światła Constellation II','','','',''),
(262,1,1,'Być może właśnie jesteś na jakimś życiowym zakręcie, czegoś się obawiasz, walczysz ze swoimi demonami, masz gorszy czas lub wrażenie, że wszystko spadło właśnie na Twoje barki. W życiu każdego z nas są chwile, którym brakuje światła, optymizmu i chociaż promyczka nadziei.  Załóż piercing Glimmer of hope jeśli brakuje Ci wiary w siebie. Wesprze też on Twój nastrój i pomoże dostrzec właściwy kierunek, abyś znowu dostrzegł Słońce na swoim niebie.','','piercing-srebrny-z-cyrkoniami-glimmer-of-hope','','','','Piercing srebrny z cyrkoniami Glimmer of Hope','','','',''),
(263,1,1,'Ganesha to jedno z najbardziej znanych hinduskich bóstw. Jest Panem Szczęścia, który zapewnia radość, dobrobyt i sukces. Jest też Panem Początków, usuwa przeszkody, które pojawiają się na Twojej drodze, zarówno materialne, jak i duchowe. Jego atrybuty to mądrość i spryt. Cyrkonie zaś symbolizują światło na drodze życia, do którego dąży Twoja dusza, a także nadzieję i pozytywne nastawienie.  Załóż piercing Ganesha, gdy rozpoczynasz nowe przedsięwzięcie i potrzebujesz usunąć wszelkie przeszkody na swojej drodze oraz jeśli rozwijasz się duchowo i chcesz intuicyjnie podążać ścieżką swojego przeznaczenia.','','piercing-srebrny-z-cyrkoniami-ganesha','','','','Piercing srebrny z cyrkoniami Ganesha','','','',''),
(264,1,1,'Krzyż to jeden z najstarszych symboli religijnych, stosowany już około 8000 lat przed Chrystusem, w epoce mezolitu. W starożytnym Egipcie popularny był krzyż „anch”, w Grecji jako symbol Dionizosa, a w Babilonii boga Bela.  Ametyst to kamień „harmonii i relaksu”. Pomaga uwolnić od lęków oraz przywrócić równowagę osobom podatnym na stres. Jego właściwości sprzyjają odczuciu spokoju i uwolnieniu umysłu od negatywnych myśli. Pomaga radzić sobie z emocjami, sprzyja  cierpliwości i uwolnieniu od codziennego zmęczenia i problemów. Przywraca harmonię ducha, pomaga walczyć z uzależnieniami.  Krzyż jest symbolem tego, w co wierzysz, dlatego załóż pierścionek Purple Cross, by zaufać w Wyższy Plan, jako najlepszy możliwy dla Ciebie scenariusz oraz wprowadzić do życia harmonię i pozytywne spojrzenie.','','pierscionek-z-ametystem-talizman-harmonii-i-wiary-purple-cross','','','','Pierścionek z ametystem - Talizman harmonii i wiary Purple Cross','','','',''),
(265,1,1,'Kwiat jest symbolem ulotności życia. Odpowiednio zadbany rozkwita swoim pięknem i zapachem, by po kilku dniach przekwitnąć. Życie ziemskie jest tak samo ulotne i kruche jak płatki delikatnych kwiatów. W codziennym pędzie zapominamy o tym i bierzemy za pewnik nasze zdrowie i szczęście. Dlatego powinniśmy przejść je z uważnością i wdzięcznością, tak by nasze piękno mogło rozkwitać każdego dnia, pamiętając o tym, że dar życia to wystarczający powód do bycia szczęśliwym.  Załóż piercing \"Magic Power\" by cieszyć się tym co tu i teraz, dostrzegać piękno obecnej chwili i być wdzięcznym za możliwość doświadczania.','','piercing-z-kwiatkiem-i-cyrkoniami-kolczyk-do-chrzastki-ucha-magic-flower','','','','Piercing z kwiatkiem i cyrkoniami kolczyk do chrząstki ucha Magic Flower','','','',''),
(266,1,1,'Słońce reprezentuje ogień. To żywioł oczyszczający, który wypala negatywne emocje i sprzyja otwieraniu nowego rozdziału w życiu. To również symbol wszelkiego życia na Ziemi, źródło siły, jasności i dobrostanu. To również źródło energii dobrobytu i szczęścia. Słońce symbolizuje także męską energię, odpowiedzialną za działanie. Energię, która sprawia, że jesteśmy pełni sił i pewności siebie na co dzień i w dalekosiężnych celach.  Rodonit pozwala się zdystansować i spojrzeć świeżym okiem na stare sprawy. Uwalnia od wątpliwości i wspiera podejmowanie trudnych decyzji. Może okazać się pomocny w odkryciu Twoich predyspozycji i wykorzystaniu potencjału.   Załóż pierścionek Helios, gdy brak Ci wiary w siebie, czujesz się zagubiona w otaczającym świecie i chcesz odkryć swoją moc.','','pierscionek-z-rodonitem-talizman-oczyszczenia-i-wsparcia-helios','','','','Pierścionek z rodonitem - Talizman oczyszczenia i wsparcia Helios','','','',''),
(267,1,1,'Są takie momenty w życiu (te, które chcemy wspominać i te, o których pragniemy zapomnieć), które zasługują na swój rytuał. Ślub, zbliżający się poród, urodziny, nowa praca, lub też zakończenie toksycznej relacji, chęć pozbycia się lęków i stresów, zamknięcia niekorzystnego rozdziału w życiu - to jedne z wielu okazji do przeprowadzenia rytualnej kąpieli. Wystarczy zestaw Moonsister, wanna pełna wody i…. Twoja intencja, z którą się wykąpiesz.  Święte Drewienko Palo Santo oczyści wszystkie negatywne energie i przygotuje do rytuału, naturalna wegańska Świeca ze specjalną afirmacją, podniesie Twoje wibracje podczas kąpieli, lawendowa gąbka konjac zmyje z Ciebie wszystko, czego pragniesz się w życiu pozbyć, wyciszy umysł i otworzy na nowe, a zapach musującej kuli przyciągnie energię, której potrzebujesz! Na koniec zrelaksujesz się masując buzię rollerem z naturalnego kwarcu, byś nie tylko czuła się wspaniale, ale też pięknie wyglądała! To magiczny prezent dla siebie lub bliskiej osoby! Podczas kąpieli zadbaj o moment uważności - nie spiesz się, myśl o swojej intencji i i czekaj aż Wszechświat przyniesie Ci jej spełnienie!   Opis rytuału:  1. Zapal Pało Santo z intencją oczyszczenia z niskich wibracji 2. Zapal świecę z intencją podniesienia swoich wibracji i przeprowadzenia pięknego rytuału 3.Namocz gąbkę. Gdy „spuchnie” wymasuj nią całe ciało (nie używaj mydła!) z intencją oczyszczenia ciała i umysłu ze wszystkich blokad lub energii, wydarzeń lub rzeczy których chcesz się pozbyć z życia. 4.Wrzuć do kąpieli Musującą Kulę i wycisz się przy ulubionej muzyce lub w ciszy. Pomyśl o tym jak to jest, gdy Twoja intencja się spełni! Wejdź w ten stan. Jeśli medytujesz -  ten moment to świetna okazja! 5.Wymasuj buzię rollerem - pomyśl o tym, jak kwarc oczyszcza Twoją buzię i dodaje Ci siły i blasku. Energia kamienia przepływa przez Twoją skórę i wypełnia całe ciało siłą, której potrzebujesz do spełnienia intencji. 6.Wypowiedz na głos swoją intencję i podziękuj sobie za piękny rytuał.','','rytualna-kapiel-moonsister-na-wlasna-okazje-pelnie-lub-now-ksiezyca','','','','Rytualna Kąpiel Moonsister - na własną okazję, Pełnię lub Nów księżyca','','','',''),
(268,1,1,'Otwarcie Trzeciego Oka to naturalne następstwem duchowego rozwoju. Usytuowane na czole centrum połączenia ze źródłem pozwala nam widzieć, słyszeć i czuć dużo więcej. Praca z czakrą trzeciego oka umożliwia także współodczuwanie energii innych osób, widzenie aury, zwiększa intuicję, a co za tym idzie otwiera na jasnowidzenie i jasnosłyszenie.   Rytuał \"3 Eye\" powinny praktykować osoby, które rozwijają się duchowo i szukają sensu swoich doświadczeń. Pozwala on spojrzeć w głąb siebie i połączyć się ze swoim wyższym JA. Rytuałowi towarzyszy medytacja spotkania z duszą. Jest to również rytuał zwiększenia intuicji, uwolnienia z karm, oczyszczenia z bytów astralnych i wampirów energetycznych. Niezbędnik każdej osoby zaczynającej przygodę z duchowością.  Co znajdziesz w rytuale \"3 Eye\"?  1. Kadzidło Yerba Santa, która oczyszczania  i uzdrawia energię i przestrzeń.  2. Warkocz trawy cytrynowej, która zalepia dziury w aurze.  3. Miotełkę o do pożegnania złych, niesprzyjających energii.  4. Święte drewienko Palo Santo do przypieczętowania dobrej energii i powitania pozytywnego nastawienia.  5. Fioletową świecę otwierającą na rozwój duchowy.  6. Naturalny, słońcowany bloodstone, czyli kamień jasnowidzów, mistyków i proroków, który otwiera na kontakt z wyższym Ja. Otwiera Trzecie Oko i zwiększa możliwości intuicji. Uzdrawiające kamienie, które znajdziesz w tym rytuale zostały oczyszczone, energetycznie naładowane i pobłogosławione intencją.  7. Prostą instrukcję dla Twojego Osobistego rytuału.  Zrób rytuał \"3 Eye\" zawsze kiedy czujesz potrzebę spotkania się z duszą, uwolnienia karmy lub rozwoju duchowego.  Uwaga! Podczas kadzenia, bardzo ważne jest zachowanie bezpieczeństwa! Należy zadbać o bezpieczne podłoże i podczas kadzenia otworzyć okno. Dokładnie tak samo postępowali nasi przodkowie – pozwalali uciec diabłom, demonom i wszystkim ciemnym, ciężkim, niesłużącym nam energiom   ☺  Należy pamiętać również o tym, że małe dzieci, kobiety w ciąży, chorzy na padaczkę oraz osoby uczulone są bardziej wrażliwe na działanie kadzideł i olejków eterycznych i nie powinny ich stosować. Rytuał duchowy nigdy nie zastąpi leczenia farmakologicznego.','','rytual-rozwoju-duchowego-3-eye','','','','Rytuał rozwoju duchowego - 3 Eye','','','',''),
(269,1,1,'Podnieś swoje wibracje osobiste, chroń się przed wpływem złych emocji i wampirów energetycznych!  W zestawie znajdziesz narzędzia magiczne wspierające energię miłości:   czerwona niteczka ochronna z turmalinem  obelisk z obsydianu z kartą do ładowania i muślinowym woreczkiem  kadzidło naturalne YERBA SANTA  świeca manifestacyjna z obsydianem  kartka z dokładnym opisem zestawu i afirmacją','','magiczny-zestaw-energia-ochrony','','','','Magiczny zestaw „Energia OCHRONY”','','','',''),
(270,1,1,'Mantra to dźwięk, który wznosi nasz umysł ponad materialny wymiar. Słowo mantra oznacza \"ta, która chroni umysł\". Słuchając lub powtarzając mantry oczyszczamy stopniowo umysł i ciało. Stajemy się szczęśliwi i wolni od niepokoju. Rytuał Mantra ma być duchowym środkiem na wyciszenie i podobnie jak ona ma uwolnić nas od niskich wibracji i otworzyć na dobre energie. To rytuał, który możesz stosować obok leczenia jako praktykę duchową przy depresji lub nerwicy.   W rytuale Mantra znajdziesz polskie rodzime zioła, rośliny rosnące w naszym środowisku, w naszej strefie klimatycznej od stuleci. Z ich mocy czerpali nasi przodkowie. Mają zatem znacznie lepsze oddziaływanie zarówno we wszystkich rytuałach, magicznych, duchowych, czy zdrowotnych. Każde kadzidło przygotowywane jest przez naszą zielarkę – od momentu zerwania ziół po zawiązanie na nich moonsisterowej nitki.  Co znajdziesz w rytuale \"Mantra\"?  1. Palo Santo do przypieczętowania dobrej energii i powitania pozytywnego nastawienia.  2. Miotełka do pożegnania złych energii.  3. Kadzidło witające Spokój i Oczyszczenie.  • Lawenda jest rośliną o bardzo szerokich właściwościach magicznych i zdrowotnych. Przypisuje się jej moc uzdrawiania, zarówno ciała jak i ducha (uzdrawianie żalu i poczucia winy), jest wykorzystywana w licznych rytuałach, gdyż przyciąga zdrowie, szczęście spokój. Lawenda ma bardzo silne właściwości antybakteryjne, które mogą zahamować rozwój flory bakteryjnej oraz antyseptyczne. Łagodzi skutki stresu emocjonalnego i napięcia nerwowego, ułatwia zasypianie. Chroni i oczyszcza.  • Szałwia biała, to jedno z najbardziej ulubionych ziół każdej zielonej czarownicy. Posiada bardzo silny aromat i jeszcze większe magiczne moce. Szczególnie pomocna jest w rytuałach dotyczących zdrowia i ochrony. Szałwia uwalnia od złych mocy, negatywnych uczuć, chroni przed wampirami energetycznymi, czy odcinać istniejące połączenia wampiryczne, a co za tym idzie – uzdrawia nasze biopole. Im silniejsze biopole, tym większe zdrowie fizyczne.  • Liść laurowy, czyli ziele o bardzo szerokim zastosowaniu magicznym, będzie przede wszystkim gwarantem ochrony, oczyszczenia, wytrzymałości oraz mocy.  4. Ręcznie laną świecę z naturalnego, wegańskiego wosku sojowego na przywitanie równowagi . Aromatyzowana w 100% naturalnymi olejkami eterycznymi wzmacniającymi moc rytuału: lawenda, rozmaryn, drzewo cedrowe, olejek drzewa herbacianego. Udekorowana, wzmacniającymi moc rytuału, kwiatami lawendy oraz ametystami – kamieniami, których energia harmonizuje nasz organizm na każdym poziomie. Ametyst przywraca równowagę osobom podatnym na stres, przynosi spokój i uwolnienie umysłu od negatywnych myśli. Pomaga radzić sobie z emocjami, dodaje cierpliwości, uwalnia od codziennego zmęczenia i problemów.  5. Naturalny Prehnit, który jest silnym kamieniem ochronnym. Wzmacnia siłę życiową i zwiększa poziom energii witalnej. Pomaga zrozumieć i przepracować bolesne wspomnienia i doświadczenia, ułatwia przebaczenie sobie i innym. Ułatwia bycie tu i teraz. Przynosi potężne energie uspokajające i wyciszające. Do dziś w Afryce Południowej stanowi atrybut miejscowych uzdrowicieli. Łagodzi zmartwienia i niepokój wszelkiego rodzaju.  6. Prostą instrukcję dla Twojego Osobistego rytuału wraz z kojącą afirmacją  Zrób rytuał Mantra zawsze kiedy czujesz niepokój, smutek lub przygnębienie.  Uwaga! Kadzidła palą się inaczej niż szałwia lub Palo Santo! Podczas kadzenia, bardzo ważne jest zachowanie bezpieczeństwa! Należy zadbać o bezpieczne podłoże i podczas kadzenia otworzyć okno. Dokładnie tak samo postępowali nasi przodkowie – pozwalali uciec diabłom, demonom i wszystkim ciemnym, ciężkim, niesłużącym nam energiom :)','','rytual-uspokajajacy-mantra','','','','Rytuał uspokajający - Mantra','','','',''),
(271,1,1,'Pozwól intencji wybrać Ciebie! Ten Magiczny Rytuał Mystery będzie dla Ciebie niespodzianką.  Rytuał Mystery to szansa na wsparcie obfitości, ochrony, nowych początków lub miłości. Jeśli nie możesz zdecydować, czego w tym momencie najbardziej potrzebujesz, zdaj się na Wszechświat!   W każdym magicznym rytuale znajdziesz naturalne, ziołowe kadzidło, świece wspierająca intencję, święte drewienko Palo Santo, kamień do pracy z energią, miotełkę do odganiania niechcianych energii oraz instrukcję, dzięki której, krok po kroku, wykonasz rytuał, nawet bez wcześniejszego doświadczenia! Każdy z nich, wzbogacony jest dodatkowo o kadziła stożkowe, dobrane zapachem do intencji.','','rytual-magiczny-mystery','','','','Rytuał magiczny - Mystery','','','',''),
(272,1,1,'Otwórz kanał bezwarunkowej miłości, wzmocnij miłość własną i otwórz się na nowe lub wzmocnij istniejące juz relacje. Buduj szczęśliwy i harmonijny związek ze sobą i bliskimi Ci ludźmi!  W zestawie znajdziesz narzędzia magiczne wspierające energię miłości:   czerwona niteczka ochronna z kwarcem różowym  obelisk z kwarcu różowego z kartą do ładowania i muślinowym woreczkiem  kadzidło intencjonalne MIŁOŚĆ  świeca manifestacyjna z kwarcem różowym  kartka z dokładnym opisem zestawu i afirmacją','','magiczny-zestaw-energia-milosci','','','','Magiczny zestaw „Energia MIŁOŚCI”','','','',''),
(273,1,1,'Czy wiesz, że szacunek do hierarchii rodowej i poukładanie spraw rodzinnych jest warunkiem dobrostanu w życiu?  Choć wydaje się to nieprawdopodobne, żywiąc żale i urazy sam nie dopuszczasz do swojego życia dobrostanu. Przepracowanie rodowych sprawia, że karma rodowa odpuszcza i nie przenosisz ich na swoje dzieci.  Warto zrozumieć w tym miejscu, że przychodząc na ziemię sami wybieramy sobie rodziców i dzieci – takich, żeby pomogli zrealizować nam NASZ PROGRAM. Na przykład – apodyktyczny ojciec uczy Cię empatii. Absorbujące dziecko uczy Cię cierpliwości. Wszystko, co wywołuje w Tobie złość, uczy Cię wybaczania i współczucia.  Dzięki rytuałowi \"Forgivness &amp; Love\" pojednasz się  z rodem. Wybaczysz wszystko, co Cię boli i zaczerpniesz z niego siłę, napełnisz się jego miłością, spojrzysz na niego z wdzięcznością. To bardzo uwalniający rytuał. Możesz go także zrobić w stosunku do każdej osoby, która Cię zraniła i chcesz to uwolnić.  W rytuale znajdziesz polskie rodzime zioła, rośliny rosnące w naszym środowisku, w naszej strefie klimatycznej od stuleci. Z ich mocy czerpali nasi przodkowie. Mają zatem znacznie lepsze oddziaływanie zarówno we wszystkich rytuałach, magicznych, duchowych, czy zdrowotnych. Każde kadzidło przygotowywane jest przez naszą zielarkę Olę – od momentu zerwania ziół po zawiązanie na nich moonsisterowej nitki.   Co znajdziesz w rytuale \"Forgivness &amp; Love\"?  1. Święte Drewienko Palo Santo do przypieczętowania energii wybaczenia i powitania pojednania  2. Miotełkę do pożegnania żalu i urazów i ran emocjonalnych  3. Kadzidło witające wybaczenie, miłość i pojednanie, w skład którego wchodzi m.in: lawenda, róża, pędy jałowca, oraz liść laurowy z intencją miłości.  • Lawenda  jest rośliną o bardzo szerokich właściwościach magicznych i zdrowotnych. Przypisuje się jej moc uzdrawiania, zarówno ciała jak i ducha (uzdrawianie żalu i poczucia winy), jest wykorzystywana w licznych rytuałach miłosnych, gdyż przyciąga miłość, szczęśliwe małżeństwo, dzieci oraz błogosławieństwo dla domu. Lawenda ma również właściwości relaksujące, kojące, wyciszające. Chroni i oczyszcza.  • Liść laurowy, ziele o bardzo szerokim zastosowaniu magicznym, będzie przede wszystkim gwarantem wierności i siły związku.  • Róża jest najczęściej wykorzystywanym kwiatem w miłosnej magii. Ma moc przyciągania miłości oraz utrzymywania namiętnej i zmysłowej atmosfery w związku. Róża ma moc odbudowy związku, wpływa także na podniesienie miłości własnej. Przyciąga szczęście i miłość.   • Rozmaryn wykorzystuje się w miłosnych rytuałach do uzdrowienia związku. Zapewni także jego ochronę.  • Młode pędy jałowca podniosą energię w związku (rozpalenie miłosnego ognia) oraz płodności.  4. Różową świecę na bezwarunkową miłość wybaczenie.  5. Kwarc różowy – który leczy emocjonalne rany, jest kamieniem empatii i bezwarunkowej miłości.  6. Rodonit, który pomaga wybaczyć, usuwa emocjonalne rany i blizny z przeszłości, ugruntowuje miłość i uzdrawia relacje.  7. Prostą instrukcję dla Twojego Osobistego rytuału wraz z afirmacją uzdrawiającą rodowe relacje.  Zrób rytuał  \"Forgivness &amp; Love\"  za każdym razem, kiedy potrzebujesz przepracować tematy rodzinne, jesteś podczas ustawień systemowych, potrzebujesz uwolnienia karm rodowych i żali rodzinnych.  Uwaga! Podczas kadzenia, bardzo ważne jest zachowanie bezpieczeństwa! Należy zadbać o bezpieczne podłoże i podczas kadzenia otworzyć okno. Dokładnie tak samo postępowali nasi przodkowie – pozwalali uciec diabłom, demonom i wszystkim ciemnym, ciężkim, niesłużącym nam energiom. Należy pamiętać również o tym, że małe dzieci, kobiety w ciąży, chorzy na padaczkę oraz osoby uczulone są bardziej wrażliwe na działanie kadzideł i olejków eterycznych i nie powinny ich stosować. Rytuał duchowy nigdy nie zastąpi leczenia farmakologicznego.','','rytual-czerpania-sily-i-pojednania-z-rodem-loveforgivness','','','','Rytuał czerpania siły i pojednania z rodem - Love&Forgivness','','','',''),
(274,1,1,'Zestaw luksusowych kadzideł patyczkowych w 7 wariantach, dedykowanych do pracy z każdą czakrą. Kadzidła mają za zadanie unormować przepływ energii w każdym ośrodku energetycznym, wprowadzić balans i harmonię do ciała i duszy.     Czakra korzenia  - kolor czerwony (Truskawka)   Czakra sakralna  - kolor pomarańczowy (Pomarańcza)   Czakra splotu słonecznego  - kolor żółty (Cytryna)   Czakra serca  - kolor zielony (Mięta)   Czakra gardła  - kolor błękitny (Jagoda)   Czakra trzeciego oka  - kolor niebieski (Lawenda)   Czakra korony  - kolor filetowy (Jeżyna)','','zestaw-luksusowych-kadzidel-na-harmonizowanie-czakr','','','','Zestaw luksusowych kadzideł na harmonizowanie czakr','','','',''),
(275,1,1,'Aura jest niewidzialną emanacją lub polem energetycznym wokół człowieka, które odzwierciedla poziom jego energii. Badając kształt lub kolor aury można dostrzec pierwsze symptomy choroby. Rytuał AURA ma przywrócić duchową równowagę w organizmie. Zgodnie z myślą „w zdrowym ciele, zdrowy duch”, rytuał możesz stosować obok leczenia jako uzdrawiającą praktykę duchową.  W rytuale \"Aura\" znajdziesz polskie rodzime zioła, rośliny rosnące w naszym środowisku, w naszej strefie klimatycznej od stuleci. Z ich mocy czerpali nasi przodkowie. Mają zatem znacznie lepsze oddziaływanie zarówno we wszystkich rytuałach, magicznych, duchowych, czy zdrowotnych. Każde kadzidło przygotowywane jest przez naszą zielarkę – od momentu zerwania ziół po zawiązanie na nich moonsisterowej nitki.  Co znajdziesz w rytuale \"Aura\"?  1.Święte Drewienko Palo Santo do przypieczętowania dobrej energii i powitania Dobrego Zdrowia  2. Miotełkę do pożegnania złych energii i chorób.  3. Kadzidło witające Dobre Zdrowie, w skład którego wchodzą m. in.:  • Lawenda, która jest rośliną o bardzo szerokich właściwościach magicznych i zdrowotnych. Przypisuje się jej moc uzdrawiania, zarówno ciała jak i ducha (uzdrawianie żalu i poczucia winy), jest wykorzystywana w licznych rytuałach, gdyż przyciąga zdrowie, szczęście spokój. Lawenda ma bardzo silne właściwości antybakteryjne, które mogą zahamować rozwój flory bakteryjnej oraz antyseptyczne. Łagodzi skutki stresu emocjonalnego i napięcia nerwowego, ułatwia zasypianie. Chroni i oczyszcza.  • Szałwia biała, czyli jedno z najbardziej ulubionych ziół każdej zielonej czarownicy. Posiada bardzo silny aromat i jeszcze większe magiczne moce. Szczególnie pomocna jest w rytuałach dotyczących zdrowia i ochrony. Szałwia uwalnia od złych mocy, negatywnych uczuć, chroni przed wampirami energetycznymi, czy odcinać istniejące połączenia wampiryczne, a co za tym idzie – uzdrawia nasze biopole. Im silniejsze biopole, tym większe zdrowie fizyczne.  • Liść laurowy, czyli ziele o bardzo szerokim zastosowaniu magicznym, będzie przede wszystkim gwarantem ochrony, oczyszczenia, wytrzymałości oraz mocy.  4. Biała świeca witająca Uzdrawiające Energie.  5. Kryształ biały, który ma najsilniejsze działanie oczyszczające i jest kamieniem o uniwersalnym zastosowaniu. Można go dowolnie programować za pomocą wybranej afirmacji. Dzięki temu będzie przyciągał to, czego pragniesz. Możesz zaprogramować go na zdrowie, dobrą energię, dobre samopoczucie, siły witalne i oczyszczanie z choroby lub np. zmęczenia.  6. Prostą instrukcję dla Twojego Osobistego rytuału wraz z uzdrawiającą afirmacją.  Stosuj rytuał AURA każdorazowo, gdy czujesz spadek sił witalnych lub zmniejszenie odporności, a także jako wspomaganie w leczeniu farmakologicznym, o ile nie zabrania tego Twoje schorzenie.  Podczas kadzenia, bardzo ważne jest zachowanie bezpieczeństwa! W pomieszczeniu należy otworzyć okno, ponieważ niektóre zioła spalając się, mogą tworzyć toksyczne związki. Dokładnie tak samo postępowali nasi przodkowie – pozwalali uciec diabłom ,demonom i wszystkim ciemnym, ciężkim, nie służącym nam energiom.   Należy pamiętać również o tym, że małe dzieci, kobiety w ciąży, chorzy na padaczkę oraz osoby uczulone są bardziej wrażliwe na działanie kadzideł i olejków eterycznych i nie powinny ich stosować. Rytuał duchowy nigdy nie zastąpi leczenia farmakologicznego.','','rytual-zdrowia-aura','','','','Rytuał zdrowia - Aura','','','',''),
(276,1,1,'Indyjska tradycja ręcznego wyrabiania kadzideł sięga tysięcy lat. Otrzymuje się je poprzez mieszanie suszonych kwiatów, ziół, i przypraw i łącznie w całość dzięki aromatycznym żywicom z tropikalnych drzew. Podczas palenia stożkowych kadzideł wydziela się głęboki aromat, nieco cięższy od klasycznych kadzidełek w pałeczkach.    Olejek paczuli jest związany z żywiołem ziemi i czakrą korzenia, ma bardzo mocny, głęboki, piżmowy zapach, który określa się jako drzewny, słodki i korzenny.','','kadzidlo-stozkowe-paczuli','','','','Kadzidło stożkowe \"Paczuli\"','','','',''),
(277,1,1,'To wysokie wibracje powodują, że jesteś szczęśliwy, wdzięczny, uważny, żyjesz w dobrej energii i zgodzie ze Światem. Nie czujesz urazów, nie stresujesz się, a ludzie w Twoim otoczeniu czują się dobrze. Wysokie wibracje to jasna, świetlista i czysta energia.  Ruytuał \"Good Vibes Only\" pomoże Ci podnieść swoje wibracje. Znajdziesz w nim polskie rodzime zioła, rośliny rosnące w naszym środowisku, w naszej strefie klimatycznej od stuleci. Z ich mocy czerpali nasi przodkowie. Mają zatem znacznie lepsze oddziaływanie zarówno we wszystkich rytuałach, magicznych, duchowych, czy zdrowotnych.  Każde kadzidło przygotowywane jest przez naszą zielarkę Olę – od momentu zerwania ziół po zawiązanie na nich moonsisterowej nitki.  W rytuale \"Good Vibes Only\" znajdziesz:  1.Święte Drewienko Palo Santo do przypieczętowania energii namiętności i powitania miłości oraz płodności.  2. Miotełkę do pożegnania niskich wibracji.  3. Kadzidło witające dobrostan i pomyślność, w skład którego wchodzi: żywotnik zachodni, laska cynamonu, plaster suszonej mandarynki, anyż oraz liść laurowy z intencją odniesienia sukcesu.  • Żywotnik zachodni, to drzewo z rodziny cyprysowatej o bardzo wyjątkowych właściwościach. Igły żywotnika pięknie, cytrusowa pachną i mają moc przyciągania dobrobytu, działają ochronnie, przynoszą komfort, uzdrawiają. Drzewo to wytwarza olejek zwany tujonem, któremu przypisuje się właściwości przeciwgrzybiczne i antybakteryjne, pogłębia oddychanie i oczyszcza umysł. Palony z intencją obfitości przyniesie spokój, spełnienie i dobrostan.  • Cynamon ma moc uzdrawianie, przynosi sukces, oczyszcza, przyciąga pieniądze oraz wzmacnia działanie innych elementów kadzidła. Zapach tej niezwykłej rośliny wywiera dobroczynny wpływ na siły witalne. Cynamon to bardzo popularna roślina stosowana przy rytuałach związanych z sukcesem, działaniem i koncentracją.  • Mandarynka, jak i inne rośliny cytrusowate, jest owocem, który przynosi radość, pozytywizm, dobrą, ożywczą energię. To jeden z najczęściej stosowanych owoców w rytuałach na sukces i dobrostan.  • Anyż zaś przynosi szczęście i farta.  • Liść laurowy, czyli ziele o bardzo szerokim zastosowaniu magicznym, będzie przede wszystkim dodawał siły, mocy do osiągnięcia założonego celu i sukcesu.  4. Świecę wykonaną z naturalnego, wegańskiego wosku sojowego. Laną ręcznie. Aromatyzowaną w 100% naturalnymi olejkami eterycznymi wzmacniającymi moc rytuału: cynamon, goździk, drzewo cedrowe, olejek pomarańczowy. Świeca udekorowana jest wzmacniającymi moc rytuału goździkami (mają właściwości przyciągające), zielem angielskim (przynosi szczęście, dobrobyt i pieniądze) oraz kryształem górskim.  5. Naturalny kryształ górski, który jest najlepiej programującym się kamieniem, a co za tym idzie – wzmacnia moc wypowiadanej intencji. To swoisty „wzmacniacz energetyczny” działający jak akumulator. Kryształ górski to kamień o uniwersalnych właściwościach - przynosi optymizm, jasność umysłu, zdolność do koncentracji oraz pozytywną energię.  6. Prostą instrukcję dla Twojego Osobistego rytuału.  Zrób rytuał Good Vives Only za każdym razem, gdy czujesz, że Twoje wibracje spadły – odczuwasz przytłoczenie, przygnębienie, spadek energii.  Uwaga! Podczas kadzenia, bardzo ważne jest zachowanie bezpieczeństwa! Należy zadbać o bezpieczne podłoże i podczas kadzenia otworzyć okno. Dokładnie tak samo postępowali nasi przodkowie  – pozwalali uciec diabłom, demonom i wszystkim ciemnym, ciężkim, niesłużącym nam energiom.  Należy pamiętać również o tym, że małe dzieci, kobiety w ciąży, chorzy na padaczkę oraz osoby uczulone są bardziej wrażliwe na działanie kadzideł i olejków eterycznych i nie powinny ich stosować.   INSERT INTO `ps_product_shop` VALUES
